INSERT INTO `comments` VALUES (19,NULL,10,'general','Observations',',11,1,','Anonymous','Teacher','',0,10000,0,0,NULL,'There is something wrong with the timing of this test.  I thought we were testing kids on their ability to really read closely  but all they had time to do was rush rush rush.  Also what was weird was the passages were not that hard - so it\'s not going to look that hard.  And the questions weren\'t that hard.  But the answers were ridiculous.  Adults with PhDs wouldn\'t have known which were the right answers sometimes - really.  But when you have barely a minute to think about it, it really became a test of how much you could rush or how much you could remember off the top of your head'),(20,NULL,0,'6','Observations',',11,2,','Anonymous','Parent','',0,NULL,0,0,NULL,'My sixth grader was in tears after the second day of the test.  Didn\'t even get to the essay - has NEVER had that happen before.  What\'s the point of making kids feel this awful about themselves?   He\'s a good student, now he feels terrible'),(21,NULL,0,'7','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,NULL,'Day Three felt reasonable.  If they got rid of Day Two, when even my good students didn\'t get to the essay sometimes, the test would feel a lot more reasonable.  Is it fair to test the tests on kids though?  Didn\'t they test the timing?  '),(22,NULL,1,'8','Observations',',11,1,','Anonymous','Teacher','',0,20000,0,0,NULL,'What\'s up with reading four pages of directions to the kids before they start?  My English Language Learners were in a daze'),(23,NULL,2,'5','Observations',',11,1,5,','Anonymous','Parent','',0,NULL,0,0,NULL,'Watched my child do test prep booklets, test prep mornings, test prep afterschool, even test prep Saturdays.  Then she didn\'t even get to finish the test.  Taking her to a bookstore this afternoon to find some real reading'),(24,NULL,0,'3','Implications for Instruction',',12,5,','Anonymous','Teacher','',0,50000,0,0,NULL,'Third graders had to keep rereading and rereading these long answers to find them in the passages.  Is that really what we want third graders doing?  I\'m worried about them poring over these small details forever. '),(25,NULL,1,'3','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,NULL,'I thought the test was hard. I had kids not able to finish in the time frame given. Why do we set time limits, if we want to see what kids know?'),(26,NULL,6,'3','Ideas for Constructive Action',',13,2,4,','Anonymous','Parent','',0,NULL,0,0,NULL,'We need another solution, besides opting out. How can we support our children? My child only could talk about the test for days and was so concerned each day afterwards.\nWhat can we do? I have joined alliances on FB and written into schoolbook. Will the chancellor take meetings with parents? What will it take?'),(27,NULL,1,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,NULL,'Why do the test takers put the easier texts at the end? DOes not seem fair.\n'),(28,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,1,0,NULL,''),(29,NULL,0,'general','Observations',',11,6,','Anonymous','Other','',0,60000,0,0,NULL,'The test wasn\'t hard at all but timely.  Students couldn\'t finish the exam.  How can we judge students on an essay when they weren\'t able to do the essay because of timing.  Common core wasn\'t written to test speed reading it was written I believe for deeper comprehension.  Its almost as  if we set up our students for failure.  Also for a company to use text from their books in an exam seems unethical and unfair.  Lastly I wonder if the writers of the test should be judged on some of the grammatical errors that occurred in the answers that seemed not to make sense and often times looked like two choices could answer the questions.'),(30,NULL,0,'4','Ideas for Constructive Action',',13,','Roger Rabbit','Teacher','',0,NULL,1,0,NULL,'Nuts'),(31,NULL,4,'5','Implications for Instruction',',12,3,','Renee','Teacher','src2124@tc.columbia.edu',0,30000,0,0,NULL,'As a teacher, part of my role is to teach concepts and skills that my children are expected to master. Unfortunately, the journey toward this mastery is inextricably tied to assessments designed to determine what children know and what teachers have taught.  We are a nation that is preoccupied with quantitative data. These statistics derived from assessments and testing are what drives the institution of education. As a result of the recent ELA exams, I’m concerned that the primary focus for teaching and learning will simply about how well students score on state exams and the ramifications of this in terms of the self-esteem and development of all children. \n\nI am not against the Common Core. Actually, I believe the standards set by the Common Core are reasonable goals to aspire to. I am troubled by the convoluted manner in which these standards have been interpreted and presented to children on the recent ELA exams. \n\nRequiring children to read multiple passages under the pressure of an exam is one thing. But then, including questions that were both tedious to interpret and would require the stamina of an Olympic athlete to answer is at best unrealistic, and at worst, cruel. I am also baffled by the decision to include texts that are recommended on the Engage NY website in terms of level of complexity for 7th graders, on a 5th grade exam. Is the message for teachers then that grade-level reading is now inadequate and instead, all students should be reading several grades above their level? \n\nFurther, I can’t help but wonder what can be gleaned from the results of these exams? What exactly will this data show? The choices seem narrow – a) Some children are great test-takers or b) Some children are not. Many of the questions and answers were highly subjective and therefore, how can this data be used to draw conclusions about a child’s mastery of skills, concepts, or their academic abilities? I have a bachelor’s degree, two master’s degrees, and I’m currently pursuing a doctorate at an Ivy League University, and I could not determine the “right” answer for some of the questions. \n\nMost concerning to me is the well-being of the children I teach-- children who sat down each day to an exam they believed they should have been able to complete, and if not, then perhaps they hadn’t tried hard enough, hadn’t learned enough, and weren’t smart enough. And over the next few months, when the results are distributed and reports are displayed all over the media, these same brilliant, wonderful children, will again, question their intelligence, especially if the results show that they are now in need of state mandated academic intervention services. \n\nHow can this be what’s best for children? What can educators take away from the experience of these exams that can truly inform our instruction in meaningful ways?\n'),(32,NULL,1,'8','Observations',',11,1,','Lynn Norton-Manna','Teacher, Parent','lmanna528@aol.com',0,19990,0,0,NULL,'The push this year to cram more \"standards\", but not significantly increase time to answer questions, left children feeling pressured. Children felt rushed to finish their work and they didn\'t feel that there was enough time to check over what they had answered. The craziness of this was not lost on 8th graders. When I asked my son, \"How was the ELA?\" He answered, \"Ironically they gave us a passage about savoring every moment of time and then gave us insufficient time to answer questions about it.\"'),(33,NULL,1,'3','Observations',',11,9,','Anonymous','Teacher','hkutnowsky@hotmai.com',0,55000,0,0,NULL,'Directions took a MINIMUM of 30 minutes each day.  By the time they begun the test, they were already burnt out.\nWe were not permitted to proctor our own students.  I saw children struggle severely with the extended response.  Not that they couldn\'t write, but not understanding that there was a specific question in the box.  This is due to a lack of test prep, not a lack of instruction.  These test should not test the teachers ability to PREP their students.'),(34,NULL,1,'4','Observations',',11,2,5,','Kim wright','Teacher, Parent','Prekwright@gmail.com',0,NULL,0,0,NULL,'This year I was able to observe my son\'s response before and after the 4th grade test as well as the entire elementary building that I work in. First my son who is a very good student but is clearly an active boy who needs to be challenged on a regular basis was having such anxiety over the test the day before and frustrated his teacher to the point that she asked me to speak to him. Once speaking to him he and other students were having anxiety that if they didnt do well on the test that they would not go to the next grade level and or that they would receive ais services in which they wouldn\'t be able to do chorus or band next year. Once I explained it to him that the likeliness of that happening is far from the truth because he is one of the top ten kids in his grade level. Once he began taking the test and describing it to us he was extremely frustrated as to the reading pieces that were boring and of no interest to him and that every questoion he had to answer needed supporting detail. Luckily baseball has started and has given him an outlet  to release some of this frustration. I understand the need to challenge students more and to raise the expectations but when children are doing practice exams since January and then hearing that most students will not do well goes against everything as to why I became a teacher.  School is suppose to be fun and engaging using inquiry as a basis for learning and interpreting new things  not to be robots that know how to choose a b or c. Life isn\'t like that. The other part of this is that teachers can\'t do it alone. In those foreign countries that we are being compared to don\'t challenge what the teacher is doing, they are valued and supported by the parents  '),(35,NULL,0,'4','Observations',',11,','Kim wright','Teacher, Parent','Prekwright@gmail.com',0,NULL,1,0,NULL,'This year I was able to observe my son\'s response before and after the 4th grade test as well as the entire elementary building that I work in. First my son who is a very good student but is clearly an active boy who needs to be challenged on a regular basis was having such anxiety over the test the day before and frustrated his teacher to the point that she asked me to speak to him. Once speaking to him he and other students were having anxiety that if they didnt do well on the test that they would not go to the next grade level and or that they would receive ais services in which they wouldn\'t be able to do chorus or band next year. Once I explained it to him that the likeliness of that happening is far from the truth because he is one of the top ten kids in his grade level. Once he began taking the test and describing it to us he was extremely frustrated as to the reading pieces that were boring and of no interest to him and that every questoion he had to answer needed supporting detail. Luckily baseball has started and has given him an outlet  to release some of this frustration. I understand the need to challenge students more and to raise the expectations but when children are doing practice exams since January and then hearing that most students will not do well goes against everything as to why I became a teacher.  School is suppose to be fun and engaging using inquiry as a basis for learning and interpreting new things  not to be robots that know how to choose a b or c. Life isn\'t like that. The other part of this is that teachers can\'t do it alone. In those foreign countries that we are being compared to don\'t challenge what the teacher is doing, they are valued and supported by the parents  '),(36,NULL,0,'5','Observations',',11,1,','Denise Richford','','denise.richford@verizon.net',0,NULL,0,0,NULL,'As a teacher of a gifted class, my students did not have enough time to do the quality of work they are capable of.  While they all finished, many had to rush through their essays as the clock was ticking.  If they had more time, they would have been able to develop their essays in a much more sophisticated way.  I don\'t believe you can get a true reflection of a student\'s ability when you put them on a clock, as they are more focused on finishing rather than the quality of the work they are producing.\n\nIf you truly want to see how well a student comprehends what he or she has read, give them the time to digest what they have read.  If you truly want to see how well a student writes, give them the time to plan and develop their writing with the sophistication you are expecting.'),(37,NULL,1,'5','Observations',',11,1,7,','Anonomous','Teacher','',0,NULL,0,0,NULL,'As a teacher for 25 years I have see. Many tests come and go. As the city becomes a melting pot, and English is a second language for many the tests get harder and harder. The test practice materials are few and far between and do not match the difficulty of the test . But the main problem is the length of the test .  Many students were forced to fill in answers at the last minute. The big question is what are we trying to do to kids? Should we be spending time teaching  them to be great thinkers and creative or should we spend time teaching them to take tests so they could go to the next grade. Bottom li e they never go to summer school and they always go to the next grade! What are we doing ? Does anyone care about the kids except teachers!!! Also if you think for one minute that if scores are related to teacher evaluations there will be cheating!!  Who is this for and why..???\n\n '),(38,NULL,6,'6','Observations',',11,1,','Diana','Teacher','Dbeltrani@tywlsbrooklyn.org',0,19980,0,0,NULL,'My students were beyond stressed out prior to and during this test. I had a student\'s mother call me the night before the test because her daughter was hysterical crying and did not want to go to school. I had another student go to the bathroom in her pants on day two of the test because she was too nervous to leave and lose time on her essay. I had numerous students cry during the test across all three days and two students (one of whom is special education) who threw up directly following the test and had to go home. \n\nOn that note, my students with double time will be testing for a total of 18 hours over a two week period (ELA and math test combined). Not to mention, all general education students will sit for a minimum of 9 hours across the ELA and math test which, based on my personal knowledge, is longer than any other  test for adult professionals (save for the certified public accountant exam). My students are eleven and twelve!\n\nI graduated with a 3.99 GPA at Adelphi University with a BA in English and received a full scholarship to Teacher\'s College, Columbia University to earn my MA in the teaching of English. I graduated from Teacher\'s College with a 3.99 GPA as well. That said, I doubt I would have scored a four on this 6th grade ELA test. The amount of time allotted was not enough time to complete the test well. Most of my students finished; however, I doubt their work was quality and they admittedly reported it was not. Many told me they had to guess on the multiple choice (especially on day two) in order to finish. They were also honest in that they were forced to \"drop quotes\" in their short response and/or essay because there just wasn\'t enough time to write quality, well thought out  responses. Not to mention, almost all multiple choice questions required students to return to the text, locate the correct excerpt, and reread; there just was not enough time. In addition, the answer choices included vocabulary many 6th graders could not understand and offered multiple feasible answers. Again, as an English scholar who spent years as a research assistant looking for answers, these questions trapped me!\n'),(39,NULL,0,'general','Observations',',11,1,6,','Anonymous','Other','',0,NULL,0,0,NULL,'This years exams to say the least were to long for students to finish.  Students were challenged by the text but were not overwhelmed, did meet challenging questions but were not completely lost, even when questions had questionable answers that at times seem to have two answers,were not deterred but they were defeated because of the length and time of the exam.  Students who could have shown amazing success with the right amount of time were often reduced to putting down any answer at the end or guessing or leaving things blank.  This undermines the whole purpose of the exam which was to see the students in relation to the common core standards.  Students will not have a fair assessment of their knowledge because of the time constrant and to me this demeans the efficacy of the data that will be gathered.  One wonders if the test makers even field tested this exam or understand the amount of time needed for a student to finish this demanding test.    '),(40,NULL,0,'6','Observations',',11,5,6,','Andrew Hossack','Teacher','andrewhossack@gmail.com ',0,NULL,0,0,NULL,'\nIn the Common Core era, we have all begun to adhere to a shift toward close and careful reading of complex texts.  We expect students to think more deeply about the texts they are reading, from the \"zoomed out\" ideas of overall structure,  organization, and theme to the very \"zoomed in\" details such as the effect a particular word choice has on tone and meaning in a sentence.  We are teaching student that a lot can be gained by lingering over a particular text, or section of a text, and rereading sections that are confusing or they believe to be important.  \n\nI believe that many of this year\'s test questions were completely fair and valid in assessing students\' ability to demonstrate just those types of skills.  What I don\'t believe is that is anyone, adults or children, can be truly \"close readers\" of 6 multi-page texts, of varying genres, in 90 minutes.  Nor do I believe you need multiple choice questions to span multiple days.  Nor do I believe you need more than one essay to assess a child\'s ability to write about text with evidence.  T\nhe tests, in short, need to be shorter and more thoughtful.  Much like teachers, in their limited instructional time, must make every minute, every question, every activity, every text count to the fullest, test makers should do the same.  '),(41,NULL,1,'general','Ideas for Constructive Action',',13,2,','Anonymous','Teacher','',0,59990,0,0,NULL,'Too much pressure for students, teachers, and administrators. Students are being asked to do things that they developmentally are unable to do. Obviously, the people creating the CCSS have not taken a child development course. There is no satisfaction or enjoyment in education anymore...very sad. Children don\'t enjoy \"learning\" and teachers don\'t enjoy \"teaching\". It has all come down to a test...how sad for our children.'),(42,NULL,0,'8','Observations',',11,2,3,7,8,9,','Elena Heglund','Teacher','ElenaHeglund@gmail.com',0,NULL,0,0,NULL,'Hello,\nI can guarantee that I cannot specifically comment on many of the passages because I hardly saw the exam. I do know that there was simply NOT ENOUGH time for my students to finish, especially on day 2. There was a lot of confusion on the mechanics of the exam itself, because Books 2 and 3 were given out at the same time, along with the scan, and the kids were not sure what to do first due to strategies that they had been taught regarding the writing.  Book 2 should have been timed first and then Book 3 should have been timed separately.  It is overwhelming to put that much material on a kid\'s desk at once.  The proctors reported that it took nearly TWENTY minutes to read the directions on Day 2.  Completing the books separately would of course be helpful with the directions because that is a lot of information for teenagers to take in at once.  While the passages themselves were okay,  if slightly dry, the questions seemed incredibly difficult for kids to process.  Many of my proctors reported the kids were staring at the questions, welling up over the difficulty.  The general feeling from many ELA teachers was that this year\'s ELA exam was not developmentally appropriate and I concur.  The students themselves informed me that the passages were too long, and since I saw one passage that was four pages long, single spaced, I could not imagine how a child with ADD, ADHD or any other special needs really could have managed to answer the questions well.  Many of my higher level students are panicking that they will be put into AIS next year.  It is also important to note that by Day 3, Book 4 of the exam students were beginning to suffer burn-out. '),(43,NULL,1,'general','Observations',',11,8,','Kelli McDaniel','Other','kelmcd34@gmail.com',0,NULL,0,0,NULL,'On day 2 of the ELA (for 3rd, 4th, and 5th graders), there was a book 2 and a book 3. It would be helpful to the children if these books were together in one booklet. I realize that it is easier for the scorers in the long run to have 2 separate books, but it is better for the students if they are together. You have to remember these students are 8 and 9 years old and the fact that they had 2 booklets together in one sitting unnecessarily made them more anxious than they already were (many were saying things like, \"we\'re taking two tests today?\"). It also was difficult for them to have 2 booklets and an answer sheet on their small desks, and many students kept accidentally pushing them on to the floor, causing distractions, because they had a hard time organizing the materials. I realize that they could be taught how to organize and manage their testing materials better, but is that really how we want to spend our instructional time? It would make more sense to have them in the same book, possibly with perforated edges), and afterwards the teacher or the testing coordinator could break them apart into 2 separate booklets.'),(44,NULL,0,'8','Implications for Instruction',',12,','Anonymous','Teacher','',0,NULL,1,0,NULL,'Since it has been revealed that the Autumn Leaves passage appears in the Pearson 8th grade ELA text and that some students had an opportunity to read and analyze the text prior to the test, the test is already invalid for that day. Even if those questions are discarded, students unfamiliar with the text used valuable time reading it - as it was at the beginning. Students who knew the text had a time advantage from the start. '),(45,NULL,1,'general','Observations',',11,2,','Anonymous','Teacher','judyfischer@optonline.net',0,NULL,0,0,NULL,'In the tests I proctored, ELA Grade 6, the tests were excessive in length.  How is it possible 270 minutes of testing is necessary to evaluate our students.  The anxiety level in the room was overwheleming.  I had one student go to the nurse four times with a stomach ache; a bloody nose which got on the test booklet;  a student who could not get past that there was no answer sheet for the second book of day 2, etc. to name a few.  In addition as these tests always coincide with the onset of allegry season...overall a mess.\nTesting has gotten out of control.  I\'m hoping that this movement of parents who \"opt out\" of testing for their child takes off.'),(46,NULL,0,'6','Observations',',11,','Anonymous','','Gfdh@dg.com',0,NULL,1,0,NULL,'#67 instructions were rather subjective. '),(47,NULL,0,'8','Observations',',11,5,6,','Kimberly','Teacher','kimono507@gmail.com',0,NULL,0,0,NULL,'As far as I know, this exam was meant to assess the students\' learning this school year with the new CCLS in place.  They were supposed to be reading closely, making valid claims with relevant evidence, and synthesizing information, etc.  However, these exams forced my students to rush, especially on Day 2.  There was NOT enough time and their answers and confidence were the sacrifice.  '),(48,NULL,0,'6','Observations',',11,','Denise Nobile','Teacher','dnobile@somersschools.org',0,NULL,0,0,NULL,'I\'m not opposed to students reading complex text on an exam, what I am opposed to is not giving students enough time to do the close reading that is required for understanding. '),(49,NULL,1,'4','Observations',',11,6,7,','Anonymous','Teacher','Udyrl79@me.com',0,NULL,0,0,NULL,'I find it funny that the common core stresses close reading and repeated readings of text but the assessment tests kids the opposite way.   The amount of reading and writing required in a grossly underestimated amount of on task time assess how quickly kids can skim through a passage and put some sort of coherent answer together in essay form before the time runs out.  As a teacher, I am all for the higher level of rigor and accountability associated with the line of questioning.   However, this test does not favor those with any disability, or those who need time to synthesize what is read.  Furthermore, kids with disabilities were crushed by the Lexile level of these tests.   One size does not fit all.   '),(50,NULL,1,'5','Observations',',11,1,3,4,','KB','Teacher, Parent','beaverk@whbschools.org',0,NULL,0,0,NULL,'First day of multiple choice was unfair- there were at least 6 questions that that could have had more than one answer - if the state continues to ask questions like that, the kids should be able to defend their answers in writing. All 3 days were entirely too long for kids of this age.  They simply do not have the where-with-all to stay focused for that length of time.  Like it or not, we have become a society of multi-taskers with short attention spans.  That does not mean kids aren\'t learning, it just means they learn differently.  \nI like that we are directing kids to use text based evidence and am a supporter of that, but these tests become invalid and inappropriate when the directions, questions, and in some cases the answers, are unclear. \nAlso, asking children of this age and under to do that much writing is irresponsible.  College students struggle putting their thoughts together in a cohesive essay never mind elementary students.  Have them fill out graphic organizers- that will cause much less stress on them and have the same results as far as comprehension goes.\nFinally, include current CLASSROOM teachers with at least 7 continuous years of teaching experience (but not more than 20) as well as at LEAST 5 years experience on one grade level when writing these tests.  I can assure you that the tests will be of high quality and a better measure of student ability than what has gone on the past 5 years.'),(51,NULL,0,'6','Observations',',11,3,','Linda','Teacher','',0,9990,0,0,NULL,'I do believe common core curriculum sets education on the right path.  However, these tests are simply wrong.  Since when do we test sixth grade students on their ability to infer the question in order to answer the question?  \n\nI saw students diligently work only to be crushed by the grueling test.  The majority of the students came away saying Day 2 was way too  much to accomplish in the allotted time fram.'),(52,NULL,0,'8','Observations',',11,','Linda','Teacher','',0,NULL,0,0,NULL,'Many students simply did not have the time to finish their exams.  One of my students simply stopped at the end of the second passage. When asked why she did not finish, she said because she did not read.  This student happens not only to be a good student, but also a second language learner.\n\nMany students were frustrated by the amount of work to be accomplished within the time frame.  Not that they were not \"trained\", not that they were not \"willing\", but there was simply too much to do and to do well.'),(53,NULL,0,'6','Observations',',11,','Anonymous','Teacher','MsMDeSimone@aol.com',0,NULL,1,0,NULL,'More time was needed each day for students to effectively close read and answer both the multiple choice questions and the written resposnes.  Students were stressed and defeated by the constrainsts of the 90 minutes.  All good writing practices took second place to getting it done. Many of my best students who take pride in what they write did not finish. What a shame.  \n\nOver all, the passages were lengthy and boring, but were not as complex as the test on the spring ITA. \n\nThe questions were fair, but the distractors were impossible to evaluate as being wrong. \n\nDays one and three were difficult, however day two was a travesty. I do not understand what NYSED is trying to prove by giving 11 year olds 2 books with 5 reading passages, 21 multiple choice questions, 3 short responses, and 1 essay to finish in 90 minutes. I don\'t know many adults that could have finished on time.  My students were in tears.  One student told me, \"Mayor Bloomberg told the world we should expect to do poorly, and he was right.\" \n\nHow is this college and carreer ready? In what college educated field would you be held to these extreme time constraints?\n\nI would have left my name if teachers were not warned we could lose our jobs for discussing this \"secure\" test.   \n\n'),(54,NULL,1,'3','Ideas for Constructive Action',',13,1,2,','Patricia Austin','Parent','paustin1380@gmail.com',0,NULL,0,0,NULL,'If the best students are the ones who run out of time because they are doing their best to respond to the rigor of the test AND truly address the tasks, I think it is more than obvious that there is an imbalance that needs to be addressed.  Strong students in tears because they did not finish is , I am sure, not an objective of all these changes.'),(55,NULL,0,'5','Observations',',11,2,3,6,','Wendy Scharf-Corcione','Teacher','wendylynnscharf@hotmail.com',0,NULL,0,0,NULL,'The choice and reading level of texts was appropriate for 5th grade.  Yet the questions [multiple choice] were confusing, vague and didn\'t align with the way readers are taught to think about texts.  Almost every question required a \'look back\' to numbered paragraphs which was very time consuming for a timed exam.  It also seemed very redundant to have mutliple choice 2 days as well as short and extended response 2 days.  Most of my students lost their focus and desire to put forth effort by Day 3.  These tests don\'t seem to align with the thinking that readers are being taught with the CCLS - the tests negate the depth, complexity and insight that readers and writers have been cultivating all year.  The tests seemed more like a \'guessing game\' and were trying to trick readers [mutliple choice].  There were many questions that I myself was unsure of how to answer!  The short answer and extended response questions seemed fair; yet as I said before a bit redundant due to repeating the same tested skill two days in a row.  It saddened me to see my inner city students put forth so much effort on these tests, and I\'m sure their scores will not reflect their hard work [yet another failure in their already challenging lives]. And we wonder why the graduation rate is so low?  When you are constantly experiencing failure, you eventually give up, and many of my students have begun questioning why we need to continue learning after the tests are over.  They view the purpose of education as test preparation.  That\'s the message the emphasis on state testing is sending to my students. Obviously that is not the way to prepare their minds for college and career-readiness.'),(56,NULL,0,'5','Observations',',11,','Kathleen Shanahan','Teacher','KathShan2@aol.com',0,NULL,1,0,NULL,'The problem with the fifth grade test was highlighted by the passage that dealt with the Lewis and Clarke expedition.  Young readers are taught strategies for understanding the meaning of text   One such strategy is using the context to discern meaning of an unknown word.  The passage I highlight had the question \"What was the significance of the American Indian on the expedition?\"  Students did not know the word \"significance\" and rightfully recognized they could not be certain of the answer.  Using details of the text, there are two different groups of Native Americans cited....the guides for Lewis and Clarke, identified as Shawnees, and those Native Americans who could agree to trade furs with the Americans.  Students were expected to draw conclusions as to why the American Indians (did it matter which group?) were important to the exploration.\n\nAs common core speaks to an understanding of words such as significance being necessary, perhaps a list of such words could be targeted for grade levels.  Frankly I concentrated on multiple meaning words such as product rather than narrowly defined ELA terms.\n\nClearly, instruction needs to be geared toward inferential thinking which we had been told.  What we were not told was that every question would be a close read and that literal questions were not on the test.'),(57,NULL,1,'4','Observations',',11,1,','Phil Richford','Teacher','prichford@schools.nyc.gov',0,NULL,0,0,NULL,'I teach a 4th grade, general education class and there was not enough time for the students to do quality work. They say all students have different needs, yet you make them take a test within a certain time frame. It is not fair. 70 minutes was not enough time to do quality work. They rushed to get it done and there was no way it showed my students best work. We teach the writing process where you plan, draft, revise and edit. 70 minutes was not enough time to digest what was read, go back into the text for evidence and create a good response to the question. Give the students more time to do quality work.'),(58,NULL,0,'3','Observations',',11,','Kathleen Shanahan','Teacher','KathShan2@aol.com',0,NULL,1,0,NULL,'For the life of me I cannot see how there was a correct answer listed in the choices of synonyms provided for the words, \"proper child\" and \"shamed\" found in the poem, \"i had a little shadow.\"  \n\nCreating questions that did not have a \"right\"answer or had more than one is unfair and irresponsible.  Creating questions that are unclear to an eight year old is creating needless stress.  The writing questions - to be totally correct - required the ability to nuance the question....much less the passage.  At least the State did not include the Tolstoy passage!\n\nI heard of numerous complaints of students crying, becoming ill and being told the parent told the child to come home if it is too upsetting.  Many did not finish the test...often our most proficient students.  I had students with accommodations so they generally finished with the additional 35-45 minutes.'),(59,NULL,0,'5','Observations',',11,6,','Enrique Tovar','Teacher','Etovar@portchhesterschools.org',0,NULL,0,0,NULL,'The design of the test is contrary to the skills that the common core requires students to learn are purportedly being tested on.  Students are taught to close read in order to be able to understand a text fully.  Yet, the time limits of the test does not permit students to do so. Students could not reread a text, annotate it, use context clues and answer questions based on textual evidence and still finish the test.  \n\nThus, students were faced with a dilemma- use the strategies they were taught throughout the year to comprehend the text and not finish the test, or abandon those strategies but be able to finish the test. \n\nClearly this could not be the intent of SED.  '),(60,NULL,0,'6','Observations',',11,','Anonymous','Teacher','',0,NULL,1,0,NULL,'I believe that there was a question that had no correct answer on the test.  It was a question about the \"bird\" and the process involved in \"imprinting\".  There were two answers that were half correct but neither was the true answer!'),(61,NULL,0,'6','Observations',',11,1,3,8,9,','Dori Moore','Teacher','mooredcm@aol.com',0,NULL,0,0,NULL,'     Many of the comments have already voiced my concerns.  Tests were too long.  Students rushed to put anything down for the last passage on Day 1 because they did not have enough time to read closely. On Day 2, because many did not finish on Day 1, students rushed to make sure they were done on time. Several students were upset by the fact that there were questions that did not appear to have one correct answer.  The directions on Day 2 were too long and having 2 books was annoying. There were more than a few words that were unknown vocabulary for a typical 6th grader but no real context clues to help them.  Some of the extended response and essay questions were difficult because students didn\'t even understand what was being asked.  \n     I believe it important to assess students. I believe that this could be done with 25 - 30 multiple choice questions, 5 extended response questions and one essay.  We have now reached the point at which the amount of testing we are subjecting young children to, has become abusive.\n\n'),(62,NULL,0,'general','Observations',',11,3,','Liz Phillips ','Principal','Lphilli@schools.nyc.gov',0,29990,0,0,NULL,'Although the passages were reasonable,both in terms of reading and interest level, the multiple choice questions on day one and two were very problematic and did not really test higher level reading comprehension.  There was a huge emphasis on details from specific paragraphs.   Although it seems legitimate to have some such questions, there were too many.  One of the impacts of this is that even excellent readers (myself included) had to reread many times to answer all the questions.   For children that meant that many (particularly in fifth grade) were not able to finish or had to rush at the end.   In too many cases, there were at least two answers (or in one case none) that appeared to be correct.  There were also too many questions (both short response and multiple choice) about structure rather then about meaning of the passage.   There is something wrong with a test when a highly literate adult reader can carefully read a passage and not answer a single question without rereading. I think think there are huge negative implications for this for schools who teach to the test.  We need our students to \"get\" the big idea of what they read, as well as to focus on details, but this test suggests that teaching should just be about focusing on details.   '),(63,NULL,4,'general','Ideas for Constructive Action',',13,4,','Liz Phillips ','Principal','Lphilli@schools.nyc.gov ',0,23000,0,0,NULL,'I would advocate a few different things:\n1.  Test transparency--the public should be able to see the tests after the scoring period is done.  It is the only way that people will understand that these tests don\'t test deep comprehension (at least the multiple choice questions don\'t). \n2.  All state legislators, the Commissioner, and the Regents should be required to take the 5th and 8th grade test.  I truly believe that if they experienced the test (at least the multiple choice portion), they would think twice before passing legislation or mandates that assume that this test accurately assesses real comprehension.   \n3.  Eliminate poetry from the elementary school tests.   The worst questions for at least one grade were on the poetry passages.  I believe that if adults in positions of power had to answer the fifth grade poem questions they would be absolutely shocked ...and unable to answer some of them.   \n4.  Reduce the number of questions but keep the time the same so that children are not rushing through these tests.   Take the multiple choice out of day two so that children do not have to manipulate two booklets and can have sufficient time to work on the short and extended responses, which with some glaring exceptions (short responses on structure for grade 4) were actually decent questions.  \n5.  Make sure that the test publisher is prohibited from using passages that are in their own text books.   \n6.  Make the directions briefer and do not include reading twice the list of all the electronic devices that are not allowed.    '),(64,NULL,1,'3','Observations',',11,','Mel','Teacher, Parent','',0,NULL,1,0,NULL,'I am a teacher of ELLs and a parent and these are my thoughts:\nDirections read were far too long, even for an adult to pay attention to, let alone children and ELLs at that. I understand the need for children to be more well-versed when it comes to non-fiction texts, but could we please put texts there that are interesting  and can be more engaging for students? Do students really care about Ellis Island? How about a piece on dinosaurs, monster trucks, sports? These are all legitimate non-fiction pieces. Also, do we need to beat a dead horse with a stick? Does the test need to last for three days and be so long each of these three days? Many students with the best of intentions and motivation, start off great and end up feeling defeated. My son goes to a strong school district, has been blessed with brains and great teachers and he was still miserable. He said and I quote, \"What kind of mean, sinister adults would do this to a kid?\" This is coming from a child who loves school and loves to learn! What is the message we are sending our children, our bright children who struggled on this test, our ELL children who have come so far with their new language but won\'t be able to past this test (and shouldn\'t be expected to if you look at the research for language acquisition out there). There has got to be a better way.'),(65,NULL,0,'4','Observations',',11,','Clare McCarthy','Teacher','clare.mccarthy@gmail.com',0,NULL,1,0,NULL,'I administered days 2 and 3 of the 4th grade ELA exam.\n\nThe time constraints were ridiculous. The amount of work that kids were expected to do in 70 minutes was absurd.  How were they expected to construct thoughtful responses to the passages when they weren\'t given time to think?  \n\nI laughed when I had to read the directions, \"Read each passage carefully.\"  What hypocrisy. I could never read 3 pieces, write 5 short responses and one long essay with any kind of care in 70 minutes, much less when I was in fourth grade.  \"You can reread the passages as many times as you need to in order to answer the questions.\"  Oh, well thanks for your permission. Can I bake a cake and run a marathon in that time, too, while I\'m at it?\n\nUgh.'),(66,NULL,0,'general','Observations',',11,1,3,','Anonymous','Principal','',0,NULL,0,0,NULL,'While the passages were lengthy,the multiple choice questions were quite alarming. I noticed a strong emphasis on close reading linked to paragraph processing. It required the reader to do a lot of revisiting paragraphs in the passage. The questions were all higher level with many focused on author\'s craft. Some questions had more than 1 possible answer. It was complicated and one had to be a very discerning reader. Not enough time was given. My kids used every minute!\n\nThe extended responses were more straight forward and fair. The question prompts had clarity for the reader. Some of the short responses dealt with minutia from the text. That concerned me.'),(67,NULL,1,'5','Observations',',11,1,','Cora Sangree','Teacher, Parent','Marycora.sangree@gmail.com',0,NULL,0,0,NULL,'I simply do not understand why the test is so long. Either a child can read, or he can\'t, and it doesn\'t take so many repedative passages to figure it out. The ERB that private schools use are three hours and test both reading and math. The test for admittance to the specialized high schools in NYC is two and a half hours long and tests both reading and math. Why is it that these tests have a combined length (reading and math) of nine hours? '),(68,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,NULL,'End to all standardized testing. '),(69,NULL,0,'4','Ideas for Constructive Action',',13,1,8,9,','Anonymous','Parent','',0,NULL,0,0,NULL,'Too long for students of this age!  My wife and I spent numerous hours counseling our son not get stressed over the assessment!  We told him we don\'t care how he does, the important thing to score well on is his report card, especially in 4th grade.  The directions for day 2 were not handled correctly, and from talking with teacher they followed the directions.  Teachers read the direction for the two books and turned student free to complete the books independently.  What third or forth grader is good at item management?   Additionally, we don\'t want our child\'s scores shared with any organization outside of his SCHOOL DISTRICTand SED.  '),(70,NULL,0,'3','Ideas for Constructive Action',',13,','Stephanie Flunory','Teacher','minni64@aol.com',0,NULL,1,0,NULL,'Lucy, please go away .....you  have destroyed our children enough with your failed reading and writing program....if my school had not been using TC for the past 20 years our kids would at least had half a chance to pass the test. I blame you for a generation of students who can\'t read or write. .....just go away'),(71,NULL,0,'4','Observations',',11,1,','Maureen Beyrer','Teacher','mbeyrer@pvcsd.org',0,NULL,0,0,NULL,'I noticed many more of my students were unable to finish the exam due to the complexity of the questions. \n\nI would hope they would construct more age appropriate questions. The questions were wordy and complicated even for an adult reader'),(72,NULL,1,'6','Observations',',11,4,10,','Alison Hockenberry','Parent','alison.hockenberry@gmail.com',0,NULL,0,0,NULL,'My child told me she thought the tests were reasonably challenging and in fact easier than she expected them to be. However, she thought there were numerous grammatical al errors in some passages. In fact in one of them she thought there were so many that she expected one of the following  questions to be about identifying a d correcting them. I absolutely want to see a copy of these tests. Why we are not allowed to see them is beyond baffling to me. My taxpayer dollars pay for these tests and I have every right to see what is being expected of my child. I happen to support the higher expectations and increases emphasis on critical thinking, but how can I know if that is what\'s truly being demanded of my child if I can\'t have access to the test?'),(73,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,1,0,NULL,'We teach children to be readers yet we are asking children to sit for 70 minutes, complete a close read on each passage and answer questions that require time to think. The timing on the test was not enough. Students were rushed and frustrated when they didn\'t finish. In the real world, which is what we are preparing them for, there isn\'t time restrictions. When they go to college they most certainly will have deadlines but they will have time to develop their writing and make changes as needed. Not to mention that these tests show a snap shot of what type of readers we have. I had a real problem with the passages selected. Not many students, especially inner city students didnt have the background knowledge that was needed for some of the passages. Also, the question themselves had multiple answers where students would have to go back and look for evidence. This wasn\'t possible with the time restrictions. '),(74,NULL,0,'7','Observations',',11,','Anonymous','Teacher','',0,NULL,1,0,NULL,'Book 4 of the grade 7 ELA assessment did not accurately measure students\' abilities to read or write; instead, it assessed how adept they were at circumventing stumbling blocks. The paired passages were both set in the same location, however, one was spelled \"Klondike\" and the other used the alternate spelling, \"Klondyke.\" I feel this was purposely used to confuse students. '),(75,NULL,1,'3','Observations',',11,2,','Anne Terese Colao','Teacher','atcolao@greatneck.k12.ny.us',0,NULL,0,0,NULL,'My students have sought me out often in the weeks before and during the test.  Their anxiousness is visible on their face.  I walked them through their strengths, but the responses I received were worrisome.  The children felt that this was not a test for what they had achieved but a test to trick and deceive them.  \n\nThis is the exact opposite of what good education means.  It is absolutely fine to assess growth and achievement, but when students find a test to be an obstacle and a \"trick\" that looks to foul them up, one has to wonder about the purpose and impact on our children.\n\nLater, on Thursday I was approached by students of mine that are now in 4th grade.  They were dismal about the whole experience.  They felt so prepared as good readers and writers and believed the test was designed to fail them.  I tried to reassure them, that this was an assessment of learning and achievement, but I worried that this was not the case.\n\nAs a teacher, I believe that if the students feels so usurped by the actual test, than there is something wrong here.  Most of the children who reached out to me are very strong students, and they were concerned that they might not achieve a 3 never mind a 4.  The anxiety grew when the students saw the first day of testing.  I believe that if testing is grade appropriate, the children should recognize that they can achieve well.  Since all our grade levels are teaching to the standards, it is unreal that our students would feel that the test is out of sync with their learning.  So instead of having a publishing company prepare the test, why not have teachers who know, truly know and teach the CCS prepare the test, so that it matches the expectations.  In my mind, it\'s abusive to create a test that puts off high achieving students and makes them feel threatened and at a loss.'),(76,NULL,0,'8','Ideas for Constructive Action',',13,','I don\'t hate the CCLS','Teacher','grandits5@verizon.net',0,NULL,1,0,NULL,'I absolutely, positively LOVE the new CCLS in NYS.  They demand students think critically, read critically and write critically.  All year, my students and I have explored literature and non-fiction pieces to get to the meaning through nuance in language and rhetorical strategies.  And then the test came...\n\nI am nearing completion of my PHD and cannot understand how 63 multiple choice questions are necessary to assess student reading/comprehension and further cannot understand how multiple choice questions, period, can assess critical thinking and/or reading.  We\'ve all taken our fair share of multiple choice tests and we can all honestly (if we dare to be honest) say that many times there are 2 possible \"good\" answers.  Multiple choice questions ask us to put ourselves in the test makers\' shoes and pick \"their\" right answer.  Many times during our discussions in class (not about the test but about multiple choice questions in general), my students, through their critically thinking with textual evidence to back it up, could easily argue 2 answers.  To me, multiple choice questions are meant for lower level thinking, thinking I believe the CCLS is saying is not sufficient (and I would completely agree).\n\nNow, I am all for writing that asks students to answer questions based on higher order thinking while providing textual evidence to prove their thinking.  I personally loved day 3 (as did my students - they felt empowered, smart and able to \"think\").  \n\nNow for the down side:  day 2 was FAR too long. 21 multiple choice questions based on 3 \"meaty\" passages, short responses and a long response (based on other readings) was far too much to squeeze into 90 minutes of testing.  If the CCLS truly are meant to assess higher order critical thinking, it was impossible to do on day 2.\n\nAnd finally, a comment from one of my students.  This bright young lady (who succeeded all year in defending her arguments about all types of text) did not finish day 1 or day 2 (probably because she was thinking...and that\'s a good thing but not on timed tests).  We reflected at the end of it all without discussing particulars and she summed up the experience in words no scholar could match.  She said, \"You know what it was like?  It was like someone handed Michelangelo a paintbrush, told him, \"Go - you have 90 seconds\" and he did what he could with the time and painted a smiley face.\"\n\nSadly, our students who were SO EXCITED to prove their thinking on the test felt like failures because they could not finish the test.  \n\nAs their teacher, I will continue to encourage my students to think, read and write critically.  I will continue to expose them to rich literature and thought-provoking non-fiction pieces.  I will continue to expect so much out of them because they are capable of way more than most other standards ever gave them credit for....but.....I hope the test catches on to what critical reading, writing and thinking looks like and how it should be assessed.\n\nPlease don\'t continue to set our students up for failure - they are doing great things in their classrooms.  Let them have the chance to show you what they know and prove to you that the CCLS are both implementable and worthwhile.'),(77,NULL,0,'7','Observations',',11,','Andrew Morris','Teacher','amorris@dcseagles.org',0,NULL,1,0,NULL,'I\'m writing this letter to share my thoughts regarding the Common Core ELA State Test that was administered in our school over a three-day period – April 16th, 17th, and 18th.\n\nAs a middle school English teacher, I\'m not impressed with the new Common Core ELA State Test. I not only speak for myself, but for my colleagues here in school as well.\n\nConvolution, imprecision, boredom, and overload do not add up to text complexity, nor do they increase rigor. They simply frustrate and confuse perfectly capable and knowledgeable middle school students. \n\nAnd we wonder why many of our kids are turned off to reading and writing! These sorts of tests are the culprit and the test preparation that goes into them. All of it undermines the oomph of great reading and writing -- the deep charge and potential impact of great literature and the creative drive behind all forms of writing.\n\nI teach at a small, rural school in upstate New York. I had thirty-two students take the state exam. \n\n \n\nDay One Observations:\n\nI thought the passages were OK, high-interest, and grade-level appropriate. I was expecting the texts to be more complex (based on the samples the state provided), but they were not.\n\nThe trouble with the exam begins with the multiple choice questions. Most, if not all, of my students easily comprehended the passages they read on day one. All of them expressed to me that the questions were \"tricky\" and \"confusing.\" \n\nFor example, two of the questions asked students, \"Which of the following is the best summary of the article.\"  For each of these questions, there were four lengthy summaries (a,b,c, or d). Students could easily narrow the four summaries down to two possible choices, but the differences between the two possible choices were so subtle that you\'re no longer measuring that student\'s ability to summarize! You\'re measuring if they can pick up on matters of inclusion and exclusion. It\'s more trickery than actually measuring the mastery of a particular skill, especially in this multiple-choice format.\n\nThe correct answers for those questions included a piece of information that the other possible summaries neglected to include, but at that point it was subtle enough not to even matter -- and it wouldn\'t in the \"real\" world in the context of how we use summary in our own writing. Summaries aren\'t meant to be nuanced! \n\nState Ed. will argue that it comes down to \"close reading,\" but in no way is this representative of close reading as its used in real world reading and writing! For 7th graders, it\'s a trap and not a true measurement of their skills. Questions like this set students up for failure, not success.\n\nIf I had a student read that same passage in class and then provide me with a summary of that passage\'s main points, they would easily master the skill.  The multiple-choice format ruins this -- the format distorts the actual skill being tested.\n\nI would argue, though, that the English Regents exam in 11th grade contains appropriate examples of multiple choice questions.\n\nThe current Common Core ELA State Test is so convoluted and sizeable that teachers will be forced to teach to the test – to teach isolated skills, drill those skills, and assess the acquisition of those skills all year long. This only deflates learning and teaching. \n\nA multiple-choice test is not a good measure of the highest possible learning our students are capable of, and when the questions and responses are purposely written in a manner that’s convoluted, confusing, and imprecise, the format of the questions and responses is actually a form of trickery, a trap.  Such questions trivialize the reading passages; such questions manufacture the illusion of right and wrong. They’re not measuring how well a student can closely read a full text, and they surely do not match up with how we think, read, and write in the adult world.  \n\nThe bottom line is that a multiple-choice format distorts the actual skill being measured – skills such as summarizing, using context clues to define unknown words, analysis, and interpretation. I would bring up more specific examples from the test, but I vowed to keep secret the guts of the behemoth.  Anyhow, why would transparency matter when it comes to mandated tests created by Pearson that your sons and daughters have to sit through over a three-day period, for a total of 270 minutes? What does it matter that there are serious problems with these state tests?\n\n \n\nDay Two Observations:\n\nAgain, the wording of the questions and responses was poor. There were at least six questions I starred -- questions that made me pause and return multiple times to the text. These questions would obviously be confusing and frustrating for a 7th grade student. \n\nWhat these multiple-choice exams force the students to do is not applicable to what we actually do when we think, read, and write as adults or college students. If my students were performing an analysis or writing from sources, they would have the time to do so and they would have a stronger purpose to do so. The context would be appropriate as well.  They would also have access to a dictionary and opportunities to converse and discuss. There would surely be no multiple choice questions pertaining to summaries, alliteration, author\'s purpose, or structure after a reading! There would be relevant discussion and purposeful writing.\n\nIf a student of mine decided to focus on the structure of a poem for a writing assignment, he or she would have the time to think and to develop a response. He or she would attend to the nuances and intricacies! When you try to do this through a multiple choice question, it\'s simply stifling at best and in no way measures what a student is actually capable of doing with a set of skills.\n\nWith regard to the passages on day two, they were not interesting at all, particularly the Alcott excerpt and the poem about male raindrops. If anything, they were monstrously boring. \n\nThe short answer questions and the essay prompt were easy enough, but not very thought-provoking -- they would not respond to such menial questions in my own classroom.\n\nAs on day one, I had a few students that did not finish the exam. They skipped short answer questions and moved to the essay.  Three students composed only an introduction before the ninety minutes was up.\n\n \n\nDay Three Observations:\n\nAgain, there was a lot to slog through. Thankfully, no multiple choice questions!\n\nTwo questions asked why the author included a particular section in his or her writing. To write about why the author is choosing to supply certain information and why that information is significant is a perfectly fine prompt -- a skill useful when researching and writing from sources.\n\nMy hope is that they will do away with the multiple-choice format and move to a writing exam or keep the multiple-choice format and at least follow the lead of the Regents exam, or dump the every notion that drives all this nonsense -- data, statistical comparisons, and measurment of standards-based requirements. None of it really matters now or in the long run, but we\'re being forced to believe that it does. \n\n \nSincerely,\n\nAndrew Morris\n\nTeacher (history & English, grades 7-12)'),(78,NULL,0,'general','Observations',',11,1,','Anonymous','Principal','',0,NULL,0,0,NULL,'Overall the teachers felt that the tests were very challenging.  There was also consensus that the time frame - while a lot of time for kids to sit - was still not enough time for kids to finish.  We had kids crying, bubbling in any answer and overall feeling very frustrated.   My own child, who is in honors classes in JHS, felt the test was difficult especially days 1 and 3.   I would say these exams are not developmentally appropriate. '),(79,NULL,0,'general','Observations',',11,','Anonymous','Principal','Gcascian@3villsgecsd.org',0,NULL,1,0,NULL,'Overall the teachers felt that the tests were very challenging.  There was also consensus that the time frame - while a lot of time for kids to sit - was still not enough time for kids to finish.  We had kids crying, bubbling in any answer and overall feeling very frustrated.   My own child, who is in honors classes in JHS, felt the test was difficult especially days 1 and 3.   I would say these exams are not developmentally appropriate. '),(80,NULL,0,'7','Observations',',11,','Andrew Morris','Teacher','amorris@dcseagles.org',0,NULL,1,0,NULL,'I\'m writing this letter to share my thoughts regarding the Common Core ELA State Test that was administered in our school over a three-day period – April 16th, 17th, and 18th.\n\nAs a middle school English teacher, I\'m not impressed with the new Common Core ELA State Test. I not only speak for myself, but for my colleagues here in school as well.\n\nConvolution, imprecision, boredom, and overload do not add up to text complexity, nor do they increase rigor. They simply frustrate and confuse perfectly capable and knowledgeable middle school students. \n\nAnd we wonder why many of our kids are turned off to reading and writing! These sorts of tests are the culprit and the test preparation that goes into them. All of it undermines the oomph of great reading and writing -- the deep charge and potential impact of great literature and the creative drive behind all forms of writing.\n\nI teach at a small, rural school in upstate New York. I had thirty-two students take the state exam. \n\n \n\nDay One Observations:\n\nI thought the passages were OK, high-interest, and grade-level appropriate. I was expecting the texts to be more complex (based on the samples the state provided), but they were not.\n\nThe trouble with the exam begins with the multiple choice questions. Most, if not all, of my students easily comprehended the passages they read on day one. All of them expressed to me that the questions were \"tricky\" and \"confusing.\" \n\nFor example, two of the questions asked students, \"Which of the following is the best summary of the article.\"  For each of these questions, there were four lengthy summaries (a,b,c, or d). Students could easily narrow the four summaries down to two possible choices, but the differences between the two possible choices were so subtle that you\'re no longer measuring that student\'s ability to summarize! You\'re measuring if they can pick up on matters of inclusion and exclusion. It\'s more trickery than actually measuring the mastery of a particular skill, especially in this multiple-choice format.\n\nThe correct answers for those questions included a piece of information that the other possible summaries neglected to include, but at that point it was subtle enough not to even matter -- and it wouldn\'t in the \"real\" world in the context of how we use summary in our own writing. Summaries aren\'t meant to be nuanced! \n\nState Ed. will argue that it comes down to \"close reading,\" but in no way is this representative of close reading as its used in real world reading and writing! For 7th graders, it\'s a trap and not a true measurement of their skills. Questions like this set students up for failure, not success.\n\nIf I had a student read that same passage in class and then provide me with a summary of that passage\'s main points, they would easily master the skill.  The multiple-choice format ruins this -- the format distorts the actual skill being tested.\n\nI would argue, though, that the English Regents exam in 11th grade contains appropriate examples of multiple choice questions.\n\nThe current Common Core ELA State Test is so convoluted and sizeable that teachers will be forced to teach to the test – to teach isolated skills, drill those skills, and assess the acquisition of those skills all year long. This only deflates learning and teaching. \n\nA multiple-choice test is not a good measure of the highest possible learning our students are capable of, and when the questions and responses are purposely written in a manner that’s convoluted, confusing, and imprecise, the format of the questions and responses is actually a form of trickery, a trap.  Such questions trivialize the reading passages; such questions manufacture the illusion of right and wrong. They’re not measuring how well a student can closely read a full text, and they surely do not match up with how we think, read, and write in the adult world.  \n\nThe bottom line is that a multiple-choice format distorts the actual skill being measured – skills such as summarizing, using context clues to define unknown words, analysis, and interpretation. I would bring up more specific examples from the test, but I vowed to keep secret the guts of the behemoth.  Anyhow, why would transparency matter when it comes to mandated tests created by Pearson that your sons and daughters have to sit through over a three-day period, for a total of 270 minutes? What does it matter that there are serious problems with these state tests?\n\n \n\nDay Two Observations:\n\nAgain, the wording of the questions and responses was poor. There were at least six questions I starred -- questions that made me pause and return multiple times to the text. These questions would obviously be confusing and frustrating for a 7th grade student. \n\nWhat these multiple-choice exams force the students to do is not applicable to what we actually do when we think, read, and write as adults or college students. If my students were performing an analysis or writing from sources, they would have the time to do so and they would have a stronger purpose to do so. The context would be appropriate as well.  They would also have access to a dictionary and opportunities to converse and discuss. There would surely be no multiple choice questions pertaining to summaries, alliteration, author\'s purpose, or structure after a reading! There would be relevant discussion and purposeful writing.\n\nIf a student of mine decided to focus on the structure of a poem for a writing assignment, he or she would have the time to think and to develop a response. He or she would attend to the nuances and intricacies! When you try to do this through a multiple choice question, it\'s simply stifling at best and in no way measures what a student is actually capable of doing with a set of skills.\n\nWith regard to the passages on day two, they were not interesting at all, particularly the Alcott excerpt and the poem about male raindrops. If anything, they were monstrously boring. \n\nThe short answer questions and the essay prompt were easy enough, but not very thought-provoking -- they would not respond to such menial questions in my own classroom.\n\nAs on day one, I had a few students that did not finish the exam. They skipped short answer questions and moved to the essay.  Three students composed only an introduction before the ninety minutes was up.\n\n \n\nDay Three Observations:\n\nAgain, there was a lot to slog through. Thankfully, no multiple choice questions!\n\nTwo questions asked why the author included a particular section in his or her writing. To write about why the author is choosing to supply certain information and why that information is significant is a perfectly fine prompt -- a skill useful when researching and writing from sources.\n\nMy hope is that they will do away with the multiple-choice format and move to a writing exam or keep the multiple-choice format and at least follow the lead of the Regents exam, or dump the every notion that drives all this nonsense -- data, statistical comparisons, and measurment of standards-based requirements. None of it really matters now or in the long run, but we\'re being forced to believe that it does. \n\n \nSincerely,\n\nAndrew Morris\n\nTeacher (history & English, grades 7-12)'),(81,NULL,0,'3','Observations',',11,3,','Anonymous','Teacher','',0,29980,0,0,NULL,'The test questions on the multiple choice section were designed to confuse.  My top readers were getting different answers, and these are excellent readers who read The Chronicles of Narnia and Harry Potter easily and well.  \n\nMoreover, across all the days, the constant references to tiny sections of the texts meant the children were being asked to go back and sift through pages in a way that is developmentally inappropriate for very young children.  Many excellent readers with fine comprehension skills and well-developed vocabularies are nonetheless inept at comparing paragraphs over multiple pages simply because they are third graders!  This is a particular challenge for boys.  It requires a great deal of well-developed spatial relations as well as manual dexterity to manage two test books, an answer sheet, a pencil, an eraser, a highlighter, and the constant flipping of pages back and forth to find the several paragraphs being analyzed.  Young children are physically not ready for this, nor does it test any higher level thinking.\n\nAlso, after all the hype about focusing on vocabulary and content knowledge, finally, these texts did not have challenging vocabulary at all.  How about very straightforward questions and a range of text levels within the test, so a score of four would mean the child can actually read advanced texts, not the child can guess the tricks right.\n\n\n\nI would like a question on the next DOE survey asking how many teachers had children crying during this test.  I had two, both solid readers who feared they had run out of time.  \n\nThis is a travesty of an assessment.  I am just grateful I work for one of the few principals in NYC who hasn\'t turned her school into a tool of Pearson, Inc. by succumbing to the test-prep craze.'),(82,NULL,0,'3','Observations',',11,','Anonymous','','',0,NULL,1,0,NULL,'It'),(83,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,1,0,NULL,'It'),(84,NULL,0,'7','Observations',',11,','Andrew Morris','Teacher','amorris@dcseagles.org',0,NULL,1,0,NULL,'I\'m writing this letter to share my thoughts regarding the Common Core ELA State Test that was administered in our school over a three-day period – April 16th, 17th, and 18th.\n\nAs a middle school English teacher, I\'m not impressed with the new Common Core ELA State Test. I not only speak for myself, but for my colleagues here in school as well.\n\nConvolution, imprecision, boredom, and overload do not add up to text complexity, nor do they increase rigor. They simply frustrate and confuse perfectly capable and knowledgeable middle school students. \n\nAnd we wonder why many of our kids are turned off to reading and writing! These sorts of tests are the culprit and the test preparation that goes into them. All of it undermines the oomph of great reading and writing -- the deep charge and potential impact of great literature and the creative drive behind all forms of writing.\n\nI teach at a small, rural school in upstate New York. I had thirty-two students take the state exam. \n\n \n\nDay One Observations:\n\nI thought the passages were OK, high-interest, and grade-level app