 I not only speak for myself, but for my colleagues here in school as well.\n\nConvolution, imprecision, boredom, and overload do not add up to text complexity, nor do they increase rigor. They simply frustrate and confuse perfectly capable and knowledgeable middle school students. \n\nAnd we wonder why many of our kids are turned off to reading and writing! These sorts of tests are the culprit and the test preparation that goes into them. All of it undermines the oomph of great reading and writing -- the deep charge and potential impact of great literature and the creative drive behind all forms of writing.\n\nI teach at a small, rural school in upstate New York. I had thirty-two students take the state exam. \n\n \n\nDay One Observations:\n\nI thought the passages were OK, high-interest, and grade-level appropriate. I was expecting the texts to be more complex (based on the samples the state provided), but they were not.\n\nThe trouble with the exam begins with the multiple choice questions. Most, if not all, of my students easily comprehended the passages they read on day one. All of them expressed to me that the questions were \"tricky\" and \"confusing.\" \n\nFor example, two of the questions asked students, \"Which of the following is the best summary of the article.\"  For each of these questions, there were four lengthy summaries (a,b,c, or d). Students could easily narrow the four summaries down to two possible choices, but the differences between the two possible choices were so subtle that you\'re no longer measuring that student\'s ability to summarize! You\'re measuring if they can pick up on matters of inclusion and exclusion. It\'s more trickery than actually measuring the mastery of a particular skill, especially in this multiple-choice format.\n\nThe correct answers for those questions included a piece of information that the other possible summaries neglected to include, but at that point it was subtle enough not to even matter -- and it wouldn\'t in the \"real\" world in the context of how we use summary in our own writing. Summaries aren\'t meant to be nuanced! \n\nState Ed. will argue that it comes down to \"close reading,\" but in no way is this representative of close reading as its used in real world reading and writing! For 7th graders, it\'s a trap and not a true measurement of their skills. Questions like this set students up for failure, not success.\n\nIf I had a student read that same passage in class and then provide me with a summary of that passage\'s main points, they would easily master the skill.  The multiple-choice format ruins this -- the format distorts the actual skill being tested.\n\nI would argue, though, that the English Regents exam in 11th grade contains appropriate examples of multiple choice questions.\n\nThe current Common Core ELA State Test is so convoluted and sizeable that teachers will be forced to teach to the test – to teach isolated skills, drill those skills, and assess the acquisition of those skills all year long. This only deflates learning and teaching. \n\nA multiple-choice test is not a good measure of the highest possible learning our students are capable of, and when the questions and responses are purposely written in a manner that’s convoluted, confusing, and imprecise, the format of the questions and responses is actually a form of trickery, a trap.  Such questions trivialize the reading passages; such questions manufacture the illusion of right and wrong. They’re not measuring how well a student can closely read a full text, and they surely do not match up with how we think, read, and write in the adult world.  \n\nThe bottom line is that a multiple-choice format distorts the actual skill being measured – skills such as summarizing, using context clues to define unknown words, analysis, and interpretation. I would bring up more specific examples from the test, but I vowed to keep secret the guts of the behemoth.  Anyhow, why would transparency matter when it comes to mandated tests created by Pearson that your sons and daughters have to sit through over a three-day period, for a total of 270 minutes? What does it matter that there are serious problems with these state tests?\n\n \n\nDay Two Observations:\n\nAgain, the wording of the questions and responses was poor. There were at least six questions I starred -- questions that made me pause and return multiple times to the text. These questions would obviously be confusing and frustrating for a 7th grade student. \n\nWhat these multiple-choice exams force the students to do is not applicable to what we actually do when we think, read, and write as adults or college students. If my students were performing an analysis or writing from sources, they would have the time to do so and they would have a stronger purpose to do so. The context would be appropriate as well.  They would also have access to a dictionary and opportunities to converse and discuss. There would surely be no multiple choice questions pertaining to summaries, alliteration, author\'s purpose, or structure after a reading! There would be relevant discussion and purposeful writing.\n\nIf a student of mine decided to focus on the structure of a poem for a writing assignment, he or she would have the time to think and to develop a response. He or she would attend to the nuances and intricacies! When you try to do this through a multiple choice question, it\'s simply stifling at best and in no way measures what a student is actually capable of doing with a set of skills.\n\nWith regard to the passages on day two, they were not interesting at all, particularly the Alcott excerpt and the poem about male raindrops. If anything, they were monstrously boring. \n\nThe short answer questions and the essay prompt were easy enough, but not very thought-provoking -- they would not respond to such menial questions in my own classroom.\n\nAs on day one, I had a few students that did not finish the exam. They skipped short answer questions and moved to the essay.  Three students composed only an introduction before the ninety minutes was up.\n\n \n\nDay Three Observations:\n\nAgain, there was a lot to slog through. Thankfully, no multiple choice questions!\n\nTwo questions asked why the author included a particular section in his or her writing. To write about why the author is choosing to supply certain information and why that information is significant is a perfectly fine prompt -- a skill useful when researching and writing from sources.\n\nMy hope is that they will do away with the multiple-choice format and move to a writing exam or keep the multiple-choice format and at least follow the lead of the Regents exam, or dump the every notion that drives all this nonsense -- data, statistical comparisons, and measurment of standards-based requirements. None of it really matters now or in the long run, but we\'re being forced to believe that it does. \n\n \nSincerely,\n\nAndrew Morris\n\nTeacher (history & English, grades 7-12)\n'),(87,NULL,0,'3','Observations',',11,1,2,','Anonymous','Parent','',0,NULL,0,0,NULL,'Students were not given enough time for the demands of this test. 90 minutes for the amount of reading they had to would have been sufficient instead of 70 minutes. My son hyperventilated and was in tears because he could not finish his last sentence on the second day. It has taken days to console him and kids should not feel that kind of pressure. '),(88,NULL,1,'3','Observations',',11,1,2,','Molly Marcinelli','Principal','Mmarcinelli@lancaster.wnyric.org',0,NULL,0,0,NULL,'I alway try to remain positive in times of change.  I saw some positives on day one on the the third grade exam as that was the grade I taught for many years before I became an administrator.  Some of the inferential questions were excellent.  The rereading that the test questions demanded was great.  The reading selections were wonderful. The only question I have is it is reasonable to expect that average third graders can think at this level?  If they can, then by all means, let us go for it as this will be a fun way to teach.  However, if they are still more concrete thinkers then let\'s hold off.  My recollection as a third grade teacher is that my really bright students could think in this way but maybe that was because I wasn\'t teaching them in the right way.   Many questions are out there still for me as far as what we can expects and what we should push for?  Day two had lots of figurative language and metaphor and again what can we expect from 8 and 9 year olds?  There is no doubt in my mind that the test are too long and I believe they should be scaled back to two days, at least for the third graders.  But the million dollar question is what is the appropriate amount of rigor which is reasonable to expect from a certain grade level, in particular third grade?  I am not sure we know.  I am not opposed to the common core or increased rigor..just please make it reasonable for the age level and please don\'t make them cry.'),(89,NULL,0,'6','Observations',',11,1,2,8,','Laura','Teacher','',0,NULL,0,0,NULL,'One third of my students ran out of time to complete all of the questions on Day 2. Additionally, most of the ones that did finish rushed through the extended response question at the end in order to complete it before their time was up. Completing two books in one testing session is way too much to ask of 11 and 12 year olds! We had kids crying at our school thinking they were going to \"fail\" because they couldn\'t finish. I know of several kids that actually got sick during the test due to anxiety and just feeling overwhelmed. It\'s sad that they feel this kind of pressure due to these unrealistic expectations placed upon them by the creators of this test.'),(90,NULL,0,'7','Observations',',11,','Andrew Morris','Teacher','amorris@dcseagles.org',0,NULL,1,0,NULL,'I\'m writing this letter to share my thoughts regarding the Common Core ELA State Test that was administered in our school over a three-day period – April 16th, 17th, and 18th.\n\nAs a middle school English teacher, I\'m not impressed with the new Common Core ELA State Test. I not only speak for myself, but for my colleagues here in school as well.\n\nConvolution, imprecision, boredom, and overload do not add up to text complexity, nor do they increase rigor. They simply frustrate and confuse perfectly capable and knowledgeable middle school students. \n\nAnd we wonder why many of our kids are turned off to reading and writing! These sorts of tests are the culprit and the test preparation that goes into them. All of it undermines the oomph of great reading and writing -- the deep charge and potential impact of great literature and the creative drive behind all forms of writing.\n\nI teach at a small, rural school in upstate New York. I had thirty-two students take the state exam. \n\n \n\nDay One Observations:\n\nI thought the passages were OK, high-interest, and grade-level appropriate. I was expecting the texts to be more complex (based on the samples the state provided), but they were not.\n\nThe trouble with the exam begins with the multiple choice questions. Most, if not all, of my students easily comprehended the passages they read on day one. All of them expressed to me that the questions were \"tricky\" and \"confusing.\" \n\nFor example, two of the questions asked students, \"Which of the following is the best summary of the article.\"  For each of these questions, there were four lengthy summaries (a,b,c, or d). Students could easily narrow the four summaries down to two possible choices, but the differences between the two possible choices were so subtle that you\'re no longer measuring that student\'s ability to summarize! You\'re measuring if they can pick up on matters of inclusion and exclusion. It\'s more trickery than actually measuring the mastery of a particular skill, especially in this multiple-choice format.\n\nThe correct answers for those questions included a piece of information that the other possible summaries neglected to include, but at that point it was subtle enough not to even matter -- and it wouldn\'t in the \"real\" world in the context of how we use summary in our own writing. Summaries aren\'t meant to be nuanced! \n\nState Ed. will argue that it comes down to \"close reading,\" but in no way is this representative of close reading as its used in real world reading and writing! For 7th graders, it\'s a trap and not a true measurement of their skills. Questions like this set students up for failure, not success.\n\nIf I had a student read that same passage in class and then provide me with a summary of that passage\'s main points, they would easily master the skill.  The multiple-choice format ruins this -- the format distorts the actual skill being tested.\n\nI would argue, though, that the English Regents exam in 11th grade contains appropriate examples of multiple choice questions.\n\nThe current Common Core ELA State Test is so convoluted and sizeable that teachers will be forced to teach to the test – to teach isolated skills, drill those skills, and assess the acquisition of those skills all year long. This only deflates learning and teaching. \n\nA multiple-choice test is not a good measure of the highest possible learning our students are capable of, and when the questions and responses are purposely written in a manner that’s convoluted, confusing, and imprecise, the format of the questions and responses is actually a form of trickery, a trap.  Such questions trivialize the reading passages; such questions manufacture the illusion of right and wrong. They’re not measuring how well a student can closely read a full text, and they surely do not match up with how we think, read, and write in the adult world.  \n\nThe bottom line is that a multiple-choice format distorts the actual skill being measured – skills such as summarizing, using context clues to define unknown words, analysis, and interpretation. I would bring up more specific examples from the test, but I vowed to keep secret the guts of the behemoth.  Anyhow, why would transparency matter when it comes to mandated tests created by Pearson that your sons and daughters have to sit through over a three-day period, for a total of 270 minutes? What does it matter that there are serious problems with these state tests?\n\n \n\nDay Two Observations:\n\nAgain, the wording of the questions and responses was poor. There were at least six questions I starred -- questions that made me pause and return multiple times to the text. These questions would obviously be confusing and frustrating for a 7th grade student. \n\nWhat these multiple-choice exams force the students to do is not applicable to what we actually do when we think, read, and write as adults or college students. If my students were performing an analysis or writing from sources, they would have the time to do so and they would have a stronger purpose to do so. The context would be appropriate as well.  They would also have access to a dictionary and opportunities to converse and discuss. There would surely be no multiple choice questions pertaining to summaries, alliteration, author\'s purpose, or structure after a reading! There would be relevant discussion and purposeful writing.\n\nIf a student of mine decided to focus on the structure of a poem for a writing assignment, he or she would have the time to think and to develop a response. He or she would attend to the nuances and intricacies! When you try to do this through a multiple choice question, it\'s simply stifling at best and in no way measures what a student is actually capable of doing with a set of skills.\n\nWith regard to the passages on day two, they were not interesting at all, particularly the Alcott excerpt and the poem about male raindrops. If anything, they were monstrously boring. \n\nThe short answer questions and the essay prompt were easy enough, but not very thought-provoking -- they would not respond to such menial questions in my own classroom.\n\nAs on day one, I had a few students that did not finish the exam. They skipped short answer questions and moved to the essay.  Three students composed only an introduction before the ninety minutes was up.\n\n \n\nDay Three Observations:\n\nAgain, there was a lot to slog through. Thankfully, no multiple choice questions!\n\nTwo questions asked why the author included a particular section in his or her writing. To write about why the author is choosing to supply certain information and why that information is significant is a perfectly fine prompt -- a skill useful when researching and writing from sources.\n\nMy hope is that they will do away with the multiple-choice format and move to a writing exam or keep the multiple-choice format and at least follow the lead of the Regents exam, or dump the very notions that drive all this nonsense -- data, statistical comparisons, and measurement of standards-based requirements. None of it really matters now nor will it matter in the long run, but we\'re being forced to believe that it does.  As a result of having to push this cart, teachers will be forced to teach to the test all year long simply because the test is so sizeable and convoluted.  That’s happening right now in my district. It’s back to rote learning and skill drilling. Teaching isolated skills. The passion, interest, curiosity, and fluidity that are at the heart of learning and teaching will no longer exist. It’s deplorable that students will have to look back and call this mess their education.\n\n \nSincerely,\n\nAndrew Morris\n\nTeacher (history & English, grades 7-12)\n'),(91,NULL,0,'4','Implications for Instruction',',12,1,2,','Michaela Bice','Teacher, Parent','mmbice@msn.co',0,NULL,0,0,NULL,'The amount of time and pressure placed on the ELA prep and consequences were ridiculous!  My fourth grader is a carefree, above grade level student.  She never doubted her ability in school, but this year she became too focused on the \"test.\"  Her writing lost all creativity and seemed robotic.  She did not expand her vocabulary or use background knowledge.  She felt it was \"too risky\" and she could get points deducted if she was wrong.  What are we doing to our children??? Mistakes are no longer use as springboards to learning, but something to be feared?  My little girl was afraid of letting me down and more importantly her teacher.  All year long she stated, \"Yes mommy it is good, but would I get a four?\"\n\nAssessment is necessary - it drives instruction, however this form of assessment is not used as a teaching tool.  It is a political game with our children as pawns.'),(92,NULL,0,'3','Observations',',11,','Anonymous','Teacher','sga040800@aol.com',0,NULL,0,0,NULL,'Two of my students did not begin either essay on Day 2 or Day 3 due to time constraints. Both students are average readers and work on-grade level.'),(93,NULL,0,'6','Observations',',11,1,3,5,8,','Anonymous','Teacher','Lschwarz24@yahoo.com',0,NULL,0,0,NULL,'Time seemed to be the biggest problem.  90 minutes seemed like tight timing to do the amount of reading, thinking and re-reading that was expected.  Many questions required students to re-read portions of the passage.  One question even asked students to re-read 11 lines of text!  The readability of the passages seemed appropriate, but the questions were difficult. \n\nOn day 2, students got 2 book.ets. Although directions said to do multiple choice first, some students began with the written responses for book 3.\n\nWith 10 minutes left, 11 of my 19 students were still working. They had 10 minutes to write an essay.  Those students who finished with the multiple choice were just randomly bubbling in answers.   There was simply not enough time to do all that was being asked. \n\n\n\n'),(94,NULL,9,'general','Observations',',11,6,','Janet Steinberg','TCRWP Staff','',0,59980,0,0,NULL,'Students love a challenge and the test they told me was challenging but doable.  What they didn\'t like was that the odds were against them because of the timing.  Most of them complained of not finishing leaving things blank or of having to write anything at the end of the exam because they could not finish. I would think than the data is not authentic because it is not about what the students knew it was about the race to finish.\n\nThey also wondered like in other years how the people writing the text can put two answers down that could conceivably answer the question. \n\nI also read in the Gotham paper that some text were taken form Pearsons actual program which makes me wonder about the ethics of the exam.  If the Gotham report is true is it ethical for a testing company to use actual text the students just saw from there reading program.  That seems to me an unfair advantage for some of the students.  \n\nLastly the test did hurt some students.  A young girl left crying due to the fact that she couldn\'t finish and later said she gives up this is not what we want from this exam.  This is not the only story I have heard like that.\n\nI wonder what we did want to prove with this exam.  I wonder if the results will be authentic.  I wonder if testing three ccss like it stated in the manual on the New York State Website is going to prove the students do not meet the demands of the whole ccss if they didnt have time to finish the exam.  I wonder?'),(95,NULL,0,'4','Implications for Instruction',',12,','Michaela Bice','Teacher, Parent','mmbice@msn.co',0,NULL,0,0,NULL,'The amount of time and pressure placed on the ELA prep and consequences were ridiculous!  My fourth grader is a carefree, above grade level student.  She never doubted her ability in school, but this year she became too focused on the \"test.\"  Her writing lost all creativity and seemed robotic.  She did not expand her vocabulary or use background knowledge.  She felt it was \"too risky\" and she could get points deducted if she was wrong.  What are we doing to our children??? Mistakes are no longer use as springboards to learning, but something to be feared?  My little girl was afraid of letting me down and more importantly her teacher.  All year long she stated, \"Yes mommy it is good, but would I get a four?\"\n\nAssessment is necessary - it drives instruction, however this form of assessment is not used as a teaching tool.  It is a political game with our children as pawns.'),(96,NULL,0,'6','Observations',',11,1,2,5,','Jaime Warren','Teacher','Jaimewarren@enterprisecharter.org',0,NULL,0,0,NULL,'I noticed that my students were working hard, reading carefully while close reading and citing everything with text details. Because they did everything I taught them, they didn\'t come close to finishing. They had extreme anxiety after the first day of testing to the point where many students were getting sick. I felt like my students were more prepared than ever to take these assessments and I just don\'t feel as though the time allotted was enough for them to show what they\'ve learned. I hope in the future that the time allotment is adjusted because if we are truly teaching these kids to read for meaning, we don\'t want them rushing through to finish in 90 minutes.  If these assessments  are supposed to be an indication of college, we should be reminded that many assessments  in college are not timed at all because the professors expect you to take your time and do you BEST work, not your FASTEST work!'),(97,NULL,0,'7','Ideas for Constructive Action',',13,1,2,8,','Anonymous','Teacher','',0,NULL,0,0,NULL,'Day two of the ELA exam was overkill.  I don\'t understand why the students would need two books in one day- especially since they completed multiple choice  the day before.  If the state wanted to keep the multiple choice, why not make it one book and make the 3 passages include the 21 multiple choice questions, short response, and extended response question.  The students were very overwhelmed with this day and many did not finish in time.  This lead to a lot of anxiety about scores, and frustration about not being allotted enough time. '),(98,NULL,0,'7','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,1,0,NULL,'Day two of the ELA exam was overkill.  I don\'t understand why the students would need two books in one day- especially since they completed multiple choice  the day before.  If the state wanted to keep the multiple choice, why not make it one book and make the 3 passages include the 21 multiple choice questions, short response, and extended response question.  The students were very overwhelmed with this day and many did not finish in time.  This lead to a lot of anxiety about scores, and frustration about not being allotted enough time. '),(99,NULL,0,'7','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,1,0,NULL,'Day two of the ELA exam was overkill.  I don\'t understand why the students would need two books in one day- especially since they completed multiple choice  the day before.  If the state wanted to keep the multiple choice, why not make it one book and make the 3 passages include the 21 multiple choice questions, short response, and extended response question.  The students were very overwhelmed with this day and many did not finish in time.  This lead to a lot of anxiety about scores, and frustration about not being allotted enough time. '),(100,NULL,0,'7','Ideas for Constructive Action',',13,','Mindy','Teacher','',0,NULL,1,0,NULL,'Day two of the ELA exam was overkill.  I don\'t understand why the students would need two books in one day- especially since they completed multiple choice  the day before.  If the state wanted to keep the multiple choice, why not make it one book and make the 3 passages include the 21 multiple choice questions, short response, and extended response question.  The students were very overwhelmed with this day and many did not finish in time.  This lead to a lot of anxiety about scores, and frustration about not being allotted enough time. '),(101,NULL,0,'7','Ideas for Constructive Action',',13,','Mindy','Teacher','',0,NULL,1,0,NULL,'Day two of the ELA exam was overkill.  I don\'t understand why the students would need two books in one day- especially since they completed multiple choice  the day before.  If the state wanted to keep the multiple choice, why not make it one book and make the 3 passages include the 21 multiple choice questions, short response, and extended response question.  The students were very overwhelmed with this day and many did not finish in time.  This lead to a lot of anxiety about scores, and frustration about not being allotted enough time. '),(102,NULL,0,'7','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,1,0,NULL,'Day two of the ELA exam was overkill.  I don\'t understand why the students would need two books in one day- especially since they completed multiple choice  the day before.  If the state wanted to keep the multiple choice, why not make it one book and make the 3 passages include the 21 multiple choice questions, short response, and extended response question.  The students were very overwhelmed with this day and many did not finish in time.  This lead to a lot of anxiety about scores, and frustration about not being allotted enough time. '),(103,NULL,1,'general','Observations',',11,1,5,6,8,9,','Lynnda M. Nadien, Ed .D','Principal, Parent','lnadien@uniondaleschools.org',0,NULL,0,0,NULL,'It was too long! Ridiculously long, full of assumptions!\nIt was completely void of the theoretical framework for reading and it was not even \'common core\' aligned! \nOur highest functioning kids did not finish!\nOur lowest functioning kids did not finish! \nWhy were there four booklets?\nWhy did each elementary school in the same district administer different forms of the test? More field testing? For what? We never receive any feedback!\nData? Please!!!\nWhat makes this tool valid, or aligned to anything related to reading comprehension? Who stands behind this nonsense?\nThe directions read took 12 minutes--children were literally sitting for more than 3 hours--is that not corporal punishment? \nOrganizing and packing was a task unto itself! What are we doing here? The school was immobilized for at least 5 hours to administer, and count!!\nSeriously, what was the point? \nMetacognitive processes cannot be measured with these tools and I am not so sure cognitive processes were measured. How does the \'test\' know what a child is thinking? If you choose the wrong answer you must be \'low\' and if you choose the right answer, you are a \'college and career\' ready kid? Is that metacognition? Is that what a good reader does? What are we really measuring somebody\'s wallet?\nI hope the state enjoys skewing our data--we appreciate the mockery you are making of our hard work with our children all year--and the children  thank you too--the \'testing protocol\' has made them feel inadequate and incompetent and the adults feel the same way--this one measure is not a reflection of our work! Our children have had a substantial amount of formative and summative assessment opportunities this year and in the past and they have done well!! This time or this round of assessment is just a political ploy to make corporate richer--and guess what? You are in no way preparing a child for college ready anything at this point--you are creating a environment for children to cry, stress out, withdraw and become ill---but I suppose the money will make it all better?\nNow this week we have math, and the entire school is dreading it--and that is just unacceptable! I must then as principal continue to present our work positively and tell my kids everyday that no matter what the outcome--they are the BEST!!!!!!\nPS--\nIdeas for constructivist outcomes: Use student portfolios in 3-8 to assess a child. Design a rubric! \nImplications for Instruction: We need to provide for integration of our curriculum to allow children a full view of each subject area and how the areas are inter-related--we need learning to be student centered and we need to assess a child\'s work and they need to assess their own work--we will never have feedback that is substantial to change instructional practices from these \'assessment\' days!! We need concrete work--to inform our instruction--not skewed data! A statistician knows that 30% up is unlikely and 30% down is equally unlikely and would cause mass hysteria---so what are we really doing with all of this? \nBy the way, the above-mentioned is how we have been working for many years in my building and our scores have always been effective--now we have no chance........we are \'cut\' before we \'complete\'--it is a \nfrustration and infringes upon our efficacy as dedicated and intelligent professionals! '),(104,NULL,0,'4','Implications for Instruction',',12,','Michaela Bice','Teacher, Parent','mmbice@msn.co',0,NULL,0,0,NULL,'The amount of time and pressure placed on the ELA prep and consequences were ridiculous!  My fourth grader is a carefree, above grade level student.  She never doubted her ability in school, but this year she became too focused on the \"test.\"  Her writing lost all creativity and seemed robotic.  She did not expand her vocabulary or use background knowledge.  She felt it was \"too risky\" and she could get points deducted if she was wrong.  What are we doing to our children??? Mistakes are no longer use as springboards to learning, but something to be feared?  My little girl was afraid of letting me down and more importantly her teacher.  All year long she stated, \"Yes mommy it is good, but would I get a four?\"\n\nAssessment is necessary - it drives instruction, however this form of assessment is not used as a teaching tool.  It is a political game with our children as pawns.'),(105,NULL,1,'5','Observations',',11,3,','Anonymous','Principal','',0,NULL,0,0,NULL,'This  exam did, via multiple choice, did not test critical thinking nor skills, but rather it tested if scholars out choose what the creator felt might be the best answer. There were at least two answers per question that one could make an argument for as in college.  Yet, unlike college they could not do that although this is supposed to be about college readiness standards '),(106,NULL,0,'4','Observations',',11,1,2,','Brooke Geller','Other','Gellerbrooke@gmail.com',0,NULL,0,0,NULL,'Teachers I work with told me children did not want to come to school and were extremely tired. Proficient readers and writers did not have enough time to finish and looked at their teachers wondering when the test would end.\n\n'),(107,NULL,1,'8','Observations',',11,9,','Anonymous','Teacher','',0,54990,0,0,NULL,'For the 8th Grade ELA test, the reading selections seemed to be at an appropriate reading level although the topics were not especially interesting for most 8th graders.\n\nThe bigger problem was in the choices given for the multiple choice items.  In many cases the difference between a correct and incorrect choice came down to nuances of meaning.  It was not always clear to teachers what the state was looking for in the \"correct\" response.  \n\nThe choices given seemed to be set up to \"trick\" the students. \n\nThe directions seemed to be exceptionally long-- some students were zoning out before the test had even started. '),(108,NULL,0,'general','Observations',',11,','Peter','Teacher','peter.cipparone@gmail.com',0,NULL,1,0,NULL,'I thought the ELA test for 4th grade was rigorous and fair. I will always wonder whether students got a theme question wrong because a) they didn\'t bubble in the answer correctly, b) because the question was worded strangely, or c) because they actually need to work on interpretation. Plus we won\'t get the results back until next fall. This is the problem with relying on high-stakes testing. \n\nHowever, the truth is that generally our best readers and writers did well, and our most struggling readers and writers did poorly. We need to boost the literacy of all of our students. Later in life, students will absolutely need to be able to read closely and think critically about the author\'s point of view. \n\nThe sky-rocketing importance of scores on a single test is a problem, and the test itself needs work. But if my students are all going to succeed in school going forward, I have a lot of work to do as well. \n '),(109,NULL,0,'4','Observations',',11,','Peter','Teacher','peter.cipparone@gmail.com',0,NULL,0,0,NULL,'I thought the ELA test for 4th grade was rigorous and fair. I will always wonder whether students got a theme question wrong because a) they didn\'t bubble in the answer correctly, b) because the question was worded strangely, or c) because they actually need to work on interpretation. Plus we won\'t get the results back until next fall. This is the problem with relying on high-stakes testing. However, the truth is that generally our best readers and writers did well, and our most struggling readers and writers did poorly. We need to boost the literacy of all of our students. Later in life, students will absolutely need to be able to read closely and think critically about the author\'s point of view. The sky-rocketing importance of scores on a single test is a problem, and the test itself needs work. But if my students are all going to succeed in school going forward, I have a lot of work to do as well.\nPeter - Teacher'),(110,NULL,0,'7','Observations',',11,3,','Andrew Morris','Teacher','amorris@dcseagles.org',0,29970,0,0,NULL,'I\'m writing this letter to share my thoughts regarding the Common Core ELA State Test that was administered in our school over a three-day period – April 16th, 17th, and 18th.\n\nAs a middle school English teacher, I\'m not impressed with the new Common Core ELA State Test. I not only speak for myself, but for my colleagues here in school as well.\n\nConvolution, imprecision, boredom, and overload do not add up to text complexity, nor do they increase rigor. They simply frustrate and confuse perfectly capable and knowledgeable middle school students. \n\nAnd we wonder why many of our kids are turned off to reading and writing! These sorts of tests are the culprit and the test preparation that goes into them. All of it undermines the oomph of great reading and writing -- the deep charge and potential impact of great literature and the creative drive behind all forms of writing.\n\nI teach at a small, rural school in upstate New York. I had thirty-two students take the state exam. \n\n \n\nDay One Observations:\n\nI thought the passages were OK, high-interest, and grade-level appropriate. I was expecting the texts to be more complex (based on the samples the state provided), but they were not.\n\nThe trouble with the exam begins with the multiple choice questions. Most, if not all, of my students easily comprehended the passages they read on day one. All of them expressed to me that the questions were \"tricky\" and \"confusing.\" \n\nFor example, two of the questions asked students, \"Which of the following is the best summary of the article.\"  For each of these questions, there were four lengthy summaries (a,b,c, or d). Students could easily narrow the four summaries down to two possible choices, but the differences between the two possible choices were so subtle that you\'re no longer measuring that student\'s ability to summarize! You\'re measuring if they can pick up on matters of inclusion and exclusion. It\'s more trickery than actually measuring the mastery of a particular skill, especially in this multiple-choice format.\n\nThe correct answers for those questions included a piece of information that the other possible summaries neglected to include, but at that point it was subtle enough not to even matter -- and it wouldn\'t in the \"real\" world in the context of how we use summary in our own writing. Summaries aren\'t meant to be nuanced! \n\nState Ed. will argue that it comes down to \"close reading,\" but in no way is this representative of close reading as its used in real world reading and writing! For 7th graders, it\'s a trap and not a true measurement of their skills. Questions like this set students up for failure, not success.\n\nIf I had a student read that same passage in class and then provide me with a summary of that passage\'s main points, they would easily master the skill.  The multiple-choice format ruins this -- the format distorts the actual skill being tested.\n\nI would argue, though, that the English Regents exam in 11th grade contains appropriate examples of multiple choice questions.\n\nThe current Common Core ELA State Test is so convoluted and sizeable that teachers will be forced to teach to the test – to teach isolated skills, drill those skills, and assess the acquisition of those skills all year long. This only deflates learning and teaching. \n\nA multiple-choice test is not a good measure of the highest possible learning our students are capable of, and when the questions and responses are purposely written in a manner that’s convoluted, confusing, and imprecise, the format of the questions and responses is actually a form of trickery, a trap.  Such questions trivialize the reading passages; such questions manufacture the illusion of right and wrong. They’re not measuring how well a student can closely read a full text, and they surely do not match up with how we think, read, and write in the adult world.  \n\nThe bottom line is that a multiple-choice format distorts the actual skill being measured – skills such as summarizing, using context clues to define unknown words, analysis, and interpretation. I would bring up more specific examples from the test, but I vowed to keep secret the guts of the behemoth.  Anyhow, why would transparency matter when it comes to mandated tests created by Pearson that your sons and daughters have to sit through over a three-day period, for a total of 270 minutes? What does it matter that there are serious problems with these state tests?\n\n \n\nDay Two Observations:\n\nAgain, the wording of the questions and responses was poor. There were at least six questions I starred -- questions that made me pause and return multiple times to the text. These questions would obviously be confusing and frustrating for a 7th grade student. \n\nWhat these multiple-choice exams force the students to do is not applicable to what we actually do when we think, read, and write as adults or college students. If my students were performing an analysis or writing from sources, they would have the time to do so and they would have a stronger purpose to do so. The context would be appropriate as well.  They would also have access to a dictionary and opportunities to converse and discuss. There would surely be no multiple choice questions pertaining to summaries, alliteration, author\'s purpose, or structure after a reading! There would be relevant discussion and purposeful writing.\n\nIf a student of mine decided to focus on the structure of a poem for a writing assignment, he or she would have the time to think and to develop a response. He or she would attend to the nuances and intricacies! When you try to do this through a multiple choice question, it\'s simply stifling at best and in no way measures what a student is actually capable of doing with a set of skills.\n\nWith regard to the passages on day two, they were not interesting at all, particularly the Alcott excerpt and the poem about male raindrops. If anything, they were monstrously boring. \n\nThe short answer questions and the essay prompt were easy enough, but not very thought-provoking -- they would not respond to such menial questions in my own classroom.\n\nAs on day one, I had a few students that did not finish the exam. They skipped short answer questions and moved to the essay.  Three students composed only an introduction before the ninety minutes was up.\n\n \n\nDay Three Observations:\n\nAgain, there was a lot to slog through. Thankfully, no multiple choice questions!\n\nTwo questions asked why the author included a particular section in his or her writing. To write about why the author is choosing to supply certain information and why that information is significant is a perfectly fine prompt -- a skill useful when researching and writing from sources.\n\nMy hope is that they will do away with the multiple-choice format and move to a writing exam or keep the multiple-choice format and at least follow the lead of the Regents exam, or dump the very notions that drive all this nonsense -- data, statistical comparisons, and measurement of standards-based requirements. None of it really matters now nor will it matter in the long run, but we\'re being forced to believe that it does.  As a result of having to push this cart, teachers will be forced to teach to the test all year long simply because the test is so sizeable and convoluted.  That’s happening right now in my district. It’s back to rote learning and skill drilling. Teaching isolated skills. The passion, interest, curiosity, and fluidity that are at the heart of learning and teaching will no longer exist. It’s deplorable that students will have to look back and call this mess their education.\n\n \nSincerely,\n\nAndrew Morris\n\nTeacher (history & English, grades 7-12)\n'),(111,NULL,0,'5','Observations',',11,2,3,','Stacy G.','Teacher','',0,NULL,0,0,NULL,'The test was filled with opportunities for kids aged ten-eleven to feel uncomfortable, insecure and frustrated. These children live in a world where white flags are being held up all around them and yet they still have to endure painstakingly long and difficult tests. The passages were not child centered, rather they were difficult to read and boring. Many questions left teachers with unclear definitive answers, so how can a ten-year old figure it out? Further, three days is too long. As teachers we want to help our students. The testing environment goes against every thing we represent as teachers. Having to watch a kid frustrated with tears in his eyes when all we can say is \"just do your best\", is not good pedagogy. It just stinks!'),(112,NULL,0,'general','Observations',',11,5,','Kathleen Tolan','TCRWP Staff','',0,NULL,0,0,NULL,'     This year in my work with teachers and administrators I was inspired by their efforts to understand the Common Core Standards and by their efforts to revise their curriculum to meet the demands.  During test prep teachers worked as hard as they could to prepare materials to help prepare their students. This was so hard as there was little put out by the state to guide test prep. I also witnessed students working hard to learn the strategies being taught and applying them.  I heard from many teachers that they were so proud of their students because they could not have worked any harder or try more on the days of the test.  \n     I am concerned that the test seems to be valuing a certain kind of reading.  From what I understand children had to go back and reread for almost every question and not just one paragraph but a few.  Is this the only kind of reading we want to be cultivating?  I worry that children will get the idea that they have to read so slowly and reading rates will drop.  \n     I also heard from many teachers and students that many questions needed to be reread over and over to understand what was being asked and the choices were too close.  It seems if we want to test our students reading ability then it would not be so tricky.  Trickiness doesn\'t assess a readers ability to read.  I hope some of these test questions are thrown out.  I also hope the length of the test is revised.  If so many children couldn\'t finish on day 1 and 2  then the test is flawed.  The secrecy around this test seems wrong.  Everyone should be able to look at it to see for themselves.  Transparency is needed and hopefully this test will be made public like tests in the past have been. '),(113,NULL,0,'6','Observations',',11,1,3,','Anonymous','Teacher','',0,NULL,0,0,NULL,'It was far too long.  The questions were subjective and entirely ridiculous.  There were passages with unnecessarily difficult vocabulary, and topics so far from our students understanding(coal mining ponies), that there was no way they could\'ve applied prior knowledge to find the correct answers.  '),(114,NULL,0,'8','Observations',',11,2,3,','Anonymous','Teacher','ebrinear@aol.com',0,NULL,0,0,NULL,'Three students started to cry because they couldn\'t finish on the first day.  An additional two cried on the second day because they could not finish. A student came to me declaring that he was stupid. The third day seemed better as far as time.  The students debated various reading comprehension answer choices; and I must say, all selections were sound.  Students had valid reasons for selecting a response; of course there is no way for the test to measure that.\n\nTests need to be able to see and hear student thinking.  A reading comprehension test with multiple choice questions should not be given unless the answers are nondebateable. Vocabulary in context, grammar and literary devices are perhaps the only type of questions for bubble tests.'),(115,NULL,0,'8','Observations',',11,','Anonymous','Teacher','ebrinear@aol.com',0,NULL,0,0,NULL,'The State was able to undo an entire year of teaching kids to closely read in two ninety minute sessions.  After the students used the reading strategy on the first reading selection, they realized there was insufficient time to continue close reading on the other passages and thus abandoned the stategy.  Thank you'),(116,NULL,0,'4','Observations',',11,','Alexis Czeterko','Other','alexis@readingandwritingproject.com',0,NULL,0,0,NULL,'If there is one silver lining to the extent of state testing it is the degree to which teachers show their passion and dedication to their students. The teachers I work with have devoted countless hours to helping their students prepare both academically and emotionally for these exams. This includes spending their nights and weekends analyzing data, planning instruction, and dreaming up various ways to make the work both rigorous and engaging. Their work is a testament to how much these teachers care about not just the performance, but the well-being of their students.'),(117,NULL,0,'4','Ideas for Constructive Action',',13,','Brooke Myers','Teacher','bmsolop@aol.com',0,NULL,0,0,NULL,'The opening passage appeared to be more difficult than the latter passages, and was not of high interest to the students. The test should begin with an easier, high interest passage and become progressively harder. The first story sets the pace and mood for the entire test.\n\n'),(118,NULL,0,'general','Observations',',11,5,','Jessica Stillman','Other','',0,NULL,0,0,NULL,'It has been an amazing experience being able to go into schools all over the state and see how hard teachers and students have been working; not just since \"test prep\" began but since the early days last September.  As I have talked with teachers about the length and structure of the test I have heard really mixed reviews.  However, one thing I heard over and over again was that students seemed to struggle with going back and forth from the questions to the text.  It made me think about \"what this means\" for how we teach our students about reading behaviors starting from the beginning of the year.  It seems to me that in upper grades we want to hit the ground running come Sept and really have students talking about their books and referring to the important parts in their stories.  I think if they become more accustomed to this behavior it will feel less like a tedious chore and more like authentic reading. \nThis is just one thought I was having in response to the test.  I would love to hear other thoughts on people\'s observations and what they think it can/will mean for our teaching!'),(119,NULL,0,'3','Observations',',11,','Anonymous','Parent','',0,NULL,1,0,NULL,'It\'s unbelievable that people in Albany expect 8 and 9 year old kids to sit quiet not move and not talk for hours on end.  I\'m beyond offended that a test it it\'s proported \"Security measures\" have become more important than subject and relationship with students.  One things for sure, kids will know how to take a test, but not be able to think for themselves.'),(120,NULL,0,'3','The Need for Transparency',',11,10,','Anonymous','Parent','',0,NULL,0,0,NULL,'It\'s unbelievable that people in Albany expect 8 and 9 year old kids to sit quiet not move and not talk for hours on end.  I\'m beyond offended that a test it it\'s proported \"Security measures\" have become more important than subject and relationship with students.  One things for sure, kids will know how to take a test, but not be able to think for themselves.'),(121,NULL,0,'6','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,NULL,'The reability level of most of the passages was a10th or 11th grade level...get stories on their level. Day 2 was horrible!!!! The children did not have enough time! What was the purpose of more multiple choice that tested the same thing as the day before. About 10 of my 56 syudents had 5 min to write the essay. RIDICULOUS! !!!!'),(122,NULL,0,'6','Ideas for Constructive Action',',13,1,','Tonijo Davis','Parent','mtdavis@frontiernet.net',0,NULL,0,0,NULL,'My Son of course says all test suck...But with that being said, when talking to him. Day 1 was ok, he did not feel stressed or rushed for time. Day 2 he felt unsure at the end of the test as he didn\'t have enough time to be as creative as he would of liked on the end essay, but he is one of only a few that actually got to the essay part. He felt that and extra even 10 minutes in day 2 would help with that test scores. Day 3 he felt was the easiest of all 3 test as far as the questions, but still felt like 10 more minutes would of helped with makeing sure test was complete and accurate.\nMy son loves reading so he is a strong reader so this may have helped him in his scores, he has loved books since the 1st one i opened for him.\nSo if he felt more time was needed then a not so strong reader would of really struggled with it. Just a suggestion for next year.'),(123,NULL,1,'6','Observations',',11,2,7,','Rose Gayton','Teacher','rgayton@olean.wnyric.org',0,NULL,0,0,NULL,'On the third day, a special education student in our school had a complete meltdown during the test.  He was sobbing uncontrollably and had to be removed from the classroom.  He was distracting more than the number of students in his room, he was distracting the room beside him also, since the rooms are connected by a moving wall.\n\nIt is completely unnecessary to test students until their frustration levels boil over.  Although he is the only story I have, I\'m sure there are many more like him.\n\nThis week he starts the process all over again.'),(124,NULL,0,'8','Observations',',11,2,','Rose','Teacher, Parent','rgayton@olean.wnyric.org',0,NULL,0,0,NULL,'My daughter came home completely stressed out every day of the 8th grade ELA exam.  She said she didn\'t have enough time to give the essays much thought, as she was trying to get the whole exam completed.  She said most of her peers didn\'t get finished on the second and third days.\n\nI\'m concerned about how well she did.  If she couldn\'t focus on the essays, the tests will not reflect her true ability.'),(125,NULL,1,'general','Observations',',11,1,5,','Anonymous','Teacher, Parent','',0,NULL,0,0,NULL,'As teachers, we have given our students many reading strategies for working through text that is challenging. They know how to annotate texts and have learned the value of re-reading to enhance understanding. Yet the 8th grade NYS ELA exam, which did indeed include long and complicated reading passages in the spirit of Common Core, did not allow the time students need to complete the tasks. They did not have time to re-read or annotate, so in my opinion the test results will in no way reflect my students\' ability to read \"rigorous\" text. \n\nAs a parent, I am appalled that our local districts are not pushing back on Albany and standing up for what we know is NOT good education practice. '),(126,NULL,3,'8','Observations',',11,1,5,','Sarah Bandemer','Teacher','sband0830@hotmail.com',0,NULL,0,0,NULL,'I have been teaching 8th Grade English for 12 years.  In this time, I have prepared students for, administered, and graded 12 different state exams.  I was anxious to see the new test and how it would directly relate to the new common core that I have been implementing in my classroom.  Needless to say, I was abhorred.  We have been exercising Close reading strategies, planning strategies, and best practices for the past 8 months in my class.  The students who DID close reading, who DID use graphic organizers to plan their essays, who DID re-read their short answers, DID NOT FINISH.  I wound up consoling students in tears who said they tried their best and still could not finish.  The students who were able to complete the test, all said they rushed through.  They did not use the close reading strategies, because they were afraid they wouldn\'t have enough time. \nWhat is it that we are supposed to be teaching these students?  Because I am no longer certain.  Kids, rush through and put down any answer.  Hopefully it will be good enough.\nIn my opinion, this is a completely invalid means of assessing student achievement of the common core.  I truly hope New York State takes this into account for future assessments.  I hope to never again have to console my students as I had to  after this test.'),(127,NULL,0,'8','Observations',',11,1,3,','Anonymous','Teacher, Parent','',0,NULL,0,0,NULL,'Day 2 -Books 2 & 3 were incredibly challenging and most students didn\'t even finish in the allotted 90 minutes of testing. On top of that the repetative and tedious directions took nearly 20 minutes for most people to read. So our students actually sat for 110 minutes. This is just cruel. \nAlso, why are students taking the regents exam still permitted to have all their testing accommodations but our younger students are not?\nThe reading comprehension pieces were boring. If they have to read nonfiction at least make it something relatable for them.\nSome of the questions staff couldn\'t pick a correct answer for. Some students were so baffled they didn\'t finish and ended up guessing the answers for the last passage.\n'),(128,NULL,0,'5','Observations',',11,3,6,7,','Jane Kowaleski','Teacher','jkowaleski@portchesterschools.org',0,NULL,0,0,NULL,'I have questions and comments to go along with the questions.\n1) Why have so many passages? To me there should be one fiction, two non-fiction and one poem.  That should suffice if a child knows the material.  It\'s the old addage: if you give a student 10 math problems and he can do them, what\'s the point of giving 100 problems?  He/she knows how to do them.  If you give a student 10 math problems and he CAN\'T do them, what\'s the point of giving 100?  He/she doesn\'t know it. The teacher has to find another way for that student to know the material. You should be able to measure what the student knows with fewer passages.\n\n2) What is the purpose of being timed?  To me, it\'s more pressure and if the student was given time to complete it, he/she would do well.  Some adults have trouble with timing.  It\'s not fair to the student.\n\n3)Ten and eleven years old are still at the literal stage of development.  They are not developmentally at the abstract stage yet. There were too many abstract questions on the test.\n\n4) On the multiple choice part, there were some choices that 2 responses could have answered the question.  Where is the fairness in that?\n\n5) I love the common  core.  But I think the state should have waited one year before testing students on it to give teachers a chance to get to know it and teach it well.  That wasn\'t fair either.\n\n6) What do you do for the autistic/spectrum child who just doesn\'t understand some of the inference questions in that test?  Just not getting it is part of their disability.  It\'s not fair that the classroom teacher is being \"graded\" (APPR) on something she/he has no control over.\n\n7) I know the old addage: \"Life isn\'t fair.\"  But it should be fair and so should state testing.  It\'s too much.\n\n8)Testing should be done everyother year.  Let teachers teach!!'),(129,NULL,0,'7','Observations',',11,2,7,','Anonymous','Teacher','',0,NULL,0,0,NULL,'As a special education teacher, I work with students in an ICT class who have a range of disabilities.  All of the children I work with have extended time to take this already-too-long test.  It was torturous watching these children stress and have meltdowns about the ELA test!  I had two students with double time cry because they didn\'t finish.  Yes, DOUBLE TIME, which means that they sat in a quiet room for over 3 hours.  I don\'t understand how giving more time to take an already excruciating long test is a feasible solution to accommodate children who have a hard time sitting still or focusing...There needs to be a better way to measure what students learn that is reasonable and equitable. '),(130,NULL,1,'8','Observations',',11,5,6,','Katherine Hernandez','Teacher','Khernandezla@gmail.com',0,49990,0,0,NULL,'I\'d had high hopes for the new generation of tests, because my experience with CCSS in the classroom has been so positive.  The test did not meet my hopes, though, and experiencing it felt more like a cruel trick had been played on my students than that they were getting an opportunity to show the great depth of their thinking, reasoning, analysis, interpretation, and abilities to support all of that with text evidence.  \n\nDon\'t get me wrong when I say I\'d had high hopes: that isn\'t meant to imply I am a fan of high stakes tests--I\'m not.  But I did think that we had a brilliant opportunity to make the necessary tests more aligned to what students actually do in school.  We\'ve worked to linger longer and dig deeper, rather than skim the surface of skills and content, so that our students would have the opportunity to develop real and lasting skills and habits of mind, but the test this year did not honor that depth, because they required students to speed through the work in order to finish in the inadequate amount of time allotted.  \n\nThat said, the questions demanded the depth of thought and careful consideration our students have been developing through CCSS-aligned curriculum.  So the frustration comes from the mixed message: should students be thoughtful and thorough, or should they race to the end?\n\nI\'ll comment later on the genre content of the tests.\n\nThank you, Lucy and TCRWP, for creating this space.'),(131,NULL,0,'4','Observations',',11,3,5,9,','Concerned Teacher Willing To Take a Stand','Teacher','',0,NULL,0,0,NULL,'This year\'s ELA grade 4 state test was by far the most difficult I have ever administered.  It wasn\'t developmentally appropriate.  After reading the teacher directions aloud for almost 20 straight minutes, students were then expected to be relaxed and complete a test in 70 minutes.  Students were asked to read passages that were high interest but also extremely difficult.  The vocabulary and content was more than rigorous.  The questions given to the students were worded in a way that was never before seen.  The questions weren\'t straight forward in their meaning but required students to interpret the question then respond.  Students were exhausted before their even responded.  Multiple choices options given to students required extensive reading, vocabulary understanding and implicit answering.  \n\nThis year my students used every minute to complete the test.  Some barely finished and perhaps just guessed at then end due to the time constraint.  Also, students were asked to use details as in the past but the lack of explicit answers left students floundering for details.  \n\nState testing angers me.  It requires us to cram teaching into 7 months of teaching.  Then we spend at least a month preparing for tests, taking testing, and then correcting tests.  This is such a loss of teaching time.  After the tests are complete the staff and students are so exhausted and emotionally drained. We are expected to continue learning as if this test didn\'t interrupt our learning.  \n\nThe State already requires so much testing.  Please respect our children and get back to learning.  Students don\'t learn through extensive testing.  We need the time for hands-on exploration, researching, and real-world experiences.  '),(132,NULL,1,'general','Observations',',11,10,','Anonymous','Parent, Other','',0,24990,0,0,NULL,'Two tremendous issues with the NYS ELA exam seem to be transparency  - who gets to see the test,  and expectations for grade levels having already achieved the CCSS skills.  Liz Phillips (above) has already noted the issues of transparency.  I\'ll just note, therefore, that we need to continue to agitate for this.  It\'s not okay that teachers and children are evaluated (in NYC in tremendously high stakes ways) on a test that nobody can see or talk about.  If the test-makers can\'t afford to create a wide enough bank of items that they can share it each year (as has always been the case until last year), then we shouldn\'t be using this test.  The stakes are too high to depend on these test-makers or the state education department - teachers and parents need to be able to see the test.  When we talk about transparency, we probably need to keep reminding those outside of education how the results of this test are used.  I vividly remember  my fifth grader poring over the NYC DOE manuals for what middle schools he was \"allowed\" to apply for (even to take their own tests), based on his 4th grade ELA and MATH scores.  So at 11, his whole academic future, and the choices he could make for middle school and thus high school, rode on the ELA test he too the year before.   Educators and parents need to be able to see it as they are the most affected by it.   \n\nThe second issue is that of the expectations of NYS that students should be tested at Common Core levels already.  I see promise in the CCSS.  Of course I want my students to read this way.  I want adults to be able to read this way!  I also know that the Common Core standards assume that for the fifth grader to read and write at those levels, he or she is coming in with five years of CCSS level work behind him or her.   That\'s the promise of the CCSS.  That if your second graders can do x, then your third graders will be able to do y, and your fourth graders can do z!  Not that one teacher, in one year, can take students who are nowhere near those levels yet, and do it all in six months.   These expectations make one wonder about the pedagogical knowledge and integrity of decision makers who would roll out aggressive, CCSS level exams on children and teachers, before they have had a chance to get students to these levels (and where\'s the research on how long that might take, what resources are needed, and who is going to provide schools with those resources).   \n\nMary Ehrenworth,  Parent and Staff Developer'),(134,NULL,3,'3','Observations',',11,1,','Joanne Hindley','Principal','',0,9980,0,0,'2013-04-22 13:07:29','  As so many previous posters stated, the tests were far too long.  Just as we don\'t need to have students do fifty math problems to show mastery of a concept when they can show that with five, the sheer amount of passages was overkill and unnecessary.\n  As the assistant principal and testing coordinator in my building, I heard the same comments over and over again from teachers as they returned the tests - too long, too stressful, and not at all an accurate indication of what students can/can\'t do because it became a test about speed reading. \n  My own sixth grade son who generally does well on the written portion, didn\'t have time to do one of the short responses and only had 4 minutes left to do the long essay. Many teachers also commented that while the passages were fair, the questions were intentionally convoluted, tricky and vague. Students were often required to go back and read large chunks of text in order to answer - again, using precious amounts of time to do so.\n   For all the students that didn\'t finish or did sub-par work because of the clock, what useful information will their scores offer to anyone?  Why take it if it doesn\'t truly reflect what kids do/don\'t know? \n'),(135,NULL,0,'4','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 13:07:43','Supposedly, in response to complaints that last year\'s testing block of 90 minutes was too long, the state shortened the testing time for fourth graders to 70 minutes. However, they simultaneously lengthened the test itself by including longer and more difficult passages. As a result, some students were unable to finish the test in the allotted time.  I also felt that students experienced a greater amount of stress and anxiety.'),(136,NULL,0,'7','Observations',',11,1,2,','Carolyn Muller','Teacher','cara.muller@gmail.com',0,NULL,0,0,'2013-04-22 13:10:41','All three days of this test were much longer than tests in previous years. In my class of General Education students, about 1/3 did not finish the test or just barely finished the test on day three. Even my above-grade-level students were stressed out by how little time they had to complete and proofread their essays. On the other days, I had at least one or two students who failed to finish.\n\nThe tests were extremely stressful for students. As 7th graders in the NYC public school system, they have been told for years by their teachers and parents how important it is for them to excel on this year\'s state tests in both Math and ELA. Many high schools require 3s and 4s on the state test, and now these students are afraid that they may have fewer good options for their education, even though they earn good grades and behave in school. The acknowledgment by the State and City education departments that these tests are much harder than usual, so we should expect lower grades, does nothing to assuage the anxiety of these students and their parents or teachers. \n\nAs a teacher, I was frustrated by the sense that I was the blind leading the blind in preparing students for this test. Even during test days, I did not have access to test booklets, and I did not get to read the questions my own students were faced with answering. The State needs to provide teachers and principals with useful materials and curriculum supports so that students can practice responding to the often convoluted questions test makers devise.'),(137,NULL,0,'8','Observations',',11,1,9,','Kelly Seibold','Teacher','kseibold@eastauroraschools.org',0,NULL,0,0,'2013-04-22 13:19:55','Students were asked to sit for 4.5 hours of testing.  This seems excessive.\n\nStudents listened to 15 minutes of instruction. This increased student\'s anxiety levels as they waited-and waited to start the test.\n\nMy 8th grade teen at home stated that the instructions ask students to read and re-read information and write complete responses, but students are not given enough time for complete responses.  '),(138,NULL,0,'3','Observations',',11,7,8,9,','Lynne Burke','Teacher','lburke@portchesterschools.org',0,NULL,0,0,'2013-04-22 13:22:36','The directions that had to be read aloud to third graders were much too long, particularly on day two when their were two books.  Most third graders have practiced tests before this.  Also, having two separate books at the same time complicated things unnecessarily.  The reading passages were interesting and informative, and I think at an appropriate level.   It was helpful that paragraphs were numbered, but some of the questions were very tricky.  As a special educator, I am concerned about showing growth with students who are non-readers or perhaps just beginning to read.  We need a better way to show reading growth for those students.'),(139,NULL,0,'6','Observations',',11,','Anonymous','','dfklfd@oijfo.com',0,NULL,0,0,'2013-04-22 13:24:31','This was a hard test. '),(140,NULL,0,'general','Observations',',11,1,2,9,','Anonymous','Other','eworsnop@greenecsd.org',0,NULL,0,0,'2013-04-22 13:26:33','As a counselor, I am responsible for organizing the entire proctoring process for testing.  I have a few observations regarding the ELA testing in grades 6 through 8:\n\n1:  Day 2 (books 2 and 3) took students significantly longer to complete.  There were some students who were unable to complete all of the questions in the given time frame.  It also took teachers longer to read the test directions on that day.\n\n2:  General comment regarding the time and resources required for testing:\nI firmly believe that 3 90 minute days of testing (just for ELA) is too much for students, and ask whether the same constructs can be assessed with a shorter test.  I fear that the length is working against us, because students can get tired and sloppy in their responses.  Furthermore, it completely disrupts the instructional time for those 3 days.  After 90 minutes (or up to 3 hours for students with extended time), students are less interested in engaging in the academic process.  We have tried many different schedules over the years (shortened class periods, skipping certain periods for the day).  Regardless of the schedule that we have come up with, our days are disrupted.  Our teachers are not allowed to give tests/quizzes on the days of the exams, which means that many of them attempt to give quizzes and tests in the few days between the two tests, further overloading students.  '),(141,NULL,1,'5','Observations',',11,1,7,','Suzanne Pettifer','Teacher','Suzanne.pettifer@greece.k12.ny.us',0,NULL,0,0,'2013-04-22 13:38:36','I am a reading specialist who was assigned to administer test mods for a fifth grade student. Because of his special needs he is assessed one to one.  Here are my comments and observations based on my personal experience....\n\n1. Time - I know many of this students peers were not able to complete the tests. He was.  He did use his time and a half modification.  He needed a great deal of refocusing and his breaks were useful- these are a part of his test mods too.  His anxiety level was high as was many of our students  - not just because of the teachers preparation (which was less than it has been in the past because of the unknown), but also because of the \"other\" adult buzz(parents, media) around these tests.  I know that kids who didn\'t finish didn\'t have mods and were those cuspy kids that we know have enough challenges but not enough to get a classification or 504 plan.  Isnt there a way to give everyone a break half way?  Do we have to time it?  If so can we record the time and take that into consideration when we calculate the score? Or let the kids know that you might not finish and it is ok!!!! ???  We support kids to feel successful in so many ways through the year as good teachers and then test day PULL ALL OF THESE AND SAY  - SORRY WE CANT NOW!  \n\n2. My next thought has to do with the number of items.  Do we need to have a book 2 that looks like book one? We have said in the past that kids dont need to show through 35 problems but maybe 5 to 6 good ones that they understand a concept.  Is there a way to reduce the number?  And still have kids show what they know? \n\n3. As part of scoring if we want to see kids use evidence we should give credit for them returning to the text to highlight evidence.  That would seem to match the expectations and give greater insight into what misunderstandings occur.  But if we arent getting the tests back I guess it doesnt matter for ananlysis purposes.  THe test just seems very disconnected from our daily practice of looking at why kids what they did... maybe the reporting out will be more detailed. I am just not aware of the way scores will be reported yet.  \n\n4. Developmentally appropriate seems like a term from the past.  I do think we have forgotten that our elementary students are still developing - not entering college in the next year or two.  \n\n'),(142,NULL,0,'8','Observations',',11,1,2,4,','Anonymous','Teacher','gmterhune@hotmail.com',0,NULL,0,0,'2013-04-22 13:38:58','Thank you for the opportunity for feedback as my requests for this chance from the state have been ignored. \n\nThe recent state assessments were again problematic.  These tests are politically motivated and are not providing accurate information about student performance.  \n\nOn day two of the assessment, I had several upper level students (probably 4\'s) who did not have time to even start the essay.  On the other hand, struggling students wrote a 3-4 sentence paragraph on the same essay.  These students will be given a higher score than the better writers who ran out of time.  The new Common Core stresses writing as a process, but most students had to skip planning and editing in order to finish.\n\nLet\'s be honest...The reason the tests are so long is so Pearson can test future questions on our students.  If Pearson wants to test questions on children, they should hire them and pay them.  What appears to be educational reform is actually back room political deals involving political contributions and kickbacks.  \n\nI have no problem with the difficulty of the test.  For the most part, the content was what I expected.  The problem is the length and stress these tests cause children.  A one day, 60 minute test is plenty.  Let Pearson test its test questions elsewhere.  \n\nAs a parent, my third grade son started testing this year.  Two days before her was spinning the idea of testing in his brain.  He did not want to let his teachers down.  He knew that a 1 was bad and he did not want to do a bad thing.  \n'),(143,NULL,1,'4','Implications for Instruction',',12,1,8,','Anonymous','Other','dsostre@hczpromise.org',0,NULL,0,0,'2013-04-22 13:45:53','There were many purposful distractors in the questions.\n\nThe length of the passages required more time, that allotted. \n\nThe purpose of book 2 does not seem clear.  Book two was one extra multiple choice passage and could have been placed with book three as opposed to two books.\n\n'),(144,NULL,0,'4','Implications for Instruction',',12,','Anonymous','Other','dsostre@hczpromise.org',0,NULL,1,0,'2013-04-22 13:49:15','There were many purposful distractors in the questions.\n\nThe length of the passages required more time, than allotted. \n\nThe purpose of book 2 does not seem clear.  Book two was one extra multiple choice passage and could have been placed with book three as opposed to two books.\n\n'),(145,NULL,0,'3','Observations',',11,1,3,','Anonymous','','',0,NULL,0,0,'2013-04-22 13:55:51','\nThe passages for third grade on Day 1 ( Multiple Choice) were too long for the time given.  The questions had many distractors.'),(146,NULL,0,'3','Observations',',11,1,5,','Dawn O\'Donnell','Teacher','dodonnel@bufsd.org',0,NULL,0,0,'2013-04-22 14:20:04','My students were taught to read CLOSELY and analyze the text while reading.  Given the length of the passages,the text complexity,and the number of passages within each session, my students were unable to apply the skills they were taught AND complete the test within the time given. The state shortened the time allotted for sessions, while lengthening the requirements the students had to fulfill within each session. How does this measure accurately what the students can do? '),(148,NULL,0,'3','Ideas for Constructive Action',',13,1,8,9,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 14:24:03','On day 2 the children had multiple choice, short responses and extended responses all in the same 70 min. period. I believe that this was inapproprate for third graders because the directions were different for each part and the thinking process required them to switch gears from one to another without allowing enough processing time and time to actually work thoughtfully.\n\nThe amount of materials to manipulate, i.e different books and the scantron sheet added another layer to the testing process.'),(149,NULL,0,'6','Observations',',11,1,2,','Angela Lamorgese-McDonald','Teacher','lamorgesemcdonalda@hauppauge.k12.ny.us',0,NULL,0,0,'2013-04-22 14:26:07','On Day Two of the 6th grade ELA assessment, many of the sixth grade students did not complete the test. Of the children who did finish, many rushed through the essay with only ten or fifteen minutes to read the question, plan, write and proofread. Many children who usually do not get upset, were upset by this portion of the assessment. '),(150,NULL,0,'general','Observations',',11,1,2,3,8,9,','Dawn O\'Donnell','Teacher','dodonnel@bufsd.org',0,NULL,0,0,'2013-04-22 14:28:56','Test was too long to complete in time given.\n2 books for 8 year olds given at the same time?\nDirections lengthy and confusing.\nPassages too long and unable to be read CLOSELY during given time frame.\nQuestions confusing and wordy.\nStudents were told they would need to refer to text for answers, yet not given ample time to do this in order to complete entire sessions.\nSo many students did not finish, did this test measure their ability to read and answer questions given...or just how quickly they COULD read in order to finish the exam?\n3 students needed to go to nurse because they were sick to their stomach.\nCrying 8 year olds because they were unable to finish the test in time allotted.'),(151,NULL,1,'6','Observations',',11,4,','John Mercer','Teacher','jmercer@fulton.cnyric.org',0,40000,0,0,'2013-04-22 14:47:32',' The test was way too long.  As a grade level we had many students who were unable to finish.  Day 2 became more about time management than testing. Seriously- whose idea was it to give eleven and twelve year olds two tests at the same time with nearly 25 minutes of instruction and then just let them go and hope they negotiate their time well.  \n\nMy students reported struggling with several questions that had two right answers but obviously only one correct answer.  There were also many colloquialisms that several students did not comprehend.\n \nPassage length was also quite unreasonable at times.  Contrary to what we were told to expect, many of the short answer questions were inferential in nature.  Students, who had been taught to look back for answers were unable to find them in the passage.  Any students who tried to use the “close reading” technique would never have finished the tests. \n\nIt is clear that the design and purpose of these tests is to create a culture of failure that honestly does not exist. This will no doubt be used to criticize educators and provide an opportunity for testing companies to develop and sell study products which the schools will be forced to buy. \n\nOverall, the tests, the emphasis placed on them, and the disregard of the State Ed. Dept. for the welfare and education of our students is shameful.  Thousands and thousands of highly educated professionals, experts in their fields, have repeatedly told NYS Ed. Department that what they are doing is wrong.  The response is mind-numbing rhetoric.  This is a sad chapter in the history of American education. \n'),(152,NULL,0,'general','Observations',',11,2,7,','Anonymous','Other','mwenke@olean.wnyric.org',0,NULL,0,0,'2013-04-22 14:55:59','As a counselor in a 4-8 school, I would like to comment on the tole this has taken on the students as well as my teachers.  I have had many students in my office with anxieties over taking the test and also after taking the test.  Concerns of not doing well, feeling dumb and overall stress at such a young age is turning these youngster off of their education.  On the flip side, I have had veteran teachers in tears over concerns about how their students are going to do and how this will affect their APPR.  I even had a veteran teacher taken to the ER with an anxiety attack.  With NYS already saying students are not expected to do well on this test, this is a very high cost for them to pay. \n\nOne of my special education students has extended time on his test\n(3X).  He was testing for 3 days, 6 hours each day.  Eighteen hours of testing seem a bit ridiclous.  I am sure we will get the same results from 18 hours of testing that we will with a 40 min star assessment and also less expensive.  \n\nPlease reconsider what NYS is doing to the education and psyche of our students!'),(153,NULL,0,'8','Observations',',11,1,','Karen Schrader','Teacher','kschrader@cvcs.wnyric.org',0,NULL,0,0,'2013-04-22 15:00:34','It is absurd that there were four books and 3 dayws (270 minutes) to see if a student has made progress.  Are you kidding me?  One test for one day would have been enough.  Kids were crying. Kids were exhausted.  It was way too long.  What a waste of millions of dollars that could have been used for enrichment classes or school supplies for the hundreds of kids I teach everyday that have nothing. We must stop this excessive testing.  Standardized testing should be one day at most for each subject.  Now we need to waste 270 more minutes for Math then science.\n\n'),(154,NULL,0,'7','Observations',',11,','Anonymous','Parent','',0,NULL,1,0,'2013-04-22 15:06:41','My daughter reported that the day 3 7th grade passages had an oddity. Apparently, two terms were spelled differently in the two separate passages.\n\nIn one passage, key terms were spelled Klondike and Chilcoot Pass. In the other, the terms were spelled Klondyke and Chilkoot Pass.\n\nIf this was different styles of literary text/language, then I could understand.\n\nIf this was a spelling error, then shame on the hypocrisy of New York State\'s Education Department for not holding themselves to the same higher standards accountability that they are forcing upon our teachers and kids.\n\nOn another note, day 2 of the exam, in my opinion, was clearly not screened properly by educators with classroom experience to determine if an average functioning student could reasonably complete the tasks in the ninety minute time allotment.\n\nThat critical error was an act of incompetence, at minimum, or negligence, at maximum, by the State.'),(155,NULL,0,'general','Observations',',11,1,','Anonymous','Parent','philip177@gmail.com',0,NULL,0,0,'2013-04-22 15:07:31','There is no way you need four books and three days to see if a student has made considerable progress.  The tests were way too long.  270 minutes wasted last week , now 270 minutes wasted again this week then the 8th grade will have science tests next from the state.  When will it stop?  I am not against my sons being tested but one day is enough or two days at most.  My sons have scored perfect scores on these tests and get nothing.  The only thing the test is used for is to determine AIS and they don\'t need that so why should they take it?  To help their teachers APPR?  I guess that is the only reason.  They like their teachers and want to help them but have heard of students who don\'t like their teachers doing bad on purpose.  How sad is that?'),(156,NULL,0,'7','Observations',',11,1,2,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-22 15:07:33','Although I am a teacher in the High School, I need to comment on the 7th grade ELA exam which my daughter took.  She is a high 90 student who has scored a 4 on all of her previous state tests.  She felt that there was not enough time to finish the test.  On the 1st day, she was 1/2 done and only had 30 minutes left.  She rushed through the rest of the test.  She decided that it would be necessary to rush through the remainder of the tests so that she could finish on the next 2 days.  She told me that she finished(with about 2 minutes to spare) but she did not get to take her time to think about all of the answers.  She hoped her writing would not affect her grade because she scribbled her essays to finish them on time.  Most of her friends felt the same way.  When top students are taking the full 1.5 hours on all three days of testing, what are the average and slower kids able to do.  I think 4.5 hours of testing is too long anyway.  Kids are having panic attacks and getting sick over worrying about these tests.  Is that what we want to accomplish for our children?'),(157,NULL,0,'general','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 15:18:13','I feel the 3rd and 4th grade tests were too long.  We may have students score a 1 or 2, and this may be based only on not completing the test.  Should there be a place for a teacher to code this on the answer sheet, so when discussions come up in the following school year, schools have this information?  I suppose individual teachers could make note of this, but it also makes sense for something for it on the answering sheets.\n\nI felt the readability of the passages was appropriate for the grade level.'),(158,NULL,0,'3','Ideas for Constructive Action',',13,1,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 15:24:29','Having administered, read and reviewed the third grade ELA test,  I have the following comments.\n\nIn an attempt to force a child to choose between a right and a more right response,  a multiple choice is neither a fair not the more RIGOROUS method to do it.  to promote higher level reasoning,  give the studetn a chance to explain the right answer before assuming it is and marking it wrong.  This is just unfair.  \n\nProviding the students with only a few lines to write on left many students not proving or providing the correct answers.  Some stated they stopped when the lines ran out.  Is it a writing test or pensmanship spacing test?  The rest of the paper was blank.  instructions did not allow us to tell them to write in the blank space.\n\nTests way too long to be administered for that age of students.  '),(159,NULL,0,'general','Observations',',11,','Jennifer Kean-Thompson','Other','jennifer.kean@readingandwritingproject.com',0,NULL,0,0,'2013-04-22 15:25:01','I am a TCRWP Staff Developer and during my time in schools leading up to the ELA exam, I was in awe of teacher\'s dedication to preparing their students. Teachers are striving to educate themselves on the Common Core State Standards and what they need to do to help their students succeed.  While teachers put a lot of time and effort into preparing their students for the ELA, they never lost sight of the importance of quality reading and writing instruction.'),(160,NULL,1,'general','The Need for Transparency',',11,10,','Christopher Lehman - Staff Developer','TCRWP Staff','chrislehman@readingandwritingproject.com',0,NULL,0,0,'2013-04-22 15:38:55','While the lead up to testing seems to always be stressful, this year in the month before the test I felt teachers and schools were more stressed than ever.  With so little information coming from the state about the format and kinds of questions we were all left to guess and greatly rely on test prep products - does Rally have secret access that the public does not? or maybe Ready? or is this version in Kaplan correct?  The state\'s idea that not releasing the testing items will somehow prevent teachers from \"teaching to the test\" is Pollyannian. I actually believe knowing what is on the test, well before only a few weeks before, will help schools plan accordingly.   The state should release the full tests or a majority of authentic test items and provide schools with clearer guidance and examples early in the school year.'),(161,NULL,1,'3','Ideas for Constructive Action',',13,1,8,','Amy','Teacher','abrown@newfane.wnyric.org',0,NULL,0,0,'2013-04-22 15:41:52','I have been teaching first grade for 12 years.  This year was my first year in third grade.  And my first experience with the State Tests.\n\nI didn\'t really understand why there had to be a Book 2 and a Book 3?  The fact that there were 2 Books on this day REALLY stressed out my students.  They were worried about having enough time to finish both books.  I\'m wondering why Book 2 could not have been a part of Book 1?\n\nAlso, a few of my students did not get to finish on Day 2 and Day 3.\nI thought this test was assessing how well students could read and answer questions, but instead, it was testing how fast they can do it, and not how carefully.  I think another 10 minutes could have even help some of them.  So maybe a 90 minute test could be done in the future?\n\nThank you'),(162,NULL,0,'3','Observations',',11,1,2,5,','Anonymous','Teacher','jdavis@gfsd.org',0,NULL,0,0,'2013-04-22 15:43:26','During testing week, my students as a group became very irritable.  They had quick tempers and there were many arguments over nothing.\nThere is no amount of comfort you can give your class to make them feel at ease when you have students being given a NYS Test.  They understand the pressure and want to perform well.  I have 2 complaints with the test. 1) My best students didn\'t have enough time to complete the extended response which required them to go back through and basically summarize every single paragraph in the selection.  2) The questions required them to go back over the reading repeatedly to find answers to the questions. '),(163,NULL,0,'','Observations',',11,','Jeff William Nichols','Parent','jeff.william.nichols@gmail.com',0,NULL,0,0,'2013-04-22 15:46:18','Your introduction to this site contains a mistake:\n\n\"These tests will *effect* curriculum, shape how reading and writing are taught,\"\n\nThe marked word should be \"affect.\"'),(165,NULL,1,'3','Ideas for Constructive Action',',13,4,','Nicole Dopp','Teacher','nbrown9558@aol.com',0,39990,0,0,'2013-04-22 16:00:51','I have observations and constructive actions ideas. As a teacher it scares me that we are raising a generation of students taking these types of tests. We begin the year with pre tests that are generally about knowledge the students don\'t know yet and have not been exposed to. We say to them do your best I expect you not to know these things since I did not teach them to you yet and it\'s ok if you don\'t do well. This is the first week message we send to these children. our future. Then in April after schools have wasted valuable time teaching time on how to take the test and how to answer the questions in a way the state will accept, they take the state tests. The true reality is that the main purpose is not for the students but for compliance with NCLB and APPR. We need to reevaluate the purpose behind what we are doing. If we are wanting to produce students who will work in production lines in factories , completeing the same job in the same manner day after say then good job state ed. When I last looked we are not in that century anymore. How many educators are actually consultated when creating these tests or looking to revamp education. Not too often if you look at our state ed department. To say we are falling behind China, Japan or FInland in terms of our students is not understanding our counrty frist off. We are a melting pot of all countries unlike the ones we compare ourselves to. In addition we need to porduce students who can think outside the box, harness their creativity and learn to think creatively. What ever happened to authentic assessment of students. Assessing in a way that reflects what they have learned and putting it to use. Real world application. State ed and department of education need to step aside from theory and philosophy and get in touch with the real world of education. Voices are been risen but not loud enough. We need to save this generation of learners and not fail them in the education they deserve.'),(166,NULL,0,'','Ideas for Constructive Action',',13,','Kimberly McCall','Teacher','kkcmccall@aol.com',0,NULL,0,0,'2013-04-22 16:02:20','I was part of the scoring of the 3rd grade ELA.  As a group, we felt that the rubrics and sample answers were not very clear for the questions we corrected.  Some of the sample answers/essays were shown to be certain scores even though they did not follow the description given on the rubric.  It would make the scoring more objective if the rubrics included a \"must include\" or \"does not include\" list rather then subjective descriptions AND if the sample answers at least matched the rubrics.  A lot was left up to the scorer to decide.  This leads to inconsistent and invalid results.'),(167,NULL,0,'5','Observations',',11,','H. Sanchez','Teacher','hsanchez@optonline.net',0,NULL,0,0,'2013-04-22 16:05:52','There are numerous grammatical and puncutuation errors.  There were several run-on sentences.  In at least one case, two complete sentences were separated by a comma.  They love to start sentences with \"But\" or \"And,\" which is incorrect.  If a student wrote this sentences, I would deduct points.  '),(168,NULL,0,'general','Observations',',11,1,3,','Mary','Principal','O\'Meara',0,NULL,0,0,'2013-04-22 16:23:39','I am an ELA chIrpeson for  a district and we noticed an overwhelming number of students were unable to finish their extended response in Book 3 despite doing very impressive work on their short answer responses. We found prepping the students for the short answer using the strategy of three sentences: one to answer and two for the two details helped them to answer completely and succinctly, thus leaving more time for the extended response.\nWe agree with many that the texts were long and challenging, but manageable for most.  I am guessing the amount of these texts and number of questions prevented our students from evidencing their true ability with these texts.  In summary, the length of the tests were developmentally inappropriate, thus precluding these assessments to be used for reliable measurement of students\' reading/writing ability.'),(169,NULL,0,'general','Observations',',11,','Mary','Principal','O\'Meara',0,3,1,0,'2013-04-22 16:23:39','I am an ELA chIrpeson for  a district and we noticed an overwhelming number of students were unable to finish their extended response in Book 3 despite doing very impressive work on their short answer responses. We found prepping the students for the short answer using the strategy of three sentences: one to answer and two for the two details helped them to answer completely and succinctly, thus leaving more time for the extended response.\nWe agree with many that the texts were long and challenging, but manageable for most.  I am guessing the amount of these texts and number of questions prevented our students from evidencing their true ability with these texts.  In summary, the length of the tests were developmentally inappropriate, thus precluding these assessments to be used for reliable measurement of students\' reading/writing ability.'),(170,NULL,2,'3','Observations',',11,8,','Aisha Cook','Teacher','acook@nred.org',0,70000,0,0,'2013-04-22 16:30:37','One area of concern on Day 2 of the ELA was the 2 separate test booklets and additional answer key.  My third graders had difficulty negotiating that many items in front of them.  They were instructed to complete Booklet 2 before beginning Booklet 3.  They had no idea how many stories were in Booklet 3, so were unable to judge how much time they should spend on Booklet 2.  The testing time was 70 minutes total.  If students spent half of the time completing Booklet 2, they could not complete Booklet 3.  There were twice as many stories, short responses, and an extended response in Booklet 3.  Why are teachers unable to pace students?  Why two booklets?  What are we measuring here?  Whether they can read and write, or whether they can work under timed pressure?  They are 8 years old.  Have these test makers tried to speed an 8 year along to get dressed in the morning, eat breakfast, or catch a schoolbus?  They don\'t rush.  And if they do, they are more likely to forget something. Rushing them through these high stakes tests is not educationally sound practice.  And it is not age appropriate. '),(171,NULL,0,'general','Observations',',11,2,','Anonymous','','',0,NULL,0,0,'2013-04-22 16:33:16','Is it right for a student to feel so stressed over an exam that this student tried to commit suicide.  This students and others actually  tried to hurt themselves due to the stress.  '),(172,NULL,1,'6','Observations',',11,1,5,6,','Kelly Jones','Teacher','kjones@lakeshorecsd.org',0,49981,0,0,'2013-04-22 16:34:06','The Common Core is stressing close reading.  Reading deeply.  But yet our test forces kids to rush through at top speeds in order to finish.  How is that consistent?\n\nDay Two was much too long overall.  Directions were too long.  Testing session was too long.  Overall seat time was much too long.  Kids struggled to finish on time and do their best work.  \n\nIf you want them to think more deeply, annotate the text, grapple with the text, and fully process the text, give them fewer pieces and fewer questions.  '),(173,NULL,0,'general','Observations',',11,1,2,3,','Karen Tesik','Principal','ktesik@socsd.org',0,NULL,0,0,'2013-04-22 16:35:28','NYS ELA Feedback\n•	98% of our students stated that they needed more time to “do my best”.\n•	Approximately 30% of our students did not finish on Day 1.\n•	Approximately 55% of our students did not finish or report being “rushed” to finish on Day 2.\n•	Approximately 25% of our students did not finish on Day 3.\n•	Most students reported that the passages were at their reading level.\n•	Several students felt that the test questions contained 2 right answers.\n•	Some complained about having to do Book 2 then Book 3.  Several students asked, “Why couldn’t we do it the other way around if the writing passage was worth more?”\n•	On Day 2, approximately 2% of our students were seen for counseling by either a Guidance Counselor or School Psychologist. \n•	On the evening of Day 2, we received several parent emails and calls asking about opting out. No one refused any testing.\n•	Day 3, we had several students during the testing session become physically ill or emotionally overwhelmed. \n•	Teachers reported that many of our students had trouble flipping back and forth to answer the multiple choice questions. \n'),(174,NULL,0,'general','Observations',',11,1,2,9,','Karen Restivo','Teacher','',0,NULL,0,0,'2013-04-22 16:53:31','The test was too long to complete in the 70 min for 3rd graders.   Students were stressed about time and many could not finish in time.  Some students cried due to the overwhelming length of the test.  Having the multiple choice book on day two and written responses was too ridiculous and clearly not well planned. Having to give directions in two two books at one time was not fair for 8 and 9 year old. \n'),(175,NULL,0,'7','Observations',',11,1,2,4,5,','Carrie Gould','Teacher, Parent','cagould@windstream.net',0,NULL,0,0,'2013-04-22 16:59:23','My most important observation was that most of my students did not have time to finish the test and this bothered them greatly. Students were diligently working hard on the test, but the nature of this new test requires them to look back at the passages for almost every question and this takes a lot more time. When the test was over, students were upset, with some crying, and totally exhausted. \n\nI have never agreed with using a standardized test as the sole means of assessing a student\'s abilities, but this years test was not only daunting, but downright cruel in many cases. When our school\'s best students are struggling, I can\'t even imagine what this test was like for consultant students. As a parent, I know that the test anxiety has taken quite a toll on my child, who is a hard working student. She cries about testing days and does not want to go to school. Instead of being interested in reading for enjoyment now, she avoids it and thinks of it as a chore. We are not sending the right messages to students! We are not letting them show us all their abilities! We are NOT creating lifelong learners! It is a sad time in the Education System right now.'),(176,NULL,0,'general','Observations',',11,1,','Maggie Schroeder','Teacher','',0,NULL,0,0,'2013-04-22 16:59:34','The length of the test was too long for some students. In other cases, not enough time was given for the 3rd graders to complete their essays. The questions were worded in such a way that were confusing. If I was confused, then I\'m sure the students were as well. '),(177,NULL,0,'4','Observations',',11,1,','Jennifer Stickney ','Teacher','',0,NULL,0,0,'2013-04-22 16:59:51','I found that my strongest readers and writers in my classroom were working right up until the last few seconds.    I\'d ask that more time be given next year if there is the same number of passages being asked to be read and responded to.    Perhaps there could be fewer questions asked and then the same 70 min. for the amount of time. Thank you for reading my comment.'),(178,NULL,0,'8','Ideas for Constructive Action',',13,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 17:05:23','Students were not given enough time to complete the requirements.  Scores will not accurately reflect what students could have done with the proper amount of time.'),(179,NULL,0,'8','Observations',',11,1,2,3,','debra tordoff','Teacher','dtordoff@cvcs.wnyric.org',0,NULL,0,0,'2013-04-22 17:10:08','I am extremely disappointed in the NYS State Tests. On Wednesday, I had several students unable to finish the test. This resulted in several students crying, being sick to their stomachs, and depressed. They had the same amount of time on the third day to complete one booklet. I also was disappointed that there was no poetry, or articles that were interesting. I thought the ambiguity in the questions was absurd, and I can assure you that if I had a child that was in the seventh grade, they would not be taking the test in the eighth grade. School is where students come to feel good about themselves. I can only imagine the frustration among the classified student population. '),(180,NULL,0,'6','Implications for Instruction',',12,1,2,4,10,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 17:18:11','I feel ashamed of our profession. What are we doing for children and to them? I was sickened by the test and the process leading up to the test.The fact that it was all such a mystery is also sad. The kids were stressed and some had extreme anxiety. Even my brightest couldn\'t finish due to their anxiety. The Pearson political money making machine has got to be stopped. We have to protect our children and help them learn and grow. This was a harmful experience!'),(181,NULL,0,'3','Observations',',11,','Christine Kelahan','Teacher','ckelahan@newfane.wyric.org',0,NULL,1,0,'2013-04-22 17:18:33','The poem from Robert Louis Stephenson was incredibly hard for a third grader to understand.  The vocabulary and figurative language were difficult for most staff members.  Poetry is a valuable literacy component, but a more grade appropriate selection needs to be chosen.\nI also feel that three days of testing is too much for a 9 year old.  By the time most of the students arrived at day 3, they were fatigued and had limited stamina.  I work with children who require reading support.  I am astounded and dismayed by the requirements for success.'),(182,NULL,0,'3','Observations',',11,1,','Darlene Gaffney','Teacher','darlenechambers@optonline.net',0,NULL,0,0,'2013-04-22 17:19:05','This test was way too long for the typical third grade student.  Maintaining focus added with the level of difficult made it challenging for most.'),(183,NULL,0,'general','Ideas for Constructive Action',',13,','Lorna DeSantis','Teacher','ldesantis@adirondackcsd.org',0,NULL,0,0,'2013-04-22 17:19:15','How is it valid to evaluate teachers on student results on assessments?\n\nHow valid are multiple choice questions and short answer questions that are supposed to  measure high level critical thinking skills? In order to accurately assess higher level skills students need time to produce longer writing pieces, time to engage in project based learning or time to prepare portfolios. '),(184,NULL,0,'3','Observations',',11,1,','Darlene Gaffney','Teacher','darlenechambers@optonline.net',0,NULL,0,0,'2013-04-22 17:21:34','This test was way too long for the typical third grade student.  Maintaining focus added with the level of difficulty made it challenging for most.'),(185,NULL,1,'4','Observations',',11,3,7,10,','annonymous','Teacher','',0,NULL,0,0,'2013-04-22 17:26:30','As I read the fourth grade test and multiple choice answers, I was questioning my ability to answer and determine the correct choice. The students have to read the question, then go back into the selection, compare several paragraphs or find the relationship between them and only then go back to answer the question.  Children who require extra support, special education and ELL students find these tasks overwhelming.  These tests are not designed to promote success, but promote a feeling of helplessness.  If we truly want to use the assessments for curriculum development, then past tests should be made available so that indepth analysis can occur.'),(186,NULL,0,'8','Observations',',11,1,3,','anonymous','Teacher','',0,NULL,0,0,'2013-04-22 17:42:13','On the first day of testing, the only day where I had a chance to look over the exam briefly, I attempted to answer some of the questions.  When my relief proctor came in he did the same.  Afterwards we attempted to compare answers.  We both came to different conclusion regarding which answers were correct but totally agreed that the other\'s were also reasonable answers. There seemed to be a lot of subjectivity in the responses, which leads to frustration and a feeling of helplessness. On the second day of testing, 14 out of 21 students in my room were unable to complete the test.  '),(187,NULL,0,'6','Observations',',11,1,7,','Virginia Ellis','Teacher','vellis@portchesterschools.org',0,NULL,0,0,'2013-04-22 17:43:57','I found the second day of testing to be too much for my students. Having two books on the same day proved difficult time management for the students.  Many of our students are ELL and Special Education and need time to process what they have read.  Due to the intensive requirements on day 2, the students didn\'t even have time to think.  '),(188,NULL,0,'6','Ideas for Constructive Action',',13,1,5,6,','Eric Casale, Principal','Principal','ecasale@springsschool.org',0,NULL,0,0,'2013-04-22 17:53:43','I am a big supporter of the Common Core. I believe having national standards in getting our kids ready for the rigors of college and the work force will help our nation and move instruction forward. Therefore, implementing the expectations associated with the Common Core including what was assessed on this year\'s exams was the not an issue I personally had. In fact, expectations for the exams were what we anticipated. What I do have concern with is the timing. Where is speed listed as one of the shifts of the Common Core? Was it reasonable to expect the average student to do all that was expected in the timeframe alotted? This conern became more apparent on Book 3, of the grades 6-8 exams when we had a number of my students run out of time. It\'s my feeling that if we want students to write for a range of tasks, purposes, and audiences, then we should make sure they have enough time to go through the writing process. I would suggest we re-examine the time periods for the writing component of the exams. Let\'s give kids the time to implement what the Common Core is asking them to do in the area of writing. This would be an area I believe would demonstrate more accuratley what kids can achieve in the area of writing.\n\n'),(189,NULL,0,'general','Observations',',11,2,','Celina Bialt','Teacher','Cbialt24@gmail.com',0,19970,0,0,'2013-04-22 17:57:34','Many of the children ran out steam about halfway through the test. So while they may have done well on the beginning short answer questions, by the end they were rushing or putting their heads down and giving up. Some children ran out of time and began crying. After the test, there was an increase in aggressive or tearful behaviors from children who had not hit anyone all year or children who never cried before.'),(190,NULL,0,'general','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 17:59:30','The passages were above third grade level. 3/4 of students ran out of time. Students would have benefited from having 90 minutes. '),(191,NULL,0,'general','Observations',',11,8,9,','Anonymous','','',0,NULL,0,0,'2013-04-22 18:01:08','Having two separate booklets on day 2 was confusing for third graders. The amount of questions asked during the directions being read was troubling. '),(192,NULL,0,'general','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-22 18:03:16','I am concerned at the lack of resilience that our children and families have shown over the past two weeks regarding the state tests.  I spoke to a 4th grade student today whose parent opted her out of it due to the potential anxiety it would cause her, but the student reported wanting to take the test and not being bothered by the idea of taking the test.  Even though the tests are reportedly very difficult, it is exposure to challenges and survival of those challenges that helps build confidence and reduces anxiety about other high stakes situations.  How will children learn to handle pressure if we do not expose them to any of it?  '),(193,NULL,0,'8','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:08:37','Some students cried, one student vomited, another fainted. I\'m all for raising standards, but are stressful tests really the way to increase learning? Not only that, but is the adjectival form of \"sound\" an appropriate vocabulary word on an 8th grade exam question?'),(194,NULL,0,'general','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:13:20','The test was too long. The students lost stamina towards the end of each day. The text passages were not appropriate for the grade level. The children were stressed. The short response questions were more appropriate than the extended response.'),(195,NULL,0,'general','Observations',',11,1,','Anonymous','','',0,NULL,0,0,'2013-04-22 18:17:48','I felt the test was too long.  Some question were ambitious as were  some of the choices for multiple choices.  I liked the three sentences for short responses '),(196,NULL,0,'general','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:20:36','The test was way too long for the children to remain focused. They were too tired as they got to the last passages.'),(197,NULL,1,'general','The Need for Transparency',',11,10,','Celina Bialt','Teacher','Cbialt24@gmail.com',0,NULL,0,0,'2013-04-22 18:22:26','If the state is so confident that what they are doing is right for children then why are they so afraid of transparency?'),(198,NULL,0,'3','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:28:48','It is inexcusable to ask a child with a disability to sit for a 70+ minute reading test for three days in a row. Based on methodically taken data, teachers know well before the administration of the ELA the strengths and weaknesses of their students. \nAlthough the long term emotional and educational damage may not been evident until these children are adults, I can confidently say that feeling like a failure never has served any child well. \n'),(199,NULL,0,'general','Observations',',11,1,10,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:31:05','The length of test was inappropriate for third grade students.  Students lost stamina, this impacted their performance.  Does this really tell us about readers and writers?  Let\'s release this test so parents can see what is required.  '),(200,NULL,0,'8','Observations',',11,1,2,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:35:08','Many of our district\'s average and above average students did not finish the test on Day 2.  There were too many questions that required them to look back in the passages for the answers.  Many students were very frustrated and had a sense that they failed because they didn\'t have time to complete the essay. I would not recommend that Day 2 have two books to complete in 90 minutes. '),(201,NULL,0,'5','Observations',',11,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 18:50:01','I felt the reading passages were age appropriate. However, I think the  wording of the questions (and multiple choice answers) was completely inappropriate.'),(202,NULL,0,'5','Observations',',11,1,9,','Kerry Keenan','Teacher','kekeenan@ccsd.ws',0,NULL,0,0,'2013-04-22 18:56:58','The test should be shorter. 90 minutes is too long for 5th graders to sit still, read lengthy passages and answer questions. Some lost focus and energy after 45-60 minutes and several ran out of time.\n\nBooks 2 and 3 should not have separate directions read in succession prior to part 2. Perhaps the test can be given in fewer parts, or at least fewer books. Many children can not listen to and retain that amount of information for any period of time solely by listening to it read one time.\n\nTeacher did not receive a copy of the test and the direction book did not include copies of the specific test directions. Teachers had to look over the shoulder of a student to read off of his/her book. \n\n'),(203,NULL,0,'8','Observations',',11,1,2,','Anonymous','Other','',0,NULL,0,0,'2013-04-22 19:14:46','omg, im so pissed. i had to rush on my short response questions and only had 10 minutes left to do the essay. the test was extremely hard and 15 kids cried in my home room. i know i will score less then what i usually get. although, day 1 & 2 were hard, i found day 3 a little easier; in my opinion. I think they should just omit the essay part bc tons of people didnt get to start or even finish. '),(204,NULL,0,'6','Observations',',11,1,3,9,','Karen','Teacher','karen.ivins@riverhead.net',0,NULL,0,0,'2013-04-22 19:26:47','My sixth graders worked diligently & applied reading & writing strategies we worked on throughout this year. The tests were too long and did not allow even some of my best students to complete certain parts. If field questions are included, they need to be removed so students have a fair opportunity to complete what counts. Day 2 was a joke! Two books, an answer sheet and the jumping around of reading various instructions all at once..(some repeated) 10 minutes was not enough time for me to give all instructions, hand out answer sheets,put labels on(did not get test until 10 minutes before start time)give out booklets..my students started to second guess thier strategies to try to get the most time on the right task.. they felt they needed time for essay writing.. why add the addtional M/C questions? was it necessary?Isn\'t one essay enough to figure out if they can write?There was confusion for a few on which story went with Day 3 essay..instructions were not clear.. and this is part of my eval?? Thanks alot..'),(205,NULL,0,'4','Observations',',11,1,2,7,8,9,','Mary Pakusch','Teacher','mary.pakusch@greece.k12.ny.us',0,NULL,0,0,'2013-04-22 19:28:04','I am a special education teacher so I was involved with giving test modifications to special education students. Since it is a test of reading, the only real modifications were the amount of time children had to complete the test, and taking it in a separate location. I had 6 students who were taken out of their general education classroom to take the test. \n\nI was concerned with the length and difficulty of directions for Day 2 of the test. Students found it confusing to have both booklets at once and to hear directions about one booklet and not be able to use it before hearing directions for the second booklet. I would recommend putting both parts of the test in the same booklet. \n\nThe passages were extremely long and difficult. Students with extra time used all of their time and in a couple of cases they did not finish the test. This was especially true of the Day 1 and Day 2 tests. \n\nThe Day 3 test had 2 questions that were essentially the same about 2 different passages. Students who felt unsure of the first question did not have a chance to show knowledge of other skills in a different question. It was more like \"failing\" twice. \n\nTwo out of 6 of my students cried. One each of the 3 days, another the 2nd two days. All six students seemed much more distracted the third day, looking around if there was a small sound in the room. Also, students who receive breaks and chose not to use them the first two days asked several times for breaks on the third day. \n\nThe general education teacher I team teach with reported that several students (up to 5) did not finish the test each of the days. There was not enough time. \n\n'),(206,NULL,1,'3','Observations',',11,2,','Stefanie Harris','Parent','harris.stef@gmail.com',0,NULL,0,0,'2013-04-22 19:49:37','I am the parent of a normally happy, secure, tenacious and smart third grade boy. He enjoys learning and is doing well in school.  And yet, in prep for the ELA tests, he comes home upset, complaining of stomach aches and calling himself \"dumb\" (which he never does)?  I have been told that the test material this year is above grade level.  After day 3 of the long answer part of the test, my son told me that just stopped writing at some point when he couldn\'t find the answer.  This is not a child that gives up easily or shys away from challenges.  As such, I am trying to understand what we are trying to teach here, and what is it that you want my third grader to learn?   I can\'t come up with any reason that my 8 year old needs to be stressed about these tests.  I am trying, therefore, to understand what your reasoning is?  In addition, when you put a young child in this position unnecessarily, you force a parent not to support your cause.  I have point blank told my child that his ELA test results do not matter to me -- I only care about how he does in school on a daily basis with grade appropriate material.  Please re-evaluate what you are trying to achieve with these tests and at what cost to the children.  Thanks in advance for your concern.  '),(207,NULL,0,'general','Observations',',11,1,3,','Sue Ellen O\'Connor','Teacher','soconnor@springsschool.org',0,NULL,0,0,'2013-04-22 19:58:59','The test is too long. There is no need to test the kids for 3 days. There was a sense of defeat and despair by the last day, the effect of attrition. The questions are vague at times and sometimes oblique. There needs to be more clarity. The questions that require students to find the relationship between paragraphs by number are too abstract and confusing. I am not opposed to accountability and high standards, but I fear the tests are wagging the dog in terms of curriculum. '),(208,NULL,0,'3','Observations',',11,1,2,3,5,','Heather Potter','Teacher','hpotter@bbpschools.org',0,NULL,0,0,'2013-04-22 19:59:00','A few students did not finish the Book 1 because of the number of passages and questions.  If we are asking students to closely read passages and really digest the information they are reading, it is asking them to rush through this process.\n\nDay 2 of the test was too filled with confusing directions.  Giving students 2 separate test books plus their answer sheet was overwhelming.  It took over 20 minutes to read through the directions to both test books, and students were very confused about what they were required to do in each book.  Keep each day to one book and preferably, either multiple choice or short response.\n\nMany questions were focused on students understanding small parts of passages rather than the main idea and theme of the entire passage.  There seemed to be more emphasis on the main idea of a paragraph instead of students being able to show understanding of the entire passage.\n\nStudents were exhausted and frustrated at the end of each day of testing.  In my class, they luckily did not cry during the administration of the test, but there were tears at various other times of the day from students who are not emotional.  These tests put a lot of stress on the poor 8 and 9 year olds taking them.  They should not be subjected to these pressures at such a young age.'),(209,NULL,4,'general','Ideas for Constructive Action',',13,4,',' Dolores Troy-Quinn','Principal','',0,39980,0,0,'2013-04-22 20:03:06','A letter sent to Commissioner King:\n<p>\nDear Commissioner King:\n<p>\nI rarely write letters or e-mails to public officials nor do I complain about most changes that have taken place in the Department of\nEducation. I have proudly served the City of New York and the Department of Education for over 25 years. However, the last three days of ELA testing have caused me to contact you to express my concern about\nthese NYS assessments. I have never experienced the level of stress, anxiety and tears on the part of the students (and parents) as I have done these past three days. \n<p>\nOn the Day 1 portion of the assessment, I looked over the passages and realized that some of the questions were not testing reading comprehension, but rather, were assessing our students\' working\nmemory. As I looked over a fifth grade test, I tried to find the answer to one of the questions. It required me to flip back and forth between pages to read several paragraphs to determine the theme of the passage. By the time I reread the passages, I completely forgot what the question was asking. With all the flipping back and forth and booklets falling off the desks, I can\'t imagine how my students will perform on this\nsection.\n<p>\nI had to console so many students who were sobbing that I feel this ELA assessment borders on child abuse. This was especially so for Day 2 of the exam. Although the students had 90 minutes to complete the two booklets, many of them did not get to finish their work. They were heartbroken! They told me that they had worked so hard to prepare for these exams. Yet, they were rushed and couldn\'t use the strategies we had taught them. When we write, we plan, draft, revise and edit. Many of the students never even completed their draft! Even our strong writers could not go back and review their work. These advanced writers couldn\'t complete these tasks on time! Imagine the anxiety and stress on our special education students!\n<p>\nWe have now survived the last three days of ELA testing. I am thankful that this torture is over (for now). Unfortunately, we have to gear up for math next week. All I can think about is what this experience has done to my hardworking and caring students. I have had numerous calls from parents who were hysterical when they heard about the tests from their children. I have no problem with more rigorous assessments. What\n<p>\nI have a problem with is the inhumane treatment of my children.  It is time that the field of education be returned to the educators who understand how children develop and learn. I am asking for rigor with a conscience and an understanding of the young child.\n<p>\nSincerely,\n<p>\nDolores Troy-Quinn<br />\nPrincipal<br />\nThe Castlewood School-PS 186Q\n\n'),(210,NULL,0,'8','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 20:25:30','On day 2 of the exam students experienced difficulty finishing on time. They expressed they were overwhelmed by the multiple choice and short answer in the same day.  In addition, many students experienced the same thing on day 3. Many of them worked down to the last minute to finish the extended response questions, whereas in previous years many students finished earlier. The anxiety level during this years ELA test was very high. Students were crying after the tests expressing frustration that they did not have enough time to finish. Lastly, as an exam proctor I noticed that by day 3 the students were visibly exhausted. They had enough testing and were ready for it to be done. If there is a way to slim the testing down to 2 days I think the students would be more productive and refreshed. '),(211,NULL,0,'5','Observations',',11,1,3,7,','Janet Waller','Teacher','jwaller@nred.org',0,NULL,0,0,'2013-04-22 20:41:58','The timing of the tests worked against many of my students. They were displaying test-taking strategies - staying focused, reading carefully, going back to the text, underlining, and eliminating choices - but many did not finish Part 1, including two of my top readers. When they did finish the other parts they were race-reading and race-writing and what does that prove? They finished the “race” but I don’t think they were able to think very well about what they were reading and writing. This part, of all this experience, was demoralizing for everyone because their scores will not really reflect what they can or cannot do. Imposing a rigid time limit has to change.\n\nWorking with deep concentration under pressure for three consecutive days was also very difficult. I noticed a qualitative change in the motivation and energy level of some of my students on the third day, especially the ones who are struggling readers or writers.\n\nMany questions required a lot of shifting back and forth from question to text to figure out the answer. Students had to go back and reread whole paragraphs and simultaneously keep thinking about the question to answer. This kind of close reading is what we do want them to do, but they need to have a lot more time for it  and to reflect carefully about all the choices.\n\nThere were some very fine nuances between some of the answer choices - two that were more clearly incorrect and then two that you’d have to reread the question again and even again to really see which the best choice was. I had a difficult time with a few questions too as I glanced over the test! I think in a test situation that the choices should be clearer. Another problem with nuanced answers is this. In marketing, I believe I’ve heard that whatever choice you offer first is the one that most people will choose. Applied to the test, I wonder if this affected some students’ choices. I’m thinking of one question from a selection, for example, in which the first choice sounded right.  However, the correct choice was the third one because it more accurately answered the question.\n\nOne of the selections had a very low interest level. That’s a poor choice for a high stakes test if you want to give children a big chance to show what they can do optimally.\n\nThe majority of my students come from non-English speaking homes. Many had a very hard time with vocabulary in the directions, which then affected their performance. Although they have definitely seen the words before, including this year, they did not remember what the words mean and therefore they didn’t have a fighting chance to show what they know.   \n\nI’d love to hear what teachers in different schools are doing to help children get to grade level in reading. Most of my students entered 5th grade this year on 2nd, 3rd, or 4th grade level. Three were on grade level. Although they have definitely made progress, as evidenced in the Fountas and Pinnell assessments we use, many are still not on grade level.\n'),(212,NULL,0,'4','Implications for Instruction',',12,','Michaela Bice','Teacher, Parent','mmbice@msn.co',0,NULL,0,0,'2013-04-22 20:57:05','The amount of time and pressure placed on the ELA prep and consequences were ridiculous!  My fourth grader is a carefree, above grade level student.  She never doubted her ability in school, but this year she became too focused on the \"test.\"  Her writing lost all creativity and seemed robotic.  She did not expand her vocabulary or use background knowledge.  She felt it was \"too risky\" and she could get points deducted if she was wrong.  What are we doing to our children??? Mistakes are no longer use as springboards to learning, but something to be feared?  My little girl was afraid of letting me down and more importantly her teacher.  All year long she stated, \"Yes mommy it is good, but would I get a four?\"\n\nAssessment is necessary - it drives instruction, however this form of assessment is not used as a teaching tool.  It is a political game with our children as pawns.'),(214,NULL,0,'8','Observations',',11,1,2,7,','Jeanne Zimmerman','Teacher, Parent','jzimmerman@nwcsd.org',0,NULL,0,0,'2013-04-22 21:16:15','The test is just too long.  My students with special needs and mods for extended time were testing for almost 4 hours each day.  They were just beat when the test ended and they had not even finished.  Several of them missed their usual lunch period and this caused increased anxiety.  Test mods for students with disabilities must be seriously considered when timing for testing sessions are set.  '),(216,NULL,2,'8','Ideas for Constructive Action',',13,3,','Denise Grandits','Teacher','grandits5@verizon.net',0,29960,0,0,'2013-04-22 21:37:13','First, let me start by saying I LOVE the new CCLS.  I appreciate that they encourage students to think, read and write critically.  I appreciate that the focus is no longer on rote memorization and recitation of random, isolated facts.  I appreciate that we recognize kids can do more and give them opportunities to prove their thinking.\n\nThe test, however, did not measure critical reading, writing and thinking in a way that promoted a strong discussion of ideas with ample time to develop ideas.  \n\nLet\'s start with multiple choice questions.  While some of the questions were \"good\", many of the answers were ambiguous.  I\'m nearly finished with a PhD in English Education and I could not decide between 2 answers on numerous questions.  Given that students had, on day 1, an average of 15 minutes per passage to read (close read????) and answer 7 multiple choice questions that required them to refer back to the text (which I\'m fine with but can it really be done that quickly), how does that prove their close reading of the text?  For most of my students, they could give close attention to the first 4 passages and questions...after that, it was a race against the clock.  Further, if you truly wish to assess students\' critical reading, writing and thinking per the CCLS, how can those skills be assessed with \"one right answer\" multiple choice questions?  I vote for authentic, well-developed writing to prove what they know and why they know it...\n\nDay 2 was a fiasco.  21 more multiple choice questions, short responses and a long essay...in 90 minutes...that included reading the passages at the time of the test?  This did not give students the time or space they needed to do their best work.  In my opinion, it felt like a speed reading test and, the last time I checked, that was not one of the standards.\n\nDay 3 was more accessible but students still felt they couldn\'t develop their ideas enough.  Many of my students filled up all the lines for the short answer and then went on to write in the white space below the blank lines.  They felt that they needed to go into much more detail to fully answer the question (and shouldn\'t that be how we judge student understanding of a text???).  Isn\'t that truly the measure of close reading?\n\nFinally, I will share one of the comments of one of my students who struggled to complete the test each day.  When we \"decompressed\" about the test, I asked her what she thought.  This student, who probably will get a 2, placing in her in the \"fail\" group, made such a profound statement that spoke not only to her frustration of the test conditions but screamed her awareness of \"good\" reading and writing and her ability to read, write and think critically.  She said,\n\n    \"You want to know how it was, I\'ll tell you.  It felt like someone gave Michelangelo\n      a paintbrush and told him, \'Go, you have 90 seconds\' and he did the best with\n      what time he was given and painted a smiley face.\"  \n\nMy students have LOVED close reading, critical thinking and proving their thinking through their writing.  They absolutely achieved every single standard all year and grew as critical readers, writers and thinkers.  Yet this test will show that most of them are \"inadequate\".  \n\nAs teachers, we know that our assessments must  measure what we intend to measure and that our assessments should assess the standards.   While the CCLS empower students to claim their voice and defend their claims, the assessment used to measure that ability failed to give them the space or the time to do so.  \n\nIt is my sincere wish that NYS reevaluates the test and allows teachers, administrators and students to the discussion.  There is not a single person in the education world that doesn\'t want the best for students.  Sadly, this test was not the best measure of our students\' abilities to read, write and think critically about complex texts and about meaningful issues that will impact them their entire lives.  We owe our students much more than this and we all should be a part of the solution.\n\n\n\n\n'),(218,NULL,0,'8','Observations',',11,1,2,','Anonymous','Parent','',0,NULL,0,0,'2013-04-22 21:48:33','Overall, the undue stress that is placed on the students for this test is unnecessary.  My son, who has a 97 average in the middle school does not need to worry or fret about not having enough time because of a test that has no effect on him or his grade.  '),(226,NULL,0,'6','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 22:36:34','I had students in my class not even have the chance to start the essay on Day 2 of testing.  Completing Book 2 and Book 3 in one 90 minute session is too much!!! '),(229,22,0,NULL,NULL,NULL,'sad','Principal','sad',1,NULL,0,0,'2013-04-22 23:01:11','really sad'),(230,NULL,0,'5','Observations',',11,3,','Niamh Ni Dhiomasaigh','Teacher','Nidec@aol.com',0,NULL,0,0,'2013-04-22 23:02:18','I noticed that some of the questions on Day 1 seemed to have more than one possible answer choice.\n\nOn Day 2 students seemed to struggle to finish in the allotted time. Some students suggested doing the second book first, so that the essay was completed first. I think having  two Test books in one testing session was confusing. I also think having the field test questions embedded in the test is not a good idea. \n\nDay 3 seemed fair. The time did not seem so tight, but I do believe students need more time to write a quality essay, demosnstrating the sophisticated writing strategies we have worked on during the year.  There seems to be little time for reflection, planning and revisions in the essay writing process. \n\nStudents said that the passages selected were interesting!! I thought so too.\nI\'m not sure what the  implications will be  of using excepts from published pieces.'),(231,NULL,0,'5','Ideas for Constructive Action',',13,4,','Anonymous','Parent','',0,NULL,0,0,'2013-04-22 23:17:28','I beleive that we need to find a way to drive instruction for children that enable them to be learners NOT test takers.  Teachers are frustrated and children are burnt out at age 10 and HATE going to school because of the test prep atmosphere.  SOMETHING MUST CHANGE.  '),(232,NULL,0,'7','Observations',',11,2,','Kerry Dytche ','Teacher','Kdytche@buffaloschools.org',0,NULL,0,0,'2013-04-22 23:28:46','One word: BRUTAL. When some of my most creative and experienced writers struggle to finish on day 2, I have nothing left to say except \"shame on you\" for making kids feel that all of their hard work and writing was done for nothing. And what does this test even teach them about real world writing. I wish the state would get a clue.'),(233,NULL,0,'6','Observations',',11,2,4,','Anonymous','Parent','',0,NULL,0,0,'2013-04-22 23:39:49','My children are not just losing six days of instruction during testing, they have spent days completing \"practice tests\".  They are not learning to think, problem solve, or to enjoy the educational process.  I fear their education is inferior to what I received in a rural district 25 years ago.  As we move to the scripted delivery of the common core I fear the situation will only worsen.'),(234,NULL,0,'4','Observations',',11,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-22 23:44:57','The test was much more challenging than previous years, and the time allowed was insufficient. My students rushed through the test, some just barely finishing. This was especially evident on Day 2 & 3, since students needed to think, reflect and collect their thoughts before putting pencil to paper.'),(235,NULL,0,'general','Observations',',11,1,4,','ChickyP','Teacher','suziemath@gmail.com',0,NULL,0,0,'2013-04-22 23:48:53','The test was too long and the students lost their attention. \n\nBook 4 - Why include the first story?  If the students were to write an essay about the second and third stories, it just wasn\'t necessary.  It was the good student who didn\'t finish because they took their time.\n\nBooks 2 and 3 - About 20% of the students I proctored didn\'t finish.  I teach in a top district.  Again, why include field test questions.  Why have two books in one day.\n\nBook 1 - too many stories - not necessary.\n\nI have been teaching for 25 years and have seen wonderful tests given in late May.  Multiple choice tests are enough - one or two days for each subject at most.\n\nOnce you have schools grading their own exams, the integrity of the scores is completely lost.  We send our tests out to a private company.  Some of our local schools use every single employee to grade the written sections. Do you really think a non-ELA teacher knows how to grade \"voice\"?  This process is so ridiculous and so sad.\n\nI am a math teacher and am dreading this week\'s tests.  I used to love teaching.  It\'s not the common core or the testing in general, it is how NYS is testing and field testing.  It is the poorly written tests and horrible grading system.\n\nLast year I had kids who answered more questions correctly and had lower scaled scores.  Something is terribly wrong.  '),(236,NULL,2,'5','Observations',',11,3,4,','Patrcia Jordan-Cowley','Teacher','pat.jordancowley@riverhead.net',0,NULL,0,0,'2013-04-22 23:51:52','I am a proficient reader, belonging to two book clubs and a poetry group as well as a member of LISCBW, and SCBWI.  I am teaching 30 years.  Here are some issues to consider:\n1.  The important question I have is who makes up these questions?   If adults, like myself, have to ponder extensively over the distractors in the answer stems, how can a ten-year-old have any confidence in tackling it? I have grave concerns over the anxiety these young children have, not to mention their hating school due to the high pressure.\n2. The story selection seemed fair, but not exactly \'high interest\' pieces.  My class read the Monkey\'s Paw (7th grade reading level) recently and raved about it.  Why can\'t the team that selects the reading passages think about the interest aspect more?  All genres can be interesting to kids, if the writing is exemplary.  High level texts can be modified with a controlled vocabulary. \nIn addition, who copy-edited these pieces?  There were numerous infractions being modeled, from run-on sentences to sentences beginning with conjunctions.  \n3. Who chose the poem? It is certainly not the poem I, nor my colleagues, would have chosen. There are so many wonderful poems out there!  I am standing up for my students, as they have no representation here.  How sad!  I fear for the next generation of children...'),(237,NULL,0,'5','Observations',',11,','Patrcia Jordan-Cowley','Teacher','pat.jordancowley@riverhead.net',0,NULL,0,0,'2013-04-22 23:54:49','I am a proficient reader, belonging to two book clubs and a poetry group as well as a member of LISCBW, and SCBWI.  I am teaching 30 years.  Here are some issues to consider:\n1.  The important question I have is who makes up these questions?   If adults, like myself, have to ponder extensively over the distractors in the answer stems, how can a ten-year-old have any confidence in tackling it? I have grave concerns over the anxiety these young children have, not to mention their hating school due to the high pressure.\n2. The story selection seemed fair, but not exactly \'high interest\' pieces.  My class read the Monkey\'s Paw (7th grade reading level) recently and raved about it.  Why can\'t the team that selects the reading passages think about the interest aspect more?  All genres can be interesting to kids, if the writing is exemplary.  High level texts can be modified with a controlled vocabulary. \nIn addition, who copy-edited the passages?  There were numerous infractions being modeled, from run-on sentences to sentences beginning with conjunctions.  \n3. Who chose the poem? It is certainly not the poem I, nor my colleagues, would have chosen. There are so many wonderful poems out there!  \nI am standing up for my students, as they have no representation here.  How sad!  I fear for the next generation of children...'),(238,NULL,1,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 00:15:21','After the test, I noticed an increase in behavior problems, irritability, and down right...melt downs.   My students were so drained that they were not able to cope with normal day to day obstacles such as: who to sit with at lunch time or who took the soccer ball away at recess.  My afternoons were spent wiping tears and resolving conflicts.  It seemed like the test brought out behaviors that I had never seen in my students all year!'),(239,NULL,0,'5','Observations',',11,1,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 00:36:04','Many of my students did not have time to complete their work in 90 minutes. This is not an accurate assessment of their knowledge if they did not finish. I am CERTAINLY not saying they should have more time as 90 minutes of testing each day is developmentally inappropriate for 10 and 11 year olds. 2 books on the second day was too much. My students were physically and mentally exhausted. By day 3 two of my students fell asleep on their desks during the test. They were mentally exhausted and wanted to try their best. \n\nI am also not sure if this test is valid as students mentioned they had read a certain book in class where apparently an excerpt from the book was on the test. Some students were exposed to the text prior through reading the novel as others were not. Is this equitable and valid? \n\nI taught close reading and digging deeply into text all year yet on testing day it is encouraged that students \"read really fast and try to finish all of the questions and writing\". That is confusing to the students and causes undo anxiety. One of my brightest students stated today that she is exhausted because she has not slept well due to test anxiety. I am all for using data to drive instruction and we have wonderful data through NWEA testing and AIMSWeb Progress Monitoring. The NYS tests do not allow for that. They are also given in April when the school year ends in June. To dig deeper into the CCLS shouldn\'t we get more time in the school year to teach the students?'),(240,NULL,0,'8','Observations',',11,1,2,4,','Matt Haynes','Teacher','matthaynes5@hotmail.com',0,NULL,0,0,'2013-04-23 00:36:33','I don\'t mind the change in content to the common core standards, but it was absolutely unreasonable to expect 8th graders to finish the test during the allotted time. Day 2 was particularly ridiculous--more than three quarters of my students were unable to complete the exam and approximately a quarter didn\'t even get to start the essay. Don\'t the common core standards stress a \"close reading\"? How can one possibly do a close reading when there isn\'t enough time to do so?\n\nThe following is stated in the Educator Guide to the 2013 Grade 8 Common Core English Language Arts Test: \"The 2013 Grade 8 Common Core English Language Arts Test is designed so that most students will complete Day 1 and 2 testing in about 70 minutes and Day 3 testing in about 50 minutes. While it is likely that most students will complete testing within these times, students will be permitted 90 minutes to complete the test each day. This design provides ample time for student who work at different paces.\" These time \"estimates\" are absolutely absurd. If I took the test myself I would have a tough time completing Day 2 in 90 minutes, let alone the estimate of 70. Then there\'s Day 3--the reading of three very long passages, answering five short response questions, and then completing an essay? What kind of super human could possibly complete all these tasks in 50 minutes? Most of my students didn\'t even finish in the entire 90 minutes.\n\nI am a good teacher and I care deeply about what I do. I am dedicated to my job, dedicated to my students, and dedicated to making this world a better place. My students were prepared for this test and worked extremely hard all three days. But what, exactly, is this test going to tell me about my teaching? How is it going to help me improve? The only answer is it\'s not. The scores of my students will not be reflective of what they do or do not know. Instead, they will be reflective of the fact that they did not have enough time to complete sections of the test.\n\nThis test failed in every way possible. It left several of my students in tears, it left me feeling defeated, and the results are going to tell me absolutely nothing about my students\' growth or lack of. I\'m disappointed, I\'m frustrated, and I feel let down by the state. As I told my students after the final day of testing, I feel ashamed to be a part of this testing. This is certainly not what I got into the field of education for.'),(241,132,1,NULL,'The Need for Transparency',',10,','anonymous','Teacher, Parent','',1,24980,0,0,'2013-04-23 00:37:39','I agree with you 100% on the issue about transparency.  Why can\'t parents and teachers see the test.  Isn\'t the purpose of testing to be able to identify areas of need for the students and to work on those areas of need? It is extremely troubling that Pearson, who has a history in the past year of putting out test riddled with errors and the latest issue of incorrectly grading the G&T tests is going to be grading my child, her teacher and the school for that matter on something we don\'t even know is correct!!!!  '),(242,NULL,0,'4','Observations',',11,5,','Scott Sperling','Teacher, Parent','ssperling@pvcsd.org',0,NULL,0,0,'2013-04-23 00:45:35','The idea of the numbered paragraphs has opened up a whole new line of questioning.  Meaning more ways to confuse and trick readers. There were at least two question on Book 1 which I was not sure of the correct answer. There were other questions in Books 2 and 3 which asked for the purpose of the authors using questions and how a passage was \"organized.\"  These were absurd. The test is filled with inferential questions that tap all new kinds of twisted questioning techniques. (ie. Which quote best predicts the action in paragraph 8?  etc.) While I believe in higher level questioning, the detail questions are all but gone!  I have new appreciation for the OPT-OUT movement after administering this test!'),(243,NULL,0,'3','Ideas for Constructive Action',',13,1,8,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 00:49:23','What was the purpose of such a long test? Ask yourself what is it we are really testing. Is it reading comprehension? Writing skills? If so, give an 8-9 year old time to do it right. Give them time to practice all we teach, going back to the text, editing their own work, reading a piece more than once, etc etc etc!!! I still remember from student teaching my professor saying if you can assess a student with 10 questions, why give them 50? And why did Book 2 and 3 have to be separate? Or why was there even a Book 2 with 7 M/C questions? What was the purpose of that? Why couldn\'t they have had a day of writing? Couldn\'t Book 2 and 3 be in one book??? Things were falling off desks, kids felt unorganized! Some kids had the wrong book opened. It was not a true test of their skills.'),(244,NULL,1,'5','Implications for Instruction',',12,7,','Katie Lapham','Teacher','Katielapham1@gmail.com',0,65000,0,0,'2013-04-23 00:52:34','Here\'s a copy of the letter I wrote voicing my concerns about the test.\n\nApril 22, 2013\n \nNew York State Board of Regents and Dr. John B. King, Jr., Commissioner of Education and President of the University of the State of New York\nNew York State Education Department\n89 Washington Avenue\nAlbany, New York 12234\n \n\nDear New York State Board of Regents and Dr. John B. King, Jr.,\n\nI am an English as a Second Language (ESL) teacher at a Title I elementary school in New York City. This is my seventh year of teaching in the same school.  Prior to becoming a teacher, I worked in sales for textbook publishers.  In defining what it means to be a teacher, I have always held the belief that, first and foremost, I must serve as an advocate for all of my students. It is this deep-seated conviction that has inspired me to write to you. \n\nLast week, I administered the grade 5 Common Core English Language Arts (ELA) test to a group of 10-year-old former English Language Learners (ELLs).  Over the course of three consecutive days, they were asked to answer a total of 63 multiple-choice questions on two different answer grids, and eight short-response questions and two extended-response questions in two different booklets.  In order to do this, they had to first carefully read and re-read a large number of reading passages. \n\nMost of the grade 5 students throughout New York State received 90 minutes each day (a total of four and a half hours) to complete the tests.  As former ELLs, the students I tested received an additional 45 minutes of testing time each day.  Thus, they sat in a testing environment for a total of six hours and 45 minutes.  If they had not received extended time, most of the students would not have finished any of the exams at the conclusion of the standard allotted time of 90 minutes.  While I was impressed by the students’ stamina, resilience and overall positive attitude, by the end of day two their test fatigue and frustration were visible.  This week, they will receive the same amount of time as the state administers to them the 2013 Common Core Mathematics test.  By the end of Friday, April 26, this group of former ELLs – fifth graders - will have tested for a whopping total of 13.5 hours.  \n\nI ask you to picture your own children and grandchildren – even your 10-year-old self – sitting for that long to complete such lengthy standardized tests.  I have a three-year-old daughter and my stomach tightens at the thought of her being subjected to such excessive testing. This brings me to my next point.  The 2013 Common Core ELA and Math tests come at the culmination of months-long test preparation in our public schools that include four Acuity Benchmark Assessments (two for each subject area) and countless hours of teacher-created test prep practice.  This egregious amount of classroom time devoted to standardized tests is robbing our students of their right to a meaningful education. \n\nI support the implementation of the national Common Core Learning Standards (CCLS).  In lesson planning, I regularly refer to the Common Core app on my smart phone to ensure that my lessons reflect their rigor.  While I’ve always cultivated an atmosphere of critical thinking in my classroom and have long utilized authentic texts such as The New York Times, the CCLS have aided me in taking my instruction to the next level, particularly with regards to writing.   Because my school has adopted the push-in model for ESL instruction, I collaborate and co-teach with a classroom teacher during the fifth grade literacy block.  Our unit on Abraham Lincoln – for example - serves as a bridge that takes students from slavery to The Civil War.  Not only do we guide students through the complex, higher order thinking task of analyzing and writing about two contradictory speeches that Lincoln gave on slavery, but we constantly make connections to material already learned and to forthcoming material.   Our lessons, therefore, are not taught in a random, disconnected fashion.  Rather, they are overlapping and reinforcing.  I am proud of the CCLS-inspired work that my co-teacher and I do, and I am proud of our ESL students – most of whom are “below grade level” – for meeting our challenges and for applying their new knowledge in other academic contexts.  An ESL student who got only 31% of the questions correct on the Fall 2012 Acuity Benchmark ELA Assessment recently brought tears to our eyes when he correctly used the word threshold in his writing, a term that had been taught to him months prior in a different unit. \n\nWhat differentiates this type of instruction from that related to the state assessments is that the non-test prep work we do in our classrooms is much more inspirational and meaningful to both students and teachers.  While the reading passages on state assessments and test prep materials do indeed draw from a variety of authentic, multilayered texts, students are reading only short excerpts that are unlikely to make a lasting impression.  Students do not make the same kind of emotional connection to assessment material as they do when analyzing a non-fiction topic in depth or when reading a work of literature in its entirety.  The tests and test prep materials neither take into consideration nor honor the uniqueness – the kaleidoscope of emotions – of each individual student.  The work I do in the classroom is what motivates me to go to school every day.  I am grateful for the opportunity to open children’s minds and to help guide them on their pursuit of happiness. The high stakes testing, unfortunately, poses a roadblock to this.\n\n“Lack of rigor” in our schools is not the only factor contributing to our nation’s broken educational system, as our one-size-fits-all standardized testing program seems to suggest.  In my school, we struggle on a daily basis with the effects of poverty and home life instability.  How do we as teachers and schools ensure the academic success of all kids whose families do not appear to value education? On top of our instructional duties, we face the Sisyphean task of getting parents more involved.  In order to be successful students, kids need to come to school every day, and they need family support in being able to complete their work both at home and at school.  The weight given to standardized assessments and the corresponding Common Core Learning Standards does little to address the root causes of dysfunction in our public school system. \n\nI am deeply troubled by the path our state is headed down in assessing our elementary school students, and I strongly urge you to re-think both the design of and the importance placed on state assessments.  You are making it that much harder to recruit talented individuals to the teaching profession.  The tests are also souring the educational experiences of our youngest citizens, the ones we are preparing so hard for college and career readiness.  However, we must also invest more in breaking the insidious, concrete-walled cycle of poverty in our nation.  A much greater importance must be placed on fixing the root causes of low academic performance and educational inequities.\n\nSincerely,\n\n \n\nKatie Lapham, NYC teacher\n\n           '),(245,NULL,0,'4','Observations',',11,1,3,','Roxanne Clabeaux-Michalak','Principal','rclabeauxmichalak@hotmail.com',0,NULL,0,0,'2013-04-23 00:54:39','Grade 4 ELA contained the same reading passage and questions as Grade 5.  The State has said they are looking for vertical alignment by doing this but will only count toward scoring at the appropriate grade level.  This means that students spent time reading and answering questions on a passage that will not factor into their score; yet, it took them a great deal of their testing time.  \n\nAll ELA tests at Grades 3-5 were too long. Most children were unable to finish and felt very frustrated that they were unable to do so. Also, the tests at these 3 grade levels seemed to ask questions that students of this age are developmentally not able to answer.  \n\nI am an administrator in a small city school district with high poverty and a large percentage of ESL students. Nothing is more important to us than having our students excel academically.  However, these tests do not determine a student\'s ability to read and write; rather, they seem to be created to \"prove\" our deficiencies. \n\n \n\n'),(246,NULL,0,'4','Observations',',11,1,','Chris Crill','Teacher','ccrill@pvcsd.org',0,NULL,0,0,'2013-04-23 00:54:52','My impression of the 4th grade ELA is the questions were intense. I think the readability of the passages were on target and the passages were mostly engaging. Many of the questions and the wording of the questions were developmentally challenging for most 9 and 10 year old children. Many students ran out of time or rushed to complete the exam (after 70 minutes of sustained focus). '),(247,NULL,0,'8','Implications for Instruction',',12,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 01:07:37','I cannot fathom the purpose behind the absurd time constraint placed on our students come test time. We want them to perform at the highest levels, and yet we give them a near impossible task. As someone who is an actual published writer, the worst thing you can do to stifle someone\'s creativity or writing ability is give them the shortest amount of time possible. Are testing their ability to read and write? Or are we testing their ability to beat the clock?'),(248,NULL,0,'8','Observations',',11,1,6,','Kristin Smith','Teacher, Parent','Ksmith@aldenschools.org',0,NULL,0,0,'2013-04-23 01:11:12','It goes without saying having read all of the previous comments that there was too much to do and not enough time in which to do it well. In my 17 years of teaching, I have never felt as though I have lost more time, credibility, and (to be perfectly frank) personal sanity than I/we have lost this year.  As a Special Ed teacher, I have seen my students really work hard to understand and embrace close reading, only to have it backfire on them in the end, even with extended time.  Frustrating for them and for me as well.\nAs a parent, I listened to my own 8th grader express the same frustrations to me (and my 4th grader as well).  \nI wholeheartedly assert that Common Core is superb stuff and, if implemented correctly, has the potential to launch teaching and learning into uncharted territories.  I believe it has the potential to prepare kids for the unknown waters that await us in the next decades.  \nWhat I disagree with is assessing my kids as though they\'ve had 8 years of Common Core based instruction rather than 8 months.'),(249,NULL,1,'8','Observations',',11,9,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 01:11:26','Funny that the directions for two days straight were full of errors (referring to sections that did not exist or forcing the teacher to repeat 2-3 times when unnecessary). If you cannot even take the time to ensure the quality of the DIRECTIONS, then who the hell are you to assess students at all? Pearson has the state handcuffed with $$ while they in turn chokehold the districts for the same bottom line. Education is not the goal...'),(250,NULL,0,'general','Observations',',11,2,7,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-23 01:13:48','As teacher and parent, I noticed several things.\nAs a parent, I have an above average fifth grade student, who was a nervous wreck before the test.She was afraid of what the test would be like.  Each day, she came home exhausted---not the way 5th graders should be.  They didn\'t play PE before the test because they didn\'t want them to lose their energy.  We took away the students being kids during this time.  My daughter and her friends were talking about the test, and how they felt there were a few different ways to answer certain questions.  A friend of hers, another bright student, was in tears the first day because he didn\'t finish. He was afraid he failed.  Is this worth putting our kids through this?  I think not.\nAs a teacher of special education students with test mods, these students worked so hard and still didn\'t finish.  Day 2 was too much with two books to deal with.  By day 3, the kids were exhausted and had difficulty putting forth the effort that they had the days before.\nThe state stresses close reading...the students didn\'t have the chance to do that, and if they did, they definitely wouldn\'t finish.\nI think the system needs to be looked at again to see what are we looking at---seeing what students have learned, or seeing how long students can handle sitting through a test????  To me, it seems the latter, and that\'s totally unfair!  There needs to be a better way for children to show off what they\'ve learned and the progress they\'ve made then torturing them by sitting for long periods of time.'),(251,NULL,0,'8','Observations',',11,2,','Josephine Ramage','Teacher','jramage@tywlsbrooklyn.org',0,19960,0,0,'2013-04-23 01:19:51','Book 1 - 90% of 8th grade students finished, but needed all 90 minutes.  As I observed students watch the clock, I know they rushed through the last passage because of the time constraints. \nBook 2 and 3 - I cannot think of better words than this was an unfair assessment of students\' reading and writing skills. It was impossible to successfully complete this part of the test in the time allowed.  As I proctored the exam I was almost in tears watching my students persevere through this test as though their lives depended on it. They would look up at the clock and their eyes would bulge in fear as they went back to their test booklets to feverishly write more.  We used NY Ready as our test prep materials and we used the third practice test to familiarize our students with the test.  I am also the lead ELA teacher at my school and led PDs on strategies to attack this exam.  Imagine my dismay when I saw that the format given by NY Ready did NOT align to the format of the Day 2 test. We taught our students to go directly to the essay prompt so they would have a purpose for reading the \"paired passage\". Ends up the passages were unrelated and the essay only addressed the second passage. It seems to me that the test makers wanted to keep us guessing, wanted to trick us and our students. I watched students\' faces scrunch in confusion as they did what I had told them to do. I again wanted to cry as I thought of all the students throughout our school confused by the strategies their teachers taught them.  But I had to hold it together, I had to be a calm and confident teacher silently communicating, \"You can do it\" with my eyes, while in my heart I knew it was impossible.  \nBook 4 - was actually a relief compared to the struggles of Day 2.  Most students finished with little to no time to spare. Students started this day\'s test exhausted.  I had many students slouching and putting their heads on their desks right from the start of the exam.  They were almost showing defeat going in.\nI can\'t think of any other time in life when you have to go through a three day test to showcase your skills.  This is completely unfair and as I think of those younger than my 8th graders -those elementary school babies - I add my voice to so many others - this can\'t continue.'),(252,NULL,0,'3','Observations',',11,2,','shanna schwartz','Parent','shannabethschwartz@gmail.com',0,NULL,0,0,'2013-04-23 01:21:29','My third grader came home from school on Thursday sobbing.  He confessed that when he tried to include all the details his teacher had taught him, he spent too much time on a short answer and never even started the long response before time was up.  No amount of our reassurance seemed to calm him and finally he went up to his room to console himself with a book. Two hours later he emerged.  \"Mom, now my teacher is going to think I\'m stupid and the middle schools won\'t want me...\"  Is this education?'),(253,NULL,0,'3','Implications for Instruction',',12,5,','anonymous','Teacher','RandLsmom1@aol.com',0,NULL,0,0,'2013-04-23 01:24:04','To better prepare our students, we should be timing our students on their reading throughout the year. If they don\'t finish the book, oh well. During my read alouds I will surely ask which paragraph the picture supports. And of course,the children will need to tell me which sentence supports the main idea of a specific paragraph. We should also be sure to set the children up to cry in front of their classmates as this is now part of the testing situation.'),(254,NULL,0,'8','Observations',',11,1,5,','Anonymous','Teacher','',0,49985,0,0,'2013-04-23 01:25:59','Day two of the test is completely unfair to use against them because the majority of the students were unable to complete the test during the time allotted for both books.  Furthermore, requiring the students to flip back, reread a section, determine a claim, then figure out which piece of information provides the best evidence for a claim, is a three step process in which students have an unfair probability of missing that question dependent on which claim they determined a section of a passage was making.  The test is too objective and is creating a generation of students who think they are incapable of doing anything. '),(255,NULL,0,'6','Observations',',11,4,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 01:31:54','I would Like to know why we are giving our Education system to Bill Gates and Pearson?????  What do they know about education, testing, teachers, principles, schools or students???  I see this as a huge money making business plan for both Bill Gates & Pearson.  I would like to know how many politicians are making money on this insanity also!!  Somebody please stop this madness and lets let the educators decide what is best for our students!!!!'),(256,NULL,0,'6','Observations',',11,4,','Anonymous','Other','',0,NULL,0,0,'2013-04-23 01:32:46','Coming from someone who has worked in middle schools for the last twenty years, I was both humbled and disgusted at both the lead-up to and the testing days themselves.  Watching my dedicated and diligent colleagues work alongside me for weeks and weeks to prepare students for an unrealistically difficult and developmentally inappropriate exam was, indeed, humbling.  The seriousness with which we approached preparation for the ELA exam was without equal.  What disgusts me was the lost instructional time.  Honestly, is this the way we ought to be spending precious teaching time?  Preparing for a test everyone knew was out of reach for nearly all our students?  As a long-time educator that honestly cares about kids, I, for one, cannot say it is.  Something must be done, as this test will likely not only render psychological damage on many of our kids, but shape their relationship to literacy for the rest of their lives.  And that in my opinion is too high a price to pay for \"assessing the standards\".'),(257,NULL,0,'3','Observations',',11,2,','city teacher','Teacher','RandLsmom1@aol.com',0,NULL,0,0,'2013-04-23 01:33:50','One of my grade 3 boys was bawling by question 15 on day 1. He was calmed down but never got his mind focused on the test and answered only one more question before time was called. The SED needs to have a provision for kids who cry during the test. Sick children get to finish on another day, so why not emotionally distressed students? What he experienced is tantamount to child abuse. I cannot yell at students so why should we be able to put so much pressure on them that they fall apart? '),(258,NULL,1,'5','Observations',',11,1,2,','Michelle','Parent','shellydex@hotmail.com',0,NULL,0,0,'2013-04-23 01:45:51','My son, who is an above average student stressed about this test for days.  I tried to calm his fears and told him to do his best.  The test from what I was told had longer passages and answers that were too similar to distinguish what the answer might be.  He did not finish the first day and was beyond upset.  By the second day, he did not have enough time to finish again.  By the third day, he just did not care anymore.  This is a student that has always obtained a high Level 4 since 3rd grade.  What NYS has done is discouraged every child, making them feel dumb and worthless.  Is this what we want for our children?  I am sure there is a better way to assess and I urge NYS to find it before we raise the dumbest children because of this ridiculous testing.'),(259,258,0,NULL,NULL,',','Michelle','Parent','shellydex@hotmail.com',1,NULL,0,0,'2013-04-23 01:47:27','By the way, this is the child that scored 100% on all the pre-testing.  Thanks for nothing NYS.'),(260,23,0,NULL,NULL,',1,2,','Michelle','Parent','shellydex@hotmail.com',1,NULL,0,0,'2013-04-23 01:49:19','I agree.  My 5th grader did not get to finish the test out of all three days.  It was beyond ridiculous.  Nothing like making a child feel worthless.'),(261,NULL,4,'3','Observations',',11,2,7,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 02:06:49','I administered test mods to a student who is in a self contained classroom.  She has an iep.  She is in a self contained classroom because she doesn\'t learn as her peers do.  Yet she had to take this test.   For what?  To show that she doesn\'t learn like her peers.  Oh yes. We already knew that.  She couldn\'t answer any questions.  She cried .  She was frustrated.  Ive been an educator for 32yrs.  Ive never felt so helpless in my life.  What a sad messed up situation someone has created in education.  Shame on all of you.'),(262,NULL,6,'general','Observations',',11,3,5,10,','Mary Conlon','Teacher','',0,49989,0,0,'2013-04-23 02:11:32','I support rigorous instruction and curriculum and I understand that standardized testing has a place in public education however the ELA test was flawed in so many ways that it has almost no useful value. I also object that the test is not made available to the parents, teachers and administrators. What\'s with the secretive nature of the exam anyway?  \nAlthough the passages were too long, and a tad difficult, it was the question format/stems that were most problematic. This year rather than ask \"In this sentence the word rigorous means...\", third grders were asked to find which words suggest what the word means. Also there were too many questions that required the students to go back and reread four whole paragraphs. This question has more to do with upper grade organizational skills than grade level reading comprehension. I think test makers haven\'t (yet) figured out how to measure \"close reading\". \nIs it really necessary to utilize four document booklets and three full days to assess how our students are doing? Is this the best use of our valuable instruction time?\nFor some children, after months of preparation and two weeks of high pressure testing it becomes more difficult to engage them in authentic learning.\nI am sure that many well meaning, conscientious educators are involved in making up these tests but it seems we have gotten off track somehow. I wholeheartedly believe we could do better in our mission to serve our students.'),(263,NULL,1,'6','Observations',',11,1,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 02:13:37','The test took most students too long to finish or they did not finish. The passages were numbered, when does authentic literature have numbers in it? The questions were confusing. Confusing does not equal higher order thinking skills. The questions were not developmentally appropriate. Children grow and develop on a continuum. The tests seemed to think that all students were very advanced thinkers capable of abstract thought mastery. Does testing an item make it developmentally appropriate? What is next, expecting all,children to walk at the same age, talk at the same age, potty train at the same age? The tests as given were not indicative of what 11 year olds should be doing. '),(264,NULL,0,'general','Observations',',11,4,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 02:28:31','I wish someone would do an investigation into the money trail leaving Pearson HQ.  Why else would officials cling to a model introduced during the Bush era (teach-to-the-high-stakes-test) that has proven to be a dismal failure.  I mean, look at the ranking of US students in relation to the rest of the industrialized world.  '),(265,NULL,0,'general','Observations',',11,','Private School Mom','Parent','flyingkites59@hotmail.com',0,NULL,0,0,'2013-04-23 02:28:42','Did anyone read those marking guidelines?\n\nMy daughter thought the test was easy. But she is an A+ student. But I doubt she will get her usual 4 since I doubt she knows how to write a \"compelling\" introduction and conclusion to an essay. \n\nI also doubt anyone can quantitatively score an introduction or conclusion for \"compellingness\". \n\nGrade 6 and they have to write a best seller on some stupid little essay on a probably boring as all get out topic.  '),(266,NULL,0,'4','Observations',',11,1,2,','Lesa Wilbert','Teacher','sasablue0222@gmail.com',0,NULL,0,0,'2013-04-23 02:29:33','My observations:  Six out of 24 students did not finish Book 1.  Four of them were on question 15 when time was called.  Our best and brightest were so stressed out that one kid was pulling his hair and another was rocking in her seat holding her stomach.  These are two of the kids who should be able to get a 4 without worry.  Post Day Two, where the kids were given Book 2 and 3 and told to plow through without time warnings, other than the fantastic \"10 minute warning\",  we had a chance to listen to three of our absolute top notch students discuss the test.  We did not engage but only listened, as we know all too well that NYSED would love nothing more than to go after our licenses for daring to complain. All three girls talked about doing their best (something they actually strive for with us) and how hard it was to balance running out of time with good work.  One girl said she was worried that she made bad choices on Book 1 since she was crunched for time.  Another said her essay was awful because she didn\'t have enough time to plan it. A third wondered aloud why all year they are told to take their time and DO GOOD WORK, but at state test time it\'s the opposite.  The struggling students really tried, but the shear amount of reading was overwhelming.  Anyone who has scored these knows that those 15 points of unanswered questions just gave the kid a 1.  Do you know that last year kids needed 85% of the raw points to get a 3?  Awesome!  9 year olds should definitely have  more challenging goals than 17 year olds.  Embedded field test questions are disgusting, and eat into children\'s precious testing time.  Why should they have to determine if the company\'s questions are worthy? No matter how many times we tell the kids not to worry about field test questions (but they have no clue which they are), those kids DO WORRY because they want to do well all the time.  Let\'s just beat that work ethic out of them.  It\'s such a rare commodity these days anyway, let\'s just make sure it dies along with independent thought and creativity.  What are we doing??????'),(267,NULL,0,'4','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 02:30:34','Child # 2 didn\'t really complain. Said the test was hard. I asked her to tell me something positive.... long pause... she said \"the passages were interesting to read\". '),(268,NULL,0,'8','Observations',',11,1,2,5,','anonymous','Parent','rkatcher@gmail.com',0,NULL,0,0,'2013-04-23 02:38:46','8th grader has scored 4 and one 3 in past years. Day 1: Too many of the multiple choice questions had too many equally valid answers. He said his teacher concurred. Day 2: Some of  the short answers asked for two quotes and could easily have been brief essays. Barely started the actual essay. Day 3: Did the essay first but only finished one short answer. This is a kid who epitomizes close reading strategies, reads constantly, and has straight As at a top middle school. I can\'t fathom what these tests are supposed to be demonstrating. Completely unnecessary and demoralizing. I so wish I had opted him out. '),(269,NULL,1,'general','Implications for Instruction',',12,5,6,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 02:40:25','We want to take this opportunity to thank you for all the work you did with us this year. Your explicit, deliberate and consistent guidance proved to be crucial to our instruction and student progress. The strategies you fostered were especially effective.\nDue to the demand of the common core with regard to higher order thinking and synthesizing, “close reading” proved to be absolutely essential. All students were able to apply this tactic to some degree to better navigate and internalize the text. This enabled students to attain a deeper comprehension.  We were fascinated at the necessity and demand for this reading skill on the 2013 ELA State Exam.\n Furthermore, the emphasis on the importance of concrete textual evidence also proved to be a proactive concentration. Students were adapt at unpacking the questions and supporting them with relevant evidence properly cited from the text.\nAdditionally, our focus on text structure gave students agency and anticipated expectations of the text that ultimately enhanced comprehension.\nAll of the preceding, techniques were widely applicable and transferable which gave our students a sense of security and a clear course of action to overcome new and more rigorous standards.\nIt is with your assistance  that we have been able to transition our students more smoothly to Common Core Standards and to grow as educators. We hope to continue in future professional development with you.'),(270,NULL,0,'6','Implications for Instruction',',12,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-23 02:44:38','It appear if children used common sense or prior knowledge they will be wrong for ex. The smart intelligent question.  Corporate influence by using Pearson passages from their curriculum on the test and using trademarks all seems biased.'),(271,NULL,0,'4','Observations',',11,4,6,10,','Kristine Prass','Teacher, Parent','kprass@babylonufsd.org',0,NULL,0,0,'2013-04-23 03:37:45','What is the purpose of testing? Are we trying to \"catch\" and \"trick\" students, or are we trying to find out what they know and where they need help? There has been so much mystery and secrecy surrounding the NYS ELA (and Math) Exams this year, how were we teachers supposed to prepare our students on the types of questions they\'ll encounter, and the way in which the questions will be asked? If the questions themselves are unclear or confusing to the students, how can this be an accurate evaluation of how well they know and understand the content? Some answers are so obvious and simplistic that the students over-think the answers, while other questions are so vague a real \"stretch.\" (I must say, the questions on the test made a lot more sense than the questions on the practice tests that were available, which isn\'t exactly a glowing endorsement!) The idea of Common Core Standards has turned into a prescribed way in which \"the state\" expects the teachers to teach, rather than a guideline of what to teach. Publishing companies and people with little or no experience in education are setting the standards. What does Bill Gates know about what a nine year old should know? Do \"they\" realize that the children today need more playtime? Do \"they\" know these children, who are expected to be so sophisticated in their thought processes as to be able to analyze their own thinking, still believe in Santa Claus? As educators, we know there are many ways to teach one concept, and you\'d better be prepared to teach in as many different ways as possible because all children learn differently.  As a parent you know that no two children are alike. What happened to developmental readiness? Is it necessary for our babies in Kindergarten to feel crushed and hate school because they can\'t read yet? Tutors in Kindergarten? Really? How can we expect children to be able to read without sharing the love of books and the treasures stories hold by reading to them first? Before experience life? Kindergarten used to be a time for socializing and cooperating, and learning about the world by doing fun, age- appropriate activities. We played \"store\" and \"house\" and \"post office\" and we tried to make sense of the grown-up world by pretending. Not anymore! There is very little playtime, and the \"centers\" are more skill/concept/goal oriented. The children are in school longer, and the curriculum is getting pushed down to the earlier grades more and more each year.  As you can see, I am most passionate about this subject. I do believe in standards as guidelines so we are all pretty much on the same page, but the current way things are being done is ANTI-children. The only ones benefitting from the new CCSS are the publishing companies. Say NO to the Common Core!!'),(272,125,0,NULL,NULL,',4,','Anonymous','','',1,NULL,0,0,'2013-04-23 03:42:24','Teacher, Parent,\nI am wondering whether you have some suggestions for how local districts CAN \'push back\' on Albany. It isn\'t clear to me what the avenues are for parents to be heard, or teachers, or principals--which seems odd when the topic at hand is the best way to support kids\' growth. But I\'d love your thought on ways in which you, and all of us, can be influential. For example, what can this site do, even?\nLucy Calkins'),(273,43,0,NULL,NULL,',','Lucy Calkins','TCRWP Staff','lucycalkins@comcast.net',1,NULL,0,0,'2013-04-23 03:45:41','Kelli,\nThanks for singing your name to your posting. I think that this site will be more valuable if more of us do that. I also think that concrete suggestions like this one should be helpful to the makers of tests--after all, you are like a field-based researcher, actually documenting what you saw. I do think that there are lots of little ways to make hard tests a bit less crazy for kids,\n'),(274,64,0,NULL,NULL,',','Anonymous','Teacher, Parent','kschrader@cvcs.wnyric.org',1,NULL,0,0,'2013-04-23 03:53:17','Well said!'),(275,261,0,NULL,NULL,',','Anonymous','Teacher, Parent','kschrader@cvcs.wnyric.org',1,NULL,0,0,'2013-04-23 03:58:06','I completely agree! '),(276,NULL,2,'general','Implications for Instruction',',12,5,','Lucy Calkins','TCRWP Staff','',0,49980,0,0,'2013-04-23 04:21:13','I am in New Orleans, doing a speaking-duet with Michael Fullan on the implementation of the CCSS. Talking with Michael and thinking about all we know from decades of research on school reform, I find myself worrying that the CCSS is going to implode. If it does, the problem will not be with the ideals of the Common Core, but with the fact that people driving policy do not seem to understand about how people and organizations grow. \n\nSo many teachers and parents have been eager to embrace the challenge of the CCSS, and ready to work with heart and soul to lift expectations and achievement. But we were behind the CCSS because the standards themselves represent a robust and exciting and compelling image of what it means to be a reader and a writer. More and more, we find that the people driving the CCSS want to specify and limit what the Common Core means, turning it into a call for a very particular sort of reading and writing instruction--one that asks eight and nine year olds to see reading as rereading, as analytically deconstructing a text so as to discuss the author\'s purpose for sentence 9 versus sentence 11, and to see writing as merely as forum to display that sort of literacy-criticism. \n\n If policy makers are going to interpret the CCSS as valuing only that sort of reading, if there will be no place in schools for kids to read to learn, to read for curiosity, for reading to imagine oneself walking in another\'s shoes....then the Common Core will fail. It will fail because people who know children--parents, teachers, administrators and teacher educators--will say no. Ultimately, the only way to improve teaching and learning is to rally  teachers and parents and principals to take up the cause, to see the standards as not just a mandate but a mission.  Fullan has said it well: \"As any innovation unfolds, leaders must pay close attention to whether they are generating passion, purpose and energy--intrinsic motivation--failure to do so is a sure fire indicator that the innovation will fail.\" I have been a great advocate of the Common Core, and have tried to turn the standards from a mandate to a mission. But the ELA is making me wonder about this.  \n\nThe test that kids have just taken utterly changes what the standards mean, and the narrow definition that the test has given to the CCSS (one that matches the Revised Publisher\'s Criterion but not the Common Core itself) is pretty limiting.  Do we want reading and writing instruction in third and fourth grade to be all about rereading a passage multiple times to mine it for every literary device, for every structural decision? Is there no place for reading a passage to learn about a subject of interest? \n\nMy message to parents and teachers and principals is to go back to the text. go back to the Common Core. I think you will find that reading standards 7,8,9 are not well represented in this test, and that only writing standard 9 was well represented. You can assess a youngster\'s ability to write when all the writing is utterly based on reading a challenging text--that is an assessment of reading.  I think we should ask for tests that reflect the full Common Core, and for recognition that the Common Core itself suggests that to achieve standards level at any one grade, that youngster needed to stand on the shoulders of years of prior learning.\n'),(277,NULL,0,'general','Observations',',11,1,2,4,','Kristine Prass','Teacher, Parent','',0,NULL,0,0,'2013-04-23 04:35:12','What is the purpose of testing? Are we trying to \"catch\" and \"trick\" students, or are we trying to find out what they know and where they need help? There has been so much mystery and secrecy surrounding the NYS ELA (and Math) Exams this year, how were teachers supposed to prepare students on the types of questions they\'d encounter, and the way in which the questions would be asked? If the questions themselves are unclear or confusing to the students, how can this be an accurate evaluation of how well they know and understand the content? Some answers were so obvious and simplistic that the students over-thought their answers, while other questions were so vague, wordy, and/or confusing, it was hard to tell what was being asked.  The idea of Common Core Standards has turned into a prescribed way in which \"the state\" expects the teachers to teach, rather than a guideline of what to teach. Publishing companies and people with little or no experience in education are setting the standards. What does Bill Gates know about what a nine year old should know? Do \"they\" realize that the children today need more playtime? Do \"they\" know these children, who are expected to be so sophisticated in their thought processes as to be able to analyze their own thinking, still believe in Santa Claus? As educators, we know there are many ways to teach one concept, and you\'d better be prepared to teach it in as many different ways as possible, because all children learn differently.  As a parent you know that no two children are alike. What happened to developmental readiness? Is it necessary for our babies in Kindergarten to feel crushed and hate school because they can\'t read yet? Tutors in Kindergarten? Really? How can we expect children to be able to read without sharing the love of books and the treasures stories hold by reading to them first? By modeling what reading is? By asking questions and engaging them in the story? How can they make sense of reading before they have had a chance to experience life a little? Kindergarten used to be a time for socializing and cooperating, and learning about the world by doing fun, age- appropriate activities. We played \"store\" and \"house\" and \"post office\" and we tried to make sense of the grown-up world by pretending. Not anymore! There is very little playtime, and the \"centers\" are more skill/concept/goal oriented. The children are in school longer, and the curriculum is getting pushed down to the earlier grades more and more each year.  As you can see, I am most passionate about this subject. I do believe in standards as guidelines so we are all pretty much on the same page, but the current way things are being done is ANTI-children. The only ones benefitting from the new CCSS are the publishing companies. We need to take a stand and say NO to the Common Core!! Last year Pearson made mistakes on both the NYS Math and ELA tests. Just this week NYC parents questioned the results of a test given for entry into the gifted program, and upon review, it was discovered that 13% of the students taking the test, published by Pearson, were scored incorrectly.  The tax payers-teachers, parents, everyone who pays taxes- MUST become informed! Find out who authored the CCSS. Was the creation of the CCSS even legal?  What educators, or people with educational experience, helped draft or were a part of the process of setting the standards in any way? What former Pearson employee did Gov. Cuomo appoint a job? Why is Gov. Cuomo\'s relationship with Pearson being questioned? Why are \"they\" willing to share our students\' personal information with inBloom?  How much are these unfunded mandates going to cost the tax payer, and how will it be paid if there is a tax cap? How many billions of dollars have already been spent creating tests and standards shrouded by so much controversy? Unfortunately, if it involves money and politicians, the integrity has to be questionable and questioned. GET INFORMED! GET INVOLVED! '),(278,NULL,1,'5','Observations',',11,','PJ Motsiff','Teacher','pmotsiff@gfsd.org',0,9970,0,0,'2013-04-23 04:49:12','I know there is a lot of chatter going on inside and outside the walls of all of our 3-8 buildings right now.  I am very aware that the state gave us a warning that they were going to raise the bar.  They certainly did!  I know this is not just a district issue but one that covers the entire state of NY.\n\nI am sitting at my house reflecting on what just happened.  I love my job!!  I look forward everyday to coming to work and seeing if I can make a difference with everyone that meets in room 105 of the middle school.  I know that 1/3 of my class have more important needs that need to be addressed before we can even really focus on academics becoming a true priority. Not a problem...We have a great support staff at the middle school and are doing the best we can with them.  I knew they were going to struggle on these state assessments and planned to just nurture them along and get them through by being their biggest supporter.  \n\nHowever for 41/2 hours over the last 3 days days it broke my heart to watch some of our most gifted 5th graders trying so hard.  They read and read and read....they wrote and wrote and wrote....the entire 90 minutes.  I watched them shake out their hands and wiggle their little fingers to reduce their hands from cramping.  They were checking and double checking their answers, underlining and circling text, everything they have been guided to do in their lessons leading up to this week.  No break for 90 minutes, except to hear me give them them the 10 minute warning.  On Tuesday I had 4 of my top kids not get past 30 out of the 42 questions.  Wednesday, 7 of my Top kids never completed the final essay, one asked me which was worth more  because he wanted to tackle that one to get more points.  However, today was the hardest for me to swallow... in the final minutes I watched a child that attends young scholars be reduced to tears from the fact that he could not finish for the third time.\n\nIn my classroom, I also witnessed the opposite situation.  I had another young scholar student who is bright beyond his years complete Test 1 which includes 4 reading passages and a poem as well as 42 multiple choice questions.  He had \"completed\" his test in 35 minutes.  The rest of the time he put his head down and slept.  On day 2, he completed both books in less than 40 minutes.  As I collected the tests he verbally expressed to his 8 peers that had not completed the test, \"don\'t worry because these tests were only going to be used to grade the teachers.\"  I did have a long talk with him, as well as calling his guardian to help guide them with the facts so that they understood that this test WILL effect him in some way.  \n\nI only share these stories with you because I feel it is important that the board members and administration recognize what the teachers have endured.  The media can say all they want about our union but I can promise you the teachers in this district earned their salary in the last 3 days by supporting the best little minds in our community and keeping the energy positive.  I can assure you we will jump back in the trenches and do it again next week as well! \n\nAt the end of the day today, the parent of a high anxiety child came into the building with the sole purpose of giving me a hug just because she knew what her child had been reduced to and we had tag teamed to keep her going, me in school - mom at home!!....I had no way of holding back my tears at this point.  \n\n'),(279,NULL,0,'4','Observations',',11,1,2,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 10:15:01','We teach students to read \"closely\", annotate their text, and other strategies to get through rigorous text. Unfortunately, due to the time constraint, the students had to abandon what we\'ve been practicing all year just to finish. They all felt they had to rush through the entire test, just to finish. Despite this, there were some that still did mot finish. Students felt defeated. I\'m fine with the intensity of the test as long as they have ample time to do their best work!'),(280,NULL,0,'6','Observations',',11,1,','L. Laureano','Principal','',0,NULL,0,0,'2013-04-23 10:19:13','Overall, it seemed \"fair\" in respect that it was what we were told to expect.  In reading some of the questions, I found situations in which two answers honestly seemed possible and could be justified in discourse; this was true of several other teachers on our team.  \n\nTiming was an issue.  Asking students to read at their appropriate levels, think in a more challenging way and then respond to questions requiring more thought should mean having additional time to do these.  I noted our students working hard and thinking about their responses but several could not finish.  This skews the data.  '),(281,NULL,3,'3','Observations',',11,','Anonymous','Principal','',0,NULL,0,0,'2013-04-23 10:20:57','I thought the exam was on point.  It really assessed whether a student could fully comprehend a text, understand the concepts of comprehension a 3rd grader should be using, and was the perfect amount of time for a student that is on grade level.  No assessment is ever fair because there will always be one or two students in a group of 30+ in which the reading will be too difficult, etc.  However for these students that is where accomdations are necessary such as time and a half, etc. \n'),(282,NULL,0,'4','Observations',',11,7,','Anonymous','Parent, Other','',0,NULL,0,0,'2013-04-23 10:50:06','As a parent of a nyc student with an iep these tests are ineffective \nTesting knowledge would be best in multiple choice format that would be objective \nWriting is subjective \nScoring is against our diverse student bodies \nHow can schools embrace diversity then jam these boring passages at young students?!  Kids have different interests. That diversity has value is not consistent eith these tests. \n\nWe have yet to see the math exams. Look out here they come!'),(283,NULL,0,'5','Observations',',11,1,','Lisa Loomis','Parent','lisamloomis',0,NULL,0,0,'2013-04-23 10:51:03','School comes easily to my son.  He is a good test taker and is not bothered by them.  This year I asked him every day how the test was.  He said, \"Stupid!\"  He said it was too long and on the second day he had 2 minutes remaining when he finally finished.  He said he doesn\'t mind multiple choice or short answer but there were too many essays.  These test take away too much instruction time.  My son is a good student and was bothered by the test, how are children who are not as proficient doing.  I heard from my son that there were many tears or kids who just gave up.  I think this testing is absurd and I will opt my kids out of state testing next year!'),(284,NULL,0,'5','Observations',',11,','Lisa Loomis','Parent','lisamloomis@yahoo.com',0,NULL,1,0,'2013-04-23 10:51:19','School comes easily to my son.  He is a good test taker and is not bothered by them.  This year I asked him every day how the test was.  He said, \"Stupid!\"  He said it was too long and on the second day he had 2 minutes remaining when he finally finished.  He said he doesn\'t mind multiple choice or short answer but there were too many essays.  These test take away too much instruction time.  My son is a good student and was bothered by the test, how are children who are not as proficient doing.  I heard from my son that there were many tears or kids who just gave up.  I think this testing is absurd and I will opt my kids out of state testing next year!'),(285,NULL,0,'6','Observations',',11,1,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 10:56:59','My daughter always finishes tests early. For her to just finish as the teacher says \'pencils down\' shows there is something fundamentally wrong with the design of the test.\n\n'),(286,NULL,0,'4','Observations',',11,1,3,','Barbara Parmly','Teacher','bparmly@pvcsd.org',0,NULL,0,0,'2013-04-23 12:02:28','Average students had barely enough time to use their strategies to complete the test.  This means that struggling readers, or readers who are just at the benchmark, had difficulty completing the test USING all the strategies they have learned.  In scoring, there is no way (now that the test is super secure) that the machine can tell what strategies were used, if any, and which questions weren\'t answered at all.  This skews the data as it does not reflect what the student can do.'),(287,NULL,0,'3','Implications for Instruction',',12,4,','Brianna Friedman ','Other','',0,NULL,0,0,'2013-04-23 12:16:00','Working with K-2 teachers I am very grateful I do not have to deal with the craziness of the test. However, that is becoming less and less true. Students as young as kindergarten are having their education severely impacted by these tests. Many schools have students leave the building during testing. One school sends their pre-k to second graders to a gym for two weeks during testing, that is two weeks without instruction. Several school bring children to the park each testing day, and practice test day. I love a good trip to the park, but instructional time lost does not just apply to test takers. I am more and more often asked to do test prep work with second graders, as the pressure has caused many schools to feel starting testing earlier will help. Yesterday a kindergarten student came up tug on  my leg and ask \"is the test over yet?\" Walking into any new York city school in march until the april test are over... the tension is palpable in the air. I bite down and wait till test taking season is over and we can go back to teaching. '),(288,NULL,0,'8','Observations',',11,1,3,4,5,','Mrs. Erin B. Tryka','Teacher','etryka@aldenschools.org',0,NULL,0,0,'2013-04-23 12:22:20','I have been teaching for 13 years, and I have never seen a test have such a negative impact as this one.  Here are a few comments I shared with the superintendent of schools within my district...\n\n1. The students did not have nearly enough time to complete the test. \n \na.)  The passages on this year’s test were more complex, and to be fair, we knew about this in advance.  To help our students prepare for the new text complexity, and the Common Core standards, we taught them the \"Close Reading\" method as a Common Core reading strategy. This technique has the students first \"read for the flow\" and then go back to “mark-up” their thoughts within the text and come up with \"gist statements\" for each paragraph. Many students started out trying to \"Close Read\" because they truly want to do their very best. They realized that they were running out of time and then found themselves rushing. They know that the Close Reading method helps them to gain an understanding of the text, but it requires time to dig more deeply into what they read, and they did not have time.  If NYS expects our students to tackle more challenging text to be better prepared for college, I completely understand, and I am more than willing to implement strategies such as the Close Reading method.  In the real world college students have time to read and re-read text, mark up the passages within articles and textbooks, and take their time to understand what it all means.  NYS and Pearson must provide students with the time needed to show their understanding, and this did not occur yesterday or today. \n \nb.) The questions were more complex as well, and all of them required at least a full minute to read through and understand. The A,B,C,D choices themselves were oftentimes 2-4 sentences each! Many of the questions required them to re-read a quote and then go back into the passage to re-read the paragraph the quote was found within. If they did not go back and re-read the paragraphs, they would not be able to answer correctly. Reading the question, seeking the meaning of the question, and going back to re-read paragraphs takes my 8th graders at least 2-3 minutes. On Book 1, with 90 minutes to read 6 passages and also complete 42 questions, the math speaks for itself.  There was simply not enough time.\n \n2. There is \"too much\" test.\n \na.)  Why give the students passages with multiple choice questions yesterday and then turn around and give them more passages with questions today? Why give them short responses and an essay to write today, and then have them write more short responses and an additional essay again tomorrow? A two day test with reading passages and multiple choice on Day One and reading passages and written responses on Day Two makes more sense to me. We could assess the same Common Core standards without all of the redundancy in the tasks we are asking them to complete. \n \nb.)  Why does Pearson insist on weaving field test questions into the actual test, and why is NYS allowing this? Do they not realize that by adding to the amount of questions students are asked to complete they are creating anxiety, frustration, and tired writing hands? We are told the field test questions \"do not count,\" but we do not know which ones count or not, and more importantly, the students do not know.  The majority of our students are trying to do their best work and truly want to succeed.  When they struggle with a difficult field test question it adds to their anxiety and stress.  They are not aware which ones count or do not count so they care about each and every question.  The field test questions should not be woven into the actual test because they affect the overall performance of our students on the test.  Our students become burnt out, they are tired from answering way more questions than necessary, and adding more to the test adds more to their frustrations, thereby negatively impacting their overall test performance.  \n \n3. Evaluating the effectiveness of ELA and Math teachers based on three days of an extremely difficult test is unfair.\n \na.)  Commissioner King himself stated:\n \n“…we expect the assessment scores will decline…The number of students meeting or exceeding Common Core grade-level expectations should not be interpreted as a decline in student learning or a decline in educator performance.”\n \nIf no interpretation of our “performance” as educators is to be made, then why will our APPR points come directly from the results of this test?  How is this fair?  How does this even make sense?  Unlike other teachers who were able to design their own SLOs, the ELA teachers (and our co-teachers) have no control over these tests.  We cannot set the amount of time they have to complete them.  We have no idea what types of passages will be on the test, if our students have prior knowledge of the content within the passages, etc. Even the essay “sampler” they provided us with was very different from the one our students received today. This is unfair.  \n \nb.) Students are “opting out” and regardless of what we’ve been told, this will affect our evaluation.  Many bright, capable level 3 & 4 students are some of the ones opting out.  Their improvements and success will not be factored into the equation; this will affect my APPR points.  Also, when students complete part of the test and then “opt out” of the rest, their scores will be very low (level 1).  Those level 1 scores are factored into my APPR points.  This is also unfair.\n\nI could go on and on with much more, but these are the points I feel require immediate attention.  I hope my comments help others to understand my frustrations, and I hope they will serve as a platform for further communication with those in Alden and in NYS.  I am not opposed to the new Common Core Standards.  I am not opposed to teaching my students how to read more complex passages in order to help prepare them for successful futures.  What I am opposed to is setting them up for failure altogether, and that is what these tests are doing.  \n \nThank you for your time.\n \nSincerely,\nErin B. Tryka\nEnglish Language Arts Teacher\nAlden Middle School\nAlden, NY'),(289,NULL,0,'3','Observations',',11,2,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 12:26:44','My daughter is a good reader and does well in ELA topics.  Her overall attitude was good but it was mainly because the teacher added some fun activities to the week to balance it out.  She was not happy with the first day but seeemed to be more confident about the 2nd and 3rd days.  \n\nAs a parent and a teacher I am concerned about the stress that is put on these children at such an early age and the pace the teachers must go at to complete topics.  I want my daughter to understand for the \"long haul\" and not just for a test.  Again, my daughter is strong in this area so she will adapt.  Math will be another story ...'),(290,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,1,0,'2013-04-23 12:29:40','There was a typo in the text of \"Race to the Klondike\" by Lester David in the Grade 7 Book 4. The sentence reads: \"A gold-seeker who lacked a horse or sled would haul about 65 of pounds of supplies...\" The first \"of\" is incorrect, per an original source of the text: http://area1sixth.wikispaces.com/file/view/9503177544.pdf\n'),(291,NULL,0,'3','Observations',',11,1,2,4,9,','Michelle Doorey','Parent','4dooreys@charter.net',0,NULL,0,0,'2013-04-23 12:38:39','The idea of 10-15 minute directions every day for 6 days of state testing for elementary children is absolutely ridiculous. Many students were lost before they even began the exam. I also know that many students did not have time to finish (really? 70 minutes per day for 8 year olds is not enough time?) and were very upset. You should be ashamed of yourselves, New York State. As a parent, I am disgusted with what is being done to our children. Their brilliance is being squashed, and their love of LEARNING is being destroyed at the hands of adults. It\'s sick, and I can\'t believe it\'s been allowed to go on for this long. My son will not be taking part in any more of your \"tests\".  '),(292,NULL,0,'5','Observations',',11,1,2,','Dawn LoRe','Teacher','dlore@bufsd.org',0,NULL,0,0,'2013-04-23 12:53:45','The fifth grade ELA test was given to my group of disabled students. Session 2 was especially challenging. Although they had double time(three hours in all ), were well prepared, had made tremendous gains this year,worked diligently at a good pace and put forth extraordinary effort, several of the students were unable to complete the test due to the time constraint.  This clearly indicated that the amount of work required of the students during that particular session was excessive and unreasonable.The students were upset and exhausted.  They are now dreading the upcoming math exam.'),(293,NULL,0,'4','Observations',',11,','Sheila Higginson','Parent','schismfs@gmail.com',0,NULL,1,0,'2013-04-23 12:54:33','Before the test, my 4th grader who does well in school, usually a very confident, relaxed boy,\nhad several hysterical crying fits because he was sure that \"I\'m going to\nfail the ELA, this will be the worst summer of my life, I will have to go to\nsummer school and probably repeat 4th grade because I write so slow I will\nnever finish in time.\" \n\nOn Day 1, he came out smiling. Said he liked the passages, was able to\ndescribe them in detail (an Indian myth about the sun, why people get\nbrainfreeze, non-fiction about beaver kits, story about cowboy trying to\ntame horse), and thought he did well on the multiple choice questions.\n\nOn Day 2 he came out smiling again, even though he didn\'t get to finish the\ntest. He said he had gotten through the body of his essay and still had to\nwrite the conclusion, but he was very happy he had gotten that far. Again,\nhe liked the passages (wombat, weaver birds, how to make a candle) and could\nrecall a lot of details from them and about what he had written.\n\nOn Day 3, he said that he again didn\'t finish the test, but didn\'t seem upset. I asked him why and he said \"Because I can\'t believe how much I improved. I never thought I would ever even get to the essay. That\'s because my teacher encouraged me.\"\n\nHe has been blessed this year to have an amazing, calm, encouraging teacher who didn\'t put pressure on her class. He said that their class was the only 4th grade class that didn\'t have someone cry or have a meltdown. I believe that he was at an advantage because the topics of most of the passages were exactly what he loves reading about--animals. '),(294,NULL,0,'7','Observations',',11,','Sheila Higginson','Parent','schismfs@gmail.com',0,NULL,1,0,'2013-04-23 12:58:36','Before the test, my 7th grader who also does well in school but typically an anxious worrier,\nseemed to basically have tuned out, will not talk about tests, did not do\nwell on Benchmarks and seems to have disconnected himself from the whole\nprocess. \n\nOn Day 1, he came out and said it was easy. Then later said he had trouble\nkeeping his focus during the passages. His friend said there were a bunch of\nquestions that seemed like 2 of the answer choices could be correct, and\nthen my son confirmed that yes, that was true and test wasn\'t as easy as he\nfirst said. Seemed okay about it, though.\n\nOn Day 2, he came out looking shell-shocked and ready to cry. Said that he\ndidn\'t get to finish one short response and only put one of two details for\nit, ended in the middle of the sentence and had to go quickly to essay\nbecause there were only 10 minutes left. Said he wrote so fast he felt like\nhis hand was on fire. He said a few kids in his class (superintendent\'s\nprogram) were crying before the test was over and many didn\'t finish. He\nsaid the teacher had to pry the test from one kid\'s hand (kid is super-smart\nand capable) and that he just kept writing and crying until teacher took\npaper away. For their class, I think Day 2 was disastrous and it looked like\nalmost all the kids felt that way. \n\nOn Day 3, he looked a lot happier, but complained, \"If I have to ever read another Gold Rush passage...\" Also said it was confusing because things were spelled two different ways in different passages (Klondike/Klondyke). Said he was able to complete the test without rushing too much. \n'),(295,NULL,0,'7','Observations',',11,1,2,','Todd Pierson','Parent','pierson.todd8@yahoo.com',0,NULL,0,0,'2013-04-23 12:59:26','I have a daughter that took the state ELA exam last week.  After the second day she was spent.  She is a honor roll to high honor roll student, a part of Jr National Honor Society and told us that she did not feel like she had done well after the first day because she could not concentrate fully. The big picture in education is to help our children have as much knowledge as possible, so that they will have a successful life. Tests are important, but so is sparking a child\'s interest, making learning fun.  '),(296,NULL,0,'5','Observations',',11,1,2,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 13:02:05','I felt this test was very long and difficult. My son, who in the past scored 4s on both ELA and Math, had difficulty finishing the test on time. He was very stressed and upset by this. There is no reason why children should be tested like this!!!'),(297,19,0,NULL,NULL,NULL,'Jose Baires','Other','',1,NULL,1,0,'2013-04-23 13:09:48','This makes so much sense!\n\nMore!'),(298,NULL,0,'7','Observations',',11,1,3,5,','Fred Axelrod','Teacher','faxelrod@greatneck.k12.ny.us',0,NULL,0,0,'2013-04-23 13:13:29','1. The test was too long.\n2. The test did not measure reading ability. It measured problem solving ability. The passages were interesting and accessible; the questions were not. They were overly nuanced and ambiguous. They were tricky, not honest.\n3. The barrage of multiple choice questions did little to see how students use and apply information, organize evidence or use information to present an argument. Those are higher thinking skills that should be developed.\n4. It is very likely that a teacher would be given the tests just before starting time, administer the tests, collect them and then turn them in -- all without any time for the teacher to see the test, let alone have time to properly analyze the test. How are teachers supposed to prepare students for a test they have barely seen? '),(299,NULL,0,'general','Observations',',11,2,7,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 13:14:28','If I understand this correctly, there isn\'t an established passing grade prior to the scoring of the test. This would lead me to believe that getting a 1,2,3 or 4 will be determined according to a bell curve after the test is scored. Therefore the test has to include a wide range of difficulty. Now here is one of my concerns. The child with a learning disability affecting reading and writing will almost always  end up at the lower end of the bell curve.  This means that despite years of developing reading and writing skills and making progress at their level, they will be forced to attempt work considerably beyond their present capability. Can you imagine the frustration. I can. I witnessed it several times. Children who began the test with confidence, trying to apply all of the skills they had be taught quickly found that despite their best effort, they were confused and/or unable to finish the test. Most children just gave up as I was required to quietly sit by and watch this disaster unfold. So I ask, with all of the other test gived to classified students, why do we need to put them through six days of a frustrating, humilliating task? \nI also wonder about the childens\' legal rights? Would the Commissioner of Education ask a physically disabled child to run a mile? With years of support perhaps the child would eventually be able to do so, but the process cannot be rushed even if the Commissioner want it to be. Why would it be different with a child with a learning disability? Eventually, with support,children with learning disabilities will learn to read but it is a process that requires a motivated, enthusiastic student not a defeated one. '),(300,NULL,0,'8','Observations',',11,2,','sheryl maningo','Teacher','maningo.sheryl@avcsk12.org',0,NULL,0,0,'2013-04-23 14:03:58','I teach Social Studies, and thank God, no longer have to contend with the 8th grade Social Studies Exam.  I was disheartened to learn that my students were being tested on new curriculum last week when ELA teachers only received the suggested reading list last month and have not had time to implement it.  Some of my students were near tears during and after the exam. How would you feel if two booklets were handed out to complete and you never got to the second one? Or, on the third day, could not understand those passages about crows and were unable to complete the essay? Some students were at a disadvantage because students at schools that could afford the Pearson materials had already studied one of the passages. This mania about standardized testing and Common Core Learning Standards is going to be the death knell of American public education.'),(301,NULL,0,'8','Observations',',11,1,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 14:08:30','There was not enough time for students to use the strategies we taught them all year, especially on Day 2 (Books 2 & 3)! We emphasize close-reading, which involves annotating and highlighting, and planning your writing, which means creating some form of graphic organizer. Towards the end of the testing time, I was praying that the kids would put down their highlighters and just read or write as fast as they could... the opposite of what I had encouraged all year long. I\'m not opposed to more rigorous texts, critical thinking and analysis, etc. but there needs to be ample time in order for the kids to do their best!'),(302,NULL,0,'8','Ideas for Constructive Action',',13,1,4,','Karen Rock','Teacher','krock@plattscsd.org',0,NULL,0,0,'2013-04-23 14:33:50','The test was too long given the padding from the field questions. The students- even my very best- were so stressed that they could not finish the test because of the extra work. It was grossly unfair and, in the long run, will not win public support if the tests are deemed unfair this way. My best advice is the insist Pearson take out the field questions so that we are truly measuring what the children can do to get more reliable statistics on learning as well as not get the public to rally against these tests. '),(303,NULL,0,'general','Ideas for Constructive Action',',13,8,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 14:38:28','Why were there multiple books for day 2?  Why couldn\'t the material have been placed all in one book?  '),(304,NULL,0,'general','Observations',',11,5,','Mary Ehrenworth','Parent, TCRWP Staff','',0,NULL,0,0,'2013-04-23 14:45:08','Thinking more about what these tests are asking kids to do with nonfiction, and very unsure about this research base.  Basically, every grade is asking students to analyze the craft of expository texts - including asking things like \'the author probably included x in order to...\' and then the kids are supposed to figure out if it was to build tension, engage the reader, serve as a gripping example, and so on.  \n\nBut in order to be a critical reader of nonfiction, isn\'t one of the most crucial things having read a lot on the subject?  I wonder if this inching through isolated texts is really will help kids be better prepared and do better in college, versus reading everything they can get their hands on about a subject, which will gradually increase their knowledge and their ability to critique texts?   Mentioning this because as tests drive curriculum, if we push kids towards inching slowly through these short texts (and it\'s not clear if some of these are even worthy of this kind of craft analysis), they will get hardly any reading done. \n\nAlso watching my own sixth grader, and when he could talk back to texts, or appreciate them at the craft level, it was often because he knew a lot about the subject - from reading everything and building knowledge.'),(305,NULL,1,'general','Observations',',11,6,','Mary Ehrenworth','TCRWP Staff','',0,NULL,0,0,'2013-04-23 14:50:24','We\'re getting a lot of letters from teachers about how they\'ll need to change their curriculum so kids spend more time in middle school analyzing \'how\' authors make an argument versus comparing the content of their arguments.  This kind of meta-analysis, is it really what the CCSS calls for in middle school?  Law school, for sure, but is it the most pressing work for thirteen year olds?  When I read the standards, especially reading standards 1-3,  it feels like the test is moving to testing standards for 9th to 10th grade - but then we don\'t have any information on how students are doing with the work of their own grade. '),(306,NULL,0,'8','Observations',',11,1,5,','Sarah M. Brown','Teacher','brown.sarah@avcsk12.org',0,NULL,0,0,'2013-04-23 14:57:35','I felt that there was an inappripiate amount of material to be read during each session (especially days two and three).  I understand that there were field test questions folded into the assesment, but the amount of material was overwhelming and led to many students skimming the material instead of being engaged with it.  If the intention was to raise the difficulty level by using topics that were of little interest to 12-14 year olds, you succeded.  I believe that the student experiences during the ELA exam will lead to more rufusals on the math exam this week.'),(307,NULL,0,'4','Observations',',11,1,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 15:01:10','The second day questions were too long for the time given.  My child is in a G and T class.  These are the smart and quick kids.  Their vocabulary and use of language far out-passes mine at the same age.  Almost none of the class was able to finish in the time allotted.  because of this, if the field test questions were at the beginning, the test results will be very skewed.'),(308,NULL,4,'3','Observations',',11,2,3,4,6,7,8,','Deborah Linscott','Teacher','deviart@aol.com',0,NULL,0,0,'2013-04-23 15:27:38','I was shocked by how much the test measured inductive and abductive reasoning with overwhelming cognitive complexity, and how little it measured the standards appropriate to grade 3.  The answers did not follow with certainty from the questions, and about half of the questions themselves appeared intentionally vague, syntactically and semantically complex, and/or challenging with regard to eye-hand-coordination.  Children had to cognitively fill in the questions with what did not exist, or sometimes even ask themselves what the test makers REALLY wanted to ask because it was not readily apparent.  Even adults often arrived at an \"if, then\" but \"if, then\" range of responses that then required internal argument to choose.  Surveying the premises required to answer the questions made me and my colleagues exhausted by about a third of the way through Day 1, and we are not eight or nine.  Early on children I observed became confused and exhausted.  They persevered with their best intentions and innocence, lacking the experience to say to themselves, \"This is $#@*\"  I thought the second piece was about a level R/S becasue of embedded metaphor, central to both questions and meaning.   \n\nResidual fatigue factored into children\'s performances on subsequent days.  I never witnessed so few children writing \"their best game.\"  With all of Pearson\'s test creation experience and generous funding with our tax dollars, they made a test that is completely developmentally, cognitively, and syntactically inappropriate to the population.\n\nIf I stay in teaching, I will be writing my own improvement plan any second to propose to district leaders.  It will say things like:\n\n1. Get children to practice flipping back and forth between stapled pages while holding a question in their mind for at least 10-15 lessons if you want them to pass the ELA.  This is a demanding and complex task that requires direct instruction for success.\n2.  Have children read questions intended for linguistic and intellectual screenings over and over, about two years above their current grade placement for 20ish lessons.  They may or may not be able to learn how to understand these questions, but at least they will be familiar with increasingly complex questions.\n3.  Teach children not to become agitated, upset or apathetic after 10-20ish questions that they cannot easily respond to.  Breathing and meditation for at least 20-30 lessons.\n4.  Stop accepting into the reading program: children with below \"above average\" IQs, ELLS, the emotionally challenged, and ADD children, because really, they don\'t have a chance. \n\nThe only recommendation for my teacher/ teacher-trainer improvement plan that has anything to do with the CCSS is:\n5. Get more teachers to teach children to look at word choice, synthesized with tone, mood, and author\'s purpose in regard to setting.\n\nI sat at a table with grads from Cornell, Columbia and a Brown U. attendee who argued tenaciously about answers.\n\nIs Cuomo\'s agenda to make most teachers fail?  So he can look better when the test gets easier next year?  It certainly was not Pearson\'s purpose to test the CCSS.  That I know for sure.'),(309,NULL,0,'5','Observations',',11,5,','Anne Slattery','Teacher','slattery.anne@avcsk12.org',0,NULL,0,0,'2013-04-23 15:53:03','We work hard to teach our students correct reading comprehension strategies (such as close reading) and the writing process.  When they take the test there is not enough time for students to utilize the strategies they have been taught.  I do not understand why these tests have to be timed.  Also, Book 1 and Book 2 are the same skills, reading comprehension.  Do we really need Book 2 and is there any reason to have 6 reading passages?  Are we testing stamina or reading skills? '),(310,NULL,0,'8','Observations',',11,1,2,6,7,','Michael Greenberg','Teacher','mgreenberg@greatneck.k12.ny.us',0,NULL,0,0,'2013-04-23 15:56:44','I thought the exam was exceedingly difficult. Students were pressed for time during every session, every reading passage was at least challenging, and the multiple choice questions were very difficult (sometimes I couldn\'t find the choice I was looking for; sometimes I couldn\'t figure out which of two or three choices was the best one). Day Two was an unmitigated disaster; it was a day that left many students in tears. This is an exam on which most of our elite students can and probably will succeed. I don\'t object to the implementation of the CCSS, and I can see the need to measure that, but there has to be a kinder way. This was just brutal. '),(311,NULL,0,'8','Implications for Instruction',',12,1,2,4,','Erena Fulton','Teacher','efulton@chazy.org',0,NULL,0,0,'2013-04-23 16:19:18','I teach the entire 8th grade and the entire 10th grade at Chazy Central Rural School. One major concern is the instruction time lost for all of my students. My 8th-graders and I spent 4 weeks working on how to take the NYS ELA test instead of honing useful, real-life skills needed for college, work, and life. During the test, I saw students shaking their heads, laying their heads on their desks, and showing signs of giving up because the test is ridiculously long. THankfully, most of them don\'t know the test is loaded with fake test questions that will not even be scored.\n\nIn addition, I did not teach my sophomore classes 3 times last week because I was administering the ELA 8 test. I will not teach them for 2 more days this week because I will be scoring the ELA 7 and 8 tests at CVES.\n\nAnd one more point is important: I am now part-time after teaching full-time for 10 years due to budget issues. The state tests are eating up value dollars that could be used for teaching useful subjects in quality classes. This is unacceptable.\n\nErena Fulton  '),(312,NULL,0,'5','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 16:21:11','In my opinion it is counterproductive to expect 5th graders to be tested for such an extended period of time.  My Special Education students were given double time(as required by their IEPs), yet were unable to finish on Day 3.  Is it wise to expect students to work for that length of time for three days in a row?  What is the purpose?  My students put forth every bit of effort they could muster and applied the strategies they have been taught.  Surely there must be a better way to assess student growth and achievement.'),(313,NULL,0,'general','Ideas for Constructive Action',',13,2,7,','Elizabeth Neild','Teacher','eneild@niskyschools.org',0,NULL,0,0,'2013-04-23 16:26:06','Students with disabilities that read 2 grade levels below their assigned grade level should be assessed using an alternate method. I conduct the NYSAA for a few students in my class, but it should be more widely accepted as assessments for these students (especially as it gets aligned to the Common Core next year). My students must score a 1 on their NYS ELA exams to qualify for the program, yet I will be assigned a negative score for their performance. Several of my students cried or became very frustrated during the test since they are forced to sit through extremely long testing sessions in which they cannot even read the material. I lose over 10 hours of vital instructional time to test for both ELA and math. I would like to help develop new criteria to determine which students should be alternately assessed.'),(314,NULL,0,'6','Observations',',11,1,','Julie Taylor','Teacher','taylor.julie@avcsk12.org',0,NULL,0,0,'2013-04-23 16:55:50','I felt overall that the tests were too long, especially session 2 and 3 that were on the same day.  Allowing students only 90 minutes to do this test was unreasonable.  Students were very frustrated when they knew they were not going to be able to finish.'),(315,NULL,0,'general','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 17:05:39','I feel this test is not an accurate measure of a students growth at all. The test was too long for this age group.  Because of the amount of reading passages, distractor answers, and imbedded field questions you are not getting an accurate reflection of the students\' abilities.'),(316,NULL,0,'general','Observations',',11,1,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 17:08:00','I felt that the questioning was very vague. I think that some important skills could be stressesd if they allow tests to be analyzed by students and teachers so we can learn from these tests.'),(317,NULL,0,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 17:10:58','Although this test was fair in the questions that were asked, I am disheartened at the fact that many of my students did not earn a score based on their true abilities. This was a result of being overwhelmed with the amount of content covered. Since they were overwhelmed they were not able to complete their essays and were cheated outnof earning a 4. They simply ran out of time. '),(318,NULL,0,'4','Observations',',11,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 17:15:31','The questions were very difficult . They  frequently asked the students to refer back to numbered paragraphs, which were confusing.'),(319,NULL,0,'6','Observations',',11,1,','Julie','','',0,NULL,0,0,'2013-04-23 17:25:02','One has to say the students were prepared .  Everything we learned about the exam came true.  Even to the push towards three to four sentences this helps the kids work faster.  What we didn\'t expect was the amount the kids had to do more than what is expected on the SAT.  We are thankful for the pd about the kids we aren\'t thankful for the irrational expectation if the test makers.'),(320,NULL,0,'5','Observations',',11,','Dina Weiss','Teacher, Parent','',0,NULL,1,0,'2013-04-23 17:32:59','How dare you use an article about the Wright Brothers that states they did not graduate high school or college, and yet be focusing on their wonderful contribution to society and how their determination and creative wisdom is what\'s to be valued! These exams are determining who is college and career ready. Are you saying that the Wright Brothers who did not graduate high school are to be looked down upon? So why are you sending that hypocritical message to our children?! Shame on you! All children find their own unique ways to fly.'),(321,NULL,0,'3','Observations',',11,5,','Anonymous','Other','',0,NULL,0,0,'2013-04-23 17:43:30','I proctored the exam for students who missed a test day. The test required shifting back and forth between sections to read and respond over several pages, I suspect this was confusing for many students, by the time you get back to the page you need you forget what the question asked. I will be interested to see how students performed on Day 3 of the test. '),(322,NULL,0,'8','Observations',',11,4,','Debra DiTuri','Teacher','ddituri@socsd.org',0,NULL,0,0,'2013-04-23 18:39:13','Here are my concerns:\nThis test does not measure the best work that my students can do. I spend days teaching my students about good writing and the writing process. However, on day two of the test, they barely had time to write their introduction. Forget planning the essay…editing and revising… there was no time. When one of my students asked if she could start with book three (the essay) first, she was told no. She had to do the multiple-choice first. As an educator, I teach my students to recognize their strengths and weaknesses. There is a reason I’m an English teacher and not a Math teacher. I know myself as a learner. I know my strengths. And so I teach them to know who they are as a learner and make adjustments to achieve their own personal best. So why give them both books at the same time, yet not allow them to choose which to attack first? If I’m a student anxious about the essay and worried about test fatigue, why not let me do the essay first?\nAnnotate! Annotate! Teach the kids to annotate! Teach them to have a conversation with the text, to ask questions, to think about main ideas, author’s purpose, themes and characters etc. But the State didn’t give them enough time to annotate. They want the kids to read deeper into the text, but they are making the text harder to read, longer to read, and adding more questions for them to answer. Completely unfair. \nWhen the kids are asked to answer a question based on line 32, they should not have answers that include interpretations of line 32 both in and out of context. My students are taught to go back into the text and read the line IN the context of the story/article. This includes the line before, and the line after. But the choices the State is giving them include an interpretation of the line in isolation, and also in context. So my students are not thinking about the literature, they are thinking about what The State wants. Is the line meant to be taken literally, or do I go back and see how it functions in the story/article? This is not a question that will reveal anything about the student’s ability to read. This is a question that tests a student’s confidence as a reader. I don’t know about anyone else, but at 14 there was precious little I was confident about…\nThe idea about high stakes testing at every grade level saddens me.  Children should be protected from test results that pigeon hole their potential. Their brains grow and develop at many different rates. If they have a bad day and don’t do well on the third grade test, are they given AIS services? Are they pulled out of their class in front of their peers? How does this impact them socially? Do they now believe they are stupid because that’s what your test told them?\nA school can not be run like a business. We do not work for a company; we work for every individual child. \nThank you for the opportunity to voice my concerns.\nMrs. D. DiTuri\nSouth Orangetown Middle School\n'),(323,NULL,0,'general','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 19:13:23','It is amazing that we were told ahead of time by Dr. King that on these tests that the students were going to do poorly. Now if that is not setting kids and teachers up to fail, I don\'t know what is!! '),(324,NULL,0,'3','Observations',',11,1,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 19:23:51','There was not adequate time for the students to closely analyze the reading and answer the questions. Some of the questions were also very \"tricky\" for students on a third grade level. I was surprised there was not more non fiction text.'),(325,NULL,0,'3','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 19:34:35','The test was way too long. By day three I had so many kids burned out and not care about their responses. Many of my higher readers did not finish and were confused by the questions. Not only did I have mutliple students each day not finish but I had 8 and 9 year old students crying and upset. Why are we doing this to little kids? I feel like a big bully when they are crying and I have to say sorry I cannot help you please reread your question. I now have kids with stomach aches and sudden \"illnesses\" because they are dreading the Math tests. \n\nToo many tests, too many days, questions too difficult and tricky, directions way to lengthy, In short WAY too much for a 8 or 9 year old!'),(326,NULL,1,'3','Observations',',11,1,2,','Robin Hoorwitz','Teacher, Parent','',0,NULL,0,0,'2013-04-23 19:34:40','I do understand the value of developmentally appropriate assessments that inform instruction and provide the necessary data regarding a child’s progress. However, as a third grade teacher and parent, I truly question the motivation behind such an extensive and exhaustive test for third graders, eight year olds. Not only does it somehow assess their ability to read and understand text, it is also equally a test of maturity and motivation. Particularly with regard to the short and extended response questions, some children can truly answer these questions verbally, but have little or no desire to put these responses into written words, particularly after 210 minutes of testing over three days. By the time many of my students got to the extended response question on day three, they were simply DONE. They had little desire to write the perfect response, include details, and display the good writing strategies that had been modeled in my classroom all year long. Does this mean that they didn’t know what to do, or simply were they acting like 8 years olds watching the clock to see how many more minutes of ELA testing they still had to endure? When they receive their scores, with many more falling below proficient than in the past, will they still feel that learning is engaging and fun?\n\nI am so happy that my children have graduated from public education so that they don’t have to endure this undue and potentially humiliating pressure at such a young age. My children were still “college ready” attending top business schools, and feeling good about themselves and their education.\n'),(327,165,0,NULL,NULL,',','Anonymous','','',1,NULL,0,0,'2013-04-23 19:45:42','Everything you wrote is so true and worded so well.  '),(328,NULL,1,'general','Observations',',11,1,4,6,','Anonymous','Parent','',0,NULL,0,0,'2013-04-23 19:52:01','The amount of time spent on these tests is outrageous. The tests themselves take 9 hours of class time, while the entire year of instruction is slanted toward the test.  When New York state tied teachers\' evaluations to the test, they almost guaranteed that students would be pushed harder, and taught less, just so that teachers could save their jobs.  This years round of tests, with the common-core standards is definitely putting the cart before the horse.  No educator, experienced or not, would ever give a test on material that had not been taught, yet that is what NY State has done by implementing the CCS standards the same year they began testing on the material.  Most students do not have the in-depth base of knowledge that the CCS Standards were designed to teach.  How can NY State expect students to pass this type of test.  \n\nSome parents have had enough.  In Saranac Lake, New York a coalition was formed and 54 students REFUSED the test.  \n\nSee links below to contact the group.\n Zoe Smith, Head of the Patents Coalition\n email:zsmith@wcs.org\n\nTo sign a petition to disconnect learning from testing click the link below, (or paste it into your browser):\nhttp://signon.org/sign/new-york-state-our-students?source=s.icn.em.mt&r_by=7401762'),(329,NULL,0,'5','Observations',',11,2,3,','Tanisha Jones','Teacher','tjones@nred.org',0,NULL,0,0,'2013-04-23 19:52:05','The NYS 5th grade ELA exam was way too hard for the children. The types of text they were given were very wordy and challenging above their grade level. The children were very frustrated and discouraged by all that they saw. This test is not a true measurement of what children can really do.'),(330,NULL,0,'4','Observations',',11,1,2,5,6,','Lori Ruede','Teacher','ruede.lori@avcsk12.org',0,NULL,0,0,'2013-04-23 19:54:43','The shift to teaching the Common Core this year was a challenge in and of itself.\n\nOne aspect of the Common Core was to have the students read closely. The test did not reflect that shift. Instead the students were expected to read an abundance of information and answere challenging questions that required the students to go back and reread sections of the text. There just was not enough time.\n\nThe students were clearly frustrated and worried that they did not have time to complete their tests. I told them to do their best and not to worry if they did not finish. I asked them to use the same skills they had used throughout the year and closely read, but many students still worried about not finishing and rushed through the test without taking their time.\n\nAsking our students to think critically and deeply all year long and then having to administer the ELA tests in 70 minutes only created an atmoshere of anxiety!\n\nWhat a shame the students could not have been given a set of tests that would more fairly reflect the Common Core.\n\n\n\n\n'),(331,238,0,NULL,NULL,',2,','Anonymous','Parent','',1,NULL,0,0,'2013-04-23 19:58:25','My daughter was bursting into tears in the evenings and mornings the whole week and into the weekend.  This is very unusual behavior for her.  She was also fighting with her friends in our after school share. She is normally a good student and test taker.'),(332,NULL,0,'8','Observations',',11,1,2,3,','Kristin Klein','Teacher, Parent','kklein@greatneck.k12.ny.us',0,NULL,0,0,'2013-04-23 20:43:58','This assessment was ridiculously hard.  While I am all for raising the standards for student learning, this assessment presented them with a cadre of tasks that left students feeling overwhelmed, taxed, and exhausted.  Day 2 was excruciatingly long; many students with whom I have spoken were either unable to finish all of the tasks, OR finished them in a manner that was slipshod and haphazard.  This was an unfair assessment for students and I do not think it can fairly assess their knowledge, capability, or potential.'),(333,NULL,0,'8','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-23 21:26:51','The language on the test was fair, with a few tricky exceptions. Book 2 was too much work for the time allotted, and very few students finished. This will skew scores and artificially lower student scores due to an overplanned day two. '),(334,NULL,0,'8','Observations',',11,1,3,','Aaron','Other','',0,NULL,0,0,'2013-04-23 21:36:35','The tests were harder, longer and some stories did not make sense. The timing was not appropriate for this type of test and many question required many quotes from the story and required students to flip back and forth thus wasting time. The NYS cannot judge a students performance on just one test!!!!!! A student can just have a bad day or just missed the bus....... I believe this test should be omitted for this year!!!!!!!!'),(335,NULL,0,'8','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-04-23 21:36:57','The tests were harder, longer and some stories did not make sense. The timing was not appropriate for this type of test and many question required many quotes from the story and required students to flip back and forth thus wasting time. The NYS cannot judge a students performance on just one test!!!!!! A student can just have a bad day or just missed the bus....... I believe this test should be omitted for this year!!!!!!!!'),(336,NULL,0,'4','Observations',',11,1,3,','Lisa Giacomo','Teacher','lgiacomo@mtplcsd.org',0,NULL,0,0,'2013-04-23 22:44:12','This test was definitely too long for the average fourth grader to complete in 70 minutes.  The analytical nature of the questions required students to reread the passages more than once.  Many students were not able to write the well-planned responses practiced in class as a result of a lack of time. Many seemed to rush through the last few responses in an attempt to finish the test while others did not complete the test.  Consequently, this test does not serve as a measure of a student\'s true ability.  In addition, one question appeared twice in Book 4.  I feel that if a student did not understand how to apply this question to one passage, they were not be able to do so for the second passage. As a result, it seems unfair to penalize a student twice for the same error or lack of understanding.'),(337,NULL,0,'8','Observations',',11,3,','Audra Emmerich','Teacher','Aemmerich24@gmail.com',0,NULL,0,0,'2013-04-23 22:56:23','The passages were very long and there wer way too many answers that were similar and made,it practically impossible to choose one. '),(338,NULL,0,'4','Observations',',11,1,2,','Roxane Basandella','Teacher, Parent','Rbasandella@westburyschools.org',0,NULL,0,0,'2013-04-23 23:36:19','Readability of tests seemed very fair.  However, 3 days of testing was too much.  By day 3 the children were at their wits end.  They felt tremendous pressure and were tired of sitting for such extended periods of time so many days in a row.  I felt that 30 multiple choice questions was fair, but the amount of work they needed to do in books 2, 3 and 4 seemed a bit unfair.'),(339,NULL,0,'4','Observations',',11,','Roxane Basandella','Teacher, Parent','Rbasandella@westburyschools.org',0,NULL,0,0,'2013-04-23 23:36:20','Readability of tests seemed very fair.  However, 3 days of testing was too much.  By day 3 the children were at their wits end.  They felt tremendous pressure and were tired of sitting for such extended periods of time so many days in a row.  I felt that 30 multiple choice questions was fair, but the amount of work they needed to do in books 2, 3 and 4 seemed a bit unfair.'),(340,NULL,0,'6','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 00:26:43','The test was far too long. Students were struggling to complete it within the 90 minute time frame.rushing and I\'m sure last minute guessing occurred. Why did we need another book of multiple choice and a 3 Rd passage with short answers in book 4 that had no implications in the extended response.'),(341,NULL,5,'general','Observations',',11,','Janet ','Other','',0,NULL,0,0,'2013-04-24 00:32:23','I just wanted to thank the teachers for all the work they have done with the students all year long.  Lets remember all the amazing things I have seen this year, the writing where students were able to tell their story, argue what they felt is important using text based evidence, read texts that challenged them, made them question what they read and what they believe and more importantly work together to help each other grow and succeed.  All these qualities plus more I heard were used again and again during these exams.  But more important thanks to the amazing teachers we get to work with students were able to bounce back and that no matter what the students were able remember how important they are  and how amazing they are.  Looking at students in a number of schools the students were able to bounce back from this exam regroup and remember what is important. Its not about the exam but about the passion they bring with them everyday when they walk through the door.  So I just have to say thanks to all of you out there. You remind us all why we became educators.'),(342,NULL,0,'5','Implications for Instruction',',12,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 00:42:34','I think we should just do test prep all year long if we wish to see our students do well on these state tests!  Read passages, answe multiple chocie short and exteneded responses everyday with the same wording and question types alligned to ccls they will see on the state test.'),(343,33,0,NULL,NULL,',9,','Anonymous','','',1,NULL,0,0,'2013-04-24 01:10:00','I also felt that the directions took too long.  On the 2nd and 3rd day, my students asked me not to read them so they could just get started on the test.'),(344,NULL,0,'4','Observations',',11,5,7,','Johanna Quinde','Teacher','Jquinde2@gmail.com',0,NULL,0,0,'2013-04-24 01:12:08','The test required higher level thinking at all times, it was a test that required students to have reading comprehension and be able to infer from the passages to answer the questions.  Students had to understand the whole passage and be able to relate ideas from the entire passage to answer questions.  To many of my students disadvantage the test passages were at a High 4th grade level.  My students are ELL who were taking the test for the first time due to the time in the country.  To prepare this students for the test was frustrating since they knew that the test was going to be beyond their reading level since they are for the most part reading below a first grade level and they are taking a test that measures their reading comprehension in the Target Language. '),(345,25,0,NULL,NULL,',1,','Anonymous','','',1,NULL,0,0,'2013-04-24 01:14:08','I also had several kids who did not finish in time.  Even my most capable and diligent students had difficulty with the time frame.'),(346,NULL,0,'4','Observations',',11,','Johanna Quinde','Teacher','Jquinde2@gmail.com',0,NULL,0,0,'2013-04-24 01:15:14','The test required higher level thinking at all times, it was a test that required students to have reading comprehension and be able to infer from the passages to answer the questions.  Students had to understand the whole passage and be able to relate ideas from the entire passage to answer questions.  To many of my students disadvantage the test passages were at a High 4th grade level.  My bilingual students that are ELL who were taking the test for the first time due to the time in the country.  To prepare this students for the test was frustrating since they knew that the test was going to be beyond their reading level since they are for the most part reading below a first grade level and they are taking a test that measures their reading comprehension in the Target Language.  '),(347,88,0,NULL,NULL,',1,','Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-04-24 01:26:58','I felt that the inferential questions were expecting 3rd graders to think like adults, from an adult perspective with adult experiences, rather than the nine-year-olds they are.  The test did not seem developmentally appropriate for this age group at all.  70+ minutes without a break is clearly too long.  3 days of this testing is insane.  By the 3rd day, the extended responses my students wrote in no way reflected their true writing abilities.  '),(348,134,0,NULL,NULL,',1,2,','Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-04-24 01:34:57','I completely agree that the number of passages was unnecessary.  Who in the real world does that and why would they read so many unrelated passages back to back in 70+ minutes?  This is not something we would ever do in the classroom as part of our school day.  Couldn\'t the passages at least be related in some way along with the extended response question? There was just too much new information for a third grader to try and process in the time allotted.'),(349,261,0,NULL,NULL,',1,','Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-04-24 02:02:45','It actually makes me quite angry thinking about my 3 students with severe learning disabilities who were forced to take a 70 minute test, 3 days in a row, on reading material well beyond their current abilities.  In addition to this, we were forced to waste what could have been valuable learning time for them going over testing procedures and test expectations.  This test was of no value to them, their parents, or me as their teacher!   '),(350,NULL,0,'3','Observations',',11,1,2,','Margaret Edwards','Teacher','edwards.margaret@avcsk12.org',0,NULL,0,0,'2013-04-24 02:05:23','I had many students that were unable to finish the tests in the time allowed.  This created a lot of frustration and stress, which accumulated as the days of testing continued.  I feel the number of questions should be reduced rather than lengthening the time, since 70 minutes a day for 3 days is a LOT of time dedicated to testing 8 and 9 year olds!'),(351,38,0,NULL,NULL,',','Sara','Teacher, Parent','followthelight@gmail.com',1,NULL,0,0,'2013-04-24 02:05:40','Full disclosure: I am having a hard time believing you. Is this Susan Ohanian writing? This is just too crazy a stack of hyperbole. Vomiting. Pissing pants. Hysterical and sleepless prior. Wow! \n\nBut I have to tell you, if ALL this is true, and my child or grandchild were in your class, I would be working really hard to have you dismissed. Children are malleable and impressionable. Left alone, they are agnostic about tests, generally do their best and shrug it off on the playground after (I am a thirty year NYC educator as well as a parent and grandmother. I know of what I speak). \n\nIf this pattern of distress is true, YOU made your kids this anxious. YOU worked them up prior. YOUR bad attitude is standing in your children\'s way. How come children all over Asia and Europe and Australia and New Zealand can handle the academic rigor we are (SOME of us are) trying to attain and assess in the US and you can\'t help and encourage your students children to do their best and tell them that their best is all you ask?\n\nYou really need to get out of the way and let your children prosper with an adult who believes in them as full-blooded, durable and spirited human beings. \n'),(352,NULL,0,'4','Observations',',11,2,3,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 02:13:34','This was the most ridiculous assessment I\'ve seen in my 15 years as a general ed. teacher!  The only positive was I thought the reading passages were fair and engaging.  The questions were incredibly difficult for a 4th grader.  If teachers are disagreeing over answers imagine how a 9 year old felt.  You had to flip back and forth so many times for each question that students began worrying if they would finish.  I don\'t think the assessmnet fairly tested reading comprehension but how it can frustrate students and test their level of perseverence.  Not for nothing but in the real world do we read stories that have numbers next each paragraph?  Questions like does this sentence predict paragraph 5? 6? or explain 10? 11?  Seriously?????\nI couldn\'t believe that day 2 had more multiple choice comprehension questions.  The first day wasn\'t enough?  '),(353,281,0,NULL,NULL,',1,','Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-04-24 02:21:26','I am shocked and saddened to hear this response from a principal.  I do think an argument could possibly be made for the questions and reading material on their own being \"on point\".  However, the \"perfect amount of time\" for a 3rd grader to sit and read unrelated passages, answer rigorous questions, and write an extended response with no break is certainly not 70 minutes, 3 days in a row!  I would be very interested to see what a child development specialist has to say about this and pray that someone is pursuing that information.  And we are certainly talking about far MORE than 1 or 2 who struggled with the level of difficulty AND time frame.  These are NOT students who qualify for the accommodations you mentioned, they are the average and high-achieving 9-year-olds.    '),(354,308,0,NULL,NULL,',2,4,','Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-04-24 02:41:04','I completely agree.  It makes me sick to think of the amount of money the state has given Pearson for a test that is truly of no value.  Pearson will be given even more money in the years to come as they rewrite the test, trying to make it right.  It was widely publicized by the media that SED expected low scores.  On the first day of testing, as students were discussing their anxieties, one of my students said, \"No one expects us to do well anyway, so don\'t worry about it\".  She had been told this by her parents who were trying to relieve her anxiety.  I wish more parents had chosen to \"opt out\".  I wish I could have suggested that parents \"opt out\" for those children who never stood a chance.    '),(355,326,0,NULL,NULL,',2,','Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-04-24 02:59:41','My students also had little motivation left by the 3rd day of testing.  They already felt defeated.  They saw no reason left to even try their best.  Unlike classwork or typical curriculum tests, they knew they would not be asked to correct mistakes or edit their writing to reflect their true capabilities.  They knew this test score would not be reflected on their report card nor would it prevent them from being promoted to fourth grade.  Their parents and teacher would not even know their score until they were carefree on summer vacation.  My cheers of encouragement for them to persevere through this rigorous test fell on deaf ears by Day 3.  They simply saw no reason to do so and I\'m not sure I do either.  '),(356,NULL,2,'general','Ideas for Constructive Action',',13,','Lucy Calkins','TCRWP Staff','Lucycalkins@comcast.net',0,NULL,0,0,'2013-04-24 03:06:17','To all who have contributed to this site--or who have read and agreed with it:\n\nThe site contains a lot of valuable information. We\'d love suggestions for how we can organize the site so it is more useful, and how we can bring this information to people who can make a difference.\n\n'),(357,NULL,0,'3','Implications for Instruction',',12,6,','dmm','Teacher','dmantrone@aol.com',0,NULL,0,0,'2013-04-24 03:11:37','Passage Selection - I was surprised at the limited range of texts on the third grade ELA test. Obviously we teachers were aware of the increased emphasis of nonfiction  - which I have no qualms about. We\'d also been told that on the test the types of texts would be more varied (stories, plays, poems, websites, biographies,articles, etc. - there was an extensive list of possible types). Yet on the third grade test, the types of texts were very traditional - one poem, several short stories, an excerpt from a novel and several nonfiction articles. So much for diversity of passage types! And there were, I believe, a total of 11 passages over the 3 days, so there was certainly an opportunity to vary texts.\n\nOf equal or even greater concern to me is the type of NONFICTION passages. There was an overabundance of science/technology articles. Only one passage could be called historical, and it was a very boring article! Given the subject matter of that article - there were plenty of options - nteresting primary and secondary sources that could have been included instead.  One passage, I suppose, could be labeled history/technology - to be honest, but. the majority were definitely science related passages.\n\nI am concerned that since there is NO Social Studies testing anymore, that history/social studies types of texts will NOT be emphasized, resulting in continued reduction of the value and important of social studies and history as part of the K-8 curriculum. This de-emphasis is certainly reflected in the limited selection of passages on the third grade test - and I  would not be surprised if this held true throughout the grades.\n\nThis unequal focus on content area subjects is unfortunately in line with the Common Core and current societal trends pushing an emphasis on graduating \"workers\" as opposed to informed, educated citizens who understand and appreciate history as a teacher and informer of current political and social issues. What are the implications, as teachers and schools see social studies topics NOT having an equal footing on these tests? I already know of NYC schools where students are not getting the state required minutes of SS and Science because of literacy/math demands. Will whatever time is left over for these 2 content area subjects result in Science \"winning\" the limited time demands?  Shame on NYS for this blatant neglect of the historical record of our country, the world and of current events. It sends the wrong message to schools, teachers and students about the importance of learning about our past and understanding (and evaluating) events that have made are affecting the world today.'),(358,NULL,1,'general','Observations',',11,1,4,10,','Dave S.','Parent','drs32@rochester.rr.com',0,NULL,0,0,'2013-04-24 03:29:38','If I took my child to the doctor and the doctor said, \"Your daughter is sick and needs medicine,\" I would ask, \"What are you prescribing?\"  If the doctor replied, \"I can\'t tell you and I won\'t.  Protocol dictates that in these cases, patients take this medicine.  You may not opt out.\" I would be out of that doctor\'s office faster than you could say High Stakes Tests.\n\nYet in school, we freely give our children over to state employees (called teachers) who dutifully administer this exam which, we\'re being told, suddenly has the predictive powers of an aptitude test like the SAT to inform us of who\'s college bound and who\'s ... not?  Is the state proposing tracking many more students into vocational careers and away from college?\n\nWe are witnessing, as a result of the common core standards and assessments, a corporate intrusion into our public schools the likes of which we\'ve never seen in the history of American education.  \n\nThe shortcomings of this test and the resulting failure of many, many students (most of which could have been avoided with more time to take the test) will fuel the fire of the reform movement, providing fodder and soundbites in the coming months.  We\'ll hear ranting like \"Well, sure, the scores were going to dip a bit ... but come on!  Thirty percentage points in just one year?  Are you kidding me?  What are these teachers doing??\"  Next will come the accusations that schools are failing miserably (actually, we\'ve been getting told that since the 1950s, but last I checked we\'re still the sole economic and military superpower on the planet).  Finally, Bill Gates and his sycophants at Achieve and PARCC will trot out new tests, damaging new curriculums will follow, and, if all goes well for the reformers, a self-fulfilling prophecy will spell doom for public schools.\n\nAnd all the while, Finland, Cananda, Singapore, and the rest of the world laugh at us.  And continue to beat us senseless at our own standardized testing game.'),(359,NULL,0,'4','Observations',',11,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 08:44:25','two questions on setting on day 2 was not fair.  If a student has difficulty explaining why the setting was important to the story with details in one question why penalize them twice?'),(360,NULL,0,'3','Observations',',11,','gary baldwin','Teacher','baldwingar@slcs.org',0,NULL,0,0,'2013-04-24 09:33:30','I witnessed a learning disabled student work for 2 hrs 56 min. on part one with out taking a brake.  She probably got about 50% of the questions correct.  On part two, after another grueling session, suddenly she broke down - wracking sobs- \"It\'s to hard!\"  over and over.....'),(361,NULL,0,'6','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 09:46:16','Part 3 extended response did not specify which story was to be referenced. As a result many students were confused and used the incorrect story to answer the questions. '),(362,NULL,0,'4','Observations',',11,4,','James VanCour','Teacher','juneau@ridgeviewtel.us',0,NULL,0,0,'2013-04-24 12:07:07','Those who can, TEACH! Those who cannot, pass laws about teaching!!! Once again, another year, another test, another NYS blunder...Congrats!!! Race to the top (RTT) is defined as a CONTEST for 4.3 billion dollars in federal funding to states who meet criteria. I didn\'t realize our profession was about a contest. Sad to say the least! All of this with no regard to our students. '),(363,NULL,0,'8','Observations',',11,8,','Anonymous','Other','',0,NULL,0,0,'2013-04-24 12:28:16','Having two books in one day was absurd. Students were overwhelmed with having to switch gears and books halfway through testing. Not to mention it being an administrative nightmare trying to sort 4 books instead of three. Please do away with having two books in one day for next year. Many of my students didn\'t finish the writing portion on Day 2 because of this. '),(364,NULL,0,'general','Observations',',11,4,','Anonymous','Teacher, Parent, Other','',0,NULL,0,0,'2013-04-24 13:03:21','Common Core Standards designers are nothing but Progressive Communist Radicals.  This program has it\'s foundation in the works of Dewey, Alinsky, and Cloward-Piven who\'s primary objective were to subvert the U.S. Constitution and destroy the Middle Class (Religion, Family, and Eduction) in order to bring about a Communistic / Fascist Hybrid form of government.  Obama, Clinton, Duncan, Darling-Hammond, Aronson, Wharton and a whole host of other education criminals, are all Alinskiites.  This movement is being driven by Soros and Gates funding and has nothing to do with improving the quality of our educational system.  I personally am spreading the word to my fellow educators, therapists, friends, and family to do their own background studies of who and what is driving this B.S.  My own community organizing is going well with over 50 educational professional made aware of what you clowns are doing, and they\'re pissed.  To a one, those educators, with children in the system, will be keeping their own children home moving forward.  Eventually, the people of this Country will hold you and your ilk responsible for your treasonous actions.'),(365,NULL,2,'4','Observations',',11,7,','Michelle','Teacher','mrumble@boces.com',0,64990,0,0,'2013-04-24 13:03:50','I had kiddos pulling on their hair, balling up their little fists and crying due to the tests. This is not acceptable. I have a MA in SPED and my undergrad is in ELA and some of the wording of some of the questions - I wasn\'t even sure what they were looking for... My kiddos are SPED and they can\'t use their testing accomodations? What do you think they have them for?'),(366,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 13:28:08','I believe the test was fair, but there was some terms that confused the students when answering the questions. I also felt for all grades 4,6,8 that the time that was given for each questions was not enough for the students to accuratly answer to the best of their abilities.'),(367,NULL,1,'5','Observations',',11,1,5,','Tim Butler','Teacher','',0,NULL,0,0,'2013-04-24 13:28:15','The test was too long. You want us to use \"close\" reading and other strategies to comprehend difficult texts, yet you do not give us enough time to do them. \n\nWhy is part two even a part of the test? Was there not enough multiple choice questions on part one? How many of those questions were field test questions? '),(368,NULL,0,'general','Observations',',11,4,','James VanCour','Teacher','juneau@ridgeviewtel.us',0,NULL,0,0,'2013-04-24 13:33:34','Do we want a diversity of talents from individuals who are passionate, curious, self-confident, and risk taking, or do we want a nation of excellent test takers with outstanding performances on math and reading test? Obviously, state and federal gov. have chosen test scores in a limited number of areas over diversity, individual interests, and creativity. A narrow minded point of view that doesn\'t foster growth but limits growth to three days and four test. Why???...MONEY'),(369,NULL,0,'general','Ideas for Constructive Action',',13,4,','Cheryl Tyler','Other','janectyler@aol.com',0,NULL,0,0,'2013-04-24 13:41:29','I believe that the emphasis on high stakes testing is the civil rights issue of the decade: kids are being held over, schools (all in high poverty neighborhoods) are being closed and teachers are threatened with being removed from the classroom because of their students\' performance on two tests. This emphasis on testing comes from national policy and is implemented on the state and local level.\n Strong coalitions of voters need to be formed to let politicians know that this emphasis on testing is the antithesis of educating children to become thoughtful, analytical and  reasoned citizens.\n'),(370,NULL,0,'6','Observations',',11,1,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 14:47:32','The amount of time given on day two was not nearly enough for a majority of students.  We had numerous students, high academic students, not able to finish due to the amount of work necessary.  How is this then an accurate reflection of their capability?  The test was extremely long, with questions and answers that were beyond most ability levels for 6th grade students. '),(371,NULL,0,'3','Observations',',11,3,8,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 14:58:14','I thought the passages selected were fair.  Even for a student that has more diffiuclty reading, the passage length and difficulty level was appropriate for grade 3.  However, the wording of the questions was difficult.  As teachers, we struggled on some questions to know which answer might have been the correct choice when viewing the test.  That, in my opinion, is not grade level appropriate for 3rd grade.'),(372,NULL,0,'3','Observations',',11,1,3,8,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 15:04:16','I thought the passages were too long for the amount of time given.  I had a high number of students that did not finish in the amount of time given on all three days.  The wording of the questions was difficult.  As teachers, we struggled on some questions to know which answer might have been the correct choice when viewing the test.  The expectation that students need to keep 2 separate sets of directions for Book 2 and 3 straight within the same time period is unrealistic.  The students are 8 and 9 years old but we expect them to respond and act much older than they are.  '),(373,NULL,0,'5','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-24 15:29:29','As a parent of a 5th grade boy, I would like to express my concern regarding the stress that my son felt before and during these exams. Is 3 days of testing seriously necessary? It seems incredibly contrary to expect a young boy to sit still for 90 minutes, 3 days in a row, and expect him to do well.\nNot one study on child development and expectations that I can find recommends this as good practice.'),(374,NULL,0,'general','Ideas for Constructive Action',',13,1,4,5,6,','Patricia Fabrizio','Teacher','fabriziop@mail.ircsd.org',0,NULL,0,0,'2013-04-24 15:45:45','I have been, and continue to be, a supporter of the CCLS and believe that students will benefit from instruction which based upon student learning targets driven the the CCLS.  The CCLS and the \"shifts\" encourage deep understanding of text demonstrated by effective close reading and academic writing demonstrating a student\'s ability to write evidence based claims.  It\'s all good STUFF!\nMy concerns begin with assessment that requires students to function as noted above...very time consuming...and then placing time restrictions upon those students.  Interestingly enough, the time restriction frequently impacts our most capable students, those \"diving\" most deeply into text, the most.  \nFinally, to the constructive action point: GIVE THE STUDENTS THE TIME AS THEY NEED TO COMPLETE THESE COMPLEX TASKS!'),(375,NULL,0,'7','Observations',',11,1,2,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-24 16:53:17','My daughter is a conscientious student who was overwhelmed both by the length of the exam and the pressure put on her to do well. We are turning school into a culture of fear. We are placing too much emphasis on tests that have not been properly piloted and in some cases that ignore developmental differences among children. The notion that all children must learn the same things at the same pace \"or else\" is the antithesis of good instruction and assessment. '),(376,NULL,0,'8','Observations',',11,1,2,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 17:01:13','Overall, I have no objection to the concept of creating a more rigorous test to match more rigorous standards.  However, the test was much too long, and incredibly redundant in terms of types of questions.  First of all, one set of multiple choice questions, short response tasks, and one extended response would reveal the same skill level as what was actually administered.  Not only did most students not finish in the time given, but they were mentally exhausted (one student with dyslexia took 100% extended time, and proceeded to cry when he finished the test.  When asked what was wrong, he responded, \"I\'m so tired.\").  In addition, administering an inordinate amount of tasks will now require more grading on the part of teachers than is actually necessary to assess skill level (this means more time out of the classroom).  Second, the overload of questions did not even contain widely varied tasks.  There were more context questions than one can count.  Finally, the 8th grade Math exam was so short in comparison, that on day one, students finished in 35 minutes, whereas they were unable to complete the ELA exam.  Yet, my SLO score will come from a test into which I was given no input, and was too long for even my most capable students to complete.  My suggestion is this: Day 1, multiple choice; Day 2, short answer questions; Day 3, extended response.  There was absolutely no reason for Books 2 and 3.  '),(377,NULL,0,'4','Observations',',11,9,','laura','Teacher','',0,NULL,0,0,'2013-04-24 17:41:14','grade 4 instructions on day 2 were missing in student booklet but referred to in teacher directions that were scripted to be read to the kids. It was confusing at at time when it was confusing enough becasue it was the 2 book day'),(378,NULL,0,'6','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 17:44:34','This may have already been said, however, it needs to be said again.  Day 2 was too long!   90 minutes was not enough time for students to read , comprehend, analyze, and then respond in writing.  Top students could not finish the test on day 2.'),(379,NULL,0,'6','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 17:46:09','I don\'t think there was a correct answer to question #33.\nInsufficient time to finish Book 3 and 4.\n\"Sweetest cherry of all,\" really?\nLack of precise directions to essay in Book 4 - which passage do we respond to?\nLastly, what is a \"response\"? Do they mean for the student to write an \"essay\"? \n'),(380,19,0,NULL,NULL,',','Anonymous','Teacher','',1,NULL,0,0,'2013-04-24 17:48:51','I often wonder if we look at these tests and remember the age of the children taking them.  Looking at both content (types of questions) and time on task.  Neither seemed appropriate for our students'),(381,NULL,0,'8','Observations',',11,1,2,6,','Theresa Walter','Teacher','twalter@greatneck.k12.ny.us',0,NULL,0,0,'2013-04-24 17:54:04','The test seemed exceedingly lengthy and cruel.  The test asked the children to perform many of the same tasks repeatedly - like answering seven short response questions over two days in very little time.  Our curriculum has changed to match the challenges of the Common Core, most of which I truly believe is meaningful and purposeful.  These tests, however, seemed to undermine the skills we\'ve practiced - close reading, careful observations, connecting to theme and author\'s purpose.  Students were given too much to do and they responded by rushing.  Many did not finish and our very best students came out from the rooms in tears.  Did not seem fair - in fact, seemed brutal.  We all pay when it comes to these high stakes tests - but it seems criminal to punish twelve and thirteen year old children this way.'),(382,NULL,0,'7','Observations',',11,1,3,','Aaron Montgomery','Teacher','amontgomery@mamkschools.org',0,NULL,0,0,'2013-04-24 18:03:25','This was much more readable than expected.  There are two concerns that I have:\n\n1. The time constraints of Book 2 and Book 3.  Students felt incredibly rushed throughout Day 2.  Our school places a good deal of emphasis on writing, and for a student to complete an extended response and three short responses after completing 21MC questions was overwhelming.\n\n2. While I appreciate the increased difficulty in the test, looking for the \"best\" answer seemed to be excessive.  The students claim that many questions had four possible answers, but one \"best\" answer.  Text evidence and rereading was essential for accurate answers.  According to the students, that type of depth in question comprehension is incredibly time consuming and stressful.'),(383,NULL,0,'8','Observations',',11,4,','L McCurdy-Little','','lmccurdy@mamkschools.org',0,NULL,0,0,'2013-04-24 18:18:54','It was disappointing to find out that some students got to see the test ahead of time and go over it with their teachers? That isn\'t fair:\nhttp://www.nydailynews.com/new-york/practice-material-found-upstate-exams-article-1.1321448'),(384,NULL,0,'general','Observations',',11,1,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-24 18:54:36','Having been involved in scoring the ELA assessment I am concerned with the inconsistencies in the training, practice and CAS guide papers for the Short Answer responses and essay questions.  Not only were the phrasing of the questions poorly worded, but the guide papers were confusing and in many cases appeared to arbitrarily assign scores to responses.  When a room of professionals question the rationale of the answers provided it should be apparent that the question is poorly designed. The short answer response and essays are  subjective and are not a fair way to assess our students.  Many of the students were not able to complete the essay or appeared to run out of time as their responses showed they were racing to finish.  Some didn\'t even get to start the essay. \n     '),(385,NULL,1,'8','Observations',',11,1,3,','Kristi M. Willis','Teacher','kwillis@greatneck.k12.ny.us',0,NULL,0,0,'2013-04-24 18:59:48','1)  There were several questions for which there seemed to be two arguably correct responses.  I realize students were asked to discern \"the best\" possible response, however, it made me pause to consider what was actually being tested.  If the point of the ELA is to determine how well they understood the literature by reading it on their own, why offer responses that might be labeled as \"tricky?\"  I realize there must be some low-, medium-, and higher-level questions in order to determine student\'s various ability levels, however, if you provide two correct responses, but only select one as the \"correct\" reponse, then it\'s simply not an accurate measure of a person\'s comprehension.\n2)  Days 2 and 3 seemed somewhat redundant.  Both required reading and answering questions...why do we have need for two days of testing the same skills?'),(386,NULL,0,'general','Observations',',11,4,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 19:01:17','\n\nTo Whom This may concern:\n\nI personally feel that the Government and everyone else involved with the system of educating children should be ashamed of how they are setting children up for failure. These exams are nothing but money making tools for the rich. Students\' abilities nor accountability is being considered. There is no accountability on no one, but teachers.\nHow in the world can a teacher be accountable for students\' performance when there are so many external factors affecting their performance. These exams are beyond our students\' levels of performance. They are not even developmentally appropriate. The true objective of the tests are to rid our nation of public schools and unions that protect teacher\'s rights. In addition, these tests do note qualitatively, nor quantitatively demonstrate student\'s knowledge or skills. This NATION does not care about anything other than money. Meanwhile, we wonder why we are reverting to a third world nation? Our children will never be able to compete when GREED is at the forefront! '),(387,NULL,0,'general','Observations',',11,4,','Mark','Teacher, Parent, Other','',0,NULL,1,0,'2013-04-24 19:20:43','Having been a Biology teacher and a Occupational Therapist for nearly 30 years, it never ceases to amaze me, what these clown in their academic towers produce.  How many successful models have been produced in the past 50 years?  Every four years it\'s a new and improved model, which produces worse result.  We have the most highly educated, committed, teachers in the world, yet they are continually hamstrung by these ludicrous academicians.  Most of the jokers, who write these programs. have abysmal records of success themselves as educators.  Yet somehow they are considered \"Leaders in our field\".  I recently saw that Bill Ayers was honored by a national teachers union in Atlanta!  You have got to be absolutely kidding me.  Ayers and his group \"The Weather Underground\" are serial murders and bombers, yet our profession is honoring him.  As as earlier poster noted, there are a significant number of questionable individuals involved in the writing of the core standards.   Educators and parents need to take back education and start thinking about\'s what\'s best at a \"local level\" for their children. One size fits all education clearly doesn\'t work in a society as diverse as ours.  Common Core Standards equals centralized control and removal of the States academic automony. Look around you, what program has the Federal Government ever run, that wasn\'t full of corruption and incompetence?'),(388,NULL,0,'6','Ideas for Constructive Action',',13,7,','Melinda Preston','Teacher','preston.melinda@avcsk12.org',0,NULL,0,0,'2013-04-24 19:28:55','It is very challenging for Special Education students with reading disabilities to read at grade level.  How can we assess their writing if they are unable to read the text they are to write about?  It would seem more appropriate for students with disabilites to have accommodations that will allow them to demonstrate what they do know, not to create an environment of failure.  Would it be possible for students with disabilities to be assessed at the level they are performing at within the classroom?  That would seem more fair.'),(389,NULL,0,'4','Ideas for Constructive Action',',13,','4th grade teacher','Teacher','',0,NULL,0,0,'2013-04-24 19:35:46','I teach 4th grade and felt the test was fair and does set the bar high for our students in the future.  My take-away is that responding to literature in a written format is truly the only way to demonstrate one\'s understanding of a reading and that through additional practice with writing responses to reading, students will be successful with this type of test.  However, this learning and practice really must come for all prior grades starting in Kindergarten and not wait until 4th grade to begin a focus on writing.'),(390,NULL,0,'7','Observations',',11,1,','Claudia Montecalvo','Teacher','cmontecalvo@spencerportschools.org',0,NULL,0,0,'2013-04-24 19:41:48','I do not understand how within one article there could be two different spellings..  The test, itself, was OK.  However, kids needed more time to actually complete the test.  I doubt that any adult could read 5 passages, complete multiple choice questions(using strategies that require look backs), answer BAF paragraph questions ( that require text details), and complete an essay within a 90 minute period.  \n\nIs this a test that is meant to check for literacy and writing, or see who is the quickest?  Adults go through the writing process, then edit, and then rewrite.  We, unfortunately, do not allow 12 year olds the same consideration...   Kids\' placement for the next year depends upon this. Then, we give them 2 more days of testing just like this. How dare we do that to children?\n\nRegardless of what you think, I am not worried about my job security...  I have been an effective teacher for 30 years.  Last year, I was \"highly effective.\"  As a \"highly effective\" teacher, I find testing in this fashion totally ineffective.'),(391,NULL,1,'8','Observations',',11,1,','Anonymous','Other','',0,NULL,0,0,'2013-04-24 19:58:04','honestly this test was UNFAIR. The state should take in consideration of students. THIS TEST SHOULD BE OMITED THIS YEAR, AND IF THEY DECIDE NOT TO, KIDS SHOULDNT BE PUT INTO A SUPPORT CLASS. I HARDLY HAD ANY TIME TO FINISH THE ESSAYS AND SHORT RESPONSES. IF THEY DECIDE NOT TO OMIT THE TEST, NEXT YEAR THEY SHOULD AT LEAST MAKE IT EASIER. I THINK ITS TOTALLY UNFAIR AND THE ELA SHOULD BE NOTED ABOUT THAT.'),(392,NULL,0,'8','Observations',',11,1,','Donna','Teacher','Miller',0,NULL,0,0,'2013-04-24 21:29:07','Day two of the exam was far too long to be completed by most students. The level of background knowledge needed to complete the written part of the exam was too high.  If this is a reading test, the prompts should only be related to the reading and not assume students know about magnetism or what an air shaft is.'),(393,NULL,2,'3','Observations',',11,1,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 21:38:50','The passages for third grade were very long.  The types of questions were unfair.  For example the question \"Why is the setting important to this story?\"  Most students know what setting is and that is how they responded to the question.  They wrote what the setting was.  That concept for an 8 year old is unrealistic.  That is just one example.  Another is the field tests.  If Pearson wants to research they need to do it another way and not at the expense of the students.  Also there was an identical passage and question types used for 3rd, 4th, and 5th grade which is unfair as well as all the other issues. This is just the third grade'),(394,NULL,0,'5','Ideas for Constructive Action',',13,1,5,','MaryJo Capuano','Teacher','mcapuano@portchesterschools.org',0,NULL,0,0,'2013-04-24 21:39:23','The 90 minutes allowed for Gen. Ed. students was not enough time to read, comprehend, and answer all of the questions. We teach the children to do a \"close read\", but that was not possible with this test. It felt like a race to the finish. '),(395,NULL,0,'4','Observations',',11,1,','Anonymous','','',0,NULL,0,0,'2013-04-24 21:41:50','Passage were too long and required background knowledge that the student did not learn yet because it wasn\'t aligned with social studies content for that grade.  Tricky questions as well.  There is so much wrong with this test.  Field tests were unjust.  Pearson should do research on there own not at the students\' expense.  '),(396,NULL,0,'general','Observations',',11,6,7,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-24 21:50:41','I am a Literacy coach.  We have been aligning our curriculum with Common Core State Standards in full just this year.  To change the exam to be totally aligned to CCLS was just unfair.  What was that about.  The students worked hard but no matter what kind of teacher you are  there was no way to prepare the students for that test.  Boring long passages, unfair questions where choices were so close to the right response, Asking them more about author\'s craft and things of that sort instead of questions about the actual test, Passages that that were not aligned with the Social studies and or science for that grade so the students didn\'t have any background knowledge.  Most of all the Field tests that were embedded, how ridiculous is that.  Pearson is so out of control.  Doing research on the students\' expense is just horrible.  Also plugging in name brands as some sort of advertisement really?  I thought the exams as a whole were unrealistic and totally unfair to these poor children.  Students with and without disabilities struggled as well as the ELL population.  '),(397,NULL,0,'7','Observations',',11,2,','Tara Molloy-Grocki','Parent','tmolloygrocki@yahoo.com',0,NULL,0,0,'2013-04-24 21:53:38','My 7th grade son came home totally defeated all three days. He said the stories were long and the questions didn\'t make sense. He said he spent much of his time just trying to figure out what they wanted him to answer. He felt rushed and on several answers just put down anything because he felt he had to rush to finish the test. This makes no sense. This is not going to show what a great thinker he is or how smart he is. '),(398,NULL,0,'8','Observations',',11,1,2,','Justin','Other','',0,NULL,0,0,'2013-04-24 22:42:20','I have to say, on the part two and three, instead of reading carefully and analyzing the passages, I was forced to rush through it all because I felt as if I had no time at ALL to finish. Even when I rushed I finished with 3 minutes left. Some of my classmates were crying because it was so difficult and none of them finished. WE NEED MORE TIME!!!!'),(399,385,0,NULL,NULL,',3,','H. Sanchez','Teacher','hsanchez@optonline.net',1,NULL,0,0,'2013-04-24 22:56:59','This is one of the points I made as well.  If there are two answers that are both 100% correct, how is one \"better\" than the other?  Correct is correct.  There is no need for this \"gotcha!\" kind of crap.  Ask sensible questions that will determine if the student understood the passage; don\'t try to trick them. '),(400,NULL,0,'7','Observations',',11,','Chris Wierzbicki','Teacher','cwierzbicki2@schools.nyc.gov',0,NULL,1,0,'2013-04-24 23:15:09','Day 3 had two reading passages on the Gold Rush.  One used Klondike and the other used Klondyke.  Students were asked to write an essay comparing the two stories.  A student asked me how he should spell it.  Why include two passages that describe the same thing using two words that are spelled differently?  Confusing to some students.'),(401,NULL,1,'general','Observations',',11,4,','Chris Wierzbicki','Teacher','cwierzbicki2@schools.nyc.gov',0,NULL,0,0,'2013-04-24 23:21:26','This year has been all about assessments.  Pre assessments, post assessments, exit tickets, etc.  We have been told to grade quickly and return to students to give them meaningful feedback and further guide instruction by learning from their mistakes.  Why is it that their MOST IMPORTANT assessment of the year, these tests, will never be viewed and turned into a learning experience?  Seems like hypocrisy from the DOE and the test manufacturer.  Parents need to file FOIA requests for the test AND SOON, before all evidence is SHREDDED!'),(402,26,1,NULL,NULL,',4,','Anonymous','','',1,NULL,0,0,'2013-04-24 23:40:53','It will take a lawsuit, and I\'m not kidding.  I have several parents who are looking into it.'),(403,NULL,0,'6','Observations',',11,1,2,3,6,','D. Frisina ','Teacher','Dfrisina@aol.com',0,NULL,0,0,'2013-04-24 23:58:38','I\'m still in shock. As a 6th grade ELA teacher, I admittedly felt sorry for my students. I stand behind the Common Core and the effort of all to bridge the educational gap and foster college and carrer readiness.  As a school, we have stood behind the standards, aligned all of our curriculum and pushed our students day in and day out.  All of this was shattered as we sat in our Bronx classroom shaking our collective heads as our students fumbled to finish and battled with time.  Yes, 90 minutes is not enough time to critically examine multiple texts and construct responses.  Yes, reading an enormous amount of words in both texts and questions is a bit excessive.  Yes, requiring teachers to read a direction script to students that may range from 15-30 minutes to complete is outrageous.  Is this what we have come to?\nI watched as my students read each text at surface level, forgoing almost every strategy that they have learned as it pertains to close reading and critical analyzation of the text.  I watched as the \"quote dropped\" in their written responses that they hurried through in order to finish on time.  I shook my head as the collectively forgot who they were as writers and discarded every period of writer\'s workshop.  And how about the field questions? \nWhat pains me the most is circulating as I proctored the Math Exam today. 34 questions for day 1? I don\'t mean to gripe as I found this fair to my students and they honestly agreed. However, what accounts for the workload variation by subject? In order to even attempt to answer a question, a student must sift through an ELA text, then answer text-dependent questions that force the student to analyze the text, in addition to understand the academic vocabulary present in the question stem.  Where was that on the Math Exam?  The simple answer is it had no place. Why then must we force our ELA students through and elongated labyrinth of reading?  And if we do, why must we time it?\nThe purpose of this is not to complain about the differences between subjects. As an observer, I would however be remiss if I did not point out there is not a level playing field as it pertains to the structure of the two tests.  My math students were able to use practical strategies, whereas my ELA students cast aside a year\'s worth of growth and progress in an effort to just finish... \nWhat we have become and who we will grow into will be defined by the measure by which are students are educated. I just hope that we are careful in our practices. As it stands, we have just set a terrible precedent... Forget what you know to be right and focus on responding a manner that will provide you with a maximum amount of points. \n\n'),(404,72,0,NULL,NULL,',4,','L Cummings','Teacher','',1,NULL,0,0,'2013-04-25 00:04:12','I\'m pretty sure you can see your child\'s exam after it has been graded and returned to the school.  I believe in order to see it that you must set up an appointment to sit and look at it in the presence of a school administrator.  You aren\'t permitted to copy it or take it with you though.  I think the powers that be don\'t announce this information per se because it would take a crazy amount of time if all parents did this.   Hope this info is helpful.  '),(405,27,0,NULL,NULL,',','T','Teacher, Parent','tjdunnederrell@gmail.com',1,NULL,0,0,'2013-04-25 00:11:04','That must be a new thing- this is my first year out of the classroom and it seemed to me that the reverse was true. I\'m glad I wasn\'t giving the test this year- one tip I used to share was that the harder passages were at the end and that starting there might be a good idea. '),(406,NULL,0,'3','Observations',',11,2,7,','lovetoteach','Teacher','amzoo4@aol.com',0,NULL,0,0,'2013-04-25 00:15:53','I administered this exam to my 16 bilingual students, one of which has only been in the US for 13 months. Many of the passages contained phrases and expressions that my students could never have understood. Glossaries were available for them, but they were useless. Many of my students looked and felt defeated by the end of the tests. I am saddened by what has become of our educational system and what it is doing to our children.'),(407,NULL,0,'6','Observations',',11,2,5,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 00:36:35','This test, as well as the other middle school tests were too long. Students did not have a chance to show what they are capable of.  Students were forced to rush to complete the reading comprehension. This forced them to not use their reading strategies. On the essays they did not have time to write quality responses. In my opinion you can make these tests as hard as you like but give the students time to complete them. This should be a test to show what they have learned not how fast they work.'),(408,NULL,0,'general','Observations',',11,3,4,6,','Julie C.','Teacher','julie.e.cohen@gmail.com',0,NULL,0,0,'2013-04-25 00:44:21','The third grade test questions were beyond confusing. The texts were easily readable, and enjoyable, but the questions were ridiculous for 8 year olds. I have a Master\'s and 3 years teaching experience, and there were at least 5 questions that I did not know the answer to. Many questions had at least two feasible answers. In what world is that going to help these kids succeed in the real world? Choosing between two extremely close and arguably correct multiple choice answers? What job will that help them get? \n\nAt what point will we stop this madness? Clearly, my students can read. They can talk and write about text. They can analyze and deeply discuss texts. But some will fail that test. And that will impact both their self-esteem and future academic prospects.\n\nLet\'s take some action here, and demand accountability from NYSED and Pearson.'),(409,NULL,0,'6','Observations',',11,','Sandra Mills','Teacher','dolittlescrib@ol.com',0,NULL,0,0,'2013-04-25 00:57:41','I had a chance to read the exam as the students were taking it and I have to say that it was the worst designed test that I have ever seen.  I have been a classroom teacher for twenty years and have never read stories that were so boring that even I, an avid reader, had trouble staying alert for. To make matters worse the multiple choice questions and answers did not match what the children read and did not test their comprehension but more of their analytical skill.  I am sorry but analytical skill cannot be tested in a multiple choice format.  \nI am disgusted with what the state has proposed and their delivery of the common core standards.  I am disillusioned by what th state has allowed our students to be subjected to and by the obvious ploy to break our unions and use this test to fire experienced and tenured teachers. '),(410,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 01:45:08','Most of my above grade level readers could not finish day 2 or 3 because they have internalized the close reading strategies so well they didn\'t have time to finish.  I had several students not even have enough time to start the extended response question!  What a way to knock down a student\'s confidence by giving a test that most educated adults could barely finish in that amount of time!!!!!'),(411,NULL,0,'8','Observations',',11,1,2,4,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 01:48:13','Days one and three were reasonably timed. Day two was incredibly difficult for my students to complete in 90 minutes. 14/21 students in my homeroom (exclusive of my IEP students) did not finish. Of those 14, seven are advanced placement students who did not have time to get to the essay. Isn\'t there a way to streamline this test to ONE session of mixed multiple choice, short response, and extended response rather than stretching it over three days risking burnout and anxiety? If the test is truly supposed to be indicative of success in career and college, should it be more diagnostic with transparent information on scale scoring with a timely turn around for data assessment?'),(412,NULL,0,'general','Observations',',11,','Kathryn Brown','Teacher','kathryn.d.brown@gmail.com',0,NULL,0,0,'2013-04-25 01:48:47','Help express how important it is for children to think in a wide variety of ways, while making a stand against the over-reliance on standardized test scores.\n\nVisit Have brain, will think on Facebook.  It is my campaign, perhaps even crusade, to express ourselves in a meaningful way.  Read my open letter to Commissioner King, the Board of Regents, and Governor Cuomo.  I read it at the Tell it Like It Is forum in lake Placid in March.\n\nConsider liking my page and ordering a t-shirt.  Hopefully many of you will be able to join me at the rally on June 8 on the capitol to share our collective voices about the future of education.'),(413,NULL,2,'7','Observations',',11,1,3,8,9,','Kathryn Brown','Teacher','kathryn.d.brown@gmail.com',0,NULL,0,0,'2013-04-25 01:59:07','Though it has been shared repeatedly, here are a few of my observations that I feel I am \"allowed\" to share:\n* too many passages to read with the time provided, especially if utilizing close reading strategies\n* too many repeat question types, especially considering the time allowed\n* too little poetry and fiction overall\n* too much required writing for the time allowed, especially if using any of the writing process\n* too many test books\n* too many test days\n* too many total hours testing\n* two book sin one sitting with all directions at once\n\nA Few Positives\n* use of bold print\n* bullets on the extended responses\n* fewer footnoted vocab than on the practice sample\n* context clues provided with illustrations\n* spacing of the questions\n* more appropriate reading level than on the practice sample\n\n'),(414,413,0,NULL,NULL,',','Anonymous','','',1,NULL,0,0,'2013-04-25 02:00:26','* two books in one sitting with all directions at once'),(415,413,0,NULL,NULL,',8,9,','Anonymous','','',1,4,0,0,'2013-04-25 02:01:31','* two books in one sitting with all directions at once\n(Sorry, typo!)'),(416,NULL,0,'6','Observations',',11,1,2,7,','Brigid Martin','Teacher','bshogan@yahoo.com',0,NULL,0,0,'2013-04-25 02:07:07','Scribing for Special Education students during the ELA was an abomination.  These students could not even read the test, much less demonstrate their true reading, writing, and thinking abilities at their independent and instructional reading levels.  We need tests that are designed with these students in mind.  A one size fits all approach is not appropriate nor educationally sound.  Additionally, I question the validity of such tests when students who are reading at first and second grade levels (who are in 6th grade) are asked to take tests well above their reading levels.  We know they are going to fail.  The students knew they were going to fail.  What is the point of putting eleven year old special education children through 6 days of torture and frustration (Math test included)?  '),(417,NULL,0,'4','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-25 02:18:08','I question the value of the data collected when children are guessing at some/ many of the answers/ questions... If the test is truly searching for improving teaching and schools, guessing should not be any part of it.  The data becomes invalid for its true intention.  I also question the tremendous amount of lost time daily (6 times so far by Friday), wasted time, of students sitting dutifully and quietly and doing absolutely nothing, as the principals in some school were allowed to set the guidelines for testing environment.  It is heartbreaking to watch students, teachers, substitutes stare at the walls until time is called.  It is completely unrealistic to expect students to care about going over their answers and using the time effectively.  Once these kids finish after working very hard, they are exhausted and have no interest revisiting the anxiety causing test(s).    I had the job of scribing and reading the tests so far, and it seems like a complete disservice to the students who have disabilities, of course, depending upon the disabilities, to reinforce the reason they are in the learning environment they are in.  It is in no way motivational to work harder to learn.  In fact, it seems the opposite could be true.  '),(418,NULL,0,'8','Observations',',11,1,4,6,','Deedra','Teacher','dkaake@rhinebeckcsd.org',0,NULL,0,0,'2013-04-25 11:51:30','So here I was telling my students that the passages might actually be interesting this year, and the state has proven me wrong yet again. My students found the passages quite boring and actually pretty easy to read. However, the mult. choice questions were ridiculously long, and many had mutliple answers.\n\nI am excited about the possibilities of the Common Core standards, but with nearly 90% of the 8th grade test being nonfiction and much of it in science, I might as well throw away my poetry unit and Shakespeare unit. Is this the direction we really want the subject of English Language Arts to go?\n\nI am blessed with many wonderful, hard-working, intelligent students. At least 20% of them were unable to finish on day 2 and worked until nearly the end on both days 1 and 3. I do not feel we should make the testing times longer, but the test itself should be shortened. Are we assessing their stamina or their knowledge? I have no way of training them to work diligently for 90 min or more; I teach 42 minute periods.\n\nThis is frustrating, and now 20% of my evaluation will be based on this. I certainly hope changes will be made for next year.'),(419,NULL,0,'3','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 12:25:34','As a teacher in the lower grades, I am feeling the brunt of the pressure to teach to the test, and align with common core.  But, where is any of this fair, by any means to us, the educators, who need to give this students a wealth of knowledge to succeed?  Yes, a test will dictate your future.  Sad, I know. But this is the world we are raising our children in...test,test,test. As I a mom, I am scared for my own children.  How will they do under pressure, and where is this right to time them. Not all children learn the same, so why should all children be tested the same?'),(420,NULL,0,'8','The Need for Transparency',',11,10,','Anonymous','Parent','',0,NULL,0,0,'2013-04-25 12:26:30','I have requested a copy of the ELA test booklet, in order to see if I can glean what measure of language skills the test company was looking for. Superintendent in our school called State Ed to inquire and was told \"they aren\'t sure if they are making the tests public.\" I think, having paid for said tests, the public should be able to actually see them.'),(421,NULL,0,'general','Observations',',11,1,7,','Mary Ellen Garcia','Teacher','maryellengarcia@optonline.net',0,NULL,0,0,'2013-04-25 12:40:13','Ninety minutes is a very long time to ask 5th graders to sit. If a child has an IEP they may receive extra time (1.5 is common) that is 2 hours and 15 minutes! Is three days of testing necessary, students lose stamina after the 2nd day. Two days is sufficient. Students lose a lot of instructional time with 3 very long days of testing.'),(422,NULL,0,'general','Observations',',11,5,','Mary Ellen Garcia','Teacher','mgarcia@pelhamschools.org',0,NULL,0,0,'2013-04-25 12:44:00','Students are taught to look back in the text to find the answers but having them need to look back at specific paragraphs and flipping back and forth in the test booklet made the testing process more tedious. The students lost stamina and didn\'t use a strategy that proves successful in the classroom and in life, to look back at a text when questions continually asked the studentst to look back at paragraph 5, paragraph 11 and paragraph 2.'),(423,402,0,NULL,NULL,',2,','Anonymous','Parent','',1,NULL,0,0,'2013-04-25 12:46:48','Yes, after the first set (ELA), my son became ill, headache, stomach ache, and did not want to go to school. I refused the math series. I told the Supe school was making my child sick.'),(424,241,0,NULL,NULL,',','Anonymous','Parent','',1,NULL,0,0,'2013-04-25 12:49:16','Amen.'),(425,NULL,0,'5','Observations',',11,','stephanie Pagnotta','Teacher','spagnotta@portchesterschools.org',0,NULL,0,0,'2013-04-25 12:50:57','This test was equal to last years 8th grade exam. What are we trying to prove?'),(426,NULL,0,'6','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 12:55:12','Day 2 was too long for sixth graders. Many did not get to the final passage and/or essay.'),(427,NULL,0,'3','Ideas for Constructive Action',',13,1,4,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 13:34:10','I don\'t think that having 8 year olds sit and read and answer questions for over an hour is an appropriate way to measure students\' or especially teacher\'s achievement.  I think many high school exams are about the same amount of time, so how can we expect 8 year old students to do their best on such a long test.  \n\nWhen applying written responses to reading questions the students are no longer being assessed on reading but on writing. \n\nThere needs to be a way to assess children\'s abilities in a way that is more developmentally appropriate.  Perhaps shorter tests throughout the year that will show individual growth.  Another way is to give a variety of response types ie fill in the blank true false questions.  Many childern have difficulty narrowing down the answer when two choices are so close. Really how many adults sit down after reading a book and answer questions about what they have read....maybe some responses should be demonstrated with other types of responses: artistic, musical etc.  Maybe there should be a way to pick the type of story you want.  I know my highest score ever was on a reading test where the subject was something I knoew about.  Background knowledge should be rewarded not penalized as it is in many of these tests.  Finally instead of using an overall grade, take the best score from the passages, or drop the worst score. '),(428,NULL,0,'8','Observations',',11,7,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 13:48:13','Way too difficult for all especially special education students even with an IEP. Too many stories and not enough time. Vocabulary was way to difficult.  '),(429,NULL,0,'7','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 13:49:10','Day 2 was very intense and by Day 3 students were exhausted.'),(430,NULL,0,'5','Observations',',11,1,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 13:53:39','I am more and more disillusioned by the decisions our state makes and the lack of respect our government leaders show for the teaching profession. The test this year was even more unfair and laborious for students - if that is even possible! Not only were the students alloted 90 minutes, but for the first year All my students used every bit of those minutes and were struggling to finish.  The questions were designed to make the children unsuccessful. There were completely abstract passages and many questions had multiple answers.  The questions themselves were wordy and subjective.  The most insulting part is that the state leaders actually believe these tests should prove how well teachers teach.  That is what these tests have become for the state, and they are using our children and destroying education in the process.'),(431,NULL,0,'general','Ideas for Constructive Action',',13,1,6,','Janet Chemotti','Teacher','jchemotti@westgenesee.org',0,NULL,0,0,'2013-04-25 13:56:15','The passages were mostly BORING and that\'s why the students didn\'t finish...there were VERY FEW relevant passages that a student could think \"yes, I\'ve heard of that before,\" articles were taken from magazines that were in many cases, more than 15 years old! With all of the good writing in informational text these days: from magazines like National Geographic magazines for students and others, high-interest articles about what is happening TODAY in our world about INTERESTING things and award-winning informational text, etc., couldn\'t the excerpts have come from quality material? Students won\'t have to read technical texts for their workplaces until they are actually employed, so what is the purpose of subjecting them to technical writing samples when they are 10, 11, 12 and 13 years old? Also, many questions didn\'t even connect with the CCLS in terms of testing what we have been teaching all year.'),(432,NULL,0,'general','Observations',',11,2,','Robin B','Parent','r_c_baez@frontiernet.net',0,NULL,0,0,'2013-04-25 13:56:30','These tests stress my son out so much. Both he & I want to know why there has to be so many tests, and why they are necessary or National level? This is putting my children behind because it takes away their classroom time, they have lost there excitement to learn, and I am fighting to get that back before it is too late.'),(433,NULL,0,'8','Observations',',11,1,4,10,','Brenda Burke','Teacher','bburke@portchesterschools.org',0,NULL,0,0,'2013-04-25 13:56:44','To Whom it May Concern, \n\nI found this years test to be completely unfair in so many ways:\n\n1) Time, simply not enough for the required re-read of the text and processing much more complex questions for all four books of the exam. \n2) Content, while I understand the premise of \"raising the bar\", educators and more importantly test writers have realize a student\'s capacity to comprehend and furthermore analyze authentic text and the questions aligned to them.\n3) Teachers are \"highly effective\" if they can differentiate instruction for their students, and adapt to certain learning styles. However when testing, this is ignored and all students are tested on the same level. The frustration created by this inequity is insurmountable.\n4) It is my belief that when the results come back they will be catastrophic.\n\nI have one request, I would like, no make that love, if all of the people who have decided to make these drastic changes so rapidly would sit for the exam themeselves, in the time alotted. Also, allow the taxpayers to see the exams as well, so they are privy to changes and are aware of the challenges that the teachers face.\n\n'),(434,NULL,0,'7','Ideas for Constructive Action',',13,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 14:08:25','Although the reading passages were long, they were fair, and for the most part, engaging. The constructed responses were also fair.  The multiple choice questions were very disappointing as many of them had two viable choices. Some had three.  In these questions, it was impossible for me, with a master\'s degree, to determine which answer was the \"best\" answer.  I was aware that the test would include distractor answers, but the distractors were indiscernible from the \"correct\" choice.  Also, in there was a question in the Alcott passage that referred to the main character using a nickname that was not used in the selection.  This would be very confusing to students and is a very easy fix. '),(435,NULL,1,'general','Observations',',11,2,','Karen smith','Parent','K_smith_70@yahoo.com',0,NULL,0,0,'2013-04-25 14:17:36','My daughter has come home since the beginning of the school yeas anxious about theses tests. I have seen her cry and degrade herself by calling herself stupid, dumb, never will learn math. Week prior to the test her whole persona changed on edge, nervous , crying jags, more self esteem bashing by saying she is stupid, Ect I for one am appalled at how she is crying  and to  think these test are not only unnecessary to her education. Way to build our kids self esteem keep up the good work!'),(436,NULL,0,'5','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-25 14:18:02','I do not believe testing is the proper forum for product placement.  References to brand names need to be removed!'),(437,NULL,0,'general','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-25 14:18:40','scoring three of the extended responses and one essay for the third grade was grueling! The NYS provided guidelines for acceptable answers were ambigious and frustrating.  Did the student respond in the form of a claim and include two text specific details?  What is deemed acceptable for one answer is insufficient for another.  A four bullet essay response from third graders?  Really?  Couldn\'t we ease into this \"transition\" with the expectation of a well developed paragraph (or two) response?  This has been a very disheartening time for parents, teachers and most especially students. I am all for reaching to meet a challege and raising the bar but this year has been a blur of ...too much, too soon with too little!  I do not like to think in terms of impossible but we are being asked to keep flying this plane while it is being built and it is very difficult!     '),(438,NULL,0,'7','Observations',',11,1,','Nancy Ebel','Teacher','nebel@rhinebeckcsd.org',0,NULL,0,0,'2013-04-25 14:19:35','How can you possibly assess writing, as the extended responses are suppposed to do, when students do not have time to organize their thoughts, then revise and edit what they had written?  We all know that writing is a recursive process.  I couldn\'t have written an excellent essay with that kind of time pressure.  Many of my better writers and readers were, in essence, penalized for taking too much time: time to read closely, time to think deeply, time to  carefully choose the words and sentences that would best communicate their thoughts.  The extended time students were penalized as well, by having to spend not 90 minutes, but in some cases, three hours to complete a test that wasn\'t doable by the best of them.  Some of them spent three hours, three days in a row one week for the ELA, then did it again the following week for the math, missing instruction in their other classes in the meantime.  It is not developmentally or instructionally appropriate.  Who writes this stuff anyway?'),(439,NULL,0,'5','Observations',',11,1,3,8,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 14:23:39','This test was way too long. Is it really necessary to have the students read a total of 14 reading passages to assess them? As a teacher I question how reading passages with numbers down the side relates to real life reading? I have never read a novel or interpreted a text that does this.The answers to the questions themselves were not reasonable. Not only did the students have to try and figure out what was being asked of them, they had to go back and read many different numbered paragraphs in order to use logical reasoning to answer them. If you want to test a skill such as main idea, inferencing, context clues, etc. ask them directly. Don\'t go about it in a roundabout way. They couldn\'t answer the questions because they had no idea the choices said.  Also having two books on Day 2 was very confusing. The students had too many materials on their desks and were overwhelmed by all of the directions. Why do they need to write two essays? It seems that this was a test of endurance rather than skill. Even my best readers finished with little time to spare. If we want kids to do their best, shouldn\'t they have ample time to finish and check over their work? This test  is not reflective of what my students are capable of.'),(440,NULL,0,'5','Ideas for Constructive Action',',13,1,','Julie Kuebel','Parent','jkuebel@juno.com',0,NULL,0,0,'2013-04-25 14:30:21','Not enough time was given, especially on day 2! An average kid should have had more than enough time to thoughtfully complete their work. '),(441,NULL,0,'general','Ideas for Constructive Action',',13,4,','Susan','Other','susan@first-teachers.org',0,NULL,0,0,'2013-04-25 15:04:38','What all of the observations and comments from teachers, parents and the students who took this test amounts to is the extraordinary incompetence of the testing company.  Clearly they didn\'t spend the time to field \"test\" their assessment instrument.  It is evident from the ineptly designed instructions that no one with actual teaching experience was involved.  Pearson should be fired immediately AND be required to return the tax payer funded moneys given to them.  All school districts should demand that the top personnel of the State Board of Education should resign for their wholly unacceptable performance. '),(442,26,0,NULL,NULL,',4,','Anymous','Teacher, Parent','',1,NULL,0,0,'2013-04-25 15:15:00','Opting out strikes me as the best form of support, and change agent. Creating a spectacle and a dearth of data would be an important wake-up call to state officials. '),(443,NULL,0,'4','Observations',',11,1,2,3,','Maureen Gallo','','mgallo@portchesterschools.org',0,NULL,0,0,'2013-04-25 15:15:04','One area of concern is way in which so many of the questions were worded. They were complex and confusing. Some required students to move back and forth from question to the text in order to read certain paragraphs in order to find answers that pertained to other paragraphs. By asking questions in this confusing manner it puts the student at an immediate disadvantage. Just what is the state measuring? I would ask the state to write questions that are clear and understandable so that students know what is being ask of them. Also, day 2 of the test was too long. The students were exhausted when it was over and felt tired the next day when they came in to face another morning of testing. In addition, I am not sure how the modules on the Engage NY website pertained to the test. The types of articles and questions on the modules were not at all reflected on the test. The only similairity between the two was the emphasis on non-fiction. Finally, please stop putting field questions on such high stakes tests-it is unfair to the students and teachers. '),(444,37,0,NULL,NULL,',','mvmone','Parent','',1,NULL,0,0,'2013-04-25 15:16:31','Ridiculous exercise is teacher accountability, little more.  Public schools are becoming like Kaplan Learning Centers, you get nothing but test prep for your tax dollars these days.  Children aren\'t taught critical thinking, heck, they\'re not even taught times-tables any longer.  They\'re introduced to algebraic concepts before a child can recite 7 x 6!'),(445,435,0,NULL,NULL,',4,','Cindy','Teacher, Parent','sixofusplus2@yahoo.com',1,NULL,0,0,'2013-04-25 15:18:36','We need to opt-out.  This is simply product development for corporations.  Now that FERPA allows the school to share all of data this without parental permission, we have to stop feeding it.  '),(446,NULL,1,'general','Ideas for Constructive Action',',13,4,','Cindy','Teacher, Parent','sixofusplus2@yahoo.com',0,NULL,0,0,'2013-04-25 15:22:19','Please pay attention to this and consider \"opting out.\" Parents have to unite and understand this will NOT HURT OUR CHILDREN if we don\'t allow it to and all stand together.\n\nPlease read the document that explains how PUBLIC SCHOOL IS TAKING AWAY OUR CHILDREN\'S RIGHT TO PRIVACY!\n\n\"we’ve arrived at a time when once a child\nenters a public school, their parents will never again know who knows what about\ntheir children and about their families.\"\n\nhttp://educationnewyork.com/files/FERPA-ccsss.pdf\n'),(447,NULL,0,'general','Ideas for Constructive Action',',13,','Cindy','Teacher, Parent','sixofusplus2@yahoo.com',0,NULL,0,0,'2013-04-25 15:24:09','Please pay attention to this and consider \"opting out.\" Parents have to unite and understand this will NOT HURT OUR CHILDREN if we  all stand together.\n\nPlease google ferpa-ccss in educationnewyork for the document that explains how PUBLIC SCHOOL IS TAKING AWAY OUR CHILDREN\'S RIGHT TO PRIVACY!\n\n\"we’ve arrived at a time when once a child\nenters a public school, their parents will never again know who knows what about\ntheir children and about their families.\"\n'),(448,NULL,0,'5','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 16:14:08','I felt that the test was too long, in which the students didn\'t have enough time to complete each question to their fullest capability.  '),(449,NULL,0,'8','Ideas for Constructive Action',',13,1,6,','Karen','Teacher','',0,NULL,0,0,'2013-04-25 16:30:38','I am and eighth grade English teacher in a wealthier district.  My students are very capable.  They are given all of the opportunities you could hope for.  \nThey could not finish this exam.  \nOn day one, they worked diligently for the entire 90 minutes on the multiple choice.  Most questions seemed to be good critical thinking questions (though ambiguous) and the passages were dense.  Given the opportunity, they could have defended their answers with sound reasoning and text support, which is what we want them to do when they are thinking critically.  Unfortunately, this part of the exam didn\'t allow them to show their thinking.\nOn day two, when they could have defended their answers with sound reasoning and support, they weren\'t given enough time. Some of my top students left the essay completely blank.  This does not reflect their abilities.  \nDay three seemed most fair.  \nI like the Common Core.  I understand the need for standardized tests.  But evaluating students\' abilities and my ability to teach on a poorly designed test is wrong.'),(450,NULL,0,'5','Observations',',11,1,3,','Jesse Beers','Teacher, Parent','Beers@hotmail.com',0,NULL,0,0,'2013-04-25 16:56:58','Not only was the examine poorly constructed, by the content was definitely not appropriate for 10 years olds.  I would venture a pretty safe guess that the majority of adults would\'ve had a hard time with many of the questions.  Especially those where students were asked to go back and reread multiple paragraphs over and over again.  After seeing what book 1 of the exam looked like, my wife and I decided to opt our fifth grade daughter, who is a strong ELA student who\'s scored A\'s all year long,  out of the remainder of the exam.  '),(451,NULL,0,'6','Observations',',11,1,8,','Ashley Glod-Hayes','Teacher','aglod-hayes@portchesterschools.org',0,NULL,0,0,'2013-04-25 17:07:23','Day 2 was entirely too long (too many unrelated passages to read).  Having two books to complete was overwhelming for the students.  Considering the number of multiple choice questions the students answered on Day 1, it seemed unnecessary for the students to do more multiple choice on Day 2 along with short answer and extended-response.  My students worked for the ENTIRE alloted time, were exhausted at the end and many did not finish.  It would have made a lot more sense to have a few (maybe three?) passages with multiple choice, short answer and extended answer related to the same passages.  There should not be two books to complete in one day.  '),(452,NULL,1,'8','Observations',',11,','would rather not say','Teacher','parkerdubois@aol.com',0,NULL,0,0,'2013-04-25 17:29:50','     I am a \"Back Reader\" at the Test Scoring Site. I re-read the student answers after they have first been graded by other teachers. OVER AND OVER again I am catching teacher error in the grading. Students given a score of \"0\" instead of the correct score of \"1\" and on many occasions a correct score of \"2\". \n     The system DOES NOT work. We have sat at our table and read and re-read an answer-one teacher says it\'s a \"0\" another two say it\'s a \"1\" and still others are arguing that it is a \"2\". We call over the well trained \"Floor Monitors\" and even they don\'t agree. It is so disturbing and disheartening to see what is determining our childrens future.'),(453,NULL,0,'3','Observations',',11,1,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-25 17:33:23','Test was too many days. Too long of a time period for students of this age group.  Also questions and language of the questions were not age appropriate.'),(454,NULL,0,'4','Observations',',11,2,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-25 17:36:33','As a parent of a 4th grade student and a teacher of third grade,  This test was too long, questions were confusing, and children were tired.  Too many days, too many questions, what is NYS doing?  '),(455,NULL,0,'general','Ideas for Constructive Action',',13,4,','Alexandra Miletta','Other','amiletta@gmail.com',0,NULL,0,0,'2013-04-25 17:46:52','When I read this article in the Washington Post I was outraged. http://www.washingtonpost.com/blogs/answer-sheet/wp/2013/04/16/common-core-testing-begins-in-ny-but-are-exams-ready-for-prime-time/\nI urge everyone with stories about how these exams were HARMFUL to children bring these two facts to the public in every way imaginable. The tests were intentionally harder with more items and less time; the tests included Pearson\'s field test items mixed in with the items that counted toward the score. '),(456,75,0,NULL,NULL,',2,','anonymous','Teacher','',1,NULL,0,0,'2013-04-25 17:48:03','My student told me she tried her best because she did not want me to lose my job. Children should not have to feel they are responsible. The children should not be put in this position. '),(457,NULL,0,'general','Observations',',11,1,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 17:50:26','Numerous students, both general education and regular education students did not finish the ELA tests on Day 2 which was Book 2 and Book 3.  I thought it was too much content for one day of testing on the elementary level.  Why does it have to be timed at all?'),(458,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 17:58:26','I am also scoring the test and am having the same experience as the above teacher. It is frightening how these unfair tests are being scored. '),(459,305,0,NULL,NULL,',','Tom Hoffman','Other','tom.hoffman@gmail.com',1,NULL,0,0,'2013-04-25 18:04:30','There is a discrepancy between what the standards say and what the commentary on the standards has focused on.  The actual standards DO heavily emphasize analyzing how an author makes an argument.\n\nWhether or not this is a good idea is something we should have been focusing on for the past three years or so.'),(460,356,0,NULL,NULL,',','Tom Hoffman','Other','tom.hoffman@gmail.com',1,NULL,0,0,'2013-04-25 18:31:49','Not to sound overly paranoid, but you should ask your sys admin to set up a cron job to delete the web server logs daily and do not retain a backup so the logs can\'t be subpoenaed.  \n\nAlso, perhaps a simple rating system for comments.\n\nTHANKS for doing this, btw.'),(461,NULL,0,'6','Ideas for Constructive Action',',13,','Becky silver ','Teacher, Parent','Bsilver22@gmail.com',0,NULL,0,0,'2013-04-25 18:40:15','I teach 6th grade. I have a grade 6 son as well. The poem that was on our exam was a n abstract poem written in the mid 1800\'s. the reading level was grade 10. Insulting. The bizarre inferences that SED/Pearson expected students to e able to make from a prom so very removed from their real life - is a travesty. How is this \"authentic reading\"? How is this preparing them for college or a career?  They are 11 and 12 years old. This was the second item from our test. My students were MENTALLY SPENT by the time they were finished wading through this insanity, and they still had 35 questions left with 7 more stories to plow through. I\'m embarrassed for this State !!!!!'),(462,NULL,0,'7','Observations',',11,2,3,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-25 19:05:45','There were several questions that multiple teachers disagreed about.  If we cannot agree on an answer, I would think it would be difficult for seventh graders to do so.  We also noticed that there several answer choices that were almost the exact same.  Lastly, the second day had way too many items for a seventh grader to complete well.  This resulted in a high level of stress and frustration (and even tears) for many students.  '),(463,NULL,0,'general','Ideas for Constructive Action',',13,','Brian Wasson','Parent, Other','',0,NULL,0,0,'2013-04-25 21:08:02','I hope this year\'s tests are serving as a wake up call for ALL parents and educators. A time to say, \"Hold on a minute, what is going on here?\" Literally follow the money in all of this. These tests were designed so the majority of students will \"fail\". Pearson will swoop in with all the \"materials\" to fix this, at cost. Additionally, linking these tests to teacher/principal performance corrupts the process. Additionally, linking these tests to a possible increase or decrease in state and/or federal funding corrupts the process. And these are just a few points to consider in determining what a disaster the NYSED office is right now. Look up the \"secret 60\" who designed the Common Core. We had our 3rd grade son refuse the tests this year. Reading through all these comments only reaffirms our parental decision. The rush to high-stakes testing (among other \"things\" recently implemented in our schools) has to stop. I will help make that change and return education back to the schools, educators and parents.'),(464,NULL,0,'8','Observations',',11,1,2,','Anonymous','Other','',0,NULL,0,0,'2013-04-25 21:35:54','I as an 8th grade student feel that the second day of the ELA was extremely unfair!! We were only given 90 minutes to complete 21 multiple choice, 3 short answer, and an essay! I am a very good student who normally gets a four on every ELA, but I barely finished my essay in the last second! Some of my other friends did not even get to finish their intro!!!!! I feel that if my school, which is a too school in New York had trouble with this, then how did not the best schools do? I really think that these ELA people should try to make these tests fair and not be so cruel.'),(465,NULL,0,'5','Observations',',11,1,6,','Debbie Reddick','Teacher','rreddick1@twcny.rr.com',0,NULL,0,0,'2013-04-25 21:58:55','As an educator of 31 years, I feel compelled to write about what I see as a giant flaw of this test. First and foremost, I want to say that I am a believer of the Common Core. I do believe that we need to teach our students to read closely and think at a deeper level. What I feel the test didn\'t do is test this! The State was having students pick apart a passage by looking back from paragraph to paragraph to \"find\" the correct answer. This is not the way we should be reading closely and thinking at a deeper level! The other thing that I believe is wrong with the test is the amount of time they had to accomplish these tasks. With going back into the passage so many times, students ran out of time to answer some of the questions. Was it really necessary to have students fill out a Book 2 which essentially tested the same thing as Book 1? Many children did not have time to finish Book 3! I really believe that this is not what the Common Core had in mind. Some of the questions were worded at such a high level, even I wasn\'t sure of some of the answers! '),(466,NULL,0,'8','Observations',',11,','anon','Other','rukon134@gmail.com',0,NULL,0,0,'2013-04-25 22:07:09','I like how you included an article that somewhat connected to our childhoods with Beastboy in it. '),(467,NULL,0,'8','Observations',',11,','anon','Other','rukon134@gmail.com',0,NULL,0,0,'2013-04-25 22:07:33','I like how you included an article that somewhat connected to our childhoods with Beastboy in it. '),(468,19,0,NULL,NULL,',4,','Assistant principal','Principal','SLocus@optonline.net',1,NULL,0,0,'2013-04-25 23:45:06','I understand that in Texas the state exams are untimed. Wow, what a novel idea! New York should follow that example.'),(469,NULL,0,'6','Observations',',11,2,','Anonymous','Parent','',0,NULL,0,0,'2013-04-26 00:11:31','The whole testing process has created much anxiety for not only my daughter this year but also for her friends and the teachers at her school. I understand that some kind of testing is necessary to measure progress and placement for next year but testing on information that hasn\'t been taught yet because teachers don\'t have the texts is totally unfair to everyone and ends up with inaccurate results.'),(470,NULL,0,'8','Observations',',11,2,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-26 00:22:13','Kids completely disengaged during exam. Once they finished, teachers were allowed to give them books to read and they lit up as they read things they were interested in.'),(471,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-26 00:23:19','Several questions I saw had more than one correct answer.'),(472,NULL,1,'3','Observations',',11,3,','Peggy','Teacher','',0,NULL,0,0,'2013-04-26 00:41:54','I have 23 years of teaching experience with 21 of those years at 3rd grade.  I have never been so frustrated by the multiple-choice portion of the ELA test.  When a 51-year adult with a master\'s degree has a hard time figuring out the answers to 11 of 30 questions, it is time for me to retire or time for Pearson to hire a better quality assurance team.  Are these tests given to anyone who is not familiar with the questions before they are released?  If I was allowed to keep a copy of the test, I would be happy to give the specific question #s that had confusing answer choices, but I can\'t be trusted to keep a copy.  The sad part is that I really don\'t think anyone at Pearson or the State Ed. Dept will read this.  '),(473,NULL,0,'8','Observations',',11,1,','Sophie','Other','',0,NULL,0,0,'2013-04-26 00:42:36','The test was very time consuming. I felt rushed to finish on time and felt that I couldn\'t put in all of the details I needed. I barley finished my test with only a minute left'),(474,19,0,NULL,NULL,',1,','Anonymous','Teacher','',1,NULL,0,0,'2013-04-26 00:50:29','I think that if one reads over all these comments, one of the comments that resurfaces the most is the fact that Pearson should have piloted the test to make sure that it was do-able within the allotted time. There is something contradictory about asking kids to engage in careful analytical rereading and a test on which the prize goes to the fastest kid. I know many people found that some of their strongest readers proceeded appropriately slowly and never came close to finishing the test. How tragic that those kids will be labeled as less able simply because they haven\'t been taught to engage in close reading under the press of a stop watch.'),(475,41,0,NULL,NULL,',','Anonymous','Parent','',1,NULL,0,0,'2013-04-26 00:54:18','While I do not agree that there is no enjoyment in education anymore, I do agree that this test spotlights a kind of reading that really belongs in AP English lit classes. Although kids were asked to read nonfiction passages, they were not expected to read them in order to learn about the topic. Instead, the goal was to analyze the structural and language decisions, to label the craft moves that authors made. That would have been fine if it had been 10% of the test, of 20%....but it was closer to 70%. Tests end up being the tail that wags the dog, and they shape curriculum. Thats a scary thought.'),(476,NULL,1,'general','Observations',',11,1,2,','Anonymous','Parent','',0,NULL,0,0,'2013-04-26 01:06:52','The tests were too long and too difficult for our my children to complete. Since the Common Core standards are not fully implemented it is unjust to test children on something they were not taught.  My children were told that if they don\'t do well on the test then their teachers\' effectiveness as teachers would be sub-par. My children love their teachers so they wanted to do their best on behalf of their teachers.  But, they came home and said they didn\'t have enough time to go back into the story to find the correct answers and struggled to choose the best answers.  NYS--> too much pressure put on these children and their teachers. You can\'t test on something that you haven\'t put into curriculum yet!!  These exams better be curved and NYS had better put some thought into these exams and thing about the end product many years down the road. Get out of the present and look to the future. No child left behind is great and all but there are children who will not be Harvard graduates that will need to learn a trade/skill as their profession.  Don\'t link teachers to students\' performances.  Not fair to the teacher or student.  '),(477,NULL,0,'5','Observations',',11,2,','connie gilbert','Teacher','cgilbert@cohoes.org',0,NULL,0,0,'2013-04-26 01:16:09','The length of the tests were far too long even for the average reader.  Having to look back so many times into the passages and required rereading was overlong.  Having 3 books was overkill.  It could have been accomplished in 2 books.  One for multiple choice and one for extended responses.  Some students were in tears, anxious and very stressed by the end of the 3rd day.  Others just gave up or did not finish.  '),(478,NULL,0,'general','Observations',',11,','David Sollod','Other','davidolo.davidolo@gmail.com',0,NULL,0,0,'2013-04-26 01:29:22','This test was fairly easy. It was a fair test with a few confusing questions. I think that there should be more information given within the questions however. '),(479,NULL,0,'4','Observations',',11,2,','Colleen Valcarcel','Parent','krissysmom623@aol.com',0,19950,0,0,'2013-04-26 01:46:15','I can\'t imagine that the people in charge of this Pearson (common core) education are actually human beings!!  The crying, the vomiting and the sleepless nights that went on in my house about 3 weeks prior to the test is not normal for a 9 year old it is torture and being treated like a robot.  I will not go through it again next year.  next year I will have 2 kids taking these test and I will be one of them parents to opt out because I will not let my children suffer and get turned off of going to school.  T o hear my child cry to me that she does not want to go to school anymore is not something that I want to hear.'),(480,NULL,0,'8','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-04-26 01:49:00','I took the ELAS\'s myself and I thought it was overall very hard. This year has been much harder considering Nee York State testing! I feel like the second day of the ELAs in particular was hard. I know I didn\'t finish the essay part of the test and from what I have heard a majority of other students didn\'t finish either! I just think that some of the testing was vey unfair! Anyways, thank you for reading about my thoughts of the test.'),(481,NULL,0,'6','Observations',',11,1,','Liz Golden','Teacher','Lizziehickey@aol.com',0,NULL,0,0,'2013-04-26 01:51:21','I wonder how time constraints are decided for these tests. Specifically the day 2 section of the exam.  Many students were unable to finish.  90 minutes was an insufficient amount of time. Students needed 120 minutes.  Writing for many can take more time.  I think that test makers need to take into consideration rate of reading when deciding on time intervals and skill application.'),(482,19,0,NULL,NULL,',2,','Yvonne Siu-Runyan','Other','drysr80@gmail.com',1,NULL,0,0,'2013-04-26 02:27:25','How many children are suffering, because our young are just another commodity traded on Wall Street for profit? What we are doing to are young is criminal and nothing short of child abuse. '),(483,45,0,NULL,NULL,',4,','Yvonne Siu-Runyan','Other','drysr80@gmail.com',1,NULL,0,0,'2013-04-26 02:30:37','I am so sorry about what the profiteers are doing to our young. Parents need to protect their children and opt them out of taking those tests. They cannot do much of anything except make money for the test-making corporations. Follow the money. Save our young and their future. '),(484,143,0,NULL,NULL,',8,','anonymous ','Other','',1,NULL,0,0,'2013-04-26 03:11:22','Not even sure why there was a Book 2. I suggest ALL the multiple choice be put in ONE booklet.Don\'t understand why we need additional multiple choice questions as 30 seems plenty. Crazy to be passing out 2 books to 9 and 10 year olds and giving two sets of directions. Why? What is the purpose of that? '),(485,NULL,0,'6','Observations',',11,1,7,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-26 13:15:14',' Testing middle age students for three days is way too much for them. The test should be spread out more and should have versions for special education students as well as ELL\'s. To test these students with the exact same test goes against everything we know about different students’ ability\'s and strengths. \n\n- A frustrated parent and Teacher\n'),(486,NULL,0,'7','Observations',',11,1,2,7,','Jeannette Sanderson','Teacher','jsanderson@portchesterschools.org',0,NULL,0,0,'2013-04-26 13:33:50','I understand that we need to raise the bar for all of our children, but I don\'t see how this NYS ELA Exam did anything to help us do that. The test itself was too long and many of the questions seemed intended to confound rather than challenge the reader. The test stressed and discouraged students rather than supported and encouraged their learning. It also took valuable time away from actual teaching.\n\nThe test itself left a lot to be desired. The readings were challenging and somewhat interesting (though I was surprised at how many readings there were about the West, mining, and the sea), but the amount of reading was excessive. It was more than what most students can comfortably read in one sitting, and three days of this was pure overkill. By the third day, one of our special education students was so burnt out that he asked if he actually had to read the passages. My guess is that he was also asking that because some of the questions were so inane that reading the passages didn\'t necessarily provide a lot of help in answering them. I don\'t know who writes the questions, but I\'d like them to have to sit through a similar test in which they were left feeling frustrated as well as challenged.\n\nDespite my reassurances that the test was not going to affect their grades or their promotion, the test was very stressful for many of our students. And because it was so challenging, it left many students feeling discouraged and \"dumb.\" We want to develop reading confidence so that our students are willing to tackle more and more complex texts, but this test has the opposite effect: it made many want to give up reading altogether.\n\nThe test also robbed us of valuable learning time. The amount of time spent testing (and scoring) is the most obvious waste of time. If you count in the math exam and the scoring of both state exams, we lose close to three weeks of instruction. And the actual dates of the testing were also a problem. Because such a big deal is made of the tests, many students think that once the tests are over, so is the school year. It can be difficult to recapture students\' attention and enthusiasm, especially after the weeks of testing and scoring. I don\'t know how many times I\'ve heard students say, \"You mean we\'re still going to have work to do after the test?\"\n\nAs I said, I\'m all for raising the bar. I don\'t, however, think we should wrap the bar in the barbed wire of testing that harms, rather than helps, our students.\n\n'),(487,NULL,0,'6','Observations',',11,','Pat','Principal','swifty2121@gmail.com',0,NULL,0,0,'2013-04-26 13:34:30','These examinations are child abuse. It is causing undue anxiety to students, teachers and parents. Have we as adults turned out so bad that we have to worry about the future of our country.'),(488,NULL,0,'8','Observations',',11,7,','Annoyed','Principal','swifty2121@aol.com',0,NULL,0,0,'2013-04-26 13:36:50','I prayed last night for al the Special Eduation and ELL student who have to sit through this horrible assesssment'),(489,NULL,1,'5','Observations',',11,1,3,4,','Sean Dowling','Teacher','sdowling@3villagecsd.org',0,NULL,0,0,'2013-04-26 14:20:23','Wow. Where do I begin? The ELA was far too long for children of this age. Research in the area of childhood development seems to have been completely ignored. Do we need a marathon of reading and writing in order to assess students? \n\nDay One: The passages were okay, but one was used in a Pearson review book. Unfortunately, my district did not use that. This does not seem standardized if some schools had access to one or two passages ahead of time, based upon the review materials they used.\n\nThe questions were the problem. The amount of time needed to accurately answer these questions just wasn\'t there. We\'re teaching oru children to be \"close readers\" but they weren\'t given sufficient time to do what was asked of them. What are we telling them? Read closel, but do it quickly?! What are we doing to them? The amount of rereading needed, and the possible answers themselves, left a lot to be desired. Some questions had answers that were so close that students could argue why one was better than another, if given that chance. We need to scrap the multiple choice altogether and allow studnets to defend their answers. That\'s Common Core aligned.\n\nDay 2: WAY TOO MUCH TO DO! This day was absolutely ridiculous. More multiple choice? Why? The students needed all of their time for the constructed response and extended response questions. Writing a thoughtful essay takes time, and they just weren\'t given that time. Totally and completely unfair to the students. Get rid of the multiple choice. I\'m all for the writing as the students need that instruction. Writing finally is getting its due.\n\nDay 3: Passages okay overall, but one was absurd. Fifth grade teachers know which one I mean. The extended response overall was okay, but the prompt was just too long. This must be streamlined so the students can focus in on one task, not several.\n\nIdeas for Constructive Action:\n1. Either the test needs to be shortened or the students need more time. I worry that Common Core will go by the wayside due to these insane assessments. They\'ve negatively impacted instruction. (Who tests a year\'s curriculum by April? And yes, we need the year to teach what\'s being asked of the students on both the ELA and math assessments.)\n2. Let us teach the entire year and test the students in June like the secondary students. Assessments in April is just too early. If we must test in April, then reduce the amount that needs to be covered by then. Common Core has not done that, not at the depth of understanding that\'s needed.\n3. Provide more resources before assessing! Districts just don\'t have what they need in order to implement the Common Core properly (not yet anyway). Why are we assessing for instruction that has just not occurred yet?\n4. I hope King and Tisch are listening. They don\'t know better than us. We\'re the ones teaching and implementing these changes and they better heed the feedback they\'re receiving, and adjust accordingly, or else Common Core will just be another failed government initiative.'),(490,NULL,3,'4','Observations',',11,6,','Anonymous','Teacher','dhill@mamkschools.org',0,59990,0,0,'2013-04-26 14:26:26','Some thoughts in no particular order:\n\nThis seemed to me to be a test of stamina. On both Day 2 and Day 3, after having written several thoughtful answers to short-response questions, my students were too exhausted to effectively complete the extended-response questions. While those final questions were not especially challenging, students no longer had the energy to think carefully about what they were required to do. As there are very few opportunities in the school day to make fourth graders stay in one space and stay on task for such an extensive period of time, it seems as though we are asking entirely too much of them. (Next year, I will likely encourage them to complete the extended response first, and I wish I had given that consideration going into this test. In the past I have preferred that they work on the short response first, as those questions can often be helpful when considering the extended-response question. Now I have to wonder if \"revving up their mental engines\" on the short response is more important than completing a thoughtful extended response).\n\n\nOn Day 3 students were asked the same question about each of two passages (I belive this happened on Day 2 as well, but my recall is not as clear). In addition to the fact that the answers to these questions (about setting) seemed to be a bit beyond the range of fourth graders (their answers were serviceable but I\'m sure not what the scorers will be looking for), they were very confused when they were asked the same question twice. The quality of the second response significantly diminished, as if to say, \"You just asked me this. Why are you asking again?\" Both of the selections were rich and interesting, and I believe different (and better) questions could have been asked to truly elicit students\' understanding of either or both of the texts.\n\nWe discussed at several meetings throughout this year that the focus of the Common Core at our grade level was on nonfiction. However, Days 1 and 3 did not match the information we were given by NYS. It seems a bit unfair that we were expected to spend the bulk of the year working with nonfiction texts, but students were not given ample opportunity to show what they knew about reading such texts.\n\nDay 2 did not seem to be thoughtfully managed. The information presented in the directions was lengthy and difficult for them to follow. Managing both books proved awkward for them. I am sure that there is a better way to assess student learning than having two different books that require having two different sets of directions read in one sitting.\n\nI am not surprised by my students\' performance on the test, and I do not write this to as means of offering an excuse for that performance, but I do feel that in many ways the deck was stacked against them before they even sharpened their Number 2 pencils.'),(491,31,1,NULL,NULL,',3,4,','Stephanie Morgan','Parent','stephmorgan11@hotmail.com',1,NULL,0,0,'2013-04-26 14:27:52','I read some analysis of CAT (computer adaptive testing) being developed for Common Core by Dr. Gary Thompson, an African American Doctor of Clinical Psychology (Psy.D.) currently serving as Director of Clinical Training & Community Advocacy at a private child psychology clinic in South Jordan, Utah. Dr. Thompson completed multiple thousands of hours in training/therapy/assessment/legal advocacy work with children in both the private and public school settings in multiple western states and also the authored an award winning doctoral project/dissertation.\n\nHe raised some concerns that speak to your mention of \"questions and answers that were highly subjective\".   One of the companies who is developing these tests is American Institutes for Research (AIR) with grants from the federal government. AIR \"is one of the world\'s largest behavioral and social science research organizations\" and is applying behavioral and social science to educational assessments.\n\nDr. Thompson said there is reason to seriously question what these tests are seeking to measure beyond cognitive ability and knowledge sets. Already in use in his Clinical Psychology practice, these tests have well documented potential to be highly accurate for personality assessment. \n\nThompson said he\'d stake his professional reputation on his claim that companies like AIR have the ability to devise tests that input selected variables that measure “behavioral characteristics” along with variables that measure language arts, science or math. He wrote, \"It would be relatively “easy” to design a language adaptive test that has behavioral characteristics embedded into the design of the test. Formulas could be designed to produce two sets of results (language and behavior), and then forward the language test results to its intended target (The Schools), and the behavioral results to another intended target (Federal Government, Private Agencies).\"\n\nRead his thoughts here:\nhttps://m.facebook.com/note.php?note_id=555418941145364'),(492,NULL,0,'5','Observations',',11,2,','Jack Woulfe','Teacher','woulfejac@slcs.org',0,NULL,0,0,'2013-04-26 14:43:42','I wathched as my fifth grade students, some of them with reading levels of mid second grade, struggled bravely to answer questions to stories that were way beyond their ability to decode, much less understand. They could have reacted to the situation in any number of ways, but between staring at the walls, or staring at the test booklets, they dutifully filled in their answer sheets, leaving nothing blank. Their self esteem was left battered by the experience. '),(493,NULL,0,'5','Observations',',11,7,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-26 14:46:04','I have been an educator for over 12 years and I have never been more disappointed for my students and my profession than I am this year. I constantly assess my students and tailor my instruction by the data in order to meet the needs of all of my students. \nThese tests that my students were put through this year were unfair and unrealistic. You are asking fifth graders to complete high school level questions. They were not given an age appropriate test.  In our district which is comprised of 85% second language learners, and low income population, these tests were impossible and in no way measured the intelligence and competency that they contain. The demands placed on these children are impossible. All of my ELL’s timed out even with extended time. \nSo how exactly does this measure or help our students?\n'),(494,491,0,NULL,NULL,',','Tom Hoffman','Other','tom.hoffman@gmail.com',1,NULL,0,0,'2013-04-26 14:46:23','This debacle will increase the pressure to move to computer adaptive testing, because a lot of the length and repetition in this test was probably caused by trying to include too many items above and below grade level to try to produce accurate (looking, at least) growth numbers.  You can do that much more efficiently with an adaptive test.\n\nI\'m not saying it is a good thing, but it is their obvious response to this.'),(495,NULL,2,'National','Observations',',11,2,10,','Sandra Wilde','Other','sjwnyc.sw@gmail.com',0,19940,0,1,'2013-04-26 14:50:18','After reading all these comments, and in light of the sample test items that were released by the state earlier, I believe that these tests were created in a very amateurish way, with little attempt to determine if they were actually appropriate for the grade levels they\'re being used for. Instead, the items are constructed  in a very narrow way, not from the standards themselves but from a narrow set of ideas - based on the Publisher\'s Guidelines and statements from the architects of the standards - about  close reading,finding evidence from text, and comparing texts to each other.. \nThey\'ll be able to create a bell curve from the results, but students\' scores in relation to those of other students are unlikely to provide much information about how well they\'re actually achieving the standards, since they\'re so unlike the real reading and writing that students do. \nIn the meantime, these horrible tests were administered without any attention to the predictable emotional effect that they would have on millions of children who were not only stressed but in many cases upset and crying because they felt that, despite their hard work, they were going to fail. \nGiven the disaster that these tests represent, they should be made fully available for review by the public and scholars. Given such a drastic and problematic change in testing, transparency and public comment need to trump test security.\nI am a professor of curriculum and teaching at Hunter College, CUNY.'),(496,NULL,0,'7','Observations',',11,1,','Colleen Henry','Teacher','chenry@socsd.org',0,NULL,1,0,'2013-04-26 15:04:33','Dear New York State Educatin Department,\nAs a seventh grade teacher, I made several observations during the three days our students were administered the NYS ELA Common Core Test.\n-Students were required to take a test and manage their time as if they were completing a project, not an exam. \n-The first day of multiple choice questions was not a time issue for most, but those who were granted extra time spent up to 180 minutes taking a test.\n-Day 2 was logistically difficult for most. Students did not have enough time to complete multiple choice questions, write three paragphs, and complete an essay. Those who did finish complained that they did not have sufficient time to check their work. Others planned their essays on the planning page that is provided, but did not have time to write the essay.\n-The test makers need to review both the 2-point writing rubric and the essay rubric. \n-In order for a student to receive full credit on the 2-point questions, a student is required to formulate a claim, provide two supporting details, and explain those details.\n-HOWEVER, at the Scoring Leader Training, students were receiving full credit for simply listing two text details. \n-Therefore, students who spent time doing the full task may have had time issues.\n-Day 2 set students off because they were instructed to complete Book 2 before doing any work in Book 3. both books were distributed at the same time, and some students wanted to complete Book 3 first because it had more difficult tasks in it\n- Names of places used variant spellings with no footnote. Students were afraid they were being asked trick questions\n-Students complained they were being asked the same types of questions over and over. \n-They were repeatedly asked to formulate claims and find two supporting text details. Does that skill need to be assessed over and over?\n-Can there be less questions?\n-Can we test ELA every other year, and alternate with math and not let money that publishing companies make become the factor to answer that questions\n-Students will quickly realize that they do not have time to read the entire test, and they will start using strategies to just find the answers (the same text book strategies they use when they become overwhelmed with the amount of reading)\n-Students were not asked to do anything creative\n-Creative reading and writing will become null and void\n-If teachers alther instruction to tackle these test taking strategies, the love of learning and teaching will diminish.\n'),(497,NULL,0,'7','Observations',',11,','Colleen Henry','Teacher','chenry@socsd.org',0,NULL,0,0,'2013-04-26 15:09:50','As a seventh grade teacher, I made several observations during the three days our students were administered the NYS ELA Common Core Test.\n-Students were required to take a test and manage their time as if they were completing a project, not an exam. \n-The first day of multiple choice questions was not a time issue for most, but those who were granted extra time spent up to 180 minutes taking a test.\n-Day 2 was a time management issue for most children. Students did not have enough time to complete multiple choice questions, write three paragphs, and complete an essay. Those who did finish complained that they did not have sufficient time to check their work. Others planned their essays on the planning page that is provided, but did not have time to write the essay.\n-The test makers need to review both the 2-point writing rubric and the essay rubric. \n-In order for a student to receive full credit on the 2-point questions, a student is required to formulate a claim, provide two supporting details, and explain those details.\n-HOWEVER, at the Scoring Leader Training, students were receiving full credit for simply listing two text details. \n-Therefore, students who spent time doing the full task may have had time issues.\n-Day 2 set students off because they were instructed to complete Book 2 before doing any work in Book 3. Both books were distributed at the same time, and some students wanted to complete Book 3 first because it had more difficult tasks in it.\n- Names of places used variant spellings with no footnote. Students were afraid they were being asked trick questions.\n-Students complained they were being asked the same types of questions over and over. \n-They were repeatedly asked to formulate claims and find two supporting text details. Does that skill need to be assessed over and over?\n-Can there be less questions?\n-Can we test ELA every other year, and alternate with math and not let money that publishing companies make become the factor to answer that question?\n-Students will quickly realize that they do not have time to read the entire test, and they will start using strategies to just find the answers (the same text book strategies they use when they become overwhelmed with the amount of reading).\n-Students were not asked to do anything creative.\n-Creative reading and writing will become null and void\n-If teachers alther instruction to tackle these test taking strategies, the love of learning and teaching will diminish.\n'),(498,NULL,0,'general','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-26 15:39:08','I WANT TO HEAR FROM SOME OF THE HUNDREDS OF TEACHERS WHO ARE SCORING THE TESTS!!!!!'),(499,NULL,0,'5','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-26 16:43:40','MUST clarify whether or not students are allowed to write below the lines to continue a response. I hear some testing sites are giving credit and some are not!'),(500,NULL,0,'general','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-26 17:28:04','My two girls, one in 6th grade and the other in 8th came home in tears after day 2.  They did not get to the essay.  They both expressed how unfair it was to expect them to do 2 books in 90 minutes.  They are hard working students and felt so bad.  I as a parent felt so impotent.  Why are our children being used?  Why is their love for learning being taken away by the pressure to test without enough time?  Why trick them with these confusing answers?\nWhat is NY DOE really looking for?  More money from the federal government at the cost of making our children feel like failures?\n'),(501,NULL,0,'6','Observations',',11,','Scott ','Teacher','Smisner@nred.org',0,NULL,0,0,'2013-04-26 17:47:02','The test is too long.  Is there a way to effectivley assess a students progress in half the time?\n\nThe test is too difficult for most students.  Is there a way to differentiate the test to appropriately assess out students, without them feeling lost and anxious due to the level of difficulty?\n\n'),(502,NULL,1,'6','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-04-26 18:07:11','I\'m in the minority here. My child said the test was easy. If this is the common level of education expected for 6th grade then there is no question that parental involvement (making them read and practice well beyond what is being taught in school) is key to keeping your kid way above this mess. '),(503,NULL,0,'4','Observations',',11,','Melissa Coletti','Teacher','mcoletti@portchesterschools.org',0,NULL,0,0,'2013-04-26 18:15:40','Overall, I felt the reading passages were fair samples and grade appropriate. The questions were tricky and to decrease the time was a poor testing condition. I am really annoyed that within the modules we taught the students to \"close read\" by annotating text, underlining vocabulary etc and then some students didn\'t have enough time to finish the assigned passages. What gives????'),(504,NULL,0,'5','Observations',',11,','Laura Kavourias','Teacher','lkavour@schools.nyc.gov',0,NULL,0,0,'2013-04-26 18:16:33','Seriously?!  On a whole this test was ridiculous! What is the point of making this a 3 day test?  The children are exhausted by the 3rd day, which means they are not accurately getting assessed.  If we must give them an assessment, make it only one day, pretty much mimicking Day 2 of the test. The children had an opportunity to answer multiple choice questions and short response and an extended response questions.  That was enough! The passages were long and the questions were difficult.  However, that is nothing compared to the answer choices.  Were they trying to trick the children?! Some of the choices were too close to choose.  How unfair to have these poor, YOUNG children be under such stress!  Learning should be an enjoyable experience.  I agree the bar needs to be raised, but not raised so much that it comes slamming down on them and hurts them in the end!  I truly hope things will change for the sake of our children.'),(505,NULL,0,'7','Ideas for Constructive Action',',13,','K. Bardin','','bardink@corinthcsd.com',0,NULL,0,0,'2013-04-26 18:18:52','The test needs to become fair and the goal attainable for all students.  The test was not fair.  The skills I taught my students this year were aligned with the common core strands and used the 21st century skills.  The extreme focus this year that was put on reading closely was not fairly assessed by these tests. During the Scoring Training Workshop for Distric Trainers I asked a question which could not be answered by either of the two Boces people leading the workshop.  The question was, if we are teaching our kids to read closely so they can get the most out of the reading, then how come the state test is giving too many reading passages which therefore does not allow the student to read the texts carefully?  I prepared my students to be good readers, and writers for this test and I feel that the test let them down.  My students felt beaten and defeated on day 2 because they were doing their best, applying all their good reading and writing skills, and then ran out of time! Most students in my homeroom either rushed through the essay, not using their planning page as they were taught, or they used their planning page and then ran out of time to complete the essay.  Even the directions were flawed.  This years directions stated that they may need to read a text a second time.  They were lucky if they had enough time to read it once.\n  Why does the state continue to set these kids up for failure?\nI haven\'t even mentioned the types of questions asked- there were numerous questions that even an adult with a degree in English would have a tough time answering.  The level of thought that they expect a 12 year old to have for some of the questions was unfair.  A few of the questions, regarding authors purpose, had 2 good answers and someone with a Masters Degree may have been able to pick the best one!\nIdeas for Constructive Action:\n- Assess the kids on the skills you are asking them to learn\n-Fewer reading passages (If the state can\'t accomplish the skills they are assessing in less than 8 reading passages, maybe they need to re-examine what skills they want demonstrated by the test)\n-Why have 3 more reading passages and 21 multiple choice prior to \na writing assignment? Not enough time!!!!!!!!!!!\n-Nurturing a life long love of reading is not going to be accomplished if we keep beating the kids up mentally by all of the reading on these tests!'),(506,NULL,0,'3','Observations',',11,','Maureen McLoughlin','Teacher','mmc',0,NULL,0,0,'2013-04-26 18:34:31','Many students could have used about 15-20 more minutes to work.  With many students not finishing it does not give a true picture of what the students can do. \n'),(507,19,0,NULL,NULL,NULL,'Kathleen Tolan','TCRWP Staff','',1,NULL,0,0,'2013-04-26 22:18:21','The children couldn\'t rush because the test required so much going back and rereading.  '),(508,63,0,NULL,NULL,NULL,'Kathleen Tolan','TCRWP Staff','',1,NULL,0,0,'2013-04-26 22:20:38','I couldn\'t agree more.'),(509,358,0,NULL,NULL,NULL,'Kathleen Tolan','TCRWP Staff','',1,NULL,0,0,'2013-04-26 22:32:48','Wow!!!  Why does this portrayal of our school system failing persist?  What is the benefit of that? '),(510,502,0,NULL,NULL,NULL,'Sean','Teacher','sdowling@threevillagecsd.org',1,NULL,0,0,'2013-04-26 22:46:49','Based upon your thoughtful comment, I\'ve no doubt your child does well in school. With that being said, I\'d be leery of any child saying the ela was easy, because they were not. Sometimes the kids don\'t know what they don\'t know!'),(511,NULL,1,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-26 23:18:44','The type of questions being asked were confusing to the students. They were asked more than once to answer the same type of question in the short responses. For example. \"Why was the setting important and give 2 details to support it?\" The children thought that they had to give the definition of a setting. It should have been stated, \"What is the setting in the story and why is it important?\" \nAlso in the multiple choice part of the test, the children were exhausted from reading the long passages and having to constantly go back to specific paragraphs to compare themes within each paragraph. These type of questions tested stamina not reading.\nThree days of testing with 4 books were exhausting for these students, especially with children who have an IEP, 504 or are ELL learners. Even the children in a general education class were stressed out by this experience, and some of them ran out of time and did not finish the tests.\nWhat are we really trying to test? Is it reading comprehension, written expressive skills or how well a student can survive a 3 day ordeal? '),(512,NULL,0,'3','Observations',',11,','Teacher ','Teacher','',0,NULL,0,0,'2013-04-27 00:14:26','Directions were to long \nThere is no need to put field test questions in a 3rd grade test- \nAnswer choices too wordy and some choices were so close that is was hard for a grown up to decide.  \nPassages and text complexity was fair. \nQuestions were clear. \nIn the writing part there should not be a time limit.  Children needed more time \nYou clearly had to teach children how to take the test-  the format is different from what they are used to.  '),(513,NULL,0,'7','Observations',',11,','Jim Tierney  Grade 7 ELA teacher','Teacher','JimTier1@gmail.com',0,NULL,0,0,'2013-04-27 01:02:40','I felt so bad for my students.  They were in such a state of anxiety because of the unreasonable time constraints. Some of my best students didn\'t even get to the essay.  They need to stop putting field questions on these tests. They undermine the student\'s confidence and they don\'t even count for their score.  This test demoralizes both teachers and students.  No wonder so many good teachers are leaving education. SHAME on us for putting our students through this test.'),(514,19,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-04-27 01:04:40','My sentiments exactly.   My students did not have time to finish and the thinking they were expected to do should have not been timed so unfairly.   \"Think deeply, but hurry up, hurry up, hurry up!\"   My students felt defeated.  '),(515,19,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-04-27 01:04:50','My sentiments exactly.   My students did not have time to finish and the thinking they were expected to do should have not been timed so unfairly.   \"Think deeply, but hurry up, hurry up, hurry up!\"   My students felt defeated.  '),(516,23,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-04-27 01:06:40','I\'m a teacher.   You, as a parent are doing the right thing.  Thank God for parents like you.   Enjoy the book!'),(517,26,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-04-27 01:10:52','Bypass the Chancellor. Go directly to Dr. King, Commissioner of education.  Contact your congressman/woman.  Parents have to be the ones to fight this battle.  Teachers and their unions are not being listened to.'),(518,31,0,NULL,NULL,NULL,'Peggy','Teacher','',1,NULL,0,0,'2013-04-27 01:19:16','Renee,  You have stated my sentiments exactly.   This nation\'s obsession with data for data\'s sake is destructive.  I too, had difficulty deciphering what exactly the test makers expected in the answer choices and in the short responses.   Two masters later I had to do some deep thinking and analyzing to make my choices.  Yet, I am not 9 YEARS OLD!   What is the point in all this?'),(519,NULL,0,'8','Observations',',11,','Betsy Ryan','Teacher','betsylryan@yahoo.com',0,NULL,0,0,'2013-04-27 01:27:09','we have produced a generation test phobic students who are taught to write by the formula that the test required and scored not to give and credit for creative thinking or cognitive development...just test if the students can write according to a \'formula\' James Joyce would have slit his throat...We need to have standards across the country to rpoduce proficiency  in order to improve American education..,but what happened to all the work that Gardiner has done  Even John Dewey would shout\"Stop and THINK\"! If he saw what was going on. I feel sorry for the students and rue the waste of money, time and effort.'),(520,34,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-04-27 01:32:02','Yes, Kim.  It is unfair to compare us to those other countries that VALUE education.   As we get deeper and deeper into this new phase of education the less fun the kids and I are having.   My 4th grade girls decided to make their own \"Barbie Dream House\" this week. (After TEst release!)   It was amazing to watch them problem solve as to how to construct such a thing using copy paper, construction paper and tape!   I suggested they use card board, so a student brought in cardboard the next day and constructed a staircase (exactly how a contractor would do it!).  She made the side panels by cutting a zig zag progression and then used short pieces to lay the risers and the steps.  She even made 90 degree angles. Brilliant.   I wanted then and there to stop all lessons and to create a \"dream house\" construction to scale.  What better way to incorporate mathematics?   But, no.   The fear that they will \"miss\" something that they \"have\" to know has now become imbedded into my psyche that I am no longer able to run with it as I might have in the past.   BTW  we are a \"focused\" school due to our SWD scores.  These state exams are hurting my students.\n'),(521,67,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 01:45:01','I sat beside a teacher from Canada on the airplane the other day. Canada does better than the US on tests that are given to many international countries, so I was interested in what high stakes tests are like in Canada. The teacher told me that kids are tested in grades 3,6 and 10, with only 10th grade \'counting.\' If the USA would follow suit, then our tests could involve more essays, more short answer, and rely less on multiple chice. There\'s be time for scoring of hard-to-score items. So yes, I think the tests can be much shorter, but I also think skipping years would be better.\n'),(522,141,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 01:47:26','Suzanne,\nI want to appreciate the fact that you signed your name to your post. I think our site will have more credibility if more of us do that. I also appreciate the specific concrete suggestions you gave. I especially laughed at your last line--from what I hear, the test felt like it would have been appropriate in an AP lit class for high school seniors.\n'),(523,236,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 01:49:12','I so agree with your  comment about the fact that something is very wrong if adults can\'t choose the right answer, even adults who are deeply involved in book clubs and lit studies.\n'),(524,278,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 01:55:40','PJ,\n\nThis is a beautiful post. I found myself a bit teary as I pictured your kids, working away so industriously, and thought about your pride in their hard work, too.  I find that in many of these posts, teachers are rooting for their kids, filled with enormous pride in them. It is quite beautiful, really. I feel proud of you and other teachers, just as you feel proud of the kids.'),(525,126,0,NULL,NULL,NULL,'Anonymous','Parent','',1,NULL,0,0,'2013-04-27 01:57:35','Bravo.'),(526,130,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 01:59:04','Katherine,\n\nThis is the very least we could do. Watch this weekend to see how we go about categorizing the posts abd see if you think that helps. We have journalists reading this, which I think is a good thing.\n '),(527,216,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 02:00:31','Denise,\n\nYou\'ve said what every teacher I know is feeling.\n\n'),(528,209,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 10:07:52','The flipping back to the students took the time away from them.  It wasnt that hard a test it was a test though that took time and reminded kids why reading isn\'t fun'),(529,19,0,NULL,NULL,NULL,'Janet','','',1,NULL,0,0,'2013-04-27 10:09:33','I think though now what we have to remind kids about is that this isn\'t reading.'),(530,26,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 10:12:14','I think you as a parent have to make sure you let the media know how you feel as well'),(531,NULL,0,'general','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-04-27 10:25:14','I can\'t help believing that the State and the world is listening to this feedback and thinking about the negative consequences to a test that is arduous, timely and apparently not a true measure of students ability to go to college.  In looking aver statistics to college one wonders if at times we are mislead.  College costs are astonishing and a number of students can\'t afford it how are we helping them,  students in their first year often can\'t make it due to a lack of understanding ow to be independent how are we helping learn to be independent, college often do not take student due to their application essays it\'s a personal story, and of course there are students who are not at the level of college in a recent article read this percentage has not really changed since the 70 as a matter of fact the article said that students going to college as grown which is why graduate school entrance is increasing.  The counties we are compared to do not test at such a young age, value education and allow education to be taught by educators.  Will this become a time where Darwins theory takes over and only the top win cause we are creating a time where we will not help all students.  This test indicates that are theory of education is flawed.  Testing was originally created to measure students abilities in a given subject area.  It was to be used to educate our students help them grow, now it\'s to test our students speed skills, if you are fast you win one wonders what will this due to the future of our world. Let\'s be more responsible with our future and not use rhetoric and propaganda to push an agenda that could end up damaging our next generation.'),(532,94,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 10:26:09','In our school there were students throwing up'),(533,31,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 10:31:23','I think as educators the data for this exam goes to the administrators of this exam.  Danielson, Maezanotalk about data being responsive and purposeful.   Will this data be useful in that way absolutely not but it is useful in re examining  the direction we are taking in education and thinking about purpose of that direction.'),(534,94,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 10:36:51','Unfortunately we were prepared well for this exam your work was so helpful but timing was impossible.'),(535,452,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 10:49:47','So true scoring is subjective '),(536,NULL,0,'general','Observations',',11,','Charlie','Parent','',0,NULL,0,0,'2013-04-27 11:02:00','Is it true that the scores Pearson gave to writing often were conflicted and some responses inaccurate.  How can a  company give tempates and explanations that were grammatically incorrect.  Do we not spend a lot of money on this?  How can we evaluate any child with answers and scores that I heard contradicted each other.'),(537,123,0,NULL,NULL,NULL,'Loretta Fowler','Principal','lfowler@mail.fehb.org',1,NULL,0,0,'2013-04-27 12:39:51','Dear Rose,\nI wanted to assure you that your story is not the only one.  I had a third grade student who is classified as Emotionally Disabled, and who is academically performing at a kindergarten level,have a complete meltdown in the hallway on Friday of ELA testing week.  All the frustration she had been experiencing during the 3 days of ELA testing accumulated for her.  I have her entire tirade documented on our school security system tape.  She just didn\'t understand why she had to take a test she couldn\'t read.  I had to agree with her while at the same time calm her and prepare her to be safe in the hallway and with her class during their Second Step class....which is a counseling class all our students attend.  She will need this class and positive interactions with her peers and teachers to be successful in our community even more than her academic knowledge.  Tests will never measure the social impact students, teachers, and administrators have on improving the lives of children. \n\nThank you for helping this young boy calm himself and for keeping the environment safe for your other students.  Believing all students will be at the same place on these tests is not reasonable.  Believing all students can improve and show growth is reasonable.  Yet it will never happen if they are given material they cannot read.  '),(538,63,0,NULL,NULL,NULL,'Michelle','Teacher, Parent','discenzamichelle@gmail.com',1,NULL,0,0,'2013-04-27 12:43:13','I agree with all of your ideas. However, #\'s 1 and 2 were my favorites!'),(539,356,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 13:06:54','Tom,\nWould you phone me at Teachers College tor write me (lucycalkins@comcast.net) with a phone number so I can understand your suggestion. I grasp the rating system idea and will see if our tech team can do that.\nLucy'),(540,401,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 13:10:54','Chris,\nI think your request for transparency may be the single most important post on this site.\nI hope others read this and help us figure out ways to make this happen.\nLucy Calkins'),(541,476,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 13:12:16','Your kids are right. Teachers are going to be judged and hired/fired based on kids\' results.\n'),(542,NULL,0,'general','Observations',',11,','Deborah Mumford, EdD','Teacher','mrsmumphie@aol.com',0,NULL,0,0,'2013-04-27 13:14:12','Although I am a Kindergarten teacher, I work with dedicated professionals in the upper grades of my Elementary School, and it saddens me to think that my former students are being tested on material that is based on a common core that is yet to be fully implemented in our district. I question  the thought process behind the design of such testing that has impacted our school to the degree that this unfortunate spring ritual has...Our younger students are not allowed to play outside for their morning recesses as their older counterparts are test taking and the noise is disturbing... Teachers are being pulled from their classes for correcting state tests, and aides are being re-assigned to cover classes with missing teachers as there are just not enoough subs to go around..The latest involves our specials\' teachers in Music and Art who are having to cancel their classses for all students(K inc.)as they are being re-assigned to cover classes as well...\n\nWhere are the state funds to relieve districts of these mounting costs, and day-to-day logistics?\n\nHow are these standardized tests going to influence curriculum to the point that they help to improve classroom teaching?\n\nAnd needless to say, how are we going to counteract the emotional damage the state tests are causing to some of our children who are crying and vomiting on the morning of the tests as they fear their performance?\n\nI think we need to re-think, re-evaluate, and re-assess our state\'s position in this process...'),(543,50,0,NULL,NULL,NULL,'Bill Heller','Other','thinchalkline@gmail.com',1,NULL,0,0,'2013-04-27 13:16:08','Help me understand why you would arbitrarily exclude teachers of greater than 20 years of experience from participation in test construction.  I find this ageist, discriminatory, ignorant and highly offensive.  Such prejudices only serve to divide the coalitions of parents, teachers and teacher educators who will have to join to fight the considerable political and economic influence of the corporate reformers.  I hope you will reflect on the breathtaking narrow-mindedness that your comments reflect.'),(544,495,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 13:18:13','Sandra,\nI agree that the test seems to have been written in line with the Revised Publisher\'s Criteria and not the CCSS. I know that some are trying to save the CCSS by helping people understand that most of what people feel is wrong abt the Common Core and this test has nothing to do with the Common Core itself, it is the Publisher\'s Criteria to the Common Core, which inaccurately represents the CCSS. People do not realize that the view of reading and writing in the actual CCSS is far more robust and grounded in the real world of skilled reading than is the AP English-lit crit view of reading in the Publisher\'s Criteria and now, these tests. The tests illuminate the limitations of the Publisher\'s Criteria, more than of the Common Core. I find many people however do not realize that the CCSS and the Publisher;s Criteria are opposing views. People should find Pearson\'s chapter in the IRA book that just came out of the standards as he addresses this with some detail.'),(545,26,0,NULL,NULL,NULL,'Bill Heller','Other','thinchalkline@gmail.com',1,NULL,0,0,'2013-04-27 13:19:36','Our representatives in the State Senate and Assembly are claiming that they are not hearing anything about these tests.  Parents, especially of the same party as these representatives, must make those phones start ringing in order for anything to be even questioned at the state level.  I would LOVE to see Commissioner King marched into hearings to try to defend the indefensible. '),(546,105,0,NULL,NULL,NULL,'Bill Heller','Other','thinchalkline@gmail.com',1,NULL,0,0,'2013-04-27 13:31:26','Apparently corporate mind-reading is one of those \"21st Century Skills\" that our students need to be \"college and career ready.\"  Perhaps we should include astrology and tarot reading in our core curriculum.'),(547,31,0,NULL,NULL,NULL,'Bill Heller','Other','thinchalkline@gmail.com',1,NULL,0,0,'2013-04-27 13:37:56','Embedded in your comments is probably one of the most useful bits of data that I\'ve seen.  You mention that the passages on the fifth grade exam were listed on the engageny website as being instructional texts at the seventh grade level.  This seems to be a \"smoking gun\" that confirms my own suspicions that the entire purpose of this testing enterprise is to make public schools and public school teachers look incompetent and ineffective as possible to the public.  It\'s pretty evident to me that the last purpose of these assessments was to give students a chance to \"represent\" and show what they have learned and can do.  By no means can these be considered valid and reliable measures of student achievement or teacher efficacy, particularly when the \"cut scores\" are set after the fact in such a way that it can already be predetermined as to how many students will score at each level.  The idea that one needs three and one-half hours of testing to sort students on a scale of 1-4 is ludicrous. '),(548,NULL,0,'7','Observations',',11,','Karen Malone','Teacher, Parent','kmalone3@yahoo.com',0,NULL,0,0,'2013-04-27 14:06:08','My son spent more time testing these last two weeks than most lawyers sit for their LSATS!  He has done nothing but take tests and practice tests for weeks now.  How is it possible that educated people think that this is education?  I also can\'t believe that the teachers cannot look at (or talk about!) the test before, during, or after the test is given.  How does instruction improve this way?  It defies logic. Interesting that the test can never be seen so there can never be criticism of the test or any of the actual test questions.  It\'s an insidious situation whereby the people who create a system of accountability are never held accountable.  '),(549,NULL,0,'5','Observations',',11,','Mel Haley','Principal','mhaley@herricks.org',0,NULL,1,0,'2013-04-27 14:33:45','I think that Liz Phillips really gets to the heart of the matter in her analysis of the test questions and whether, in fact, they measured students\' ability to demonstrate meaningful comprehension of the text.\n\nWhile structure and craft are important elements in analyzing the relationship of ideas and information in a text, the ELA test questions focused on these standards in a manner that did not assess whether students were able to use these elements to integrate and synthesize information and ideas.\n'),(550,NULL,0,'general','Observations',',11,','mhaley','Principal','mhaley@herricks.org',0,NULL,0,0,'2013-04-27 14:35:23','I think that Liz Phillips really gets to the heart of the matter in her analysis of the test questions and whether, in fact, they measured students\' ability to demonstrate meaningful comprehension of the text.\n\nWhile structure and craft are important elements in analyzing the relationship of ideas and information in a text, the ELA test questions focused on these standards in a manner that did not assess whether students were able to use these elements to integrate and synthesize information and ideas.\n'),(551,NULL,2,'general','Observations',',11,','Audra Robb','Parent, TCRWP Staff','audra@readingandwritingproject.com',0,NULL,0,0,'2013-04-27 15:24:15','I have heard from scorers that there is now a scoring code to assign to blank written responses (rather than giving these a “0”), presumably so that the state can decide what to do about the large number of students who did not have time to attempt a response. This allows for some accounting for what was clearly a miss-step in the timing of the exam (especially on Day 2). However, it\'s unclear how this will affect individual students\' scores, and, therefore, teacher ratings based on those scores. Such a colossal problem may invalidate all of Day 2\'s extended responses - which then becomes unfair to those students who may have rushed their multiple choice selections to allow themselves time to get to the essay. It’s also been made clear by the state, at least at some scoring centers, that if a student wrote anything at all for their essay, even if it was just a restatement of the prompt and then the words “sorry didn’t have time” that this counts as an “attempt” and therefore must be scored – and of course would then receive a “0.”\n\nThis in itself might not be so important - everyone might understand that Day 2 scores are a little unreliable - except that the data will inevitably be lumped together to create a final score for the student, then groups of student scores will be lumped together to create a score for a teacher - as if all of the scoring information (Day 1, Day 2, 2013, 2012) has equal validity. This may be ok for looking at district-level data over years, as the same irregularity existed for all students across the state, so it shouldn\'t affect the ability to look for trends, etc. What will matter is when the data is disaggregated at the student and teacher level. Then a particular student is going to end up with a score that follows him/her to middle school, to high school, etc. and a particular teacher is going to have his/her rating impacted by the specific way his/her students did or didn\'t rush to get to that last essay, which has no bearing on whether the students were prepared well to respond to multiple choice questions and write successful essays when given enough time. It would likely be fairer to invalidate all of Day 2, as a way to account for the chain reaction of that timing problem across all of the students’ responses. What a true waste of everyone’s time that will have been, if that is the response – and yet it likely is the fairest response.\n\nWhat is emerging as crystal clear is that the undue weight that these exams are given as a means of measuring student, and now teacher, performance, exacerbates any design or content flaws in the tests. Plus, the secrecy around the test - its status as \"secure\" - makes it impossible to even give specific educator feedback that would potentially help to improve the test as a fair assessment. And perhaps most distressingly, its security prevents the test from being subject to public scrutiny, and therefore the state policy makers are not held accountable for contracting for and approving a test that judges students and teachers unfairly.\n'),(552,NULL,0,'7','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-27 16:02:07','We are always told to conduct culturally responsive instruction. However, these tests unfairly favor students from suburban backgrounds. No wonder urban students struggle when they read passages that they have no prior knowledge of.'),(553,281,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 20:31:13','I agree that it is a bit odd to read this whole site, to see so much detail about the fact that kids were caught off guard over the length of the test, unaccustomed to doing close analytical reading to a stop watch (let along to the multiple booklets etc in a day) and to have a principal say that the test was just fine...Even the State Department is responding by saying there will be continued iterations. I\'m thinking that the principal who wrote this perhaps is perhaps worried that parents and kids (and teachers) will opt out. '),(554,472,0,NULL,NULL,NULL,'Lucy Calkins','TCRWP Staff','',1,NULL,0,0,'2013-04-27 20:33:00','we actually have evidence that A LOT of people are reading this. So continue speaking up.\nLucy'),(555,308,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-27 20:34:21','Bravo.'),(556,NULL,0,'general','Observations',',11,','Christine B.','Teacher','seteachr@nycap.rr.com',0,NULL,0,0,'2013-04-28 00:11:12','I\'m a special education teacher. My students are of third and fourth grade age, but they function at roughly a first grade level.  The district, teachers and parents have worked hard to get them placed in a small, special education class because they learn not only in different ways, but generally at a very different rate than their peers. \nDespite all the effort spent to give them the instruction and attention that they need, the State has determined that they need to take tests at their \"assigned\" grade level.  All in the name of \"data to drive instruction\".  What a farce.\nThe first thing I was taught in statistics class was; \"garbage in equals garbage out\".  I\'m here to tell you that NO reasonable data will be gained from the tests that my students completed.\nImagine being required to take a test where you could only read one out of every 8 to 10 words.  How well do you think YOU would do....or how would you FEEL?\nMy students work VERY hard for me and they TRUST me.  They really tried, but when a child reads at a first grade level, there is NOTHING that I can teach that child that will help him/her to get a better score on a fourth grade test.\nHowever, I can tell you PRECISELY what EVERY student in my class can and cannot do/understand....and I can show you examples of student work to demonstrate these skills (or lack of them).  Why not ASK ME?\nThis testing is the most painful thing I\'ve done.  It feels like child abuse.\nAnd then there is this misguided notion that a teacher is the only factor that effects a child\'s performance...on a test or otherwise.  I teach in a high-needs district.  I\'m not confident that I would be able to come to school and function if I had to go home each night to the families and conditions that my students live in....yet my students do it every day.  Yet these \"outside\" factors are not considered...we just blame the teachers when students do poorly in school or on these tests.\nNYSED needs to wake up.\nOne size does NOT fit all.\nStudents and teachers should be able to show their skills based on portfolios of their work.\nPlease stop the abuse of our most precious gift....our children!'),(557,209,0,NULL,NULL,NULL,'Laurie Pessah','TCRWP Staff','',1,NULL,0,0,'2013-04-28 02:35:10','Over the past week, I have visited several schools that reflect similar sentiment.  Children and teachers alike talk about their terrible experience with the ELA.  Go into the teachers\' lounge and you will hear continued conversations about lack of time. The pervasive  feeling was one of defeat.  Never have I seen more dedicated teachers who feel defeated.  Never have I heard  so many students feel defeated.  Surely there is a better way .'),(558,NULL,0,'3','Observations',',11,','Dane Snow','Parent','allnotes4me@hotmail.com',0,NULL,0,0,'2013-04-28 02:57:38','Test made my child hide and cry at school.  He was a wreck when he finished the first day.  I refused the test the following days.  I wonder if a faulty field test question was the first question that ruined him.  Stop high stakes tests!'),(559,NULL,0,'7','Observations',',11,','Margaret Horton','Teacher','mhorton@horseheadsdistrict.com',0,NULL,0,0,'2013-04-28 13:28:50','The 7th Grade 2013 ELA by no means measured what my students can do. Each of the 3 days was not \"more rigorous\", as was told to everyone by NYSED, but extremely long, with too much to complete in 90 minutes. I had 8 out of 91 students who never finished at all, one, two, or all three days. What is even more troubling to me is that I had dozens of my best and brightest students tell me that they barely finished, rushing to beat the clock. They had absolutely no time to go back and revise and proofread on days 2 and 3, or to check their answers to the multiple choice questions on day 1. When my very best readers and writers tell me that there was no time for the writing process and double checking answers, something is very wrong! All I could do is shrug my shoulders and look sympathetic, since NYSED has also forbidden any discussion of the test. \nI do not believe that even I, who earned a B.A. in English Literature and a Master\'s Degree as a Reading Specialist, could have done justice to the test in the time allotted. Once again, New York State Education Department has set the students up for failure by making the test almost impossible to finish well, yet is going to pat itself on the back for having the foresight to make the test \"more rigorous.\" \nUnfortunately, I believe the public will \"buy it\", since it was publicized in the news that everyone should expect lower test scores. The test scores are a farce. I feel that NYSED betrayed my students. Shame on them.'),(560,NULL,0,'general','Observations',',11,','Margery ','Teacher','',0,NULL,0,0,'2013-04-28 17:23:30','Just back from scoring the writing portion of the ELA in my district in Long Island.  A couple of things came up.  One was, that the scorers would have to be very well versed in the actual texts to realize when the kids were including a text detail, if they paraphrased.   We had a fantastic table leader who really looked at what might qualify as a detail, but I worry about other tables.     Another thing that happened was that one of the exemplar texts we felt was miscored - or our table leader did.  It was given a one, but actually it did include details, if you went back to the text and looked carefully enough.  So our table leader got in touch with the state, and they said we could change the exemplar to a 2, and that meant we gave the kids who had answers like that higher scores too.   But meanwhile,  my friend in another district had already scored her kids the day before - so how is this getting sent around?  '),(561,NULL,1,'general','Observations',',11,','Mary Ehrenworth','TCRWP Staff','',0,NULL,0,0,'2013-04-28 17:28:29','One of the things that we\'re not talking enough about is how New York City kids are scored in conditions that are so different than the rest of the state.  Hearing from all our Long Island and suburban colleagues about how they have been scoring, and they (rightly), score in pleasant conditions, with an attitude of \'how can we be as fair as possible to the kids,\'  even \'how can we really give them the benefit of the doubt.\'   They\'re scoring their own district and schools, after all, and it will reflect on all of them.   They\'ve been calling the state, and several colleagues have reported how when they got something changed from the state to benefit the kids, they would make sure other tables, and scorers in the district got the news. A lot of the scorers in these districts are retired ELA teachers who come back, they\'re glad to be there, they have the time to really pay attention, and they want to do well by the kids.   \n\nBut meanwhile in New York City, last year we heard horror stories of scorers who feel they are scoring \'other schools\' kids,\' and the system is set up now so they all feel like they are competing with each other and being evaluated against each other.   The conditions just aren\'t equal. \n\nTIme and again, when teachers compared actual student responses to what the state offered as exemplars, it was clear that kids in NYC have to do better to get high scores.   '),(562,561,0,NULL,NULL,NULL,'Katie Wears ','Other','wearskm@hotmail.com',1,NULL,0,0,'2013-04-28 18:54:43','Mary, \n\nThank you for sharing this thought. This is such a good point. \n\nKatie '),(563,NULL,0,'3','Observations',',11,','Kate Bennett','Teacher','kbennett88@yahoo.com',0,NULL,0,0,'2013-04-28 22:10:54','As an ESL teacher, perhaps my perspective is a bit different, but I would like to comment on the writing tasks, both in this year\'s as well as previous years\' ELA. Writing is a challenge for ELLs, of course, but when the writing task is based on readings that are beyond their ability to understand, then this portion of the test is not in fact assessing their writing ability at all, because they have nothing of substance to say. If you want to see how my students write, then have them respond in writing to something that they understand. I feel very strongly about this, as I do about the absurdity of prohibiting teachers from reading the state math test aloud to ELLs. As it stands now, the math test is not an accurate measure of their math skills at all, but rather a reflection of their lack of grade-level reading skills.  Surely this makes the test invalid for not only ELLs, but also native speakers for whom reading is a challenge. It surprises me that the NYS Department of Education fails to see this.'),(564,NULL,0,'general','Observations',',11,','Katie Wears ','Other','wearskm@hotmail.com',0,NULL,0,0,'2013-04-28 23:01:29','In reflecting on this year in schools, test preparation, and testing of students, I recall when I started studying the Common Core. When I first read the standards, I was excited because I saw so many possibilities and opportunities for schools and children. The standards represented the beginning of an exciting time for educators to be able to collaborate and create authentic reading and writing opportunities for all children. Today, in retrospective reflection, reading through thoughtful comments I ask, “What happened?”  There has to be a better way to support educators and children. My hope is that decision makers listen to those on the front line, in schools and working with children. Please take the time to reflect on the comments of thoughtful and knowledgeable educators to realize the impact of directives on young learners. '),(565,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-29 00:54:57','What have we done?  Who designed this tests? What guidelines did they use to create this test? What were they thinking?\nThe tests were to long for 3rd grade and very wordy. The children were mentally and physically exhausted . '),(566,NULL,0,'general','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-29 03:22:59','I can\'t stop thinking about revolutions...how do ordinary people become united and brave enough to revolt? Teachers possess a hidden reserve of power. What if we united, across cities, states and the country and simply refused to give the test? What if we instructed our students to fill in all \"b\" responses and leave short and extended responses blank? What if there was a massive \"sick day\" the days of our state\'s ELA test? We are like hamsters on a treadmill...we keep running faster and faster, doing more and more test prep and the tests keep becoming more and more developmentally inappropriate. I watched videos of kids doing \"test prep\" songs and dances...very creative, but awfully sad that teachers\' and kids\' creative talents and energies are being spent writing and performing test prep songs and dances instead of a spring play. How can we unite in such a way that our collective power ends this madness?'),(567,446,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-04-29 03:30:36','I believe you are correct. The only way the tests will no longer be given is when parents unite and refuse to let their children take the test. I applaud you for making such a wise decision for your own family and hope others follow your lead!'),(568,NULL,0,'6','Observations',',11,','Karine Moses','Teacher','kmoses@mail.ircsd.org',0,NULL,0,0,'2013-04-29 12:41:35','I was able to spend three days grading the 6th grade ELA test.  The majority of students wrote on their papers that they had run out of time for one of the essays.  If they were a good writer and able to do well on the short answer questions there was no way they were able to finish the essay due to time constraints.  The only difference between a 3 and a 4 on their essay was if they showed \"insight\"- something not currently being taught.  We were told to ignore glaring grammar mistakes and incorrect facts from the story as long as there were the required number of correct facts.  We were to count one sentence as an introduction and one as a conclusion- and it didn\'t even have to be separated.  That meant a student could make their entire essay one big paragraph and as long as they had the information it was okay.  We also had tests that had been ripped by students out of frustration.  Then to top it off we had tests that were unfinished because the child was either mildly histerical, had diarrea in their seat, or were sick but did not want to say anything because they did not want to miss the test.  It\'s sad to think that no one takes into consideration the fact that these kids are dealing with divorce, deaths in the family, going hungry, sleeping on floors or in cars and then have to take this test.  Two of the readings were so borring it was all I could do to make myself get through them... I can\'t imagine how hard it would be for a 6th grader.  I wonder at times if the people who came up with these tests have ever tried to take the test they have created under the conditions they have prescribed.  I don\'t think they could do it and they have stable backgrounds and get breakfast in the morning.'),(569,NULL,0,'general','Observations',',11,','anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-29 14:55:44','Well the testing is done and nothing is left, but all the emotional damage done to my students and my own children. The tests were way to long and again the state has done a good job providing a test that sets children up to be tricked and feel like failures. If we are suppose to be stressing deeper reading then why are the students being timed. They do not have enough time to fully reread and understand the passages let alone answer all the questions to the best of their ability. The most important skill to develop in a child is the since of accomplishment and success, but these tests do neither. They just cause tears and extreme anxiety. Hopefully some day someone will come to their senses and realize standardized tests are not needed to see growth. A report card or portfolio of their work does that. Children need to be looked at as individuals and not a score. I look forward to the day when this hopefully becomes a reality. Until then I will continue watch children\'s self esteems wither away.'),(570,NULL,0,'general','Observations',',11,','Heather Temple','Teacher','htemple@portchesterschools.org',0,NULL,0,0,'2013-04-29 14:57:52','Many students are exhausted and overwhelmed by the 3rd day of testing. None of them understand of why they have to take the test. This seems to more torture our students then help them.'),(571,NULL,0,'8','Observations',',11,','Mimi Wright','Teacher','mimiwrite@yahoo.com',0,NULL,0,0,'2013-04-29 15:07:46','I teach the 8th grade AIS course at my school. Student attitudes about the test PRIOR to taking the test varied from high levels of anxiety to complete disregard for the relevance of the test. Some were very concerned about how they would perform and wanted to do their best, and others stated they did not think the test was relevant to them in any way.'),(572,NULL,0,'6','Ideas for Constructive Action',',13,','Megan Rohlin','Teacher','Megan_Rohlin@auburn.cnyric.org',0,NULL,0,0,'2013-04-29 18:09:42','Really allow students to show what they know. allow them to have the time they need to complete the test.  In Massachusetts, student are not given a time limit to complete their work.  I had several students who are very good students run out of time because they were working so hard and diligently, using the strategies they were taught. Consequently, they will receive a condition code A, or more likely a 0 on the parts of the test they did not get to, or rushed in order to try to get something down on paper.\n\nIn addition, the field questions which don\'t even count may have taken  up some of the valuable time that student could have spent on questions that \"counted.\"  That is obviously unfair.  Go back to administering a field test.\n\nStudents with special needs should not have to sit through these tests if it is proven that they are reading well below grade level. Test them at their instructional level.'),(573,551,0,NULL,NULL,NULL,'anonymous','Parent','',1,NULL,0,0,'2013-04-29 18:56:33','I find it hard to believe that blank responses would be scored other than a zero. How is there any way to know if the reason for the blank is lack of time or lack of ability?  Agree it would be unfair to give credit to a child who didn\'t finish when another child may be penalized for rushing through in order to finish. Essentially, it\'s a mess. And the rumored solutions would only make things messier.'),(574,NULL,0,'6','Observations',',11,','Kathy','Teacher','Germinara',0,NULL,0,0,'2013-04-29 19:33:28','I thought that the reading selections, other than one obscure and difficult poem, were of an appropriate reading level considering the increase rigor that was expected.  I do feel that the tests have become unattainable goals set for our special education students who are still expected to take them.  They have an IEP for instruction, so the testing shows nothing unexpected BUT it does provide them with a glaring example of failure which deflates their motivation for personal growth at the middle level.  The short and extended responses were mostly fair, however, the multiple choice on day 2 and the additional miscellaneous reading kept them from having sufficient time to compete the writing to the best of their ability.  My best writers, who were applying all the strategies they should, were either unable to complete all the writing or to have time to revise and edit what they wrote.  These are important steps which can greatly improve the students efforts.  Instead, the students were stressed and disappointed in their own efforts.  Would you ask a professional writer to be judged by their first draft without time to do rewrites or edits?  Then why are we asking our children to race through the process to get it done.  Now on to the multiple choice of Day 1 and Day 2... even as an adult, I found it daunting to read that many passages and truly digest them in the amount of time given and this was asked of 11 and 12 year olds.  The questions seemed misleading at times and students reflected that they really felt there wasn\'t really one correct answer to some.  During scoring, I did not feel that the rubric and exemplars clearly mirrored one another and therefore leaving subjectivity as a factor in scoring across the state.\n\nWhy is it necessary to give so much testing in order to assess our students progress?  I could see that sort of testing every few years at specific grade levels (stagger the ELA, Math, etc)... with possible benchmark testing at in between grade levels.'),(575,NULL,0,'8','Implications for Instruction',',12,','Anonymously disheartened after 15 years of teaching','Teacher','Rreis1972@yahoo.com',0,NULL,0,0,'2013-04-29 21:00:58','In the past, teachers encourage all students to fill in blanks should they run out of time. We all wanted students to receive the highest grade possible. But what this exam has become is less a measure of aptitude and more a measure of endurance. Many of my students complained about running out of time. While filling in the blanks might be the best last-ditch effort to boost grades (and potentially, one\'s APPR) at what cost could this strategy impact in terms of meeting a student\'s genuine needs? What if an otherwise struggling learner \"guessed\" his way into proficiency status only to get denied AIS classes and resources? \nThis test is no longer a means to an end, or a tool to evaluate a child\'s real academi needs; rather, it is the end - a nail in the coffin; a high-stakes autopsy instead of a simple check-up. I have yet to see any evidence that such rigorous and extensive testing will actually improve achievement. Ironically, the CCLS\'s hallmark is to get kids to engage in evidence-based thinking. And yet students and teachers are censored from discussing the clear evidence that this test was nothing more than an engineered crisis. So sad. '),(576,NULL,0,'6','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-29 22:54:34','This test DID NOT measure all of the reading/writing skills and expertise my students acquired this year in the 90 minutes block we dedicated each day to working hard to make ourselves better readers and writers.\nYour writing pompts did not motivate my children to respond like they have all year long in our classroom this year.  They did enjoy the reading passages but the comprehension questions that went with them were framed in a very confusing way.  \nWe need their scores before school ends so they can reflect on their own strenghts /weaknesses. They want feedback just like anyone else and sending them home at the end of the summer is disgraceful. \nDay 2 with two books to complete was not good planning, much too long.'),(577,NULL,0,'general','Observations',',11,','June Bosworth','Parent','jgbosworth@verizon.net',0,NULL,0,0,'2013-04-29 23:26:01','I am ashamed that we have allowed a publicly traded company dictate the effectiveness of our schools.  Regarding the tests themselves, time allotted was not in many instances not sufficient and questions were many times above grade level and there is too much testing and undo pressure being placed on our children. I refuse to have my daughter taken out of electives next year and placed in ASI for this reason. Her qualitative grades are Merit Roll standard. These tests need to go. The teachers are all teaching to the test and not focusing on obtaining everyday benchmarks, teaching character building and how to be a independent adult in our society. Our teacher contract states 180 days in school starting after Labor Day. Out of that my child attends approx 150 full days due to teacher meetings, holidays etc. She has done nothing but study for these tests since two weeks prior to Easter. How many days was she taught prior? You figure it out. Sickening.'),(578,NULL,0,'5','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-29 23:55:07','Because of the lengthy passages and numerous questions, many students were rushing to finish at the 10 minute mark. We teach to go back and check, yet for many there was no time for this.'),(579,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-30 00:00:22','Scoring anchor papers were not consistent. One was directly copied from a text and a one. Some were not supported with details and were scored a 3. hard to score correctly when anchor papers were so inconsistent. '),(580,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-30 00:04:14','Test was way too long. One day of testing is plenty. How about 20 multiple choice, two short response and one long essay? Wouldn\'t that accurately show us what students could do? Additionally, having third graders say how feelings changed from different paragraphs or the main idea of different numbered paragraphs is ridiculous! '),(581,281,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-30 02:12:55','This statement cannot be applied to most of the classrooms in NYC.  The number of students who have been granted test modifications far exceeds \"one or two\" per classroom, and the number of students who need but don\'t receive modifications is even higher.'),(582,NULL,0,'4','Observations',',11,','Sunita','Parent','Sunitadeswal@gmail.com',0,NULL,0,0,'2013-04-30 03:43:21','As a parent of two kids who just took the New York State test, I feel we are headed in the right direction with the Common Core Standards. Our kids do need to be challenged more and with a little help most will do better than we imagine. I found the practice questions to be relevant, engaging and even fun! '),(583,NULL,0,'6','Observations',',11,','Angela Baez','Parent, Other','angela.baez@readingandwritingproject.com',0,NULL,0,0,'2013-04-30 03:44:33','A comment from a student that I am holding on to: \"The test was so long. But we read for a long time in our class too. I read a lot of books this year!\" So many of the administrators and teachers I talked to said that while the kids didn\'t get to show who they are as readers on the test, their stamina was astounding. Over and over, teachers told me that their students did not finish, but they worked up to the last moment; teachers said the number one thing that helped kids was working to extend volume and stamina during Independent Reading. \n\nI question the ethics of a Pearson test using passages previously published in their Pearson textbooks. Diane Ravitch\'s blog featured an 8th grade teacher who noticed the passage on the test was the same passage she used in her class the week before.\n     '),(584,NULL,0,'general','Observations',',11,','Angela Baez','Other','angela.baez@readingandwritingproject.com',0,NULL,0,0,'2013-04-30 03:51:25','ment from a student that I am holding on to: \"The test was so long. But we read for a long time in our class too. I read a lot of books this year!\" So many of the administrators and teachers I talked to said that while the kids didn\'t get to show who they are as readers on the test, their stamina was astounding. Over and over, teachers told me that their students did not finish, but they worked up to the last moment; teachers said the number one thing that helped kids was working to extend volume and stamina during Independent Reading.\n\nI question the ethics of a Pearson test using passages previously published in their Pearson textbooks. Diane Ravitch\'s blog featured an 8th grade teacher who noticed the passage on the test was the same passage she used in her class the week before.\n'),(585,NULL,1,'3','Observations',',11,','Lisa','Parent','leelove7@aol.com',0,NULL,0,0,'2013-04-30 04:25:25','How can stressing out 9 year olds by asking them questions above their grade level help them with self esteem?  It is like the adults and state are bullying these kids. Kids were throwing up in school, and crying. This is unreal, and the worst curriculum ever. '),(586,NULL,2,'general','Ideas for Constructive Action',',13,','Anonymous','Other','',0,NULL,0,0,'2013-04-30 10:00:29','When CCSS came out the electricity of possibility filled the air.  The wonder of what new possibilities, the air of understanding that students need to read and write, explore, discover.  Now we have come to realize that the CCSS has been a vehicle brought about to hurt students kids it was built to protect.  Misinterpretation, misguidance has led to tests that do not measure reading but measure whether a student can read quickly and read a little part of an exam piece by piece bit by bit never bringing the text together as real readers do.  Have we become a nation that doesn\'t want kids to read to write to grow explore and develop I hope not.  The CCSS has unprecedented possibilities if we use it right.  Let\'s not make the mistakes of our ancestors in the past.  We need to remind the world that we are here for the kids not for the publishing compaanies or for individuals to promote their own self I ferret.  How unethical is life becoming where a major company Pearson can sell millions of dollars of books that weren\'t even written or researched yet as well as billions in testing.  How unethical is our world when this company can promise the world and deliver nothing but the same old work of the past when kids failed.  The test is a warning let\'s not ignore these warning let\'s pay attention to it before a generation of kids is lost to mediocrity and capitalism.'),(587,209,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-04-30 10:06:40','The children were effected in ways that will show for years.  They were hurt by this exam.  One cannot believe that as the president said tests are being designed to hurt our kids.  '),(588,NULL,0,'general','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-30 14:13:31','PLEASE TAKE THIS POLL FOR MY BOOK “TEACHING IN 2013”.  THANK YOU.\n\nDO YOU AGREE WITH STANDARDIZED TESTING FOR CHILDREN?\n\n_______I’M A PARENT AND I DISAGREE\n\n_______I’M A PARENT AND I AGREE\n\n_______I’M A TEACHER AND I AGREE\n\n_______I’M A TEACHER AND I DISAGREE\n\n_______I AGREE\n\n______I DISAGREE\n\nPlease send your answers to garychatty@aol.com, privately.  \n\n'),(589,NULL,0,'3','Observations',',11,','nikki dumas','Teacher','ndumas@mail.fehb.org',0,NULL,0,0,'2013-04-30 14:28:48','There are many problems with this exam.  The most glaring problem is the sheer volume of reading that was expected of these young children.  Over one-third of my class did not get the chance to finish this test.  Given the challenging questions that required repeated reading of certain sections of the texts, students who wanted to answer correctly ran out of time because they were being conscientious.  I had three children in tears when the time ran out because they did not finish.  This set the tone for days two and three.  They learned to hurry through the questions just so they could have the satisfaction of completing the test. Every child worked hard on this test.  The results will not reflect the true abilities of these third graders. \nI found the test to be unfair, demoralizing, and detrimental to the emotional well being of my third graders.  My heart broke for them.  Furthermore, it set the stage for a dismal experience with the three days of math testing the very next week.  We need to work together to come up with a solution.  '),(590,NULL,0,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-30 14:50:23','•	Why are the ELA tests timed when in real life most critical tasks are not? Are we testing kids on their speed or their ability to think accurately? Most students were not able to use the reading strategies they have learned because there was not enough time.\n•	The wording of many questions was too complex and not developmentally appropriate for 9 & 10 year olds.\n•	Some questions asked for evidence that was not strong in the text. Poor questioning by the test writers.\n•	Why such a focus on one type of question (i.e. setting)? The tests did not seem to address a wide variety of the CCLS. They were over-focused on just a few standards.\n•	The questions about specific paragraphs – are they necessary? The students did not have enough time to go back into the text (which is a great skill to have and has been taught!).\n•	Why focus on the theme of a paragraph when we teach the theme of an entire text.\n•	Put books 2 and 3 together, too cumbersome separately.\n•	The tests were too long, the directions were overly complex, and the students did not react appropriately!\n•	All students (even high readers) were very over-stressed by the tests. We observed crying, banging heads, giving up, sighing deeply (and repeatedly), and many other stressed-out behaviors.\n'),(591,NULL,0,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-30 14:51:03','•	These tests were the opposite of what current research says is effective! Caulkins, Richard Allington, Fountas and Pinnell, Stephanie Harvey. What are we doing? '),(592,NULL,0,'4','Implications for Instruction',NULL,'Anonymous','Teacher','',0,NULL,0,0,'2013-04-30 14:51:49','What will happen to the teaching of reading?\no	We will lose the passion for reading. Everyone will teach to the test because of the APPR system hanging over our heads.\no	The writing process will get used less. There will not be time to plan, edit, and use graphic organizers.\no	More kids will hate reading and writing.\n'),(593,19,0,NULL,NULL,NULL,'Anonymous','Parent','',1,NULL,0,0,'2013-04-30 15:21:40','The test was unfair in so many ways to all involved, but most importantly to the children.  My daughter who does very well in English was unable to even reach the written portion of the exam on day 2 and left the school in tears and devastated.  She said it was impossible to determine the correct answers to the reading passages.  Why on earth did this test make it all the way to the actual testing?  What was the review process?  Why would anyone want to give a test that the majority of the kids could not finish?\nReally shocking that this test was given!!!'),(594,NULL,0,'5','Observations',',11,','Elizabeth Pesce','Teacher','epesce@mw.k12.ny.us',0,NULL,0,0,'2013-04-30 16:10:55','The vocabulary was sophisticated in the stories and the story often didn\'t clearly define the questionable words. In addition the modules teach the students to read, re-read and go back to read again when answering the questions. This test had too many passages to accomplish all of these tasks and didn\'t afford the students enough time to finish. Lastly the answers and questions seemed to be worded to confuse the students, what are we assessing the student\'s ability to comprehend and respond or their ability to decipher an adults question and guess at the two left over possible answers?'),(595,NULL,0,'3','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-04-30 16:24:33','My third grade daughter was not nervous about the ELA due to the wonderful job the teachers did at her school. Unfortunately, she came home crying after the first day because she did not finish. She said the test was so hard and she \"hated the ELA.\" I reassured her that she was going to fourth grade and to just do her best. This traumatic event caused her to be very nervous each day. When I asked her how the following tests went, her response was, \"at least I finished.\" Is this what we want our child to worry about!!! I am a teacher in New Jersey and when we give our state exams the pressure is tremendous. We need to decide what is important in education. Testing or learning!'),(596,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-04-30 16:40:42','Book 2 and 3 were too long for student\'s to completed in the 90 minute time frame.  Many of the 8th grade students came to class upset that for many, it was the first time they were not able to finish a test.  Student\'s voiced their concerns with not being tested on their ability, but on how quickly they could complete the assessment.  The strategies that student\'s were taught throughout the year could not be utilized effectively because of the stress they were under.  Furthermore, the answers took student\'s time to understand because of the lengthy choices.  Many commented to me that they had to reread them several times because of all the distractors leading to the loss of comprehension.\n'),(597,197,0,NULL,NULL,'','Kelly Boland Hohne','Parent, Other','kelly@readingandwritingproject.com',1,NULL,0,0,'2013-05-01 02:07:04','I\'ve been thinking over your question quite a bit, Celina. I think Chris’and others\' points about the need for transparency are hugely important. Transparency creates open dialogue and communication and conveys respect. The research says that learners need crystal clear goals and targeted feedback to help them reach those goals but the lack of transparency around these tests makes that nearly impossible. When the goals are murky, so is everything else. Danielson even says, “Secrecy has no role in assessment—such an environment feels like ‘gotcha’ to students” (p. 62 of her Enhancing Professional Practice). Teachers are held to being transparent with their own assessments. Why should this be any different?'),(598,NULL,0,'6','Observations',',11,','new','Parent','one',0,NULL,0,0,'2013-05-01 11:34:14','New one!'),(599,NULL,0,'6','Observations',',11,','new2','Parent, Other','one2',0,NULL,0,0,'2013-05-01 11:36:39','New one! 2'),(600,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-01 12:46:44','Day one- answer choices were difficult to choose- I could narrow it down to 2 choices- then I had to go back in, try to find evidence to support one of the answers and still had problems.  I guess 25 years of teaching Special Education and a Master\'s degree didn\'t give me enough experience to take this test.\nDay two- thank goodness my students with accommodations had double time to finish these tests.  At least they weren\'t crying because they didn\'t have time to finish it. ( As many of our regular education students, who are very good students, did.) I can\'t say the quality of work was there. By the third test, they were finished.  \nDay Three- What can I say- they were \'done\' before they started.  They tried their best and all had extended time all three days.  \nOn another note, I  would just like to give these examples that tell me ( and should tell all of us) that these tests are overwhelming to our children.  Since I am in a Pre-K- 12 building, we were able to share some testing experiences:  On day one, a 6th special education student ran out of the building when he was being taken to his testing site.  He was found in the field next to the school by a state policeman.  A third grade special education student had a mental melt down while trying to take his test. Tics became evident during the test- he has Tourette\'s Syndrome- and these are usually not present. - By the way, his regular education teacher was in tears by this time also.  She has been teaching for over 20 years. \nA fifth grade special education student, who was being tested alone- had a breakdown, grabbed his test, shook it and told the teacher \" Why do they do this to kids?! Do they hate us?!\"  On the second day he had another breakdown, the teacher tried to explain to him that this helps the teachers know how well they are doing their job also and he responded with \" WELL THEN, WE\'RE ALL GONNA FAIL!!!\"  These are not \'emotionally handicapped\' students.  They have do have an IEP- a learning disability. We as a staff do not pressure our kids about these tests. We try to keep it as low key as possible and just want them to try and do their best. What are we dong to our kids?  In the long run- will it be worth it?  \nThe 8th graders now have an 80-85 question written test in Science to take as well as a hands-on test in this area.  They have to take a Spanish Competency test.  They also have a state Social Studies Assessment to take.  On top of this, they are taking their final benchmark tests in English and Math.  How well do you think they will do on these.  These all have to be completed in the next 4 weeks so that all data can be in....'),(601,NULL,0,'5','Observations',',11,','bmaiorca','Teacher','bmaiorca@lpcsd.org',0,NULL,0,0,'2013-05-01 13:12:52','The test was extremely long. It would seem that it is testing student stamina, and not abilities and skills. Put the essay at the beginning of the session! The students were too exhausted and had too little time to demonstrate their writing skills.'),(602,NULL,0,'','Observations',',11,','Cindy Goepfrich','Teacher','cgoepfrich@carmelta.org',0,NULL,0,0,'2013-05-01 14:01:51','The ELA part of the NYS test was very long and tedious for students.  Part 2 and 3 on Day 2 were causing students to break down and cry.  This is not what education is all about.  Several students didn\'t finish because they were using the reading strategies that were taught to them.  I understand we are trying to raise the bar, but let\'s be fair about it.  These tests are only frustrating both teachers and students. \n\nWhen administering the Math, I watch students just give up and rush through their answers just to get it done.  By the third day, the students were wiped out, and under the impression that the school year was basically over because the state tests were done.  \n\nI believe that the state should reexamine what these tests are supposed to represent. I realize that we are data driven now, but what is the data telling us? How are these results going to help drive instruction, when most are not even allowed to know what was on the test?  I am bewildered at what the state is actually trying to accomplish with this result.  Is it necessary to put students under this stress in every grade level? To this intensive extent? Do we need over 60 multiple choice questions to determine if kids have met standards? Do we really need two extended responses to evaluate reading and writing skills? Did we need three sections of Math? \n\nI know that after two weeks of the state exams, both teachers and students were exhausted, stressed out,and confused.  NY state needs to take a step back and make this process fit with the needs of students. \n\n'),(603,NULL,0,'','Observations',',11,','Cindy Goepfrich','Teacher','cgoepfrich@carmelta.org',0,NULL,0,0,'2013-05-01 14:02:35','The ELA part of the NYS test was very long and tedious for students.  Part 2 and 3 on Day 2 were causing students to break down and cry.  This is not what education is all about.  Several students didn\'t finish because they were using the reading strategies that were taught to them.  I understand we are trying to raise the bar, but let\'s be fair about it.  These tests are only frustrating both teachers and students. \n\nWhen administering the Math, I watch students just give up and rush through their answers just to get it done.  By the third day, the students were wiped out, and under the impression that the school year was basically over because the state tests were done.  \n\nI believe that the state should reexamine what these tests are supposed to represent. I realize that we are data driven now, but what is the data telling us? How are these results going to help drive instruction, when most are not even allowed to know what was on the test?  I am bewildered at what the state is actually trying to accomplish with this result.  Is it necessary to put students under this stress in every grade level? To this intensive extent? Do we need over 60 multiple choice questions to determine if kids have met standards? Do we really need two extended responses to evaluate reading and writing skills? Did we need three sections of Math? \n\nI know that after two weeks of the state exams, both teachers and students were exhausted, stressed out,and confused.  NY state needs to take a step back and make this process fit with the needs of students. \n\n'),(604,NULL,0,'6','Observations',',11,','stacey diamond','Teacher','sdiamond@greenecsd.org',0,NULL,0,0,'2013-05-01 15:00:20','First of all, I want to start by stating that my school district prides itself for always being near the top of ranking of schools for our ELA and math state exams.  We have been a model school for many others to follow and have taught strategies to our students of how to take and conquer the never ending state exams.  I find it absolutely unacceptable that our NYS English regents continue to be shortened at the high school level, when middle school tests seem to grow and grow in length every year.  This year\'s exams were a disgrace to the teaching field, as well as to the students. \nI feel as though this test was more of a marathon, rather than an exhibit of what my students are capable of.  It became an athletic event, rather than an academic one.  I believe it went against every principle of teaching and was based on quality instead of quantity.  My top students came to me and apologized after the test for not having the time to do the graphic organizers that we spent so much time on. I would say over half of my entire 6th grade went until the last 5 minutes on day 2, with no chance to go back and check for errors or improvement...another reading strategy thrown out the window because of the length. They complained about the length of the questions and how it was distracting to them.  They said they spent more time flipping back and forth, and back again, because of the length of the question, that they lost focus of what the question was really trying to ask. \nThere was absolutely no reason for the second day of multiple choice.  The questions weren\'t any different, they did not test new skills, and were totally repetetive. \nI am discouraged that teaching has come down to the value of a test given over the course of 3 days that determines a student\'s AIS or lab involvement.  What about the students you have helped to build up from a 3rd grade reading level to a 4th or 5th level?  The looks in their eyes when they accomplish something is why I got into teaching in the first place.  Then we hammer them with a test of great length, not at their level, and expect them to perform at that level.  Look at their faces after that test...It is nothing but pure discouragement and disappointment. They feel beaten down, unworthy, and unintelligent.  All that pride that was built up in an entire year of instruction was suddenly stripped from them.  \nI worry about my top students feeling like they will never meet the state\'s expectations and the pressures they put on themselves because of that.  I also worry about my lower students seeing absolutely no importance of the exams because they are unreachable.\nSomething needs to give...Teachers need to be allowed to teach like they used to, with creative instruction and full class involvement.  I do not, and will not, teach to a multiple choice test and think that it determines how much my students really know.  I would love to see what would happened if all schools rallied together and refused to give these exams.  '),(605,511,0,NULL,NULL,NULL,'anonymous','Parent','',1,NULL,0,0,'2013-05-01 16:32:50','My fourth-grader said the same. Two questions on Day 3 asked about the importance of the setting. In one case he claims the setting was never even specifically identified and he thought he was being asked to name it. So a lot of time was spent combing through the text looking for a place name. '),(606,209,0,NULL,NULL,NULL,'Lisa Perkowski','Teacher','lperkowski@pjschools.org',1,NULL,0,0,'2013-05-01 17:26:27','I have to agree about the \"flipping\" - I had one kid in my proctoring room who\'s test booklet looked like an origami project as he had folded it eight ways to Sunday in an attempt to see the passage AND the question at the same time. If NYS wants true \"close\" reading and continues to ask questions that include line numbers, but little else, then they need to issue a book with the reading passages in it and another with the questions. As a librarian, when I teach kids to read and take notes, jot thoughts down, and make observations, the classroom teacher and I give them a separate piece of paper to record on, but yet the test seemed to think it was acceptable to have questions two or three pages from the readings, thus creating a situation where \"flipping pages\" was the only choice. '),(607,NULL,0,'5','Ideas for Constructive Action',',13,','Loretta Woods','Teacher','lwoods@sachem.edu',0,NULL,0,0,'2013-05-01 17:59:26','The paired passages were difficult for the students. I think a DBQ type of paired passaged that was related to their curriculum would have been a better choice. There are numerous passages about salvery, westward expansion etc that the students could use as background information  to help them relate to the texts. '),(608,NULL,0,'5','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-01 18:39:00','The directions for the elementary level test were unbelievable. To have to read them the \"warnings\" about possible electronic devices over and over again was frustrating. They were disinterested by the time the the directions were finished. The Math test required the students to have a ruler and protractor with them, but they never had to use either one!!!!  What\'s the purpose of that? Some of the questions were so long, and the reading was so confusing, that some of my best math students didn\'t know what was expected of them. They could do the individual skills, but the way the questions blended these skills together was unfair and held more than a hint of trickery. What are you folks looking for? The real world is calling...please pick up the phone and listen. We are on the brink of a revolution....... '),(609,490,0,NULL,NULL,NULL,'anonymous','Parent','',1,NULL,0,0,'2013-05-01 19:21:31','My son, who reads above grade level, was very confused by the two questions about the setting in two different passages on Day 3. Were the testers looking for something different the second time? Was it a \"trick\" question? Why ask the question twice? He came home very frustrated, unsure that his second response was in any way what the testers were looking for. '),(610,NULL,0,'2','Observations',',11,','special','Principal','special',0,NULL,0,0,'2013-05-01 20:10:10','special'),(611,NULL,0,'general','Observations',',11,','kim wozniak','Teacher','kwozniak@mx.pancent.org',0,NULL,0,0,'2013-05-01 20:13:45','70 minutes was NOT enough time for 4th graders.  If a well thought out response was expected, more time should have been allowed.  Not to mention, there was more than one question being asked - which was absurd.'),(612,NULL,0,'8','Ideas for Constructive Action',',13,','90','Teacher','90',0,NULL,1,1,'2013-05-01 20:28:22','90'),(613,249,0,NULL,NULL,NULL,'teach','','tchrclare@gmail.com',1,NULL,0,0,'2013-05-02 01:06:36','When is Pearson going to be shown to be the money grubbing parasites that they are.  Since the CC standards came about, the only ones who have benefitted is Pearson, to the tune of millions - if not billions.  Why don\'t their CEOS sit down and take their own tests and see how they fare?'),(614,NULL,0,'general','Observations',NULL,'Anonymous','Parent','',0,NULL,0,0,'2013-05-02 01:50:04','In my kid school there are G&T students who’s parents have filed the Section 504 plan/IEP form for their kids NYS test.  In other words, these students will have at least 30mins or more time to finish their paper.  I wonder if it also happens at other schools.  Having this extra time for testing will not be reflected on their test records.  I personally feel it is not fair to the students who take the test, with the same pressure, and have the standard test time of 70 minutes.\nDOE should state the time each student is given on their test records, either the standard 70minutes or the disability time of 100 minutes.  These times are very important data in evaluating test results citywide.  Especially this year the DOE wants to evaluate the new test standards.  Without time information how can they accurately define the student’s capability and competency?\nThere is a keen competition in any district for application to their future schools (middle/high school).. This competition creates stress and deep anxiety among parents and students and fair testing conditions is critical for proper evaluations. \nThere is concern that Section 504 is being improperly administered causing some parents to take advantage of its loop holes that may provide their child a temporary 504 status to give them additional time benefits, but is not part of their permanent or test records.\nI found it disturbing those parents of capable students in both regular and G&T, but not classified ELL or Section, filed and were given temporary Section 504 status just weeks or days before the test. \nSuch behavior and time benefits may be a right, but should be recorded and made part of the student test records to provide accurate and fair student-teacher evaluations and comparative data.\nThe goal of the NYS tests is to find out the standard of our students and teachers. The time taken to complete the test is a significant data point of the NYS test standards.  It needs to be added at the test records.\n'),(615,49,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-02 03:06:39','I completely agree!  I could not have said it better myself.  I also dislike the way we test special education students who we know are 2 years behind in reading and writing with the same test as the other students in their grade.  We give them double time, but all the time in the world won\'t make them able to read something way above them, let alone analyze it and decipher and break down tricky questions!'),(616,261,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-02 03:16:14','This is so clear to all of us who teach special education, why is it so unclear to the people making our kids take these tests.  We are constantly assessing these kids and reporting to their parents and designing instruction.  This test is just worthless for them!  Not to mention that after they have the stress or a meltdown, we lose a good portion of the rest of the day!  Their tics increase, one student ran away.  The student actually left the building and had to be chased.  Tell me the score is worth it!'),(617,NULL,0,'general','Ideas for Constructive Action',NULL,'Nuts','Principal, Other','Nuts',0,NULL,0,8,'2013-05-02 11:51:58','Nuts'),(618,NULL,0,'general','Ideas for Constructive Action',',13,','OOmpa','Teacher','OOmpa',0,NULL,0,0,'2013-05-02 12:05:30','Oompa'),(619,NULL,0,'8','Implications for Instruction',',12,','Stacy Cougle','Teacher','scougle@wayne.k12.ny.us',0,NULL,0,0,'2013-05-02 12:34:51','Many students did not finish the exam.  Several students wrote \"I am stupid, I could not finish\" -or something of that nature on their exams.  I am not sure this is the right direction for kids and quality education.  If we only measure the worth of a child\'s intellect by the success (or failure) of one assessment (which seems to have a hefty price tag attached) then we are placing our values in the wrong basket.  I have been an educator for 20 years and I see a dark path ahead of us if we continue to assess students this way.  The last thing any educator wants to hear is a student call him/herself \'stupid\' because of a worthless exam like the state assessement.  The measure we should be using is a sustained outlook of growth throughout the entire year.  A snapshot is not the answer.  Too many outside factors that teachers and students cannot control can impact the results of the test (familial environment, econonmic depravatity, etc.). Therefore this testing situation is not in the best interests of children or the profession.  In addition, I highly doubt the creators of this exam have prolonged teaching experience in the classroom.  The selections were not engaging for students and the quality of test questions was poor. Education has become a business....Pearson and other companies are profiting from this and lining their pockets at the expense of good teaching and learning.  The \'Modules\' they are pitching to districts to adopt are equally horrible.  They are draining the love out of learning and teaching for millions.  In the end, I hope it is worth it to them and they can sleep well at night knowing the destruction they have caused.  For me, they have killed the joy of teaching. I await the day that someone in a leadership position that has some sense and logil, realizes the gross injustice of these assessments and these \'modules\' that are choking education. '),(620,NULL,1,'4','Observations',',11,','Barb Thiele','Teacher','bthiele@wayne.k12.ny.us',0,NULL,0,0,'2013-05-02 12:44:29','AS a veteran teacher of 23 years I feel I have seen many assessments come and go.  This year I felt the readability of the 4th grade test was appropriate, however the questions and amount of writing was ridiculous.  Students were exhausted by the third day, which happened to be the day that required the greatest amount of writing. Why can\'t the writing be given first and the m/c last?  I do not feel we need so many questions. This assessment could be scaled down to two days.  It is unrealistic to expect 9/10 year olds to endure that length of test. Some of the state level people should take the test and see if they can complete the test and score 3/4.   '),(621,NULL,0,'general','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-02 12:44:57','3 days is too much for elementary children to handle. The tests are long and drawn out and by day 3, the kids have mentally checked out.'),(622,NULL,0,'5','Observations',',11,','Kristen Coleman','Teacher','kcoleman@wscschools.org',0,NULL,0,0,'2013-05-02 12:48:59','In the past, we have encouraged students to pace themselves in such a way that they finish the exams.  Several of my most capable students did not finish this year.  They were taking the time to do justice to the very lengthy and involved questions.  If we are encouraging \"close reads,\" then we must allow adequate time for students to do just that.  \nAdditionally, when scoring those students who did not finish on day two (extended response question), a bubble for \"no response\" was filled in for anyone who wrote nothing.  For students who rushed through the extended response question in an attempt to have something written down, they received a score of 1-4 points.  Even a single sentence on the essay page resulted in a numerical score.  If state ed. is interested in determining the number of students who legitimately did not complete the test (which, I have to surmize, is the reason for the \"no response\" bubble), tell teachers and students ahead of time so that your data will accurately reflect student results.  As it stands, any child who wrote anything on the extended response lines will be considered a \"finisher\" along with their peers who were able (somehow) to complete the task.  '),(623,NULL,0,'5','Observations',',11,','Sara Moran','Teacher','',0,NULL,0,0,'2013-05-02 13:35:41','I proctored the 5th grade ELA exam all  three days. I think that 3 days of testing is too much for elementary students and that two days would be more appropriate. I believe students would have improved focus and greater opportunity for success with a two day test. I am also concerned about the ELA and Math tests being given so close together. Elementary students should have a week or two between the tests.'),(624,NULL,0,'5','Observations',',11,','Sara Moran','Teacher','smoran@wayne.k12.ny.us',0,NULL,0,0,'2013-05-02 13:36:12','I proctored the 5th grade ELA exam all  three days. I think that 3 days of testing is too much for elementary students and that two days would be more appropriate. I believe students would have improved focus and greater opportunity for success with a two day test. I am also concerned about the ELA and Math tests being given so close together. Elementary students should have a week or two between the tests.'),(625,63,0,NULL,NULL,NULL,'Chris Lehman','TCRWP Staff','chrislehman@readingandwritingproject.com',1,NULL,0,0,'2013-05-02 13:46:31','Yes yes, I agree with Michelle - all points are strong but 1 and 2 in particular. It is a challenge for schools to make the most out of their testing data if they cannot see the tests themselves.  Several year ago, before the tests were secured, schools could compare scores to question types to passages, they could form a full version of how the child took that test.  Now schools will have very little data to run on, other than the test-makers interpretation of what questions and passages mean.'),(626,NULL,0,'7','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-02 13:51:00','I can not say anything more than what has been said already: Day 2 of the test was not realistic, the possibility of two answers is there to trick students, both students and teachers have been stressed out, the skills and strategies that we provided our students with, \"to help them\", actually hurt them in that they ran out of time trying their little hearts out, etc., etc.\n\nSo, I am left asking: \n-Is the purpose of the testing actually helping the students?\n-What do students gain from taking these tests?\n-Are the students actually learning anything real about themselves as learners from these tests?\n-If the concern is with teacher, does the test truly show what I do on a daily basis (my door is always open, please come in and watch me and tell me what I can do differently to help my students- I WANT TO BE THE BEST FOR THEM)?\n-Who is truly benefiting from this?'),(627,NULL,0,'8','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-02 14:02:53','Completing books 2 and 3 was too much for one day.  Book 2 was similar to Book 1.  Students were rushing to finish the extended response in Book 3.  Many did not finish.  Rushing the writing process goes against everything that students are taught.  Students experienced a lot of stress this day, and they still had one more day to go.'),(628,308,0,NULL,NULL,NULL,'Anonymous','Principal','',1,NULL,0,0,'2013-05-02 14:13:53','I believe they are trying to do what they feel is right for the students only they arent educators and there is no research to support their thinking so they really have no context for the direction they are taking us towards.  In the years to come we will read about a generation lost due to lack of research and understanding.  '),(629,26,0,NULL,NULL,NULL,'Janet Steinberg','Parent','',1,NULL,0,0,'2013-05-02 14:16:10','I believe you are doing it right now.  I believe as a parent and an educator that people are listening to what we are saying here and will reconsider moving forward.'),(630,38,0,NULL,NULL,NULL,'Anonymous','Parent','',1,NULL,0,0,'2013-05-02 14:22:20','Sara, I agree with you. And I think Diana should sit down relex yourself, and share with your kids and students how you get 3.99 GPA.  How you prepare the tests you took in before, How you help your students to prepare for the tests; Encourage them to go forward, don\'t worry about the score; explain to them the spirits and the signification of the test.  I deeply concern you may stress out the students.  '),(631,341,0,NULL,NULL,NULL,'belinda','Teacher, Parent','',1,NULL,0,0,'2013-05-02 14:50:08','So well said its not the teachers its the corporations and non educators'),(632,341,0,NULL,NULL,NULL,'Terry','Principal','',1,NULL,0,0,'2013-05-02 14:50:54','To many people do not research where the problem is they just want to place blame its sad'),(633,NULL,0,'IA','Observations',',11,','Jim Bean','Parent, Parent','jbaires@f.com',0,NULL,1,0,'2013-05-02 14:52:09','This site is cool'),(634,NULL,0,'OH','Observations',',11,','test','Administrator, Test maker','test',0,NULL,1,0,'2013-05-02 14:52:42','test'),(635,NULL,0,'Not New York State','Implications for Instruction',',12,','test','Principal, Researcher','test',0,NULL,1,0,'2013-05-02 14:53:48','this is a test'),(636,NULL,2,'general','Observations',',11,1,2,5,','Lyn McKay and Eric Byrne','Administrator','erbyrne@ccsd.ws',0,41000,0,0,'2013-05-02 15:02:10','With 4000 students in six schools in suburban New York, the Chappaqua Central School district has a significant population that was recently tested with the new ELA assessment. After the completed NYS ELA administration, we asked students and teachers for their feedback on the new assessments. After reviewing all of the feedback, we have identified three main areas of concern: test design, impact on students, and the conflict between the test itself and good research-based instructional practices.\n\n\rTest Design\rMany children were not able to complete the assessment in the allotted time frame. Our highest level students struggled with completing the assessment. Many of our students with disabilities were not able complete the assessment, even with modifications and extended time. The directions required between 16 and 25 minutes of reading by the teacher prior to administration of the assessment.\r\rThe text passages used in this year?s assessment seemed appropriate for the specific grade levels. The content of the passages, however, was not appealing to students as it was not relevant to today?s students. The volume of multiple choice questions left many of our students racing at the end to complete the test. Understanding the multiple choice questions seemed to be much more difficult than understanding the actual text passages. The language used in the questions appeared to be more challenging than the language used in the text passages. Questions appeared to have multiple correct answers and it was often nearly impossible for adults to discern the correct answer.\r\rImpact on Students\rMore students broke down and cried during this year?s ELA than any of our teachers and administrators can remember from previous test administrations. At the close of day two, students were exhausted and some expressed feelings of inadequacy. Some students entered day three of the assessment with little confidence and little willingness to try on the final day. For some of our special needs students, the task itself was so overwhelming that it made the remainder of the school day a significant challenge. As a school district that strives to provide a student-centered learning environment that is supportive and nurturing, it seems unethical and irresponsible to place students in the kind of setting created by this year?s ELA test.\r\rConflict with the ELA and Research-Based Instructional Practices\rMuch of the focus of our work in aligning with the common core state standards has been to closely read and interpret challenging texts. Additionally, students have been asked to develop written pieces that argue a point and present both their claim and a counterclaim. With the significant time constraints placed on students during the exam administration, we feel that a conflict has been created. Reading and responding to challenging text while pursuing a line of argument requires time to process and plan, draft, receive targeted feedback and rewrite. During this year?s ELA assessment, students were asked to complete a task in a manner that is counter to our instructional practices and to research. As a society that is grappling with creating schools that produce a global workforce that is filled with creative, thoughtful, confident individuals who can collaborate in innovative ways, the kind of environment created by this testing seems counter to our mission. An assessment system that aligns with the skills and abilities that our global society requires would provide a much better measure to evaluate our public educational system.\r\rLyn McKay					\rSuperintendent of Schools			\nChappaqua Central School District		\r\rEric Byrne\nAssistant Superintendent for Curriculum and Instruction\rChappaqua Central School District'),(637,94,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-02 17:20:57','How did you prepare? Did you have assistance or just use the resources from engageny?'),(638,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-02 17:28:42','The Pearson ELA Test in third grade did not reflect our teaching with the new Common Core Standards in mind. The new standards demand that students read closely which means that they need to read a passage two or three times. There was not enough time for the students to read five passages and answer 30 mmultiple choice questions even once and definitely not two or three times like we have been teaching them all year long. I would hope that the state could give Pearson our objectives before they write the nest Third Grade ELA assessment!!!'),(639,495,0,NULL,NULL,NULL,'Anonymous','Other','',1,NULL,1,0,'2013-05-02 18:27:34','Hmmn. Difficult to say that one can fully appreciate the depths of all of this!'),(640,NULL,1,'general','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-02 19:06:19','I would just like to thank you for what you did for our schools.  Faculty came back from scoring and were discussing how they could tell the difference between TC schools and others. The writing stood out and what also stood out was the fact that in the short answers students were straight to the point and answered the questions.  They noted that the advice you gave three to four sentences and the advice the state manual gave three to four sentences was so important because the students who wrote more were the students who very often didn\'t finish the essay.  Scoring was stressful but they felt that felt better to know that what was taught made a difference in what the students did.'),(641,640,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-02 19:10:30','This is so true their was a difference in the way students responded to text and wrote essays.  '),(642,NULL,0,'6','Implications for Instruction',',12,','Kim Barget','Teacher','kimbar4@yahoo.com',0,NULL,0,0,'2013-05-02 23:57:04','I was sent to score the ELA exam today - grade 6 - Book 4 and I am very shocked that students can only score the max - a 2 - on short answers only if they have the required 2 text details plus an inference even though the question doesn\'t ask for an inference, it only asks for 2 text details. I don\'t think that\'s fair, in fact, it\'s Kafkaesque.'),(643,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-03 13:56:18','I felt at the third grade level taht kids were short on time.  Especially for Book 1 and for some on Book 3.  Not that I think 8 and 9 year olds should be sitting for 90 min.  but I don\'t think it is fair to cut them off.  Are we testing their reading/writing abilities and knowledge or are we seeing how quickly they can complete a test?  Why should someone be penalized just for needing 10 more minutes to finish?  \n\nAt the fourth grade level, I was involved with scoring the fourth grade ELA Book 4.  I was surprised to see the same question regarding the importance of the setting of the story on the first 2 stories.  I felt that if a student responded too vaguley or incorrectly on the first time the question was asked, their chances of answering in the same manner is increased and they don\'t have an opportunity to address something else related to a fiction piece.'),(644,NULL,2,'RI','Observations',',11,','Tom Hoffman','Other','tom.hoffman@gmail.com',0,NULL,0,0,'2013-05-03 14:36:02','Hi Lucy,\n\nFirst, thanks for this forum, it is deeply appreciated.\n\nI am, however, genuinely confused by your argument that this test does not represent the CCSS.  I don\'t see how you can compare the CCSS to other standards and not reach the conclusion that they are intended to be narrowly focused on academic textual analysis, reaching all the way down to elementary school.\n\nThis is, of course, completely nuts, and it is why I have opposed these standards all along.  \n\nI\'ve never felt it was fundamentally driven by pedagogy or philosophy (for good or ill), either.  A certain kind of data was needed for RttT, a certain kind of \"next generation\" test was desired (computer adaptive, computer scoring of constructed responses, vertically aligned, etc.) the testing companies -- the College Board and ACT -- laid down the basic structure and CCRS to lock in this design despite the various tweaks made in the grade level standards.  The CCSS was always a test specification.\n\nI felt the Publisher\'s Criteria followed logically from the standards themselves -- moreso, I\'d add, than the surrounding commentary published with the standards.  To me there was a huge, and I thought intentionally misleading discrepancy, so maybe you are giving more weight to those texts.  I always saw them as post-hoc political cover (to appease you AND E.D. Hirsch) that would be entirely ignored in implementation.\n\nAnyhow, I\'m not sure there\'s a definitive answer here, because it depends on the generosity of one\'s reading of the standards.  When I read standard one, I see a standard very carefully worded to NOT require students to draw their own interpretations, just to be good at citing evidence.  It can be read differently, of course, but I think my reading is the one intended by the (test designer) author for their primary (test designer) audience.'),(645,38,0,NULL,NULL,NULL,'Lucy Calkins','Other','',1,NULL,0,0,'2013-05-03 15:14:15','Diana,\nIf you read through many of the comments on this site you will see that you are far from alone in saying that kids were too stressed. I think most of us know that the sources of pressure are not just within the classroom, and I disagree  that you are the cause (though always we can be self-reflective and wonder if we played a role.) I am sorry you\'ve been given a hard time on this site, and find it confusing, frankly, as others essentially said the same thing.\nLucy Calkins TCRWP\n'),(646,NULL,1,'general','Observations',',11,','Brian','Parent','chocloc@att.net',0,NULL,0,0,'2013-05-03 16:35:16','Our 8 year old son took the NY State Exams over the last 2 weeks. After all the hype about how this years test would be more difficult, he felt that the test was VERY DUMBED DOWN. Especially the math! I think Pearson felt all the pressure from NY about the test, and created a test that any simpleton could do well on.(This in order to keep the state and schools happy) So, the schools will continue to have their false high rankings, with falsely high test scores, and they will continue to graduate numbskulls.\n\nAlso want to mention that our son told us that the teacher was “helping” the students who are weak in math during the test. She walked around to them and was looking at their answers and saying things like, “You should look at that problem again”. \nWhy are teachers allowed to administer these tests to their own students? The tests should be administered by someone who does not know the children and has no stake in the outcome of their tests. I can only imagine the amount of cheating that went on in classrooms around the state.\n'),(647,32,0,NULL,NULL,NULL,'Anita Gildea','Other','gildea.a@gmail.com',1,NULL,0,0,'2013-05-03 19:20:36','Out of the mouths of babes...'),(648,NULL,0,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-03 19:34:51','I thought the assessments were quite rigorous and that students didn\'t have enough time. I thought day 2 was too much for students. Many of our 3-5 grade level students were not able to finish both books. \n\nA suggestion for next year would be to do the writing portion and extended responses in math on the begining days. Students were exhausted by the end of the three days. \n\nAs a teacher it would be extremely helpful to be able to analyze and use these first assessments to help us prepare students. '),(649,NULL,3,'National','Implications for Instruction',',12,','Lucy Calkins','TCRWP','',0,100000,0,0,'2013-05-03 19:35:41','Dear Colleagues,\n\nThis site contains responses (600+) to the all-new, CCSS-aligned ELA exam that Pearson gave this year in New York State. Given that Pearson is poised to compete with PARCC and Smarter Balanced as a provider of the new generation of national tests, I think you can look at these as responses to Pearson\'s first iteration of that new test as a harbinger of what is to come your way unless someone calls out, \'Wait! The Emperor has no clothes on.\'\n\nThe test was unlike anything anyone here had ever seen. I don\'t want to try to describe it to you because frankly, I wasn\'t allowed to see it (and didn\'t.) What I know about the test is largely harvested from these comments, and from people\'s descriptions of the test. And that, I think, is the problem. How can it be that test-makers have created a whole new generation of tests and we are not allowed to see those tests, to talk-back to this first draft of them? How can legislators in my state vote that teachers will be hired and fired based on The Test when they haven\'t, themselves, taken the test (and watched their sons and daughters, grandchildren, neighbors take the test?)\n\nPeople who have reviewed this site are phoning--the Times, The Washington Post, the Huffington Post--and they ask if my conclusion is that we need a moratorium on testing so as to give kids the opportunity to learn that is their legal right. I answer that sure--a moratorium on testing would always be welcome--but that actually I think that the issue instead is that we all need to demand to see this new generation of tests and to be part of a conversation over whether they in fact match the Common Core, and whether they in fact represent a goal worth teaching towards. My sense is the test makers have aimed to devise a test that matches the Revised Publishers Criterion more than the Common Core, and given that those two documents are contradictory, I think people need to ask whether that\'s the deal we signed on for. For instance, when we ratified the CCSS we agreed that children need to read more nonfiction - but did we agree they need to read nonfiction in the way the test suggests? Another way to say this is that I think the test makers are interpreting the standards, even for 9 and 10 year olds,  to be all about ultra-ultra-law-school-literary-criticism-level-close analytic reading, asking \'why did the author include (mean by) X in line y?\' and not at all about reading to acquire knowledge or to construct big ideas about a comprehensible story. How will a test like this alter reading and writing curriculum, and will that yield a generation of engaged, curious, thoughtful, knowledgeable readers and writers?\n\nThis is an important time. We are at a crossroads. Big changes could be brewing. I think it would help if you take some time to study these responses and add to them with specific troubles or insights. Please respond to them--you\'ll see we\'ve built a place for that--and you are welcome to write me off the site as well, if you\'d like.\n\nThanks for your advocacy on behalf of children, and for the companionship as we all work, shoulder to shoulder, to make our schools the best they can be.'),(650,NULL,0,'3','Ideas for Constructive Action',',13,','Heidi Kreit','Teacher, Parent','hkreit@hotmail.com',0,NULL,0,0,'2013-05-03 20:30:09','I am a teacher in third grade and I am also a parent of a third grade student.  I agree the test was too long.  I think the second day with two books was silly as my 17 year old does not get two books for his AP tests, or his SAT tests.  The second day reading with multiple choice was unnecessary.\n\nFuthermore, if the test was indeed to be completed, it should not have been timed.  A high percentage of my students were quite capable of completing the essay but they ran out of time.  My daughter is a competent writer and reader, ran out of time as well and never saw the essay question.  Reading fast should not be a huge requirement for third graders as they are first reading for meaning.  We teach them to be thorough and accurate.'),(651,170,0,NULL,NULL,NULL,'Chanah Markowitz','Other','dutch1782@aol.com',1,NULL,0,0,'2013-05-03 20:37:13','We found that across the grades: 3-8 students didn\'t have enough time to complete the 2 books on day 2.  We had students that became ill during the test: a few threw up and three students twisted their wrists and needed scribes for day 3. '),(652,NULL,0,'National','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-03 20:45:53','I feel like we, as teachers, are not heard. We need to organize a broader campaign that encompasses students, teachers, parents and other stakeholders, standing together against high-stakes testing. We need an expert, like Lucy Caulkins perhaps, to lead the charge. Maybe start a petition on Change.org? Gather millions of signatures of all who stand against this crazy educational practice, and advocate for some real change nationwide.'),(653,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-03 20:54:37','It is so ironic, that we teach to our students\' instructional level, as per their IEPs, but they, in  turn, have to take state tests on grade level.  It\'s not only ironic, it makes no sense whatsoever. '),(654,38,0,NULL,NULL,NULL,'Diana','Teacher','',1,NULL,0,0,'2013-05-03 21:06:36','While I wish I could say I was making this stuff up, I can honestly say it is sad (very sad), but true (very true). Thank you Lucy for your comment. I am by know means offended by the comments I provoked; I am glad that my comment is being read and people are growing angry. Something needs to change for the sake of the children; we are only harming them further by not believing what is actually going on and referring to it as hyperbolic. A test that results in \"Vomiting. Pissing pants. Hysterical and sleepless prior [...]\" is not assessing students\' learning. '),(655,236,0,NULL,NULL,NULL,'Anonymous','Other','',1,NULL,0,0,'2013-05-03 22:17:18','Did you see the article in today\'s Daily News that takes up this very question? Apparently someone leaked the test to the Daily News and they in turn are leaking it to the world. It will be interesting to see the fall out from that drama!'),(656,276,0,NULL,NULL,NULL,'Marion','Teacher','mkelly@byramhills.org',1,NULL,0,0,'2013-05-03 23:33:31','I teach in an affluent district in Westchester County, NY. Our students consistently score in the high ninety percentile. To see kids like ours, struggle against the time and have some become sick  from stress and anxiety is testimony that the state tests are not developmentally  appropriate. I can\'t imagine what it must have been like for students in less advantaged districts and for ELL students.\n\nFollowing the test, our teachers confessed to being uncertain of the answers to some of the comprehension questions. Too much emphasis was placed on the text structure( only a writing tool)  rather than the content and enjoyment of the stories.  I\'m all for rigor as we\'ve been teaching at the top of the bar for decades due to our population, but this test was too difficult for our population and therefore, most children.  It\'s disheartening to give our sweat and blood to impart a love or reading and writing to our students and then have our efforts reduced to this type of assessing. Can we maintain the rigor but amend the test to better match our teaching and reading and writing philosophy?'),(657,NULL,0,'National','Observations',',11,','Joan Jurgens','Teacher','jurgensjoan@hotmail.com',0,NULL,0,0,'2013-05-03 23:39:21','Why was the listening part of the test removed? Why was it once important and now it isn\'t? Listening is so important to learning and note taking techniques are part of the foundations of determining importance for our future learners.'),(658,NULL,0,'general','Observations',',11,','GinnyM','Teacher','Mondscheinv@lkgeorge.org',0,NULL,0,0,'2013-05-03 23:41:42','Observing students as they tackled the tests left me with the overwhelming realization that the few who always do well would handle the challenges thrown at them, but the rest, those squarely in the average range and below could not sustain any energy past the first few exercises because of the complexity of the passages and questions requiring sustained close reading. This observation comes after many months of thoughtful teaching, modeling, interactions with many genres, building stamina and practice with close reading of short texts.'),(659,NULL,0,'general','Observations',',11,','GinnyM','Teacher','Mondscheinv@lkgeorge.org',0,NULL,0,0,'2013-05-03 23:43:32','Observing students as they tackled the tests left me with the overwhelming realization that the few who always do well would handle the challenges thrown at them, but the rest, those squarely in the average range and below could not sustain any energy past the first few exercises because of the complexity of the passages and questions requiring sustained close reading. This observation comes after many months of thoughtful teaching, modeling, interactions with many genres, building stamina and practice with close reading of short texts.'),(660,263,0,NULL,NULL,NULL,'Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-05-03 23:55:04','I agree with this completely!'),(661,261,0,NULL,NULL,NULL,'Christine B.','Teacher','seteachr@nycap.rr.com',1,NULL,0,0,'2013-05-04 00:12:48','I completely agree.  As a teacher of a self-contained class, this test was beyond useless. I will not learn anything based on the test results.  My students were frustrated and stressed by these tests and, in the end, they felt defeated.  What kind of damage did we do in the name of better instruction?  On top of the negative consequences for my students, any \"data\" derived from their tests is less than unreliable....it\'s worthless.  With texts that were easily 2 or 3 grade levels above their skills, they just guessed and filled in bubbles.  Sad.'),(662,367,0,NULL,NULL,NULL,'Anonymous','Principal','',1,NULL,0,0,'2013-05-04 00:20:32','I agree. On a test this long, the fact that Pearson was using kids as guinea pigs to field test questions isn\'t reasonable. They should find other situations for their field tests. Speaking of field testing--it is abundantly clear that this test was not field tested or there wouldn\'t have been so many issues around timing and around questions in which the teachers, themselves, couldn\'t figure out a right answer.'),(663,NULL,0,'general','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-04 00:37:23','The Daily News (5/3) just published portions of the fifth grade test, and Diane Ravitch has written an analysis of the test in her blog. She thinks the 5th grade test was closer to the 8th than the 5th grade level.'),(664,NULL,0,'general','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-04 00:37:42','The Daily News (5/3) just published portions of the fifth grade test, and Diane Ravitch has written an analysis of the test in her blog. She thinks the 5th grade test was closer to the 8th than the 5th grade level.'),(665,NULL,0,'general','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-04 00:38:03','The Daily News (5/3) just published portions of the fifth grade test, and Diane Ravitch has written an analysis of the test in her blog. She thinks the 5th grade test was closer to the 8th than the 5th grade level.'),(666,NULL,0,'4','Observations',',11,','J. L.','Teacher','janet_link@optimum.net',0,NULL,0,0,'2013-05-04 00:44:26','At this level, I felt that the passages were of high interest and that the difficulty level of the passages were appropriate. That being said, what made this year\'s ELA exams so excruciating for my students were the questions. Worded in a way that we had never seen (except in a Pearson ELA Prep Book used by our grade level), the questions confused students. They were extremely wordy and you had to interpret what the question was asking before you could even attempt to answer it. In addition, the answer choices on the multiple choice questions were equally as baffling. You had to spend more than a few minutes on some choices to decipher the meaning. On what are we testing our kids? The ability to read and comprehend? Or, the ability to interpret developmentally inappropriate test questions? I had three of my top writers melt down on day 2 because they either didn\'t make it to the essay (ran out of time trying to decipher test questions and answer them thoroughly) or they didn\'t understand what the essay was asking and simply COULDN\'T provide an answer! Tears, trips to the nurse, nausea, inability to eat... all side effects of this year\'s ELA. If TEACHERS themselves struggled with some of the questions, how on earth are we to expect our 9- and 10-year-old students to answer them? It\'s discouraging and disheartening.'),(667,NULL,0,'3','Implications for Instruction',',12,','Anonymous ','Teacher','darcyw7@gmail.com',0,NULL,0,0,'2013-05-04 01:08:39','I am also deeply concerned about how anxious and overwhelmed schools will soon be rushing to buy new and \"improved\" test prep materials modeled after this year\'s ELA test.  During the 2013-14 school year, I\'m betting that test prep will be attempted with an urgency unlike any that we\'ve ever seen before (especially in vulnerable, low-income areas that tend to fall behind more affluent communities when it comes to visible (and valued!) parent outcry).  I can just see the publishers aping the nonsense that was apparent on every page of the test, forming a zillion test prep questions in that spirit, and then making pots of money from the stinking lot of it.  They\'re betting on our exhaustion and apathy, and I imagine whoever constitutes the \"they\" in this scenario live a very cloistered, controlled existence.  This whole endeavor--trying to make sense out of the irremediably ludicrous--makes me dizzy and sick.  I will definitely keep charging ahead, but I am mad as hell about the damage we\'re doing to all these kids.'),(668,57,0,NULL,NULL,NULL,'Shari Pierre','Teacher','pierreshari@yahoo.com',1,NULL,0,0,'2013-05-04 01:12:00','I agree.  If we really want to assess a student\'s reading and writing abilities they should be given the time they need to do their best work. I think that even those who have attained the highest levels of education wouldn\'t be comfortable with working under the conditions that we put students in.  I also think that it is ridiculous to give 9 year old students a reading test where the multiple choice questions are so hard that the teachers recognize the possibility of more than one answer.  '),(669,NULL,0,'3','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-05-04 01:16:35','As a third grade teacher and parent of a third grader I am disgusted with what we put these young children through. I\'ve witnessed or have been told about: a student who threw up after looking through his test saying, \"I don\'t know how to do this!,\" several children crying either because they didn\'t finish or because the test was so challenging, a child breaking out in hives due to the stress of the testing, and children losing sleep due to their anxiety.  There are so many other, valid ways to assess the learning of students. The people who create and force teachers to implement these tests seem to forget that these are individual CHILDREN with varied life experiences, personalities, backgrounds, and learning styles. There has to be another way.'),(670,134,0,NULL,NULL,NULL,'Erinn ','Teacher','',1,NULL,0,0,'2013-05-04 01:23:52','I agree with you Joanne. The texts were fair for on grade level readers but the questions were completely irrelevant to comprehension of the text as a whole or even the overall theme or main idea. I am a second year 3rd grade teacher and am already discouraged due to this high stakes testing that has taken over. '),(671,NULL,0,'3','Observations',',11,','joan miller','Teacher','jpmiller7617@yahoo. com',0,NULL,0,0,'2013-05-04 02:26:49','I have been a third grade teacher for 20 years and I have never witnessed more focus on testing students than I have in the past couple of years. I truly believe that we are doing our children a disservice by requiring them to sit for 70 minutes for three straight days to read mundane passages and answer convoluted questions that have no real meaning or value to their lives. What message are we sending to our students? Will they find joy in learning? Will there be any more life long learners? If these tests provided valuable data that could actually help children, then I might buy into them, but there were no surprises for me. I didn\'t learn anything new. The students who always perform well achieved  success and those who don\'t failed miserably - and possibly lost all confidence that they might have had in themselves as readers and writers. The only thing I learned  is that my students can persevere. Aren\'t there so many other ways to teach this valuable lesson?  '),(672,NULL,0,'general','Ideas for Constructive Action',',13,','Anonymous','Parent','',0,NULL,0,0,'2013-05-04 11:35:13','Every concerned parent needs to contact their school and request to see their child\'s written work for the short and extended response questions. You have this right. I have done so in the past and will continue to do so. Although it is disruptive for the school, it is the ONLY way that parents across the state will have any idea what children are being required to do. The fact that our children are being subjected to this abuse is one thing. That the entire test is shrouded in secrecy is another. Contact your school and request to see your child\'s exam (they are kept by law in the building for one year).'),(673,NULL,1,'National','Observations',',11,','Cathy','Teacher, Parent','Scmrdesena@comcast.net',0,NULL,0,0,'2013-05-04 12:01:29','I would like to hear about the experiences of other educators.'),(674,644,0,NULL,NULL,NULL,'Lucy Calkins','Other','',1,NULL,0,0,'2013-05-04 12:29:30','Tom,\n\nI\'m interested that we read the CCSS differently. In my eyes, the Common Core offers a fairly robust view of reading and writing, one that is quite different than the Publisher\'s Criteria. David Pearson\'s recent chapter in an IRA book on the CCSS provides a lot of evidence for this. But think just about writing for example. Only standard 9 hones in specifically on text-based writing (although many other standards welcome textual references) and the k-6 writing in the CCSS Appendix is more apt to be about students\' interests, their field trips, their self-generated intellectual work than writing in answer to a teacher-assigned prompt about a whole-class complex text. Yet one wouldn\'t know that from the Publisher\'s Criteria or from the Ela.'),(675,644,0,NULL,NULL,NULL,'Anonymous','Other','',1,NULL,0,0,'2013-05-04 12:32:06','I believe the CCSS in and of itself is a political reaction.  The CCSS though could have been an amazing document if used correctly.  The Publisher Criteria was narrow-minded and shows no research and understanding of children or how they process and learn.  The CCSS has become a vehicle for Pearson to become a conglomerate making millions of dollars at children\'s expense.'),(676,94,0,NULL,NULL,NULL,'Janet','','',1,NULL,0,0,'2013-05-04 12:36:27','The resources from engage NY helped.  Also looking at the CCSS helped us to think about what students should be doing at each grade band level.  Looking at text at the grade band levels helped.  Good reading and writing practice helps.'),(677,262,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-04 12:38:50','It\'s not secretive anymore.  Look at the daily news'),(678,94,0,NULL,NULL,NULL,'Linda P','Teacher','',1,NULL,0,0,'2013-05-04 12:44:23','Knowing you the way some of us do what would you do differently next year?'),(679,160,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-04 12:47:08','Look at the news or ebay'),(680,328,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-04 12:49:48','We applaud these parents for taking a stand'),(681,341,0,NULL,NULL,NULL,'Katie','Principal, Parent','',1,NULL,0,0,'2013-05-04 12:52:21','Wouldn\'t it be wonderful if we researched all the good thing our teachers did and made a blog like thus fir that. '),(682,586,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-04 12:55:27','This decade might be renamed for students who can\'t succeed.  It also won\'t be the students fault.'),(683,586,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-04 12:56:58','I looked forward to the CCSS I thought it would step up the good work teachers were already doing.  I thought it would do this by unifying a nation what it did was to begin to divide us '),(684,585,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-04 12:57:48','Agreed it\'s unresearched'),(685,551,0,NULL,NULL,NULL,'Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-05-04 13:00:07','It is also rumored that on day three of scoring that scores that were given a 0 is certain sites were than told they weren\'t a 0 they were a 2 this is a mess'),(686,NULL,1,'National','Observations',',11,','Monica Kalfur','Teacher, Parent','sallyslp97@gmail.com',0,NULL,0,0,'2013-05-04 13:29:55','It is increasingly disheartening that high-stakes standardized tests are the single, ultimate definition of demonstrating progress for our children. I see friends who live in other states post pictures of their children\'s wonderful school projects, activities, festivals, etc., and it further drives home the point that we\'re only teaching the children of NYS to be accomplished test takers. At the rate we\'re going, we are assuring that no future leaders, CEO\'s or celebrated artists will hail from our state. '),(687,NULL,1,'4','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-04 15:08:59','All year long, I teach my kids to do quality work that they can be proud of and then along come the state tests!  Close reading is a strategy that takes time and allows readers to interact with the text to gain a deeper understanding; however, the time constraints of the state tests don\'t allow children to use this strategy.  Or, if they use it, they certainly don\'t have time to finish.  Why should showing what you know have such a limited time constraint?  So if they don\'t finish in the allotted time, then they don\'t know it, haven\'t learned, aren\'t proficient readers?  There has to be a better way to measure what a student knows/has learned!'),(688,NULL,0,'RI','Observations',',11,','Maureen Nosal','Teacher, Parent','maureen@mapcenter.com',0,NULL,0,0,'2013-05-04 15:12:44','One of the rosy promises of CCSS was  “these standards leave room for teachers, states, and curriculum developers to determine how to best meet the goals set out by the Standards …teachers are thus free to provide students with whatever tools and knowledge their professional judgment and experience identify as most helpful for meeting the goals set out in the Standards.” \n\nLack of transparency regarding the NYC tests is troubling, cynical, and downright dishonest.  What --- or why --- are they hiding from parents and teachers?\nI agree with those who are calling for publisher’s materials  (tests and curricula developed together) to be rejected outright by teachers. \n\nTeachers, children, and parents are being battered by political posturing on education. We need to stand together and speak out against these assaults on teacher’s professional knowledge, judgment, and experience, and call this what it is: a cynical “bait and switch” move by corporations to take control of an initiative that educators supported in good faith. \n\nIt is so important to keep abreast of current debates over the tests and the implementation of CCSS, and to also read what the (real) research community is presenting. A good place to start is with P. David Pearson (NOT to be confused with Pearson Publishing), Chair of the International Reading Association’s Literacy Research Panel, who presents a clear comparison of the CCSS and Revised Publisher’s Criteria. Read it! Quality Reading Instruction in the Age of Common Core Standards, IRA, Chapter 17 http://www.reading.org/General/Publications/Books/bk496/toc.aspx\nInvite colleagues to study together and discuss.\n\nFrom the Discussion Guide: One of the selling points of the CCSS is the autonomy the Standards award teachers (that is, the CCSS afford teachers the leeway to form their own instructional plans and assessments in order to achieve \nthe Standards). However, as P. David Pearson notes, the release of the \nRevised Publisher’s Criteria may impede any autonomy ceded by the CCSS. \nLocate the Revised Publisher’s Criteria and skim the document to \nevaluate its purpose. Then, decide how it could limit the freedom \nestablished by the CCSS.\n\nMaureen Nosal\n\nWhen you wage war on the public schools, you\'re attacking the mortar that holds the community together. You\'re not a conservative, you\'re a vandal.\n\n~Garrison Keillor\n'),(689,NULL,1,'CA','Observations',',11,','Claire Ratfield','Teacher','Cratfield@gmail.com',0,NULL,0,0,'2013-05-04 15:23:41','Looking forward to deeper insights into testing and its implications for teaching'),(690,NULL,0,'general','Implications for Instruction',',12,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-05-04 15:44:48','As a parent and a teacher, I am absolutely HORRIFIED to see the direction our state has moved with these tests. I am not opposed to setting higher standards, challenging our children, and preparing them for the future. What I AM opposed to is the testing materials which are causing so much stress and anxiety on BOTH the children and the teachers, that the time that should be spent teaching/learning is now focused on TEACHING TO AN IMPOSSIBLE test! That is NOT quality use of our teaching time, and I do NOT feel my children have benefited from the way our teachers are being instructed to teach them! My children are 95 average students-- and this yet they HATE school, are completely turned off to reading and math, and feel like they will both end up in AIS next year. WHAT ARE WE DOING TO OUR CHILDREN????'),(691,NULL,0,'4','Ideas for Constructive Action',',13,','Ryan Scala','Teacher','ryscala@yahoo.com',0,NULL,0,0,'2013-05-04 18:26:39','It is so powerful to read comments from colleagues I respect, principals, staff developers and other leaders I admire.  This song by Barry Lane http://www.youtube.com/watch?v=VcjIftvIC3I kept me so grounded during a tumultuous year of teaching amidst the uncertainty, mystery and anxiety which surround these high stake tests.  We teach children and so our primary goal should be to inculcate a spirit of curiosity, inquisitiveness and intellectual rigor – which need to be nurtured in an environment that encourages risk-taking, trying and failing, sustained inquiry, developing creative solutions, collaborating through conversations with others, reading and writing A LOT.  All of these require time and are difficult if not impossible to measure in its current format.  Schools need to be communities of practice that inspire collaboration not business-like institutions that have a bottom line numbers mentality and breed competition amongst its members.\nI believe whole-heartedly in the Common Core Learning Standards.  The professional communities that I align myself with believe whole-heartedly in the Common Core Learning Standards.  This document has the potential to inspire significant change and has ignited a common conversation among educators across the nation.  However, the standards themselves testify that “The Standards define what all students are expected to know and be able to do, not how teachers should teach.” Teachers are professionals, and as such, make important decisions that impact the lives of our students. We need to be part of the conversation? We need a seat at the policy table? It is so disheartening to read the following on the Engage NY website: “New York State, for the first time, will be reporting student grade-level expectations against a trajectory of college- and career-readiness as measured by tests fully reflective of the Common Core and, as a result, the number of students who score at or above grade level expectations will likely decrease.” \n\nWhen you reflect on how hard both your students and you have worked to accelerate their achievement as readers and writers which is not often reflected in these high stakes tests, it is sad to think that you are being set up to fail .At a recent conference Doug Reeves shared that “the best accountability is local accountability at the building level, at the classroom level, and so we need to think about how we are going to document our success and tell our story, no matter what the tests are so that we are able to talk to teachers, parents and communities about their impact on instruction”.  This principle should be guiding our work with common core assessments.  Why are we spending significant sums on scoring, testing etc. that would be better spent on professional development, and resources, such as large classroom libraries and authentic learning experiences, such as field trips (providing teachers with the tools needed to grow and increase their effectiveness?)  Especially since the most important factor influencing student achievement is feedback and instructional quality, so let’s put our resources into the most critical factor influencing achievement: teachers.  \n\nThe following article by Alfie Kohn offers interesting commentary on the perceived achievement gap: http://www.washingtonpost.com/blogs/answer-sheet/wp/2013/05/03/were-number-umpteenth-the-myth-of-lagging-u-s-schools/ However, with that being said, if we are going to continue along this track of standardized tests in their current iteration, we might think about the following changes:\n\n1. Abbreviate the directions – I could tell students not bring electronic devices to school and include it in a note home. That’s enough.\n\n2. Bring back the Listening Section, which it levels the playing field for students who are reading below grade level, and provides them with access to a difficult text. It would also help address the Speaking and Listening Standards in the CCLS.  I’m not saying make the test longer. Instead, go back to its earlier format across three days.\n\n3. At the earlier grades K – 5, place more emphasis on formative assessment versus standardized assessment: systems for tracking students reading levels (see Assessment Pro), systems for tracking student growth in the different modes of writing (information, argument/opinion, narrative) using benchmarks, portfolio assessment, pre- and post assessments, and learning progressions. \n4. Decrease emphasis and high-stakes nature of standardized tests.  Hold teachers accountable, but place more emphasis on local assessment, and educating leaders and schools in how to create teams that can keep their fingers on the pulse of student performance through a regular study of student work and advocate for prevention and early intervention at grades K-2, to close the gap before it widens and becomes too significant. \n5. In my experience, great schools are a product of great leaders – leaders who know the power of distributive leadership, encourage conversations around student work, and empower teachers as decision makers. We need to provide support for principals to learn from each other by partnering schools with each other, so they will be poised to learn from each other.  These leaders will in turn provide teachers with opportunities to learn from each other. \nThere is so much more that I would like to say, but Lucy always says to find our yes – I say yes to the Common Core Learning Standards, I say yes to collaboration, I say yes to local accountability and systems for tracking student growth, I say yes to meaningful professional development for teachers in classrooms with students and yes to experimentation and risk-taking, I say yes to feedback other than state test scores.  \nFinally, I say yes to “focus[ing] on the work that lies before you – becoming the strongest teacher you can become, working to turn your school into a place where teachers help each other become stronger together than anyone could be alone.” Taken from Pathways to the Common Core: Accelerating Achievement by Calkins, Ehrenworth and Lehman \n I say no to high stakes testing, I say no to a climate of competition, I say no to top-down reform, I say no to threats of withholding funding or firing teachers, which engenders fear instead of courage and a sense of teacher and student efficacy\n'),(692,NULL,0,'4','Implications for Instruction',',12,','Ryan Scala','Teacher','ryscala@yahoo.com',0,NULL,0,0,'2013-05-04 18:38:55','It is so powerful to read comments from colleagues I respect, principals, staff developers and other leaders I admire.  This song by Barry Lane http://www.youtube.com/watch?v=VcjIftvIC3I kept me so grounded during a tumultuous year of teaching amidst the uncertainty, mystery and anxiety which surround these high stake tests.  We teach children and so our primary goal should be to inculcate a spirit of curiosity, inquisitiveness and intellectual rigor – which need to be nurtured in an environment that encourages risk-taking, trying and failing, sustained inquiry, developing creative solutions, collaborating through conversations with others, reading and writing A LOT.  All of these require time and are difficult if not impossible to measure by the test in its current format.  Schools need to be communities of practice that inspire collaboration not business-like institutions that have a bottom line numbers mentality and breed competition amongst its members.\n\nI believe whole-heartedly in the Common Core Learning Standards.  The professional communities that I align myself with believe whole-heartedly in the Common Core Learning Standards.  This document has the potential to inspire significant change and has ignited a common conversation among educators across the nation.  However, the standards themselves testify that “The Standards define what all students are expected to know and be able to do, not how teachers should teach.” Teachers are professionals, and as such, make important decisions that impact the lives of our students. If that is the case, don’t we need to be part of the conversation? Don’t we need a seat at the policy table? It is so disheartening to read the following on the Engage NY website: “New York State, for the first time, will be reporting student grade-level expectations against a trajectory of college- and career-readiness as measured by tests fully reflective of the Common Core and, as a result, the number of students who score at or above grade level expectations will likely decrease.” \n\nWhen you reflect on how hard both you and your students have worked to accelerate their achievement as readers and writers which is not often reflected in these high stakes tests, it is sad to think that you are being set up to fail. At a recent conference Doug Reeves shared that “the best accountability is local accountability at the building level, at the classroom level, and so we need to think about how we are going to document our success and tell our story, no matter what the tests are so that we are able to talk to teachers, parents and communities about their impact on instruction”.  This principle should be guiding our work with common core assessments.  Why are we spending significant sums on scoring, testing etc. (with teachers out of classrooms for days at a time)  which would be better spent on professional development, and resources, such as large classroom libraries and authentic learning experiences, such as field trips (providing teachers with the tools needed to grow and increase their effectiveness?)  Especially since the most important factor influencing student achievement is feedback and instructional quality, so let’s put our resources into the most critical factor influencing achievement: teachers.  \n\nThe following article by Alfie Kohn offers interesting commentary on the perceived achievement gap: http://www.washingtonpost.com/blogs/answer-sheet/wp/2013/05/03/were-number-umpteenth-the-myth-of-lagging-u-s-schools/ However, with that being said, if we are going to continue along this track of standardized tests in their current iteration, we might think about the following changes:\n\n1. Abbreviate the directions – I could tell students not bring electronic devices to school and include it in a note home. That’s enough.\n\n2. Bring back the Listening Section, which it levels the playing field for students who are reading below grade level, and provides them with access to a difficult text. It would also help address the Speaking and Listening Standards in the CCLS.  I’m not saying make the test longer. Instead, go back to its earlier format across three days.\n\n3. At the earlier grades K – 5, place more emphasis on formative assessment versus standardized assessment: systems for tracking students reading levels (see Assessment Pro), systems for tracking student growth in the different modes of writing (information, argument/opinion, narrative) using benchmarks, portfolio assessment, pre- and post assessments, and learning progressions. \n\n4. Decrease emphasis and high-stakes nature of standardized tests.  Hold teachers accountable, but place more emphasis on local assessment, and educating leaders and schools in how to create teams that can keep their fingers on the pulse of student performance through a regular study of student work and advocate for prevention and early intervention at grades K-2, to close the gap before it widens and becomes too significant. \n\n5. In my experience, great schools are a product of great leaders – leaders who know the power of distributive leadership, encourage conversations around student work, and empower teachers as decision makers. We need to provide support for principals to learn from each other by partnering schools with each other, so they will be poised to learn from each other.  These leaders will in turn provide teachers with opportunities to learn from each other. \n\nThere is so much more that I would like to say, but Lucy always says to find our yes – I say yes to the Common Core Learning Standards, I say yes to collaboration, I say yes to local accountability and systems for tracking student growth, I say yes to meaningful professional development for teachers in classrooms with students and yes to experimentation and risk-taking, I say yes to feedback other than state test scores.  \n\nFinally, I say yes to “focus[ing] on the work that lies before you – becoming the strongest teacher you can become, working to turn your school into a place where teachers help each other become stronger together than anyone could be alone.” Taken from Pathways to the Common Core: Accelerating Achievement by Calkins, Ehrenworth and Lehman \n\nI say no to high stakes testing, I say no to a climate of competition, I say no to top-down reform, I say no to threats of withholding funding or firing teachers, which engenders fear instead of courage and a sense of teacher and student efficacy.\n'),(693,686,0,NULL,NULL,NULL,'JoAnn McWilliams','Teacher, Parent','homejo64@gmail.com',1,NULL,0,0,'2013-05-04 20:43:25','I too am feeling disheartened.  I believe that the tide of education is making a tsunami sized turn toward high stakes standardized test-takers. Whole child, multiple-intelligences, and creative thinking and learning are being molded into a \"one-size meets test\" mentality.  This worries me immensely.  In my district I see less learning that is memorable, hands-on, and frankly \"fun\" for students and more stringent --every day is another \"absolutely necessary\" to teach or else you won\'t meet the test standard.  What happened?'),(694,185,0,NULL,NULL,NULL,'annonymous','Teacher','',1,NULL,0,0,'2013-05-04 23:42:13','I agree with many of the comments regarding the length of the test in a timed context and the ambiguity of the question and answer choices. A particularly heinous aspect of the questions, I thought, were the distractor choices; many of which seemed to reflect the developmentally appropriate ways 8/9 year olds would interpret the question given textual clues. The correct answers, on the other hand, seemed to be more consistent with adult interpretations, which would be fine, were the test measuring the comprehension of adults readers. I\'m not sure how expecting 9-year-olds to reason through complex texts and questions like adults is a fair or appropriate way to assess their reading abilities (or their teachers’ ability to instruct them well). Like many of the respondents featured here, I totally support the implementation of the CCS. My students have done an excellent job this year delving into more complex texts and pulling them apart, as good readers do, in order to achieve deeper levels of comprehension; unfortunately this test was not constructed in a way that measure their growth and hard work. '),(695,649,0,NULL,NULL,NULL,'Maureen Nosal','Teacher','maureen@mapcenter.com',1,NULL,0,0,'2013-05-04 23:51:35','Thank you, Lucy, for creating this space. I appreciate the nod to companionship as we work together to make our schools great. '),(696,NULL,0,'general','Observations',',11,','Lynn O\'Connor','Teacher','loconnor@wscschools.org',0,NULL,0,0,'2013-05-05 00:35:40','Many of my  6th grade students were unable to finish the test on day one.  The reading was too difficult; vocabulary in particular.  They were upset and felt defeated.  Day two arrived and things went from bad to worse.  Again, they did not have enough time, but after their awful experience on day 1, they scribbled down quick thoughts just to try to finish.  By day 3 they had given up.  My students were petrified of \"failing.\"  Young children should never feel this way.  Shame on the adults who did not have the intelligence to design an appropriate assessment.'),(697,NULL,0,'general','Observations',',11,','Lester J. Betor','Teacher','ljbetor@aol.com',0,NULL,0,0,'2013-05-05 01:26:50','25 minutes to for test directions seems a bit excessive to this educator!\n'),(698,NULL,0,'3','Ideas for Constructive Action',',13,','concetta moryl','Teacher, Parent','conniemoryl@yahoo.com',0,NULL,0,0,'2013-05-05 01:53:18','As a parent and a teacher with a MS in early childhood education, I feel it is not developmentally appropriate to have 8 year olds sit for three 70 minute test sessions.  I understand the desire to assess a variety of genre but that could be accomplished with one fiction, one non-fiction and one poetry selection.  Each selection could have 3 multiple choice and a short answer.'),(699,103,0,NULL,NULL,NULL,'Ann Christensen','Other','Ann_christensen@dpsk12.org',1,NULL,0,0,'2013-05-05 02:07:38','The clarity of this statement sums up so many of the other statements. The assessment is far from where it needs to be to support the kind or teaching and learning we are after.'),(700,365,0,NULL,NULL,NULL,'Colleen','Teacher','ctaliercio2001@yahoo.com',1,NULL,0,0,'2013-05-05 02:24:29','Michelle,\n\nI am confused, why no testing accomdations??? They are permitted as oultlines on their IEP\'s.'),(701,161,0,NULL,NULL,NULL,'Ann ','Other','Ann_christensen@dpsk12.org',1,NULL,0,0,'2013-05-05 02:35:06','90 minutes!? 3rd graders should not be tested for more than 45 minutes MAX. These are not endurance trials.'),(702,391,0,NULL,NULL,NULL,'Anonymous','Parent','',1,NULL,0,0,'2013-05-05 03:25:39','Is this a student? Here is the thing you should know. You can start a website or a blog and write in detail about the test--kids aren\'t under the same \'test security laws.\' It was kids writing about the pineapple and the hare that made pearson eliminate that whole passage last year. Kids should be using their argument skills to write detailed arguments against the test.'),(703,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-05 11:48:14','My students felt defeated with this test.  It is very long and tiresome for most 8 year olds.  For the most part, the stories were not intriguing for a young elementary aged student and the questionings were confusing for some of the stories.  '),(704,19,0,NULL,NULL,NULL,'Anonymous','Other','',1,NULL,0,0,'2013-05-05 12:20:14','Texas tests are! Timed. Students have four hours. We are not common core state. At this point I don\'t know if thats a good or bad thing. Our tests just changed last year to become more \"rigorous\" and they are. '),(705,269,0,NULL,NULL,NULL,'Lucy Calkins','Other','',1,NULL,0,0,'2013-05-05 13:24:47','Thanks Anonymous (but why anonymous? It ends up looking like I wrote a compliment to ourselves!) I do think that our hunches about how the test would go proved mostly true, though we were all braced for even harder passages. I think a good part of the hard part came from obscure wording and the need to look between and differentiate each of the numbered paragraphs--things that aren\'t related to valued skills.'),(706,NULL,1,'National','Observations',',11,','Anonymous','Teacher','bonniemdj@yahoo.com',0,NULL,0,0,'2013-05-05 14:02:38','I work with children in an in-patient psychiatric \nsetting. Although we can\'t coerce them into taking the ELA, we have to strongly advise them.\nMost of our kids have missed months or years of school because of the severity of their illnesses, failure, placements and more. They have trauma.  Their hospital level medication slows ability to process information, and reduces cognitive ability. Besides, many are totally distracted by their issues, have fear of failure  or are indifferent to learning academics at this time. We should be building their confidence and \nenthusiasm for learning by helping them do critical thinking via reading and writing activities that are relevant to their lives and make them feel that they count.\nBesides, I\'ve heard that the unheard of pressure for their students to get high scores- ie. keeping their jobs impinges upon the test scores takes quite a toll. I can understand why.\n'),(707,NULL,0,'general','Observations',',11,','Karhy','Teacher','',0,NULL,0,0,'2013-05-05 14:54:58','I have been teaching third graders for 22 years now and have seen a lot of changes come and go.  I believe a national core curriculum is the way to go.  I do not believe in these tests.  My students were prepared and excited to \"show what they learned\" only to be hit with extremely long stories, ambiguous multiple choice questions, and not enough times to digest, reflect, and write well.  I have never agreed with the time constraints. If you truly want to know how well a child can read and write, give them unlimited time to do it.  It broke my heart to see who truly cared and tried their best, not finish the test or rush so much in the end that they put any old answer down, just to have something written.  In the past, I felt the tests were fairer and developmentally correct for an 8 year old.  Not this year.  What are they trying to prove?  Imagine an 8 year old being turned off by school already!  This year was truly awful, the worst tests I have ever seen!  State ed and Pearson should be ashamed of themselves.  They are not improving education, but destroying it and our children!'),(708,646,0,NULL,NULL,NULL,'Kathy','Teacher','',1,NULL,0,0,'2013-05-05 15:19:02','I can assure you that 99% of the teachers did not \"cheat\" during these tests.  Not with our jobs on the line!  Putting different people in the rooms with students who are 8 year old, just adds to their stress.  The fact that your son found the test \"easy\" gives credit to the teacher who taught him.  Most post tests are \"easy\" because the children have been taught the material.  Math is skill based and if you have acquired the skill, the test is easy, especially if your child has the ability to understand math.  Lucky for you!  But, not all children can grasp math equally.  I don\'t agree, if you child is accurately reporting what was happening during the test, with what his teacher did.  It is not allowed.  Unfortunately, what did the state expect when they heavily tie a student\'s state exam results directly to the teacher\'s evaluation.  I feel bad that his teacher may have caved to the pressure, but rest assured that 99% of the teachers out there are professional and do their best for their students and do not \"cheat\" during exams. '),(709,38,0,NULL,NULL,NULL,'Josephine','Teacher','jramage@tywlsbrooklyn.org',1,NULL,0,0,'2013-05-05 16:17:33','In my mailbox this weekend was the current issue of New York Teacher put out by the UFT.  The front cover said \"Common Core exam fiasco\" and pictured a broken pencil atop a standardized test answer sheet.  The headline of the article on page 3 states \"Anxiety, tears over new state exams\".  One quote in the article states, \"On the first day, I had a student throw up.  It never happened to me before.  I\'m sure it was stress.\" (Rashad Brown, a science teacher who proctored the ELA tests at MS 224 in the Bronx) Those who would advocate for Diana\'s dismissal, would also have to advocate for the dismissal of hundreds more like her across the city and the state who experienced for the first time ever the exact same anxiety related symptoms in our children.\n\nIn NYSUT United magazine, their facebook column quotes Katie Cavanagh who works in a doctor\'s office.  She states that she is appalled by the number of preteens being put on anxiety meds because of the pressure of test taking.\n\nTeachers, principals, and superintendents in Georgia and on Long Island are cheating when it comes to state exams in their districts.  It is the culture that is being created around test taking that is causing these behaviors and reactions.  It has to stop!  And the only way to do that is to unite - not to attack each other.  We became educators because we believe that we can touch the future.  Those of us who have more experience in education need to realize that we also touch the future of younger educators. If we want smart, passionate people to remain in the educational system, we must support one another.  If you have words of wisdom on how to de-stress students, teachers and administrators, then please share - because with my 16 years of experience, I don\'t know how to de-emphasize the anxiety that comes with state tests. '),(710,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-05 16:33:38','Day 2 had several confusions that were not necessary!  There was no need for 2 books for the kids to work in.  I felt that overall there were too many main idea questions; so if kids didn\'t get it once they probably didn\'t get the answer several times.  The multiple choice questions were also too specific for children that age.  I also felt that for kids to really be able to go back and reread for specific evidence for days 2 and 3 they should have had the option of more time if needed.  It was very stressful for the kids testing and for the teachers watching!'),(711,206,0,NULL,NULL,NULL,'Lucy Calkins','Other','',1,NULL,0,0,'2013-05-05 16:46:50','Stefanie,\nDiane Ravitch--a famous historian of education--just wrote in her blog that she got a bootlegged copy of the fifth grade exam and her analysis of it (in relation to the NAEP) suggests it was at an 8th grade level. Some of the questions were printed in the Daily News. You\'ll see when you examine the test why teachers are complaining so loudly. One of the issues is that teachers will be evaluated based on their students\' scores on this test. It is admirable that teachers are not focusing on that on this site--but clearly part of the stress over the test comes because the new tests were released just when a new teacher evaluation system is gearing up.\nLucy Calkins '),(712,244,0,NULL,NULL,NULL,'JoAnne Kleifgen','Other','jk217@columbia.edu',1,NULL,0,0,'2013-05-05 17:24:19','I would like to respond to Katie Lapham\'s superb letter to the NY State Board of Regents. She represents the wisdom and insights of educators who are advocates of children in today\'s public schools, children who increasingly are emergent bilinguals with home languages that have to be left at the school house door. For 18 years, I taught children of all ages and diverse ethnolinguistic backgrounds before becoming an academic and working for another 28 years to study, understand and teach about how children and adults learn.\n\nWith increasing alarm, I am noticing that assessment policies ignore the creative resources that children bring to school and thus only deepen the inequities in our nation\'s classrooms. I urge others like Katie to make their voices known to thoughtfully contest, engage, and above all shape educational policies in this country, particularly regarding the kinds of assessment tools that are being foisted on children.\n\nJo Anne Kleifgen, Professor of Linguistics and Education, Teachers College, Columbia University'),(713,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-05 19:59:19','As a special education teacher with 28 years of experience, these tests are the most ridiculous thing I have ever seen implemented when it comes to the world of special education. Have we forgotten there is such a thing as the Bell Curve?  Many of my students are in the bottom 5% of that Bell Curve.  I have students, as I\'m sure many other special education teachers do as well, who are expected to take a NYS grade level test even though they have limited cognitive abilities and instructional levels that are 3 years or more beyond the grade level exam they are expected to take.  As I administered the test this year, not to my students, but to another group of special education students, I watched their frustration and witnessed the outcome of some of these assessments.  One student who was unable to read the grade level text, went through his answer sheet and recorded all As.  He was done in 19 minutes.  This same student when it came time to write an essay, rewrote the task assignment for the essay as his essay.  Many of the special ed students were totally confused with the ELA and Math tasks because their instructional levels do not match their grade level, so what kind of progress are we measuring for these students?  And what about all of us who teach special ed students, will be measured as ineffective teachers because our students are cognitively compromised and unable to pass a grade level NYS Assessment?  IQ scores in the 50s, 60,s and 70s.....do you think these students are really capable of doing grade level work just because they are in that grade level?  If you do, then why are they specail ed?  So my dilemma is teach to the individual instructional objectives of their IEPs or try to teach them content for the test even though developmentally they are not capable of learning it. '),(714,489,0,NULL,NULL,NULL,'lucy Calkins','Other','',1,NULL,0,0,'2013-05-05 21:01:27','Sean,\nI don\'t know about King and Tisch but I do think there is evidence that a lot of people are listening. Diane Ravitch referenced this site. Editorial writers from the Times and the Washington Post are on it. People in the State who are responsible for testing and for CCSS are following the site. What the result will be, I do not know, but yes, I think people are listening.\nLucy'),(715,673,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-05 21:08:32','Cathy, can you be specific? What would you like to hear?'),(716,689,0,NULL,NULL,NULL,'Maureen Nosal','Teacher','maureen@mapcenter.com',1,NULL,0,0,'2013-05-05 21:16:10','Can you frame the conversation? I am interested in this topic, too.'),(717,NULL,0,'2','Observations',',11,','Regina','Teacher','rdenatale@mail.edgemont.org',0,NULL,0,0,'2013-05-05 22:20:29','I am a second grade teacher and must make an observation of how the environment of a loving and caring school changes during the State exams. Many teachers in my school, volunteer, wait in the front hallways and greet the children as they enter each day. We had a difficult year with weather and disasters this year so we try to keep the spirit high and welcome the children each day.  There was a marked difference during the state exams. The responses to \"Have a good day\" were met with somber faces during test week. Children told us it was not a good day or week because \"we are being tested\".  Others used each day as a count down until if was \"all over\". Many told us that they were tried and just wished the teachers could go back to teaching and having fun.  I am fortunate that I have some of my former students come and visit me. During the seek of testing I think they just needed someone to talk to and listen.  They needed to let someone know that they tried their hardest but found the test \"hard\". Some needed to let a teacher know that the test didn\'t use the literature words that \"we have always used\" and so \"I didn\'t know what they were talking about\'.  \"I never had to guess before but this test made me feel stupid\".  What did I do?  I listened, talked and let the children know that they are smart and this is just one way to measure what they have learned.  Yes, I guess I was a teacher; something the State seems to making so much harder these days.  '),(718,NULL,0,'National','Observations',',11,','Anonymous','Researcher','',0,NULL,0,0,'2013-05-05 23:27:47','While looking at the recent PARCC sample draft assessment I am witnessing the same flaws that I think the students of New York encountered with their exam.  Pearson and PARCC are run by non educators who are failing to look at research when creating these exams therefore they will be hurting students and instead of helping students move towards college success will create a climate of failure and quitting.  We hope that the lessons learned in New York will impact the decisions that PARCC makes moving forward.'),(719,NULL,0,'6','Observations',',11,','Kristen Geoghan','Teacher','KIzzo3@schools.nyc,gov',0,NULL,0,0,'2013-05-06 00:59:40','The Common Core Standards emphasizes that students should be reading more complex texts throughout the year and participating in close reading.  This requires them to really break down the text and have a conversation with it while using active reading strategies.  The passages were challenging for my students, just as they expected them to be, and I would say the kids in my class were very prepared. As a class and a school we rose to the challenge of really challenging our students and they tried their best. \nDay one was very challenging and what I found was that the students did not have time to go back and really recheck their work or have an opportunity to reread.  Most students finished just in time if not with leaving a few blank.  \nFurthermore, the amount of work that was expected on day two and day three within that time limit was unattainable to do well. The students had to read five passages, answer three short responses, and write an essay.  If you apply the strategies you have learned all year with rereading, planning, and using active reading strategies you most likely are not going to finish in time. \nIn order for the students to apply what they learned and complete the test well was impossible.  If we are going to test our students on comprehension why is there a time limit?  One is not an indicator of the other.  My kids were sick to their stomachs that they could not finish in time.  Many of them felt they were set up to fail and felt very discouraged by day three.  I KNOW that if the state gave them the same test without the time limit the result would be very different.  \n'),(720,NULL,0,'4','Observations',',11,','Anya Mateo-Jerez','Parent','apudov@mail.comm',0,NULL,0,0,'2013-05-06 01:05:39','This test is longer than my college tests! My kids were a little nervous, but we downplayed the importance of the test at home, so no major issues there. I would prefer shorter tests throughout the year, and make list of topics available for study. This year it was like shooting in the dark.'),(721,NULL,0,'8','Observations',',11,','Teacher','Teacher','',0,NULL,0,0,'2013-05-06 03:03:19','Many of my students who are at the top of their class and excellent writers and readers let me know they did not complete the essays. They worked so hard and some took a few seconds in the last minute of the exam to write, \"I\'m sorry I do not have time to write the essay.\"\nSince when does intelligence get weighed against a clock?\nMath had 10 multiple-choice on each of the first two days in comparison and on the third day Math had 9 show-your-work problems. \nNo where on CCSS is there a standard for time factors in terms of completion of English Language Arts tasks.\nTeachers, Parents, Children were never notified so how will this be addressed, normed, counted?\nHow many children will feel they have failed? How many teachers will be rated \"Inefficient\"?\nHow many children will be held back?\nThere must be a change in the amount of work expected of a child given the time period.\nThere must be a concerted effort made to focus the test on a goal that is at the children\'s developmental level.\nThere must be a change in the tasks and expectations and scoring for this year\'s test and those going forward.\nThrow away Book 3 - there are essays and short responses as well in Book 4. \nCurrent conditions will require teachers to teach to the test including timing of tasks starting in September. This is militarization of education. \n'),(722,107,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-06 04:51:31','Looking quickly through just one of the 8th grade reading selections, I noted at least 11 words I would have included in a vocabulary list prior to reading, if the piece had been part of classroom instruction. Only one or two of these words were defined in the test manual, and few of the others had context clues substantial enough  for the students to be able to pin down the meaning.  \n\nI noticed several idiomatic expressions, some quite arcane or so seldom used in the main stream that they could only confuse and/or distract the students from real comprehension.  \n\nSome of the questions used language, i.e. \'Is the author\'s reasoning sound?\', that is rarely, if ever, heard in an 8th grade classroom.  Linked to a reading selection that, in part, discussed the sounds that some birds make, couching the question in those terms served as pure obfuscation for many students.   \n\nUnfair, excessive and morale killing, especially given the shroud of secrecy that holds the hard copy out of reach and does not allow us to review and discuss this exam with our students.     '),(723,NULL,0,'National','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-06 07:25:29','As educators, our job is to nourish our students\' innate curiosities and strengths while establishing a solid academic and social foundation so that they may grow into lifelong\nlearners with a strong sense of self. The students we teach are growing up in a world where they\'ll need to be equipped to compete in math, science, technology and the arts; and to be effective leaders, critical thinkers, and problem solvers with strong communication and collaboration skills. The global\nchallenges our students will face in their lifetime will surely test their adaptability and integrity in ways that will surpass the generations that have preceded them. Therefore, it is our responsibility to play an integral part in molding our students holistically during the crucial and formative years of their education. It is difficult to see how the New York State Testing Program contributes to these efforts. New York can and should do better for our children.'),(724,172,0,NULL,NULL,NULL,'Michelle  Hughes','Principal','michelle@highmeadowschool.org',1,NULL,0,0,'2013-05-06 10:48:47','Once again we are faced with tests, the structure of which, seem to fly in the face of the standards they are professed to assess.  The timing of these tests seem designed for failure rather than success.  The children could not plan, and thus sat shaking and racing the clock.  This is an inhumane exercise. '),(725,NULL,0,'general','Observations',',11,','Erik Tetro','Teacher','',0,NULL,0,0,'2013-05-06 12:24:26','I wanted to share with you the pressure and anxiety that these 8 and 9 year olds have gone through.  I had parents emailing me telling me that their child is not sleeping and having nightmares.  I had 4 children, during the ELA, break down and sob.  2 were sobbing so hard that they needed to be removed from the classroom for 2 minutes to control themselves.  They were disrupting the rest of the children.  \nI cannot believe the pressure that the school, teachers, parents and chidlren have to go through in order to administer a test!  C\'mon people -there has to be another way!\nThe test questions were  ridiculously hard and unfair for 3rd graders (can\'t speak for any other grade).\nThe moral in our district is at an all low!  What you are putting these children through has now crept into the educators.  \nI\'m so disappointed in New York!\nShame on you all!'),(726,NULL,0,'general','Observations',',11,','Anonymous','Principal','',0,NULL,0,0,'2013-05-06 12:36:52','The tests were absurd.  Day 2 was all to confucing for the studentsas well as the teachers.  Day one Reading passages were well above students level and the questions were highly ambiguous thus making the test impossible for students to complete in the allotted time.  The state needs to provide more passages wjich will engage he students and accurately measure their levels and progress.  In addition, the questions need to be more straightforward with a SLIGHT degree of difficulty.  The essays were also well above the students levels and need to be scaled back to accurately meausre a students writing ability.  We also need to change the allotted time for the exam.  Additionally, students who are English LAnguage Learners need to be provided a longer time frame to master English before being subjected to this Exam.  ELL Students need AT LEAST THREE YEARS before having t take this exam.  Special Ed students need to be provided with a modified exam to accurately measure their performance levels.  '),(727,94,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-06 12:38:10','One students at my middle school in our gifted class said he wanted to kill himself as he said he failed the exam.  '),(728,NULL,0,'4','Observations',',11,','Maggie','Teacher','mkelly@hartfordcsd.org',0,NULL,0,0,'2013-05-06 12:42:12','One shift in the Common Core Standards is for students to look at text more deeply--close reading. I was looking forward to the exams this year because I felt that my students were very well-prepared to do just this. I had several students who told me that they ran out of time and had to rush on the multiple choice questions. Many said that they did not finish as many as 10 multiple choice questions, despite their hard work during the entire 70 minutes. Also--One of my students (who is an excellent writer) said that she knew she was running out of time and had to rush to complete her writing. While she usually completes beautiful, well-developed paragraphs, she indicated that she wrote quick thoughts so that she had something on the paper. I don\'t think that this year\'s score will provide a true reflection on her ability or the ability of many others.'),(729,365,0,NULL,NULL,NULL,'Maggie','Teacher','',1,NULL,0,0,'2013-05-06 12:44:56','Colleen- Students are only allowed certain testing accommodations. They are not allowed any accommodations that are related to the content of the test. For example, on the NYS Common Core ELA exam, students who have \"Tests Read\" listed as an accommodation may not have the passages and/or test questions read because the test is assessing the student\'s ability to read.'),(730,NULL,0,'general','Observations',',11,','Julie Witkiewicz','Teacher, Parent','jwitkiewicz@somersschools.org',0,NULL,0,0,'2013-05-06 12:57:18','The assessments given create a lot of stress for children, parents and teachers alike. A parent considered skipping a vital appointment for her child, one that would have to be rescheduled in 3-4 months so her child would not miss the testing. Children  worried that they wouldn\'t do well enough to be promoted, results would be on their report cards and permanent records. Some exhibited physical symptoms of stress. Teachers worried that their APPR scores would be negatively effected; expectations are unclear, not all children do well on tests, not all children put forth their best effort, children have worries from outside of school; divorcing parents, sick grandparents, dying pets, etc., and as studies show, children\'s growth and learning do not have a direct correlation. Just as when they physically grow there are spurts and plateaus, so it is when they learn. It is not only unfair to measure a teacher\'s \'effectiveness\' based on an assessment, it is also counterintuitive.'),(731,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 13:24:35','At least three of my students did not finish in the required time for all three days.  These are average students.  There was not enough time.  The passages were very long & some of the questions were above the \"average student.\"  Math was just as bad if not worse.  So are we all going to need teacher improvement plans next year????'),(732,NULL,0,'general','Observations',',11,','Jennifer Schroeder','Teacher','jschroeder@sachem.edu',0,NULL,0,0,'2013-05-06 14:16:00','The length of the test on Day 2 was inconsistent with the instructional shifts.  In the course of our teaching, teachers were asked to be \"patient, create more time and space and support in the curriculum for close reading.\"  However, the structure of the test on Day 2 did not follow that principle at all.  Students were expected to be competent speed readers rather than engage with the text at a closer level as the Common Core suggests.'),(733,NULL,0,'5','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 14:25:05','Thoughts on ELA exam for Grade 5:\n\n1. While kids are told to read at their          \"independent levels\" all year long, the exam proved to be at a level that was at least 2 years above the abilities of my kids.  Completely contradictory and unfair. Those of us who are REALLY \"in\" education know about Piaget and his developmental stages of child development.  This exam was not in the realm of the current stage of fifth grade kids.  If we want to make the exam relevant, and valid, each grade level exam should be written on the vocabulary level of that grade in the month of the school year when the test is to be administered.  THEN you will be able to decide if the kids made progress.  \n\n2. Some of our highest level kids, did not finish.  Does the exam measure knowledge of content/skills or stamina and pace?\n\n3. The emotions were unreal.  Kids crying, becoming ill...all because they knew what they were trying to do was unattainable.\n\n4. What was the purpose of reading comprehension on day 1 AND day 2?  Day 2s comp section served NO purpose whatsoever.\n\n5. Some children do not have any background knowledge/experience with some of the topics used on the exam.  Without the proper developmental skills AND no background knowledge of the material, the kids didn\'t have a chance.\n\n6. It will be interesting to see how the tests change for next year....if they become significantly easier/more attainable the kids will show supposed terrific \"growth\" from the previous year, thus making the people who had a hand in this test development process look like Gods.  It would sicken me to think that our kids could be being used as political pawns.  It would be a sad day in education, our state, and our country if this were to come to light.\n\nOne can hope, sensibility will enter at some point and our kids won\'t have to suffer any longer.  Testing is a good thing...but only to check understanding of material taught and to drive instruction...other than that, it serves no purpose.\n\nMy hopes are for a brighter future for our kids.\nThey don\'t deserve what is happening to them, nor do we.\n\nBe well, Everyone.\n\nA Concerned and defeated 5th Grade Teacher\n'),(734,NULL,0,'8','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 14:36:48','The 2013 assessment had passages that were above my students reading level. It was an absolute travesty on the second day of testing because many students did not finish.  Two books could have very intelligently been combined into one which would have made more sense for the students. Awful day for them.'),(735,NULL,0,'general','Observations',',11,','B Epstein','Teacher','lateach6@hotmail.com',0,NULL,0,0,'2013-05-06 15:04:27','I was very upset after Day 2 of the 6th grade ELA exams.  The stronger the student, the least likely they were to complete their exams.  First of all, two books in one day was unfair.  The students spent too much time on the multiple choice questions as we were not given a time to have them start the 2nd book.  I actually was upset every time I saw a student stop to think as there was no time for thinking.  Students who wrote thoughtful responses to the short answers were penalized as there was not enough time to complete the essay.  Even the one student who finishede the multiple choice book quickly worked until the full 90 minutes were up.  \nThis test in my opinion tests only speed reading.  However, the students were taught to do close readng which takes time.  \nIn addition, all directions were given at the beginning of the period.  Teachers were given only 10 minutes to read directions from both books and answer questions.  \nI was shocked at how little the makers of this exam seem to know about children.  They should be ashamed.  And I haven\'t even addressed the language of the exams which was clearly designed to confuse and mislead the children.  \n'),(736,NULL,0,'general','Observations',',11,','Corrina','Teacher','cpelkey@vliet.neric.org',0,NULL,0,0,'2013-05-06 15:46:15','New York students are getting nothing out of your high stakes testing.  In fact, they are not even being taught to write well, which is why over 60% or our college students need remedial services.  My students are stressed and less educated now then in the past.  However, because I have a readers and writers workshop background, which is how I teach all of my students, I have created writers and readers.  I am sure my students will not need remedial services when they enter college, but keep this high stakes testing up and the percentage rate will jump even higher....it is called dumbing down our students.'),(737,NULL,0,'National','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 16:16:38','I don\'t mind being assessed, etc. as long as the readings and questions are developmentally appropriate.  We haven\'t been able to keep former tests so kids can get an idea of how to pace themselves, etc.  On day #2 to have the fourth graders presented with TWO SEPARATE BOOKS AND HAVE TO PACE THEMSELVES WAS SO WRONG.  EVEN THE MIDDLE SCHOOL KIDS HAD DIFFICULTY WITH THE TIME CONSTRAINT AND PACING THEMSELVES.  WHY NOT PUT ALL OF THE MULTIPLE CHOICE ON ONE DAY?  THAT WAS REALLY NOT A VALID TEST FOR ANY GRADE.  We teach the curriculum and focus on story mapping, etc.. but then the accent is on quotations which we were never told would be the focus.. and the questions were so long.  Kids rushed to finish and didn\'t give those long questions time because they were afraid.  Some third graders cried.  Have any of those who made the test taken them and timed themselves or done field testing?  We all work hard.  I call kids in the AM free to work with them, but I don\'t know if it helped at all.  We need a few years to get up to par.. Let the Kindergarteners now get to fourth or fifth grade and then test them since learning will be cumulative with everyone before that grade building upon each other.  Standards and Common Core are fine, but look at the levels of kids coming in with working parents who don\'t have time to read with the kids, do their homework with them or even check it.  We can\'t do it alone.  Teachers don\'t complain for no reason.  Listen to us, please.  '),(738,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 17:50:58','This test created so much anxiety that students couldn\'t think of anything els.  We actually had a student vomit on a test.  The state had no idea what to do with this test.  The stories on the test were engaging!  This was the only thing they got right!  '),(739,NULL,0,'National','Observations',',11,','Jet','Teacher','Babeckum@yahoo.com',0,NULL,0,0,'2013-05-06 18:25:53','The teacher is once again being ignored \nby our educrats know it alls. Since the\nearly 60s Sat scores have dropped while\nthe numer of tests have skyrocketed .\nNever enough money for the classroom \nteacher but always plenty for a cockeyed\npie in the sky program and more tests to\nprove it so.  \n    The fact is our political educational\nexperts have destroyed our education\nsystem and many believe it was intentional.\nIf the government  is our caregiver , why\neducation ?\n\n'),(740,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 18:53:24','The students didn\'t have enough time to complete the ELA test this year.  The type of questions that were asked this year required students to go back and reread several paragraphs and then analyze these paragraphs. Then go back and reread the question a second or third time.  All of this back and forth was required just for one question. And this type of question came up over and over. I don\'t think we should be asking 9 and 10 year-olds to keep up this kind of stamina for 90 minutes.  Since the students felt rushed on the first day panic set in for day 2.  Day 2 had two books with the first being multiple choice.  The students in my class were afraid they wouldn\'t have enough time to get through all of the challenging multiple choice AND read and complete short response questions and a full essay.  The test didn\'t allow them to time plan out their essays, write thoughtful essays with enough evidence and voice, and check their writing for grammar, capitalization, and spelling.  There should have been a break for students to move around a little bit half way through each session of the test. '),(741,NULL,0,'general','Observations',',11,','Melissa','Teacher','',0,NULL,0,0,'2013-05-06 18:57:28','The students in my class were feeling extremely stressed during the test.  Not because I placed any more importance on this test than I have any other year I\'ve administered it, but because as they began to read the questions their confidence and time left for taking the test began to fade quickly.  As the time dwindled students were trying to write faster, some just started rubbing their heads, and some even began to cry.  '),(742,NULL,0,'general','Ideas for Constructive Action',',13,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 19:11:28','I administered the test to all of my ELL students who were entitled to accommodations.  Therefore, I had the opportunity to look at the 3rd, 4th, and 5th grade tests.  My students had enough time to finish the test.  However, I could tell as I walked through the building that the \"regular ed\" students and even the classified students did not have enough time.  The test was much too difficult.  \nFinally, the Listening section was removed from the ELA but a tougher Listening section has been added to the NYSESLAT.  Why do this?  It makes no sense.'),(743,NULL,0,'5','Observations',',11,','David Richards','Teacher','drichards@pioneercsd.org',0,NULL,0,0,'2013-05-06 19:41:21','Some talented readers and writers running low or out of time due in part to the complexity of the tasks and their own conscientiousness in using text-based evidence to support their responses.  '),(744,NULL,0,'general','Ideas for Constructive Action',',13,','Michelle','Teacher','mmeleski@me.stier.org',0,NULL,0,0,'2013-05-06 20:19:05','I feel that the ELA Exam was extremely inconsistent and unfair to our students.  70 minutes to completely read all passages and answer either multiple choice questions or short and extended responses did not allow our children time to go back into the passage to \"closely read\".  Close reading, which is supported nationally by the Common Core Standards movement, as defined by Sheila Brown and Lee Kappes; \"Implementing the Common Core State Standards: A Primer on Close Reading of Text,\" 2012, is a mechanism for teaching about logical arguments and critiquing the reasoning of others, for gleaning evidence from text and applying critical thinking skills.  For 8, 9 and 10 year olds, this process takes more time that is allowed.  If we are to teach this process, doesn\'t it make sense for us to allow our students time to use this technique to answer multiple choice questions as well as short and extended respons questions. First, it is best practice as a test taker to preview the questions before reading the passage(s).  Then, students read the passage and move onto the questions again where they have to understand what the question is asking and then answer the question by going back into the text.  This takes time!  \n\nMy next complaint are the way some of the questions are worded.  Our students had points deducted because of the way they understood the question.  For example a question stating, \"using lines 2 through 11,\" to mean using all lines from 2, 3, 4... 9, 10, 11 is fine.  Opposed to  \"using lines 2 to 11 which after calling our call state call line, means that the students are referring to only lines 2 and only 11. BUT then giving credit for an answer that was found in line 3 and in line 12 but nothing else.  As we were trained for scoring, the materials that we had from the state to practice scoring were inconsistent.  The practice packet scored a 1 for the same answer that scored a 2 in the Consistency packet.  \nI feel that through this whole entire process, our students suffer the most.  We need to assess what we are teaching for in accordance to the Common Core.    '),(745,NULL,0,'general','Observations',',11,','John Philp','Teacher','johnphilp@hotmail.com',0,NULL,0,0,'2013-05-06 20:30:50','Pearson? And who are they again, to tell me all about education and my child?'),(746,134,0,NULL,NULL,NULL,'anonymous','Teacher','',1,NULL,0,0,'2013-05-06 20:55:07','I completely agree.Lesson blocks are generally 40 minutes for a reason--kids lose focus. Why in the world then are test makers forcing them to sit through 70 minutes? I wish they could have heard the soft sighs and quiet groaning from some of my 3rd graders midway through the test.  Furthermore, as a first year teacher I anticipated losing only 70 minutes to the test, but it took 20 -30 minutes to read the directions each day, so ,almost half a day\'s instruction was lost.  VERY COUNTERPRODUCTIVE!'),(747,308,0,NULL,NULL,NULL,'anonymous','Teacher','',1,NULL,0,0,'2013-05-06 21:08:36','I totally agree on all counts, especially with the flipping back and forth. Until the state insists that test makers  provide passages that can be separated from the questions for quick reference ,  this is a test designed to make kids fail.  Furthermore I think test makers have finally gone far enough that we are going to see a high rate of opting out next year.'),(748,NULL,0,'GA','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 21:14:16','Common Core is a joke!  It is not appropriate!!!!'),(749,NULL,0,'general','Observations',',11,','Anonymous','Parent','',0,NULL,0,0,'2013-05-06 21:16:33','Can\'t wait until the communist have to come up with something new!  Private school...here we come!   Common Core is not appropriate or rigorous!'),(750,NULL,0,'6','Observations',',11,','Mary Blow','Teacher','mblow@lowvilleacademy.org',0,NULL,0,0,'2013-05-06 21:48:38','TIME\nThe construction of the test does not align with the CCS expectation of close reading and utilizing textual evidence effectively. This type of reading and writing takes time. The students did not have enough time. \n\nMany of my students did not finish the test on Day 2 and a few did not finish on Day 3. Most of my students worked hard. They were serious about doing their best, but there are always a few who will not take it seriously and rush through. Overall, I think we will see that our students who highlight, annotate text, and embed quotes, utilize commentary and cite sources did not make it. Those who were less invested may have finished, but did not score well. Looks like we will have a lot of students with low score. \n\nSTUDENT RESPONSE\nI had some students cry, some came to me in a panic afterwards, some claim that they are not \"stupid,\" and one who actually wrote a note to the state saying that she wants to \"run away\" because she feels like a failure. By Day 3 they felt defeated. Many did not put their full effort into it. A child who thinks he can, will try. A child who feel like he can\'t, quits. In middle school, it is imperative to keep motivation and engagement. You lose that and you increased the risk of dropping out. I fear this may start a new trend.   \n\nSHORTEN THE TEST\nMy students would have been fine with more time. I don\'t believe Day 2 served a purpose. Was it even necessary? I did not see the short answer responses as more challenging. My students simply did not get to most of them. I believe it is my fault because I taught them to check for accuracy in their details, embed quotes, cite paragraphs--skills they will need to prepare them for college. They did not have time to do a thorough job--it contradicts the shifts in the CCS.'),(751,NULL,0,'general','Implications for Instruction',',12,','Mary Blow','Teacher','mblow@lowvilleacademy.org',0,NULL,0,0,'2013-05-06 21:52:59','I have to question if Book 2 was a field test. It was poorly written. After reading 2 passages, the students were asked to write describing how the \"author\" created suspense. Well, they read two passages. They should have referenced the author and title of the passage. During grading, I noticed that many students wrote on both passages--probably to make sure they did lose points for only writing on one passage. Others wrote on passage 1. Some on passage 2. This is a situation where you get out of it what you put in to it. '),(752,NULL,0,'general','Observations',',11,','Mary Blow','Teacher','mblow@lowvilleacademy.org',0,NULL,0,0,'2013-05-06 21:53:49','There is no need to reiterate what everyone is saying. I just wanted to be counted to demonstrate that this was an issue across the board.'),(753,NULL,1,'general','Ideas for Constructive Action',',13,','Mary Blow','Teacher','mblow@lowvilleacademy.org',0,NULL,0,0,'2013-05-06 22:29:39','SCAFFOLDING\nSomeone needs to evaluate these assessment to be sure the there is scaffolding of text complexity and length of passages across the board that reflect the stages of child development. The developers of this test did not take into consideration the stages of physical, mental, and cognitive development. This suggests that the students were set up for failure. I have observed, and others have verified, that there were the same passages in grades 4&5. A passage from the 7th grade modules was on the 6th grade test. \n\n\nQUESTION ISSUES\nI can only respond from memory. Therefore, without the ability or time to engage in close reading and analyze the test, it is difficult to give \"textual evidence\" and cite my source for this response:\n\nOn the sixth grade test, there was a multiple choice question on the point of view. The narrator is someone outside the story. The choices referenced the character and the character’s point of view, which is confusing because the character was not telling the story.\n\nA significant portion of the questions used the term “central idea.” This term appears to be an omiword--my new term. It is being used as a synonym for many literary terms. English content area terms should not be disregarded. How does this prepare students for college? I understand the term \"central idea,\" but it is ambiguous and misused to encompass: main idea, theme, similarities. Be specific with what you are asking.   \n\nQuestion 71: You asked students to complete 3 tasks and provide 2 details. It is impossible to respond to all the tasks using 2 text-based details, so immediately they would score a 1 if they follow the directions and questions, which by the way, they were instructed to read closely.\n\nWhy insert a blank page? It gives the impression that the test is done. It confuses kids: no stop sign, no continue on sign, just a blank page. They are 10-years-old, so guess what they did. If you tell them to watch for the signs, you should use them.\n\nIn one multiple-choice question, students were asked to identify the central idea of the passage. The answer choices were direct quotes taken from the passage, which I believe is considered evidence from the text to support a claim, not a central idea. \n\nPay attention to formatting. On the 7th grade test, one small paragraph was moved to a back page. Students thought they had finished reading the test. So when the questions said to refer to the last two paragraphs (not paragraph ? and ?), many did not realize that there was more text on the back.\n\nOverall observation of nonfiction text. In today\'s multimedia world, nonfiction text features are essential in preparing our students to be close and evaluative readers. Text features, a shift of the CCS, were basically non-existent or poorly constructed. The map on the test was inaccurate. It was missing the original map. The supplementary map did not provide the information to answer the questions accurately. They had to guess. If they had the original map, the question would have been great. \n\nI question the logic of evaluating teachers on a poorly written tests. If I were a paranoid person, I would feel like someone did not like teachers, and sadly, children, too. I think when this happens, it is not only students, but teachers who throw up their hands in frustration because it is a no-win situation and the NYSED testing program becomes ineffective. If you truly wanted feedback and want us to use data from these assessments to drive instruction, we would be able to keep a copy of the tests. I find that most teachers like to reflect, collaborate, and improve.\n'),(754,NULL,0,'6','Observations',',11,','Anonymous','Teacher','mblow@lowvilleacademy.org',0,NULL,0,0,'2013-05-06 23:13:29','In theory, the Common Core has been rolled out and fully implemented. However, the units and support materials are still being released. A process that takes time. Elementary teachers are implementing 2 content areas. I have one unit for 6th grade that Expeditionary Learning (elschools.org) has released. I don\'t believe anything on the test reflected this unit. \n\nA better solution would be to design the assessments over a 3-year process to reflect a fully implemented program. Currently, the materials for middle school are %25 complete, the tests should have been designed to reflect that. As an educator, I do not create assessments on a curriculum they never experienced.\n\nDo you want quality or quantity? You are asking us to slow down in the classroom, peel back the layers, analyze the text. Yet, the same approach is not being taken in regards to state testing. It is a recipe for failure, one that is detrimental to student success, motivation, and engagement, which will impact the education system state wide. Students feel defeated. They are being asked to work hard to fail. This is a recipe for disaster with an increase: behavior issues, disgruntled parents, and drop out rates. \n\nI feel I need to give my students voice. Below are comments that they wrote to me after reflecting on their experience of the test:\n\n\n\"I am stupid.\"\n\n\"Throughout the whole test everyone should have more than 90 minutes to do them.\"\n\n\"It is fair that the state wants to see if we are growing, but we should not have to write an essay after writing 5 paragraphs with only 90 minutes.\"\n\n\"Day 2 was way too stressful and confusing.\"\n\n\"I thought the NYS test was unfair. Some kids are slower learners and arent\' at grade level. I rushed and became very careless because it was hard to fit two tests in.\"\n\n\"The NYS test was unfair because first of all there was not enough time. Second, it was tiring and the passages were very boring. Third, their questions need to be more clear and explain the questions better.\"\n\n\"I believe the passages on the test should be more interesting to catch our attention. If the articles were more interesting we would pay better attention and get a better grade.\"\n\n\"On day 2 the time made me rush and I think I will get a low score. On day 3 I tried to go faster, but only had 5 minutes left, so the time made me rush.\"\n\n\"I need to try and manage my time better.\"\n\n\"I felt discouraged because I did not finish book 3.\"\n\n\"I felt rushed for time.\"\n\n\"I could not get through yesterday, so I worked as harder today.\" (motivated to overcome challenges)\n\n\"If you want me to work better, I need more time. I didn\'t  get enough time for book 3, day 2.\"\n\n\"It brought me down because I felt like I already failed.\"\n\n\"The essay questions were unclear. I accepted the challenge, but didn\'t like the articles.\"\n\n\"Book 3 motivated me because the time rushed my essay and I knew my essay was not one of my best. I wanted to improve my writing on book 4.\"\n\nTeacher: I am leaving my name anonymous on this response to protect the privacy of my students.\n  '),(755,NULL,0,'5','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-06 23:18:44','90 minutes, three days, it was just too long.My student with accommodations for extended time spent three hours on one of the days. The students were real troopers.  They worked as hard as they could and never gave up.  But, it was too long.  Why was the longest written response left for the last day?\nOn the first day, the students were fresh and eager and excited by the third day, they were tired.'),(756,NULL,0,'National','Observations',',11,','Tony','Principal','Sinanis',0,NULL,0,0,'2013-05-07 03:03:58','I had several issues with the NYS Commin Core tests. First off, these weren\'t tests that were about testing knowledge- they were about testing a child\'s stamina. Second, the test had such a narrow focus that relied heavily on multiple choice questions and I don\'t understand how they are an indicator of college or career readiness. Finally, the questions were tricky and they didn\'t allow kids to show their skill set as readers - instead it was about whether or not they could eliminate the ridiculous choices. The whole experience was disappointing!'),(757,NULL,0,'8','Observations',',11,','Michelle','Teacher','mfriedman@islandtrees.org',0,NULL,0,0,'2013-05-07 12:24:09','Because we had no materials that looked like the test (as we have had in the past), many students were unable to time themselves appropriately.  Day 2 was a nightmare, with 21 multiple choice questions, as well as short answer responses and an extended response.  If the state wants to see how well our children read and write, why do they need to be timed?  Many of my students did not finish (or even get to) the extended response on day 2. I could literally see the self-esteem and pride crushed as they raced to finish this unfair test.'),(758,NULL,0,'general','Ideas for Constructive Action',',13,','MS Principal','Principal','',0,NULL,0,0,'2013-05-07 14:42:30','ELA Feedback I read most of the tests 5-8 and scored Book 3 of Grade 7. 1.  I am troubled by the arbitrariness of many of the multiple choice questions.  The distractor “wrong” answers seem much more plausible this year.  While this forces kids to go back to the text to look, it also eliminates the student who can make an evidence-based case for the “wrong “ answer she chose.  I would like to see multiple choice questions eliminated entirely--they do not measure critical thinking. Many professions depend on the ability to make a strong case for a non-obvious answer. 2. The constructed response answer sheets should be separate from the physical test book to facilitate flipping back and forth for text details.   3.  All of the criteria for scoring a short answer or an essay should be included in the directions box above the lines.  Students lose points for not having a concluding paragraph or not using transition words, yet these rubric criteria are not listed in the direction box.  We teach the kids to go back and use the box as a checklist, yet not all elements are there. 4.  I found that the second constructed response pretty exactly tracked the grades given (by another grader) on the first constructed response.  One of these should be sufficient to give the same information without exhausting the kids. As a corollary, we don’t need three days and four books to get whatever info we get from these tests. 5.  Many of the prompts were very narrow and did not give the students a chance to show their own critical thinking.  It would be much more productive to see a challenging text with a prompt like, “Make a claim about this passage and support it with evidence from the text.”  If you wanted to see a particular strand, you could modify the prompt, such as, “Make a claim about a choice this author made in this text and how that supports his/her purpose using evidence from the text.” 6. It is cruel to ask students to dedicate so much energy to  this test and never be able to go over it with them.  There is no learning where we cannot, in real time, say, for example, “your details do not support this claim.”  The test company should scan all the essays with their scores and send them home with the parent report and to school. 7. Valuable strand by strand data on students such as can be gleaned from these arduous tests are not available to their teachers in any time frame to inform instruction.  In the computer age, can’t they turn them around more quickly? 8.  The April time frame is difficult. Momentum and routines built up all year grind to near halt after spring break. By the time we finish scoring, we are into May and have lost a lot of momentum in real instruction. Our teachers manage to get kids back in the saddle, but it is a heavy lift. '),(759,NULL,2,'MI','Implications for Instruction',',12,','Laura Schiller Ph.D.','Other','laura.schiller@oakland.k12.mi.us',0,NULL,0,0,'2013-05-07 15:58:33','The PAARC released test items take a narrow view of reading. Rather than promoting the critical thinking our students will need in order to be College and Career Ready, the questions across the grades focus on literal information. Inferential reasoning and critical, evaluative thinking are absent in favor of questions and tasks that focus disproportionately on what the text says. In this climate of punitive high stakes testing, what gets tested, gets taught. The PAARC assessments will determine how the CCSS are interpreted. Millions have been spent to create assessments that reflect the standards. Is this the best that can be done? \nLaura Schiller, Ph.D. Literacy Consultant, Oakland Schools MI\nPam Rickli, Literacy Consultant, Allegan AESA\nLisa Rivard, Ph.D. Literacy Consultant Wayne State University, Macomb ISD, MI\nRita Reimbold, EDS ELA Consultant, Ottawa Area ISD, MI\nSusan Golab, Literacy Consultant, Oakland Schools, MI\nMark Raffler, Educational Consultant, Kent ISD, MI\nDelia DeCourcy, Literacy Consultant, Oakland ISD, MI\n'),(760,759,0,NULL,NULL,NULL,'lucy Calkins','Other','',1,NULL,0,0,'2013-05-07 17:06:40','Laura and all,\nThe Pearson test would have been worlds better had it included MORE literal comprehension so PARCC could be worse. Instead the Pearson questions were like--\"Which of these is the theme of paragraphs 4-6?\' and \'Which of these details best supports the claim of....\' and \'what\'s the chronological mode and tone of this text (nuts, i know.)\' The questions required far more comprehension work than the passages and there was no effort to see if kids comprehended the basics of the passages.\nLucy'),(761,126,0,NULL,NULL,NULL,'Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-05-07 18:15:57','I am in complete agreement.  My students were devastated they did not finish, and I felt like a failure because all year I kept pushing them to read closer, re-read, annotate, analyze, edit, create organizers, etc, which prevented them from finishing on time.  I am so incredibly proud of my students and so frustrated over this test.  '),(762,216,0,NULL,NULL,NULL,'Anonymous','Teacher, Parent','',1,NULL,0,0,'2013-05-07 18:40:51','In complete agreement with everything you have written.  '),(763,262,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-07 23:02:22','The Daily News did not share the whole exam.'),(764,NULL,0,'6','Observations',',11,','Anonymous','Teacher, Parent','',0,NULL,0,0,'2013-05-08 00:35:38','On day 2 of testing which included, books 2 & 3, there was not enough time for students to complete the test in a manner that would would have allowed to them to perform close reads of the text or to write well-written and thought out short and extended responses. It was heartbreaking to see the students\' frustration from trying their very best, only to be told to put their pencils down when time was up before they had completed the test. \n\nThree days of testing is too much for students. They are too tired to do their very best work by the third day. It seems unnecessary to have so many days of testing. '),(765,NULL,2,'FL','Observations',',11,','Cynthia C','Administrator','',0,NULL,0,0,'2013-05-08 07:02:22','After watching what has been occurring in New York State we in Florida are wondering if the path you took to get to the Common Core is the wrong path.  Usually we look at New York as innovators and leaders now we realize that we do not want that same path for our children.  This time maybe Florida will show you how to properly educate students'),(766,94,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-08 07:05:26','Do you think this exam represents the common core standards or just a misinterpretation of the standards or as some of us were thinking a narrow lens of the standards.'),(767,649,0,NULL,NULL,NULL,'Dee Roe','Teacher','roesgrdn@cruzio.com',1,NULL,0,0,'2013-05-08 07:28:40','I am out in California and recently attended a CA Reading Association in San Diego and got to meet and talk with a Berkeley professor who was a part of the team reviewing the \'curriculum and testing\'\nthat will be presented in our state for the Common Core implementation. He was very dismayed at the\nshallow interpretation of the Common Core and indeed at the creation of a curriculum at all. This opportunity to make millions is apparently being grabbed nationwide. So discouraging!!'),(768,94,0,NULL,NULL,NULL,'Yolanda','','',1,NULL,0,0,'2013-05-08 09:54:47','Hey\nSo some of us are wondering if any research was done before any of the changes.  We were remembering like you were teacher in Post for being a leader or some of us were did they ask us what we did to achieve and we taught in some of the worst hoods in the city.  You had like what when we tracked like 70 to 80 percent hs and approximately that for college,  did they ask you what you did?  Wonder what those kids we be like if they had to take a test that didn\'t measure reading and writing with depth but measured how fast you can take an exam?  What do you think'),(769,NULL,2,'National','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-08 12:32:59','In one of his characteristically thoughtful and provocative essays, Anthony Cody ponders Randi Weingarten\'s call for a one-year moratorium on the high stakes associated with Common Core testing. Randi praised the Common Core standards lavishly but warned that they would fail if high stakes are attached to them before teachers and students are prepared to master them.\n\nCody does not agree. He maintains that the Common Core testing will have even higher stakes than NCLB. Not only will there be more testing, but teachers and principals will be fired, schools will close, communities will be harmed--as Common Core raises the bar and failure rates grow.\n\nHow does raising the bar help those who can\'t clear the bar now?\n\nAs Cody writes:\n\n\"We have this entire project based on the premise that raising the bar will bring up those on the bottom, and make them better able to compete. In fact, when you raise that bar, you create huge obstacles for those at the bottom, and in effect, rationalize and reinforce their own sense of worthlessness, and society\'s judgment that they are subpar. You further stigmatize these students, their teachers and their schools, based on their performance in this rigged race.\"\n\nHe concludes that a moratorium on high stakes test is insufficient:\n\n\"We must move beyond not only the bubble tests, but beyond the era of punitive high stakes tests. Only then will we be able to use standards in the way they ought to be used - as focal points for our creative work as educators. I would be glad to have a year\'s delay for the consequences of these tests, but I think we need to actively oppose the entire high stakes testing paradigm. The Common Core standards should not be supported as long as they are embedded in this system.\"'),(770,NULL,0,'general','Observations',',11,','Sandy Pensak','Principal','spensak@hewlett-woodmere.net',0,NULL,0,0,'2013-05-08 15:01:52','I proctored third grade FLEP students and students with disabilities. There were so many passages and so many questions that it was an unrealistic expectation for these students to show what skills they truly have developed.\nThe results of this test will be unreliable because of this. What information can next year\'s teacher utilize from this test to truly inform her instructiion when the assessment results are flawed because they did not meausre reading proficiency? The 3 days were an exercise in stamina for an eight year old whom we already knew could not read at these levels, let alone attend multiple unrelated texts and more than 30 MC questions. '),(771,393,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-08 15:11:20','I teach 3rd grade and I don\'t think it\'s unrealistic for a student to be able to explain why a setting is important to a story. Being able to identify a setting in story is such a basic skill, by third grade they should be able to go beyond that. I teach at a title 1 school with many ELL students and many below-grade level readers (as in reading on a second grade or first grade reading level), but even my lowest students can accurately identify a setting in a  grade-level text. The common core is about pushing our students farther. It might take some time for students to catch up to where they should be, but if you start asking harder questions and modeling how to think about them and answer them, I think your students will rise to the occasion.'),(772,NULL,0,'general','Implications for Instruction',',12,','Deanna D\'Onofrio','Teacher','deanna.donofrio@gmail.com',0,NULL,0,0,'2013-05-08 15:55:32','The onerous length of the test has meant that literally weeks of instructional time have been given over to preparing for, administering, and finally grading these tests. Although technically the test may be over, in my school and classroom the effects are still being felt, as myself and other colleagues are cycled out and sent to a grading site to work through these mountains of tests.\n\nThe test was literally 3 times longer than it needs to be, and I don\'t understand why public schools are forced to bear the burden, time-wise and financially, of grading them. These grading sites feel like detention centers, with supervisors circulating, rushing graders on and harping on about their own deadlines. It is truly an unsustainable, paperwork nightmare. We are generally discouraged from doing second reads or taking too long with any one test item, which means - just like the administration of the test itself - the grading is rushed and harried. Just as it\'s ridiculous to expect a 10 yr-old to sit silently and take a test in a focused manner for several hours, it\'s absurd to force educators to spend hours on end grading these tests. It\'s impossible to stay energized, unbiased, or positive in such a situation, and quite frankly - processing Pearson\'s expensive mountain of test booklets is not our job!\n\nI have a lot of issues with the test, but first and foremost, I demand that:\n-Each test is shortened to ONE DAY;\n\n- The tests are administered at the end of the school year, a la Regents schedule model - right now it\'s incredibly disruptive to our school schedule, and students have the attitude that school is basically over, even though we still have lots of work to do;\n\n- Our school schedules are adjusted accordingly, with grading and testing happening at the end of the year, so that we\'re not somehow expected to continue managing classrooms and instruction while we\'re absent for 5-6 days grading tests.\n\nTeachers want to TEACH, and these tests are preventing us from doing our jobs!'),(773,276,0,NULL,NULL,NULL,'Deanna D\'Onofrio','Teacher','deanna.donofrio@gmail.com',1,NULL,0,0,'2013-05-08 16:04:58','I agree with Lucy and Marion\'s comments about the test\'s uncommon emphasis - I would call it a narrow-minded obsession - on text structure. Lucy described it as such: \"...as analytically deconstructing a text so as to discuss the author\'s purpose for sentence 9 versus sentence 11, and to see writing as merely as forum to display that sort of literacy-criticism.\" Many of the questions focused on minutia within the texts, harping on questions about why the author chose to do this or that. I found myself wondering, \"Who cares?\" Structure, as the other commenter noted, is merely a tool for conveying meaning, and I am skeptical that there are any hard and fast answers as to why or how an author uses particular structures in their writing. The test was so utterly repetitive too, asking these exact kinds of questions over and over again! It seemed designed to test students\' patience more than anything else - with passages containing up to 50 numbered paragraphs, and questions like, \"How does paragraph 17 convey the theme differently than paragraph 32?\" I am not convinced that \"good reading\" means obsessive conjecture about the purpose of an author\'s every line. '),(774,170,0,NULL,NULL,NULL,'Deanna D\'Onofrio','Teacher','deanna.donofrio@gmail.com',1,NULL,0,0,'2013-05-08 16:10:12','The two booklets on Day Two were an organizational nightmare. Two booklets, plus an answer sheet, were just way too much for kids to manage. WHY was this necessary? The organization Time Out from Testing has called this test an example of \"educational malpractice,\" and I strongly agree. When you\'ve got children feeling ill, demoralized, and utterly overwhelmed, due to a test which the state has openly admitted is basically not going to count for anything - and yet teachers and other professionals forced to bear the brunt of organizing, collating, administering these onerous tests day after day - that is certainly a misuse of education and its resources. Teachers and parents need to continue to speak out against these tests, and know that they are standing up for what is best for our schools and our students!'),(775,490,0,NULL,NULL,NULL,'Deanna D\'Onofrio','Teacher','deanna.donofrio@gmail.com',1,NULL,0,0,'2013-05-08 16:17:39','I strongly encourage you, and all teachers, to let go of the impulse that has been forced upon us for years now... to somehow figure out strategies for our kids to take these tests, to succeed at them, whether it\'s to underline, to do the extended response first, to chew gum, to read the directions carefully and circle the genre... whatever tools or strategies we\'ve come up to feel like we\'ve got a leg up, I think it\'s time to put our energies elsewhere - namely to demand that these ridiculous tests STOP, and to speak out against their unreasonable, unfair, and unproductive presence in our schools. I know it\'s easier said than done, but worrying and obsessing about these \"gotcha\" type tests, which are frankly designed to reflect poorly on most students and schools, is part of buying into the culture of fear and school and teacher-bashing which high stakes testing and corporate school reform help to create.\n\nCorporate-created tests = poor test scores = schools look bad = illusion of a need for reform in our schools. Poor test scores sell more test prep books... good test scores are not good for business!'),(776,NULL,0,'general','Observations',',11,','Kathleen Stevenson','Teacher','kstevenson@mail.edgemont.org',0,NULL,0,0,'2013-05-08 20:25:48','I am a fourth grade teacher and I have serious concerns regarding the tests that our students are asked to do for over one hour each day, three days in a row for two weeks straight (including the math test.) In volumne alone they are developmentally inappropriate. There is no evidence that the information we gather from these tests are accurate indicators of a child\'s success in reading. Many of the questions appear to be intentionally misleading, trying to \"stump\" the reader rather than assess if they were able to make meaning of what they were reading and respond appropriately. The manner in which some of the questions were posed (referring to the idea presented in one paragraph by number and then asking students to find evidence for the idea presented in that paragraph by going back and reading four other paragraphs,which were also referred to by number!)was also inappropriate for a fourth grade reader. These tests undermined the readers\' confidence rather than assess what they can and cannot do. These are dark days for educators and students alike. '),(777,NULL,0,'6','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-08 21:29:23','The DAy Two test was exhausting. The passages were lengthy and students were overtaxed to read and complete the questions in the given time. Some students wrote just a few words for essays - scored as zero - when they clearly ran out of time.'),(778,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-08 21:33:26','It is ridiculous to test students on material not specified in a curriculum. Example - on the Grade 6 test, Day 2 - the easy required students to describe how the author build suspense in the story. \"Suspense\" as a literary element appears in the GRADE 8 standards (Reading in Literature 8.6) and in the GRADE 11 standards. 6 grade CCSS does not state that children should understand the components of suspense and yet that was their essay???!!!!!!  Unfair.'),(779,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-08 21:37:44','Not only did I have a student suffer a panic attack, another one cry and several express extreme fear during testing.... as a teacher scoring the test I had the opportunity to see the very sad notes children wrote in their test booklets expressing plaining their duress:\n\"Please help me. I have to pass this test to be a doctor.\"\n\"Give me a break, I\'m only in 6th grade!\"\n\"I need help. I (sic) red this three times and I don\'t understand.\"'),(780,NULL,1,'4','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-09 09:28:28','SHORT RESPONSES:\n\nThe short response questions were poorly worded. Additionally, the anchor papers for scoring these open response questions further confused than clarified. For instance, in Book 2, students needed to generally respond to a setting and in Book3, students needed to respond to a specific setting. It was confusing.'),(781,NULL,0,'general','Implications for Instruction',',12,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-09 13:41:08','I am shock to realise that after all the big talk about text complexity why was a story placed on all grade level? Question: what are they setting up our kids for? Another problem I have is the fact that teachers are face with so much demands and requirement who is going to make the parents accountable? I have beautiful students in my class, some are at grade level and some are not however they work very hard to be able to pass the test. I believe that schools need to have the right materials to better help these students rather than every book company trying to make money on these students education. If the state is changing the test they should make a educated decision as to what books or book company is best suited to help these students become better reader ,writers and mathematician. The math test was fear with a few problem or mistakes. Who review these booklet? The two books concept did not work out. Books was falling on the floor because students needed the space to work.As a teacher you did not want to pick up the book nor answer sheet to be blame of sheeting. Dept of educ need to make more educated decision on behalf of these students they are the future generation.\n\n  '),(782,NULL,0,'general','Observations',',11,','Mrs. Phillips','Teacher','mphillips@mail.ircsd.org',0,NULL,0,0,'2013-05-09 16:16:41','As an ESOL teacher, I administer the ELA each year to those students who are not exempt.  English Language Learners only have one school year of exemption after arriving on American soil.  After that, they must take the ELA.  This has always seemed unfair to me, especially because of the research showing it takes 5-7 years for someone to really learn a language and use it in an academic setting.  The NYSESLAT should be a sufficient test of their English skills for at least a few years.  Suddenly, the ELA\'s rigor has been upped so that it is dramatically more academic.  For a third grade ELL who is still struggling with decoding skills, asking her to discuss main ideas and include details after reading increasingly lengthy texts was emotionally and intellectually stressful.  Even with her modification (time and a half), she was unable to complete the test.  Much of it was spent staring in frustration at the test. In addition, the directions were long and convoluted for her to understand, resulting in added anxiety and confusion. Not only was it a waste of the student\'s time, but it was a waste of my time as an educator.  This three day test ate up valuble instruction time which could have better been spent practicing strategies to sound out and make sense of larger words, or how to identify the main idea using texts at her level.  I appreciate the ideas behind the common core, especially the emphasis on including the ESOL students and exposing them to the same academic materials and activities.  However, this test automatically sets ESOL students up for failure.  It tested her on material that she is not linguistically able to do!  The texts were far too difficult and too numerous.  There was not enough time for ELLs to get through the texts and complete the writing requirements.  \n\nFinally, I was asked to help grade the ELA.  I did not grade my own student due to my vested interest, of course, but I graded many third grade tests in my district.  The grading exemplars and rubrics felt inconsistent most of the time.  My fellow graders and I disagreed with the examples over and over again.  I feel that there were too many \"bugs\" in the test that needed to be worked out.  To use NY State\'s students and teachers as guinea pigs in this way was cruel and unfair.  '),(783,NULL,0,'general','Observations',',11,','Tanyo','Teacher','',0,NULL,0,0,'2013-05-09 23:33:18','Today working with my class I witnessed my students looking at history with a critical lens thinking about the perspectives one takes and debating the issues in a town hall.  I thought about the exam and those who made it and truly believe they would have hated it.  To me my kids will use this as a life experience that might led them to becoming lawyers, administrators who knows.  I think what made a difference for us is as a class we realize that the test means nothing to us in terms of data in terms of moving towards college in terms of life.  Those that believe it does misled themselves and that is sad. '),(784,262,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-09 23:34:23','It was a start '),(785,769,0,NULL,NULL,NULL,'Lucy Calkins','Other','',1,NULL,0,0,'2013-05-10 01:47:22','This is such a helpful response. Who are you?? Do you have ideas for what actually can be done?'),(786,765,0,NULL,NULL,NULL,'Lucy Calkins','Other','',1,NULL,0,0,'2013-05-10 01:57:53','Cynthia,\nI think most of us believe that no, you should NOT follow New York State\'s journey towards the CCSS. The State is in disarray over this test. It seems to me that Wisconsin\'s State Department for example, is more informed re the Ela CCSS.  I hope other readers weigh in about state\'s that seem to be getting this right. '),(787,753,0,NULL,NULL,NULL,'Anonymous','Other','',1,NULL,0,0,'2013-05-10 01:59:43','So helpful. '),(788,NULL,0,'National','Observations',',11,','Professor','Researcher','',0,NULL,0,0,'2013-05-10 16:22:16','David Kirp, professor at the University of California at Berkeley and author of \"Improbable Scholars,\" describes here the ruinous consequences of high-stakes testing.\n\nEverything associated with the corporate reform movement is failing. How much longer will the hedge fund managers and the federal government continue to fund failing strategies?\n\nHe begins:\n\n\"It’s a terrible time for advocates of market-driven reform in public education. For more than a decade, their strategy—which makes teachers’ careers turn on student gains in reading and math tests, and promotes competition through charter schools and vouchers—has been the dominant policy mantra. But now the cracks are showing. That’s a good thing because this isn’t a proven—or even a promising—way to make schools better.\n\n\"Here’s a litany of recent setbacks: In the latest Los Angeles school board election, a candidate who dared to question the overreliance on test results in evaluating teachers and the unseemly rush to approve charter schools won despite $4 million amassed to defeat him, including $1 million from New York City Mayor Michael Bloomberg and $250,000 from Rupert Murdoch’s News Corp. Former Atlanta superintendent Beverly Hall, feted for boosting her students’ test scores at all costs, has been indicted in a massive cheating scandal. Michelle Rhee, the former Washington D.C. school chief who is the darling of the accountability crowd, faces accusations, based on a memo released by veteran PBS correspondent John Merrow, that she knew about, and did nothing to stop, widespread cheating. In a Washington Post op-ed, Bill Gates, who has spent hundreds of millions of dollars promoting high-stakes, test-driven teacher evaluation, did an about-face and urged a kinder, gentler approach that teachers could embrace. And parents in New York State staged a rebellion, telling their kids not to take a new and untested achievement exam.\"\n'),(789,94,0,NULL,NULL,NULL,'chara','Teacher','',1,NULL,0,0,'2013-05-10 16:24:17','So we were wondering how and if anything will change with these assessments, do you think it will, because we want our kids to know that when a mistake is made as there are parts in these assessments that were a mistake we change and think over what we are doing to correct our mistake.'),(790,NULL,0,'National','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-10 23:20:00','Randi writes:\n\nIt’s no secret that the AFT is a big supporter of the Common Core State Standards. We believe these standards have the ability to transform the DNA of teaching and learning to ensure that ALL children, regardless of where they live, have the critical thinking, problems solving and teamwork skills and experience they need to succeed in their careers, at college and in life.\n\nAFT members were deeply involved in the development of these standards and through Share My Lesson and the AFT Innovation Fund the AFT is working to ensure that teachers, parents and even districts have the tools and resources they need to implement these standards.\n\nI am constantly on the road visiting schools and meeting with AFT members. I continually meet teachers who support these standards and who believe these standards hold great potential for their students and our public schools. But nearly every teacher I meet says that she is not getting the proper tools and resources to make the instructional shifts necessary—and as we have seen there’s been a rush to implement high-stakes tests before getting the implementation right.\n\nThe AFT wanted to match what we were hearing on the ground with real scientific data. The AFT takes our obligation to serve our members very seriously. That’s why we worked with Hart Research, the polling firm we’ve used for more than two decades, on a poll of AFT teachers to gauge their support of the Common Core and their concerns about the implementation.\n\nHonestly, I was surprised to see some bloggers and others question the results of a scientific study using standard polling research measures used by nearly every reputable polling firm the U.S. I was also troubled to see anti-union organizations being cited and used as a way to discredit the AFT and the poll.\n\nThe AFT publicly released this poll, a detailed polling memo and a powerpoint presentation on the findings. We also held a media availability during the Education Writers Association conference last week with our pollster to discuss the poll and its findings. The AFT and our pollster would have been happy to answer any questions about our poll had we been asked.\n\nI asked Guy Molyneux of Hart Research Associates to address Mercedes Schneider\'s post and you can read his memo outlining the strong methodology of the poll and its representative sample of AFT members. (Guy Molyneaux\'s memo will be posted in a few minutes).\n\nThere may be disagreements on the importance of the Common Core but as a community of educators we should respect the scientific process and the dignity of one another.\n\nMuch of the discussion around the AFT poll has focused on the 75 percent of AFT teachers who support the standards. But the poll also brought to light many concerns teachers have about the implementation of the Common Core.\n\n• 74 percent of teachers are worried that the new assessments will begin—and students, teachers and schools will be held accountable for the results—before everyone involved understands the new standards and before instruction has been fully implemented with the standards.\n\n• Just 27 percent said their school district has provided them with all or most of the resources and tools they need to successfully teach the standards.\n\n• 53 percent said they have received either no training or inadequate training to help prepare them to teach to the standards.\n\n• 76 percent said their school district has not provided enough planning time for understanding the standards and putting them into practice.\n\n• 58 percent said their district has not done enough to have a fully developed curricula aligned to standard available to teachers.\n\n• 54 percent said their district has not done enough to have assessments aligned to the standards.\n• Just 33 percent, are very or fairly satisfied with the amount of teacher input in developing their district\'s plans for the Common Core standards.\n\n• And half, or 51 percent, said there have not been enough opportunities for teachers to practice with students to ensure they are learning key concepts and principles.\n\nAgain, we may have disagreements on the importance of the Common Core. But these standards were adopted by 45 states and D.C., teachers are being expected to teach to these standards and teachers and children are being assessed based on these standards. It is clear that teachers are not getting the tools and resources they need and that they do not believe their voice is being heard. These are serious concerns and instead of fighting over polling data, I hope that we can work together to ensure that every teacher is prepared to teach to these standards. That’s what our teachers and students need and deserve.\n\nRandi Weingarten\nPresident, AFT\n'),(791,NULL,0,'general','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-11 16:47:00','I am wondering if and when we will learn from our mistakes and look at what kids needs are and what they really need to learn as learners.  To many times adults have destroyed generations of kids based on unresearched conjecture.  When will someone actually be there for our children.'),(792,NULL,0,'National','Observations',',11,','Anonymous','Other','',0,NULL,1,0,'2013-05-11 16:53:09','This has meaning to this site \nSATURDAY, MAY 11, 2013\n\nThoughts on the Destruction of the Teaching Profession and Other Losses\n\n\nAs I watch the teaching profession be destroyed before my eyes, through bi-partisan initiatives that are difficult to fight, and through the march of technology that some view as irreversible, I am filled with anger. This after all is my life they are rendering obsolete, something that has been a source of pride and excitement for me for nearly 50 years since I first started teaching tennis at Camp Kitatinny in Dingmans Falls NJ in the summer of 1963 at age 17. The kind of freedom I experienced in teaching high school students in Upward Bound programs in the late 60\'s and early 70\'s and in teaching college students and graduate students at Fordham since 1970, is gradually simultaneously being crushed by \"outcomes assessment\" and scripted learning, and the replacement of tenured positions like mine with low paid adjuncts who have no job security. And what I am experiencing in universities is magnified tenfold in the nation\'s public schools where surveillance, supervision and assessment have truly reached Orwellian proportions, and where teachers are browbeaten into squeezing all joy out of innocent children as they force march them into passing high stakes tests. \n\nI hate what is going on, and will fight it with every ounce of my energy, but as a historian, I am hardly surprised to see something of value be destroyed both by the impersonal evolution of the economy and by conscious choices of policy makers. After all, I watched the Bronx burn before my eyes in the early 70\'s as I took the 3rd Avenue El to Fordham in the early 70\'s, and watched it burn some more when the El came down at I started taking the number 4 train up Jerome Avenue. These fires weren\'t abstract to me. They destroyed neighborhoods where I fell in love, played ball, celebrated Thanksgiving and Christmas, and hung out and heard music in bars and clubs. Watching this, I felt like something precious in my memory was being desecrated, or better yet, like a limb was being violently torn from my body yet I was helpless to stop it. I joined with organizations which kept the fires from spreading to the Northern parts of the borough and began rebuilding slowly rebuilding devastated areas, but when the smoke cleared, buildings which once held 300,000 people had turned to ashes\n\nThen, ten years later, I watched cities in America\'s great industrial heartland be crushed by factory closings that not only destroyed millions of jobs that paid enough to support a family, but crushed the dreams of people whose labor had helped make the US the most prosperous, and one of the most equal nations in the advanced world, leaving huge sections of once vibrant cities looking as though they had suffered aerial bombardment. As I walked through devastated sections of Detroit, Buffalo, Youngstown, Baltimore and Bridgeport, and saw factories which once employed tens of thousands of people be knocked down, I thought of the what those communities had once been during WWII and the 50\'s, and felt tears come into my eyes for what had been lost. once again I could do nothing.\n\nGiven these experiences, it would not surprise me for the Education Reformers to have their way and make creative teaching impossible in most American public schools. I will fight them, but I am not sure my efforts will make that much of a difference\n\nBut I will say this. I cannot and will not forgive those who profit from the destruction of other people\'s livelihoods, institutions and dreams. I reserve the right to resist, along with the right of memory and of moral judgment . And I will never give those up, if only out of respect for those who lives have been crushed by \"impersonal\" forces which they experienced in the most personal terms.'),(793,792,0,NULL,NULL,NULL,'Lucy Calkins','','',1,NULL,1,0,'2013-05-11 17:25:51','The author of the above should be acknowledged. The person putting this here--could you get permission and add the author\'s name, or we\'ll need to remove it.'),(794,NULL,0,'National','Observations',',11,','Jeanne Tribuzzi','Administrator','jtribuzzi@gmail.com',0,NULL,0,0,'2013-05-12 22:52:24','What are We Teaching Toward in the 21st Century?\n\n\n	When considering a response regarding the high-stakes Common Core tests that were administered to children this spring, it would be easy for comments and feedback to be perceived as a rant against assessment.  As a district curriculum administrator in charge of English Language Arts, ESL, Second Languages, and the APPR, as well as a curriculum consultant and faculty member of Curriculum21?, it is important to note that I view authentic assessment as a critical component to curriculum.   My thoughts about these state assessments are based on my responsibilities with the administration and management of the testing and scoring procedures within my large district, and my work with teachers and principals toward articulating and implementing sound, modern literacy curriculum and practices over the past 9 years.  The knowledge of what must be in place to support student growth in reading throughout K-12 has been my work for more than two decades.  I apologize for the lengthy response, but considering these tests have the potential to pave the road in work of schools over the next decade, I felt I have to be thorough.\n\n	The goals of the CCSS are rigorous, based on learning progressions which have been articulated through backward design from the Anchor Standards in each of the four language modes, reading, writing, listening and speaking. They are also full of promise.  The fact that these assessments assessed one area, reading, indicates that a great deal of the measurement of the CCSS has been left out.  This is understandable, as assessing all standards would be impossible in terms of both time and money.  Having said this, it also appears that only one type of reading has been included, textual analysis, and many other aspects of reading were left off of the assessment.  Particularly in grades 3-5 where the difficulty level of the text and the questions very narrowly defined reading for 8 – 10 year-olds.   \n\n	The length of the tests made both the administration and the scoring problematic in that both students and teachers were frustrated, and the scoring process had to be fortified with more teachers to ensure completion of the task by the deadlines.   Teachers and students felt cheated in that all that they had done to prepare for quality work on the tests was made impossible because they had to rush.  Close reading takes time, with plenty of time needed for re-reading and analysis.  If this was the goal, the allotted time did not allow students to show their best work on this.  Fewer passages and unlimited time would help, if close reading will continue to be the only emphasis of these tests.  Close reading should not done be done quickly, under the threat of a timer. \n\n	Reading is a human endeavor that allows us to share the experiences and knowledge of life.  Children who are immersed in quality instruction and reading throughout their school career should not only be able to analyze an authors’ craft and language in the context of close reading, but should also empathize with characters in literature, learn content from non-fiction text, struggle with emotion and the concepts of right and wrong in stories of social justice, and understand more about the human condition from texts on tragedy and human perseverance.  The deeper knowledge of the world that the CCSS expects students to be exposed to will often come from the aesthetic experience and learning that occurs with wide reading.  Close reading is one skill that strong readers must possess, but it is not the only skill. Students must also have the disposition to read if they are to continue to improve in this critical skill.  If this new generation of tests will only measure Close Reading, my fear is that we will lose more readers than we gain, because classroom instruction will support that imbalance to ensure success on these high-stakes tests.   To think of student reading only as dissecting, annotating, and analyzing all that they read for the purpose of textual analysis fills me with dread.  This is going backward in my opinion, as “ English Class of the Past” will again become the teacher-driven norm.  Even for eight year-olds.  Publishers are already hard at work to put these materials in teachers’ hands.  This type of instruction, in an imbalanced approach to reading instruction, will take away the disposition to read for many students. \n\n	Reading in the 21st century is seldom linear and in hard copy for students in college.  Many of the textbooks that are new being published are in the form of eBooks or online versions that are filled with info-graphics, hyperlinks and embedded video and audio.   Simply navigating the digital reading world requires new skills such as tenacity, concentration, social awareness, and stick-to-itiveness.  This type of reading is described by Clive Thompson of Wired Magazine, http://tinyurl.com/qlm892.  He captures this new picture of what reading looks like for many young people in the digital world, and I would love to know how many of you will actually follow the link, read his post, and return to complete the reading of this text, a 21st century skill indeed.  His last paragraph captures the value of the reader, who by the way, makes reading happen.  Without the reader and his or her thoughts, reading is simply words on a page.  Not all students will go on to study English with the goal of teaching or writing, yet this year’s tests indicate that this is what students will need exclusively to be successful in college or career.  This year’s tests did not include any modern reading that college bound students must master to be successful.  \n\n	I believe that the way reading was measured on the NYS tests was too narrow to capture the broader goals of the Common Core.  Perhaps policy makers and educators need to collaborate and clarify the reasons people read, defining what a College and Career Ready reader looks like at specific ages.  Reading isn’t just for textual analysis.  Once we can agree on the different ways that reading is important for different ages, we can begin to agree on how it can best be measured at certain points along the learning progression.  This is also critical to get right in light of the pressure on teachers to show student growth against the expectations of the tests, and for the generation of readers we must nudge to independence as strong readers. \n\n	What makes us think that we can improve reading in our schools by expecting students to read above- grade-level texts when, in the current environment, we cannot manage to move ALL students to reading proficiently at grade level? There is a lack of empirical evidence to support asking students to stretch to read and comprehend complex text independently, particularly at the 3rd and 4th grade levels, in order to help them progress as strong readers.   There is however, ample evidence to suggest that reading voluminously in text that students can read successfully and with full comprehension does indeed help them advance as readers.  Stamina comes from reading independently on a regular basis, both at home and at school, and this is not something all NY students are doing regularly in traditional based reading programs.  \n\n	If the tests continue to be produced to focus on challenging complex text and questioning, my fear is that this will shift reading instruction in our classrooms to new forms of torture in service of better test scores.  This slippery slope of focusing only on complex, often dated, text has the potential to take the literacy work we so desperately need to get right, and send it backwards.  The rich will get richer when it comes to reading, and those who are functioning below grade level, for a variety of reasons, may make little progress. \n\n	Writing, thankfully, is once again a discipline of study according to the CCSS, and it was essentially not assessed on these tests.  Assessing reading was the aim of the written portions of the tests, and high quality writing was not necessary for students to gain points according to the rubrics.  Based on the district cost of scoring the written portions of the tests, and the subjectivity of scoring the responses despite the training process, this could be an area to rethink for future tests.  If the emphasis is on assessing reading, then schools could use a portfolio and rubric method for assessing and documenting growth in writing over a student’s school journey.  This will be more authentic and far less costly.\n	\n	Our district scored all six grade levels over six separate scoring days, using between 30 – 35 teachers at each session.   We did not have one day without students designated on our calendar, and we do not participate in regional scoring.  The stakes are simply too high to give away the control and the professional approach we use to complete the task.  Our approximate cost for both ELA and math scoring was $30,000.  This is a prohibitive cost, at a time when we are cutting both program and staff because of budgets constraints. \n\nI would hope that the tests, as well as the standards, are at the starting point, and that based on student performance and feedback from the field, we can continue to work on improvement until we have tools that will truly do what they were supposedly intended to do, improve teaching and learning.  These tests in their current format, in the context of the current APPR, do not hold that promise. \n\nRespectfully,\n\nJeanne Tribuzzi\nDirector of ELA, ESL, Second Languages, and Libraries\nWest Seneca Schools\n'),(795,NULL,0,'general','Observations',',11,','Ms. D.','Teacher','ps132tech@gmail.com',0,NULL,0,0,'2013-05-13 12:34:19','The tests have to be scored, particularly the hand written parts. In our school, three teachers have been sent to a district office for THREE WEEKS to score the Math and ELA tests. That is all day, everyday, for THREE weeks that these teachers\' programs are covered by substitute teachers or result in missed classes for students. The teachers take their regular salary for this but are literally \'absent\' from the school building. Hundreds of teachers are scoring these tests, BTW, not just in my school. I have scored in the past and know that very few teachers would complain about this welcome and easy break in their hectic schedules but it does cause disruption for the students who are losing their teacher to the scoring of the tests.'),(796,NULL,0,'general','Observations',',11,','Ms. D.','Teacher','ps132tech@gmail.com',0,NULL,0,0,'2013-05-13 12:34:43','The tests have to be scored, particularly the hand written parts. In our school, three teachers have been sent to a district office for THREE WEEKS to score the Math and ELA tests. That is all day, everyday, for THREE weeks that these teachers\' programs are covered by substitute teachers or result in missed classes for students. \n\nThe teachers take their regular salary for this but are literally \'absent\' from the school building. Hundreds of teachers are scoring these tests, BTW, not just in my school. \n\nI have scored in the past and know that very few teachers would complain about this welcome and easy break in their hectic schedules but it does cause disruption for the students who are losing their teacher to the scoring of the tests.'),(797,NULL,0,'general','Observations',',11,','Rachel P. Astoria','Parent','luchamos@hotmail.com',0,NULL,0,0,'2013-05-13 18:05:26','My son reported to me that he had meltdowns in class after every day of the three ELA exams.  He is in a NYC G&T program and a very smart cookie.  I have no idea how he did on the exam, nor do I care.  Putting an 8 year old through two weeks of testing for tests that are so obviously -- based on the comments here and elsewhere -- no measure of ability or knowledge is not only a waste of instructional time but also psychologically damaging. \n\nAlso, on a procedural note, I understand that, despite the fact that many teachers who saw the test found that many questions could not be answered, Pearson and NYSED have instructed schools that parents are not to be shown the tests.  Meanwhile, Pearson has admittedly screwed up its scoring of the NYC G&T tests twice (and these are only multiple choice tests).  Given this proven track record of unreliability in testing, it is imperative that parents have access to test materials to verify that childrens\' exams have been correctly scored. '),(798,NULL,0,'general','Observations',',11,','Christine Napolitan','Teacher','cnapolitan@ps10.org',0,NULL,0,0,'2013-05-14 13:30:03','The \"extra\" 20 minutes in timing was not just a gift, it was a necessity.  The higher functioning our students were, the more time they needed to do a good job.  Many took right to the last minute.\nI might add that scoring the ELA was also a huge time squeeze to finish in the allotted period we were estimated to need.\nFinally, in elementary school particularly, these test should be emphasized as ELA, not READING tests.  Days two and three were scored with the form of writing in mind.  Valid for ELA testing, but not necessarily reflective of what a child could have responded orally to a passage s/he read.'),(799,NULL,0,'general','Observations',',11,','Keturah Kendrick','','keturah.kendrick@gmail.com',0,NULL,0,0,'2013-05-14 15:48:48','The reading passages were too lengthy for a timed test in which students were instructed to read carefully and really think about their answers. Also, the questions were worded with high level vocabulary and written in syntaxes that called for a lot of decoding on the students\' part BEFORE they could even answer it effectively. It seems like Pearson was trying to prove how smart THEY were more so than they were trying to test how smart the students were. '),(800,NULL,0,'6','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-14 19:23:28','The ELA exam for Grade 6 was seemingly frustrating for many students because they were required to think critically and analyze responses in brief time periods.  Day 2 requiring TWO books appeared to be totally overwhelming to the students.\n'),(801,262,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-14 20:12:11','Yes, a good start but imagine the reaction/feedback if the whole third grade test was published for ALL in NYC to see? (I single out third grade because the test was so far off, so far away from being a reasonable assessment) Maybe if those responsible for creating the exam knew that it would be published they would try to do a better job.  '),(802,NULL,0,'7','Observations',',11,','Dina Strasser','Teacher','dinaeliz@gmail.com',0,NULL,0,0,'2013-05-15 19:31:38','Students found it extremely difficult to move from multiple choice to short/extended responses in one testing session. If we must have 2-7 samples of writing (which I find unnecessary), please give the students books which are EITHER multiple choice OR writing, so they may budget their time appropriately. \n\nAdditionally and more globally, I do not find multiple choice to be sufficient, or even accurate, for measuring the critical thinking and analysis skills we are supposed to be targeting and assessing. \n\nThere were several instances within the test where spelling of words was inconsistent-- for example, Klondike/Klondyke. This confused the students considerably. \n\nI was most dismayed at the inconsistencies and opacity of the anchor papers with which we were expected to align our test assessment. Items which counted as \"evidence\" in one set were not in others; mere recapitulation of the reading\'s topic sentences counted as legitimate \"claims\"; examples of possible evidence and/or critical thinking to guide our decisions, which had been included in the past, were eliminated. \n\nFinally, I wish to remark upon the increasingly high stakes nature of these exams. This year I saw multiple examples from my students of how aware, and increasingly pessimistic, they have become about it-- statements such as \"You want us to do well just so you can have a job\" and \"These tests kill us and affect our schedules and learning, but they won\'t help us in real life\" were common. Students see and understand that our entire building and its learning grinds to a halt for two weeks or more due to testing scheduling, accommodations and the resulting exhaustion, but that we do not devote anywhere near the same time and resources to implement research-based methodology that supports successful learning. The examples are numerous and diverse: flexible, humane scheduling; cross-curricular classes; inquiry and expedition-based teaching; authentic, multiple and *valued* measures of assessment; seminars; student autonomy and control over their environment and governance; looping; civic engagement; regular independent reading time; or even something as simple as recess at the middle grades. \n\nStudents understand and take with them through their schooling the knowledge that except for scattered, limited and local examples, our state does not put its money where its mouth is; that the most obvious mark of valuing students-- supporting and funding concrete infrastructural reform that students can directly experience in their daily lives-- is lacking. All the curricular rigor in the world, unaccompanied by meaningful change in the culture and implementation of schooling, cannot reverse this conviction once it is established; and it will nurture nothing but their cynicism, mistrust, and unwillingness to learn in school. '),(803,NULL,0,'general','Observations',',11,','Anonymous','Teacher','kerry.salvatierra@gmail.com',0,NULL,0,0,'2013-05-16 15:01:04','I would like to add to the feedback that the tests were too long, for the amount of time allotted.  This was especially the case on Book 2.  Thankfully, we had prepared our students with the appropriate pacing, after looking at the testing guides and realizing that they would really have to rush in order to finish.  It was surprising to me that the test\'s designers could not have anticipated how little time students would have to complete Day 2, by simply breaking down the day into reasonable chunks of time for each task required.  I believe that the tests on Day 2 did not adequately reflect the work our students are capable of, because we encouraged them to make less annotations as they read, and write less than we would normally encourage them to on short answer and extended response questions.  As a reading teacher, I strongly question the idea that students who can work faster are stronger readers.'),(804,NULL,0,'general','Observations',',11,','Marcy parker','Parent','Ryanjames822@aol.com',0,NULL,0,0,'2013-05-17 02:18:14','It is extremely disturbing to me as a parent, former teacher and registered nurse, to witness the emotional turmoil that these \"tests\" caused our children.  My fourth grade son suffered from stomachaches, headaches, and loss is sleep due to the stress involved regarding these \"tests.\"  I\'d love to learn the purpose of causing this type of stress to children?  We have to protect our children from stress and harm, not cause it.'),(805,NULL,0,'general','Observations',',11,','Robert','Teacher','rjamesblues@gmail.com',0,NULL,0,0,'2013-05-17 19:28:15','First, thank you for hosting this forum.  The vast public must be better educated about CCSS.\n\nI teach math at the high school level.  Is there a forum for comments on the math CCSS test being done?\n\nI am being sent to see CCSS guru David Foster at the beginning of the next school year and would like to be as informed as much as possible, especially about what he does not say!\n\n'),(806,NULL,0,'general','Observations',',11,','Demaemiainsazhf','','demaemiain@gmail.com',0,NULL,1,0,'2013-05-19 13:17:08','fadsassella <a href=\"http://vikaswieier.com\">xaikalitag</a> dreliaenzyday http://usillumaror.com - iziananatt ZitChalfblill http://gussannghor.com Cusaedura'),(807,NULL,0,'National','Observations',',11,','Anonymous','Researcher','',0,NULL,0,0,'2013-05-20 12:56:42','Leaders with Metro Nashville Public Schools have serious concerns about what is happening at some of the city\'s most popular charter schools.\n\nMORE\n\nClick to read more headlines from Davidson County.More >>\nStudents are leaving in large numbers at a particularly important time of the school year, and the consequences may have an impact on test scores.\n\nCharter schools are literally built on the idea that they will outperform public, zoned schools. They are popular because they promise and deliver results, but some new numbers are raising big questions about charter schools.\n\nOne of the first things a visitor sees when stepping into Kipp Academy is a graph that shows how Kipp is outperforming Metro schools in every subject.\n\nHowever, Kipp Academy is also one of the leaders in another stat that is not something to crow about.\n\nWhen it comes to the net loss of students this year, charter schools are the top eight losers of students.\n\nIn fact, the only schools that have net losses of 10 to 33 percent are charter schools.\n\n\"We look at that attrition. We keep an eye on it, and we actually think about how we can bring that back in line with where we\'ve been historically,\" said Kipp Principal Randy Dowell.\n\nDowell said Kipp\'s 18 percent attrition is unacceptable.\n\nMNPS feels it\'s unacceptable as well, because not only are they getting kids from charter schools, but they are also getting troubled kids and then getting them right before testing time.\n\n\"That\'s also a frustration for the zoned-school principals. They are getting clearly challenging kids back in their schools just prior to accountability testing,\" said MNPS Chief Operating Officer Fred Carr.\n\nNineteen of the last 20 children to leave Kipp Academy had multiple out-of-school suspensions. Eleven of the 19 are classified as special needs, and all of them took their TCAPs at Metro zoned schools, so their scores won\'t count against Kipp.\n'),(808,341,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-20 13:03:31','I truly believe the message should be to highlight all the mistakes the administrators at state are making '),(809,341,0,NULL,NULL,NULL,'Nicole ','Teacher','',1,NULL,0,0,'2013-05-20 13:04:41','We the teachers wAnt to thank you for this it means a lot'),(810,NULL,0,'National','Observations',',11,','Anonymous','Other','',0,NULL,0,0,'2013-05-20 14:06:56','\nRespond to this post by replying above this line\nNew post on Diane Ravitch\'s blog\n\n\nThe Bloomberg Empire Strikes Back\nby dianerav\nThis year the city of New York will pick a new Mayor, after 12 years of Michael Bloomberg.\n\nThere were only supposed to be 8 years of Bloomberg, as the voters of New York City had twice endorsed term limits of only 2 terms. But Bloomberg decided he wanted a third term, refused to call for a referendum, and got his faithful friend City Council President Christine Quinn to twist a few arms, promise that the members of the City Council would also get a third term, and voila!, our mayor had the chance to drop another $100 million into winning a third term.\n\nFor some reason, he thinks that his legacy will be his education \"reforms,\" but the voters don\'t agree. The last Quinnipiac poll showed that only 22% of voters want his autocratic style of governing the schools to continue. The rest want some form of shared governance, where other elected officials have a voice in choosing the city\'s school board, and the school board treats parents and the public with a modicum of respect.\n\nDespite the constant trumpeting of the Bloomberg PR machine, voters understand that the city school system has not improved and that it is highly inequitable. Leonie Haimson and I wrote an article in The Nation recently describing the elitist tone and consequences of the Mayor and his policies. The proportion of black and Hispanic students admitted to the city\'s exam schools (Stuyvesant, Bronx Science, Brooklyn Tech, etc.) has dropped precipitously during the Bloomberg years. The numbers are in the linked article. Brooklyn Tech, for example, which had an enrollment about 23% black and Hispanic, now has only 10%. The admission of black and Hispanic children to the city\'s coveted gifted and talented programs has plummeted since the Bloomberg administration decided that it would be determined only by a single test score, even for the youngest children. The city\'s state test scores, once the mayor\'s greatest boast, collapsed in 2010 when the state education department admitted that it had made the tests too predictable and lowered the passing score each year. The Bloomberg administration boasts about the rising graduation rate, but never pairs it with the fact that some 80% of the graduates who enter community college require remediation in basic skills. The mayor boasts about reducing the black-white and Hispanic-white achievement gaps, but the federal tests (NAEP) show the gaps unchanged over the past decade.\n\nAnd so the mayoral election is underway, and the Democratic candidates have loudly criticized the mayor\'s policies. I moderated a parent forum at PS 29 in Cobble Hill (every Democratic candidate showed up except Christine Quinn, who was attending a fundraiser, and none of the Republican candidates accepted the invitation). The entire event was videotaped and it is here on the website of Parent Voices New York.\n\nThe questions I asked were written by parents. They wanted to know (I am paraphrasing, you can watch and see the original):\n\n1) what will you do to reduce class size to not more than 20 children in the early grades (class size in New York City is the highest in 14 years)?\n\n2) what will you do to end high-stakes testing?\n\n3) will you end Bloomberg\'s policy of assigning letter grades to schools, which no one understands and which are highly misleading?\n\n4) what will you do to make the governance system more democratic, so that parents have a voice?\n\n5) will you end Bloomberg\'s policy of closing schools based on low test scores?\n\nEvery candidate--Bill Thompson, Sal Albanese, Bill DiBlasio, John Liu--disagreed with the Bloomberg administration\'s policies.\n\nAll promised to dismantle the heavy-handed reforms of the past dozen years. All agreed that schools should be helped, not closed; that class sizes, especially in the early grades, should be reduced; that the school-grading policy should be abandoned; and all promised a more democratic and more open form of governance when the mayoral control law expires in 2015.\n\nThe Bloomberg administration won\'t let the critics go unanswered. They have nothing left to boast about, so they fall back on weary platitudes about \"we can\'t go back to the bad old days.\" The mayor sent out Schools Chancellor Dennis Walcott to defend the Mayor\'s sterling record. Walcott is the third non-educator appointed by Bloomberg to be chancellor. He was preceded by litigator Joel Klein and publisher Cathie Black. The mayor thinks that educators don\'t know anything about education.\n\nDennis Walcott was once a civil rights leader. He was head of the New York Urban League before he went to work for Bloomberg as deputy mayor, largely as an ambassador to the black community. I don\'t envy him. He has to defend an administration that has privatized the public schools across large swaths of black and Hispanic neighborhoods. He has to defend an administration that has made testing its major strategy. He has to defend an administration that cares not a whit that only 9 black students were admitted to Stuyvesant High School this year, in an entering class of 1,000. He has to defend an administration that has whitened the enrollment of gifted programs by making admission dependent on a single test score. He has to defend an administration that oversaw the gutting of arts in the schools.\n\nThe mayor called his program \"Children First\" when he announced it on Martin Luther King Jr. Day back in 2003. We now know that the children who come first are the ones whose parent'),(811,NULL,0,'general','Observations',',11,','stacie geoghan','Teacher, Parent','sgeoghan@schools.nyc.gov',0,NULL,0,0,'2013-05-20 14:58:35','The test was too difficult and they didn\'t have enough time. The questions were difficult for an adult to answer. It seemed as if there were more than one answer to each question. We had to discuss it with each other as adults. Imagine these poor children.\n\n'),(812,NULL,0,'National','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-20 16:01:00',' \nSearch Opinion\n  \n\n\nWORLD U.S. N.Y. / REGION BUSINESS TECHNOLOGY SCIENCE HEALTH SPORTS OPINION ARTS STYLE TRAVEL JOBS REAL ESTATE AUTOS\nAdvertise on NYTimes.com\nEDITORIAL\nEducation, Vision and the Mayor’s Race\nBy THE EDITORIAL BOARD\nPublished: May 19, 2013 54 Comments\nFACEBOOK\nTWITTER\nGOOGLE+\nSAVE\nE-MAIL\nSHARE\nPRINT\nREPRINTS\n\nThe Democratic candidates for New York mayor, whirling around the boroughs on the debate-and-forum carousel, have been struggling for advantage and the attention of tuned-out voters. But they have had no trouble infuriating the Bloomberg administration, which seems to be getting touchier about criticism as it heads to the exits.\nRelated\n\nSeeking Teachers’ Support, Mayoral Candidates Pledge Education Reform (May 12, 2013)\nToday\'s Editorials\n\nEditorial: Derivatives Reform on the Ropes (May 20, 2013)\nEditorial: Eavesdropping on Internet Communications (May 20, 2013)\n\nConnect With Us on Twitter\nFor Op-Ed, follow @nytopinion and to hear from the editorial page editor, Andrew Rosenthal, follow @andyrNYT.\nReaders’ Comments\nShare your thoughts.\nPost a Comment »\nRead All Comments (54) »\nExhibit A was a candidates’ forum on May 11 with the United Federation of Teachers, where they took turns blasting the mayor’s record on school reform. It was five Democrats — and Adolfo Carrión Jr., who’s running on the Independence Party line — in pursuit of an endorsement, so flattery and incumbent-bashing were expected. But the jabs made the mayor go all-but-apocalyptic in reply: “If the next mayor really is serious about kowtowing to demands from some radicals in a union,” he said, “then this city does not have a future.”\n\nMr. Bloomberg’s schools chancellor, Dennis Walcott, called the criticism an “unconscionable” assault on the Education Department and accused the candidates of lacking vision. On Saturday, at a conference in Brooklyn for school administrators, he foretold a “tragedy” if the next mayor did not continue Mr. Bloomberg’s policies.\n\nBut after 12 years, this mayor’s ideas are due for a counterargument. The critiques the candidates are offering hardly shock the conscience, and their complaints about the Bloomberg administration can be heard from teachers and parents in any school in the city.\n\nThe school system has indeed gone overboard in relying on standardized testing. Tests need to be a means to the end of better instruction, not the pedagogical obsession they have become. Yes, Mr. Bloomberg has shown disdain for consultation, as in his rush to close underperforming schools without the full and meaningful involvement of affected communities. The system needs to strengthen neighborhoods’ connection to schools and reconnect with parents who feel shut out. And while charter schools can be a path to excellence, they can also cause problems. Shoehorning them into existing school buildings over local objections can alienate parents and reinforce among students a harmful sense of being separate and unequal.\n\nWhen Mr. Bloomberg won direct control of public education in 2002, it was a historic and necessary victory, ending a system of local districts that was grossly dysfunctional and unaccountable. The candidates should not be allowed to downplay or deny how bad things were when nobody was in charge.\n\nBut there can be truth in applause lines. Comptroller John Liu spoke for many at the forum when he told of his frustrating inability, as a parent, to give input to school officials. And William Thompson Jr., a former city comptroller, answered Mr. Walcott in a statement on Saturday by noting the incompleteness of educational gains: “For 12 years, the mayor has vilified teachers, shut out parents, turned classrooms into test prep centers and closed community schools. We have tried those policies, and our kids are still not receiving the education they deserve.”\n\nThe candidates are not above campaign mushiness and overpromising. While they support a long list of desirable things, like arts and music, smaller classes and community schools that provide health and social services in poor neighborhoods, they have been vague about how to pay for them. When asked at the U.F.T. forum to embrace the union dogma that only an educator can be chancellor, they all did, except for City Council Speaker Christine Quinn, who said, sensibly, “Not necessarily.” Nobody vowed to be tough in negotiating a new teachers’ contract. But that wasn’t going to happen before this group anyway.\n\nThe Democrats have work to do before the September primary to persuasively show how — and with what money — they would make the city’s schools better. They will be competing not only with a defensive mayor, but with voters’ inattention and distractions, especially if former Congressman Anthony Weiner cannonballs into the pool.\n\nThey have begun laying out ideas. Mayor Bloomberg and his aides are upset that the visions aren’t his. But they should not deny that alternate visions could exist, or the possibility that they could be better than the one we have.\n'),(813,NULL,1,'general','Observations',',11,','Nancy','Parent','sixofusplus@@yahoo.com',0,NULL,0,0,'2013-05-20 20:53:28','Were children used for the purpose of \"field testing\" these questions for reliability and validity? Isn\'t that somewhat unethical to do without asking first and making it voluntary? How did we get to this period in history that children are simply minions to be used to further the purposes of the machine? What a sad time for kids.  The new age of \"sweat shop\" labor for American children.'),(814,813,0,NULL,NULL,NULL,'Anonymous','Other','',1,NULL,0,0,'2013-05-20 23:58:48','Did you see the discussion of this in the New York Times, May 20th? You\'ll find others are asking similar questions.'),(815,687,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-21 01:48:21','This is important information for every parent to know. Parents may just possibly be able to make a difference in this cause.\n'),(816,769,0,NULL,NULL,NULL,'Penny Kittle','Teacher','pennykittle@me.com',1,NULL,0,0,'2013-05-21 14:20:06','What can be done? \n\nI believe we need another look at the standards through the eyes of child development specialists like those from Lesley College who wrote here (http://www.washingtonpost.com/blogs/answer-sheet/wp/2013/01/29/a-tough-critique-of-common-core-on-early-childhood-education/) about the inappropriateness of the K-3 standards. \n\nWe need to revisit the research on raising readers and writers and see how the standards align with our goal of creating lifelong, engaged readers and writers.\n\nWe can create local assessments that would be superior and cheaper than standardized ones. We are considering here in North Conway, NH how we can gather business leaders, parents, and teachers to examine portfolios of student work to measure our progress as a K-12 district. Our students will be handicapped by a lack of computer prowess (like many rural students) and thus the CCSS tests will measure how well our students read and write on a computer, not how well they read and write. This will not be helpful information in our efforts to improve as a school district.\n\nAbove all, we should be investing in classroom libraries preK-12 and professional development for teachers, not standardized tests.'),(817,NULL,0,'general','Ideas for Constructive Action',',13,','Anonymous','Parent','',0,NULL,0,0,'2013-05-21 19:42:34','I fail to see why there is a rush to implement. Both Commissioner King and Governor Cuomo seem to feel that it is best to implement just for the sake of implementing, rather than actually preparing teachers and students for the changes in standards and expectations. How is this approach an accurate measurement of achievement when neither the curriculum or instruction are aligned with the Common Core standards? This looks like the motivation behind the change is political rather than educational. I have read that other states are taking a more measured and careful approach to making the necessary changes, including providing teacher professional development and materials that have funding behind them, rather than adding to the long list of unfunded mandates that the Governor and Commissioner have saddled schools with while simultaneously limiting their ability to fund on the local level. It is time to change who is making the decisions - from politicians and bureaucrats to the ones who actually have to live with the decisions that are made - educators and parents.'),(818,126,0,NULL,NULL,NULL,'AW','Teacher','aweiss@eastchester.k12.ny.us',1,NULL,0,0,'2013-05-21 21:01:02','Reading skills go out the window when faced with the daunting and mundane tasks students are asked to address on these assessments. Those who practiced what we taught them ran into the most problems. Important skills like annotating, identifying key vocabulary, and extracting meaning fell by the wayside as student grappled with two answers so close that even had our department disagreed as to what was the correct answer.'),(819,NULL,0,'general','Ideas for Constructive Action',',13,','Andrew','Teacher','aweiss716@gmail.com',0,NULL,0,0,'2013-05-21 21:17:48','Every person who has sat in a classroom as either a teacher or a student understands that a large chunk of reading is context. Very rarely, if ever, will a student be assigned a reading without some degree of introduction, background knowledge, or engagement in previous learning activities. However, these assessments do just that. The assessments provide students with zero context for the reading passages that NYS and Pearson have deemed \"authentic\" and assumes students should be able to answer these questions simply based on the text. However, should a student utilize the skills outlined in the common core, such as close reading, extracting meaning, identifying key vocabulary, or making the connection between the content of the passage and their other subjects, they ran out of time.  \n\nYes, dropping items in an air shaft, life on a farm, and searching for natural resources are topics that are appropriate for middle school students based upon content, but without  providing students with context, as all teachers at every level from pre-school to post-graduate studies would do, these assessments cannot possibly measure reading ability accurately. \n\nI struggle to see how we as teachers should instruct our students to prepare for readings on these assessments about anuthing and everything when they are given little to no context. Should we simply hand out articles that have no relevance to what we are learning and hope they do well? Surely we would be chastised by our students, parents, or administrators for engaging in such a frivolous practice and yet, this is what is done on these assessments\n\nLike most ELA teachers, I create units of study and provide primary and secondary resources to help students extract meaning from a variety of texts, but do so by providing context for these units. Reading articles in isolation without context in no way prepares students for college and in no way could possibly serve as a worthy tool to assess preparedness for college.'),(820,NULL,1,'general','Observations',',11,','Andrew','Teacher','aweiss716@gmail.com',0,NULL,0,0,'2013-05-21 21:28:04','Every person who has sat in a classroom as either a teacher or a student understands that a large chunk of reading is context. Very rarely, if ever, will a student be assigned a reading without some degree of introduction, background knowledge, or engagement in previous learning activities. However, these assessments do just that. The assessments provide students with zero context for the reading passages that NYS and Pearson have deemed \"authentic\" and assumes students should be able to answer these questions simply based on the text. However, should a student utilize the skills outlined in the common core, such as close reading, extracting meaning, identifying key vocabulary, or making the connection between the content of the passage and their other subjects, they ran out of time. \n\nYes, dropping items in an air shaft, life on a farm, and searching for natural resources are topics that are appropriate for middle school students based upon content, but without providing students with context, as all teachers at every level from pre-school to post-graduate studies would do, these assessments cannot possibly measure reading ability accurately. \n\nI struggle to see how we as teachers should instruct our students to prepare for readings on these assessments about anuthing and everything when they are given little to no context. Should we simply hand out articles that have no relevance to what we are learning and hope they do well? Surely we would be chastised by our students, parents, or administrators for engaging in such a frivolous practice and yet, this is what is done on these assessments\n\nLike most ELA teachers, I create units of study and provide primary and secondary resources to help students extract meaning from a variety of texts, but do so by providing context for these units. Reading articles in isolation without context in no way prepares students for college and in no way could possibly serve as a worthy tool to assess preparedness for college. \nAndrew - Teacher'),(821,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-05-23 01:36:17','This year\'s ELA in grades 3-5 were extremely difficult and long.  While it was great that there were authentic text on the exam, were some of them out of Pearson\'s basal?  \nWe had a few students cry and/or show frustration in other ways.  I do not like that we cannot keep copies of the test, but must purchase other materials to show students the format of the test.  \nThe MC questions should all be on 1 day.  There is no need to ask so many questions of elementary school students.  Field test questions should be taken out or put at the end of the test and marked as such.  Having 2 books on day 2 was cumbersome and awkward.  For the first time, I had more than 2 students not complete the assessment.  One student was very frustrated, and tried to rip the test apart to copy pages from the passage, instead of flipping back and forth.  Our students with disabilities really struggled and did not feel good about themselves as learners when they were finished.  If NYS is going to make it this difficult for all learners, then those with learning disabilities should be given the opportunity to take an assessment at their own reading level.  I also do not like the timing of this.  It is right after spring break, and the state should wait until the true end of the year.  After testing, a lot of our students have \"checked out.\"'),(822,151,0,NULL,NULL,NULL,'Anonymous ','Other','',1,NULL,0,0,'2013-05-23 02:43:46','We have yet to find a reflective approach to teaching and learning. Let\'s keep our voices effective in advocating for child friendly assessments that are rigorous but written by experienced educators . We have handed  over education to test companies for the goal of comparisons rather than formative assessment. '),(823,NULL,0,'National','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-24 13:45:22','	\nTemps Scoring Essay Questions on State Tests\nby dianerav\nThis article may explain why the big testing corporations won\'t machines to score essays.\n\nHow do you think they score them now?\n\nHow do you think they have been scored for many years?\n\nBy temps. By people earning $10-12 an hour with no particular skills and minimal training.\n\nNot long ago, I posted a story that said that Pearson was advertising on CraigsList in Texas for people to score essays.\n\nJust think.\n\nChildren\'s lives; teachers\' careers and reputations; and the fate of the school hinge on snap judgment made by people reading these essays, scoring as many as possible in an hour.\n\nIt is a multibillion dollar business, and the name of the game is cutting costs.\n\nSo having the essays scored by machine if your goal is to maximize profit.\n\nEducation? Don\'t start talking about that. That\'s an abstraction.'),(824,262,0,NULL,NULL,NULL,'M Brown','Teacher','Mgbrown30@gmail.com',1,NULL,0,0,'2013-05-25 11:05:37','I don\'t know about the third grade test, but I did a readability assessment on the first passage of book one of the 8th grade exam and it was at a college level. Dense. Difficult. How is this appropriate for 8th grade? Furthermore, I submitted a FOIL request last July to obtain last year\'s ELA 8 exam because it appeared incredibly flawed. Access denied. I appealed. The NYS ED Department of Counsel upheld my appeal stating it wasn\'t legal to issue a blanket denial of access and gave the Office of Assessment 20 business days to disclose information. That was in the beginning of March. On April 26, 2013 I talked to Steven Katz, the Assessment Director at NYSED about the fact that the NYS Department of ED had broken the law by not disclosing according to law in the time mandated by the legal appeal. He assured me that I\'d have something in \"two weeks\" which was May 10. Not only have I not received anything -- today being May 24-- but Steven Katz has not returned any of my phone calls, nor has Ken Slentz the Deputy Commissioner whose office is supposed to be overseeing this FOIL appeal\'s mandate. Where is the accountability of NYSED? They\'ve broken the law. They don\'t return calls. They don\'t follow through on promises. I\'m disgusted. '),(825,780,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-05-25 11:21:26','Many people agree that it was not the passages that were hard to read but the questions themselves. WHAT? the kids would ask. It is hard not to think that this reflects irresponsibility on the part of Pearson. I think people should be lobbying the State to give up on Pearson.'),(826,393,0,NULL,NULL,NULL,'Anonymous','','',1,NULL,0,0,'2013-05-25 11:26:35','An assignment to discuss the \'role of the setting\' doesn\'t test comprehension, it tests a learner\'s awareness of writing techniques--and third graders don\'t yet know how to use a setting in purposeful ways to do things like bringing out a mood or creating a problem. They won\'t have the experience they need yet to be able to analyze the role that a particular setting plays in a story.'),(827,NULL,0,'National','Observations',',11,','Anonymous','','',0,NULL,0,0,'2013-05-26 00:33:04','You are here: Home / CHRIS CERRONE: The \"Parentucator\" / A middle school student’s version of a New York State Assessment\nA middle school student’s version of a New York State Assessment\nAPRIL 14, 2013 BY CHRIS CERRONE 115 COMMENTS\nFrom Sophia in Upstate New York:\n* for those who may not be aware, the young lady who created this excellent commentary used the exact look and format of the New York State ELA Assessment. (Click to enlarge the images)\n\n\n\n'),(828,706,0,NULL,NULL,NULL,'Likes the CCSS','','',1,NULL,0,0,'2013-05-29 16:15:14','It sounds as though your students don\'t take the test anyway.  They should all be Alternative Assessment.'),(829,262,0,NULL,NULL,NULL,'Margaret','Teacher','',1,NULL,0,0,'2013-06-02 21:07:28','I recommend you write to Cuomo, to Duncan, and to your legislator. Too few people speak up, and a democracy requires that people use the skills of argument to make policies that are wise ones.'),(830,38,0,NULL,NULL,NULL,'Christine','Teacher','',1,NULL,0,0,'2013-06-04 00:34:42','I, too, had students reacting to the test.  Although no one had a bathroom accident, students were stressed out, feeling nauseous, and crying at times.  Parents reported anxiety prior to testing.  I told my students outright that this test was only one of the many measures of who they are, and I encouraged them to do the best but stressed that that was the most they could do - their best.  Unfortunately, some of the students I teach receive Academic Intervention Services and hate it, so they know the only way to get out of that is to pass the stat test.  Those were the students who had adverse reactions.  Hyperbole?  I think not.  They know that their performance can affect their next year\'s schedule and they reacted according to that knowledge.  I agree with Diana and Lucy - this test was unfair and anyone who has ever studied child development knows that what we ask of these children at this age is unrealistic.  If we want meaningful learning, we have to give our children the opportunity to create that meaningful learning.  My students had to throw all of the reading and writing strategies (annotating, re-reading for meaning, planning writing, etc.) we use all year out the window because they didn\'t have time.  They perform beautifully in the classroom - this test was no indication of what they are capable of.  Sorry Sara - you are wrong with a capital W - and your delivery was quite pompous.  '),(831,NULL,0,'4','Observations',',11,','Marla Kilfoyle','Parent','marlakilfoyle@yahoo.com',0,NULL,0,0,'2013-06-14 02:44:25','My son took the first day of the ELA in grade 4.  When he got into the car I asked him how the test went and he said, \"Mommy there were questions where there was more then one right answer.  Why would my teachers make a test to trick us.\"  We chose as a family to refuse the rest of this ridiculous testing.  I had to explain that his teacher didn\'t make the test.  '),(832,649,0,NULL,NULL,NULL,'A teacher','Teacher','kglynn@southcountry.org',1,NULL,0,0,'2013-06-14 10:05:15','Great job!  Just one correction-  Pearson is not only competing with PARCC, but Pearson is PARCC.  PARCC testing is comprised of two companies- Pearson and CTB.  I served on the PARCC Committee.  When the materials were presented there was a clear difference.  One rewards great teaching and the other just fooled kids and used text was not developmentally appropriate.  I am sure you can figure out which one is Pearson.   \n\nPARCC is unable to test standards as they exist (the wording simply limits what can be asked) so they created evidence statements.  These use pieces of statements that are cut up for one purpose- testing.  We will be teaching the Common Core and testing evidence statements.   \n\nI can only hope that your next reading series does not include 2 months of \"Test Preparation\".  I think it would be in the best interest of all if you put out a recall/moratorium on those sections in your units.  Think of the the material you could replace it with, rather than subjecting kids/teachers to test prep- especially to a test that is a complete failure.  \n\nAs Pearson rolls out their new series dedicated to the test (and as I understand they did not complete it- so they are handing out binders and asking for teachers to write the curriculum) we need you to follow the lead of the AFT.  Stop teaching to the test so we can see what the Common Core feels like.  Let Pearson give a year of bubble filling torture.  The rest of us will use your units to teach through student selected and appropriated leveled books.  We will see who is standing in the end.         \n\nYou hold a tremendous amount of power and your voice is certainly louder than ours.  Thank you for speaking out!  Your contributions in education are far greater than Pearson will be.  You will have to work that much harder to undo the damage Pearson is currently causing.  You can count on teachers and parents for support!  \n\n\n\n   \n'),(833,636,0,NULL,NULL,NULL,'Lynn','Parent','Lynnvt2000@aol.com',1,NULL,0,0,'2013-06-15 03:05:33','Having 2 children one in first one in fourth grade reading your response broke my heart seeing the words of children crying for a test. :('),(834,NULL,0,'National','Observations',',11,','Mary, teacher','Teacher','',0,NULL,0,0,'2013-06-15 03:20:59','I witnessed kids saying that these tests are \'used to fire teachers\' which made me cringe.  The students I proctored were fatigued and seemingly frustrated .  They all had learning disabilities so this must have been so difficult for them.  The test itself was so far above greed level that only suer bright kids would pull off a fairly decent grade.  Most kids would struggle as expected because the vocabulary and  content of the passages ere advanced.  The answers were also confusing.  The long amount of time spent was another factor to adding to the overall fatigue.\n'),(835,620,0,NULL,NULL,NULL,'Anonymous','Teacher','',1,NULL,0,0,'2013-06-15 11:08:37','The suggestion that writing be first is new to me and makes a lot of sense.'),(836,820,0,NULL,NULL,NULL,'Lucy Calkins','Other','lucy@readingandwritingproject.com',1,NULL,0,0,'2013-06-15 11:15:10','Andrew, \n I think the scary thing is that tests do control instruction and yes, I think many teachers will respond to the increasingly high stakes nature of tests by making their teaching match the tests. It seems important to point out the damage this will cause to the test makers, so thanks for doing that. I\'m not clear if you think this aspect of this year\'s test was worse than usual, or it this is just the way that standardized tests have always been and continue to be,\nLucy'),(837,NULL,0,'general','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-06-15 21:51:06','I would love to see the people in the state who are making these ridiculous decisions come  to my school, model. for us and let\'s see how you do it!\n\nAlso, I would love to see these same nitwits raise the bar on their newborns and teach them to walk at one month old . '),(838,54,0,NULL,NULL,NULL,'Alison','Teacher','alaschryve@yahoo.com',1,NULL,0,0,'2013-06-16 09:58:47','My top performing 3rd grade students had trouble finishing the tests. I had four children out of 23 cry during the 3 days of testing. Again, these were my top performing students who were upset. If the time had been extended to 90 minutes, it would have helped tremendously. Or, if we could let the kids finish and note the times for each child without taking the test away, it would be less traumatic for everyone. '),(839,490,0,NULL,NULL,NULL,'Anonymous','Teacher','peg1254@optonline.net',1,NULL,0,0,'2013-06-17 02:06:12','I agree that trying to \"beat the test maker\" strategies is a waste of time.   Time and time again Dr. King has been approached with questions regarding these exams and the effect it has on the students.  Time and time again his response is that students need to be pushed, and that we need to stop coddling them.  This from the leader of public education in New York State?  Parents need to become aware of the ill-effects these exams have on their child.  Most parents are not aware.  They send their children to us with trust and hopes that we will do what is best for them.   It seems impossible to fight the system from a teacher\'s standpoint.  We are deemed \"selfish, lazy, and ineffective\" by the powers that be. (Perhaps a greater corporate directive?)   If change is to occur sooner than later, parents must truly understand the degradation of their child\'s education because of these tests.  I considered myself a highly effective teacher...that is...until the past three years.  I feel as if my head is spinning and I can not quite grasp what direction I need to take in order to change the course of my student\'s thinking.  My district is adopting the modules from engage.ny and I was disgusted by the curriculum.  There is NO room for students to read self-selected fiction.  The 4th grade module #3 spends at least 8 weeks on simple machines!  There are no literary texts...only informational texts on simple machines.  The writing component is an opinion essay on simple machines.  Wow!  My students will be quite engaged, I\'m sure. I wonder what parents would say about the new modules set forth by New York State?\n    '),(840,NULL,0,'8','Observations',',11,','Darlene Cowles','Teacher','cowlesd@victorschools.org',0,NULL,0,0,'2013-06-17 13:46:24','In the tests I observed, it appeared that the vast majority of footnotes were not educational in nature, but rather registered trademarks. This gave a less scholastic feel and the sense that a subtle form of advertizing was being used on our students.'),(841,NULL,0,'4','Observations',',11,','Kristen Majkut','Teacher, Parent','kristen.majkut@gmail.com',0,NULL,0,0,'2013-06-18 01:31:28','My 10-year old daughter has had a horrific year in the 4th grade.  The anxiety, tears and frustration are making her HATE school. She took the ELA, Math and Science exams over several days (multiple days per exam). She says it makes her feel stupid, because the tests ask questions that she has never seen before. Guess how many practice tests she took in advance of these tests?  At least four for each exam. It was either time to take a test, or time to practice taking a test. We are opting out next year. This is crazy - and it unequivocally is not good for kids. Why is it that there is never school funding for much - but there is always enough money for testing? My daughter will be reading a stack of library books during the administration of all of these tests next year. I wonder how many books she will be able to finish?  @kristenmajkut #optout #riseup '),(842,NULL,0,'4','Observations',',11,','john','','barny182@hotmail.com',0,NULL,1,0,'2013-06-20 11:49:10','RNB2E9 http://www.c1dOvW6eef5JOp8ApWjKQy5RO5mLafkc.com'),(843,NULL,0,'3','Observations',',11,','Anonymous','Teacher','',0,NULL,0,0,'2013-06-20 12:49:36','I don\'t feel that it is developmentally appropriate to have children who are 8 or 9 years old be subject to a three day exam. In addition, many students were unable to complete the exam in the time given.'),(844,NULL,0,'1','Observations',',11,','matt','','barny182@hotmail.com',0,NULL,1,0,'2013-06-22 17:10:03','LQeuKk http://www.c1dOvW6eef5JOp8ApWjKQy5RO5mLafkc.com'),(845,NULL,0,'1','Implications for Instruction',',12,','hhixtxnkzq','','ayyptwnvjw@yapmsb.com',0,NULL,1,0,'2013-06-23 14:48:13','avcxhfmbgffecbdl, <a href=\"http://www.gnwuhihxyl.com\">xloepygupv</a> , [url=http://www.qgsxjgsckw.com]whknsolhps[/url], http://www.crehlwqdjc.com xloepygupv'),(846,NULL,0,'1','Implications for Instruction',',12,','tgyemwikwu','','behcwjjhjg@qmqmia.com',0,NULL,1,0,'2013-06-23 19:03:39','pfkprfmbgffecbdl, <a href=\"http://www.ccmumtuxou.com\">mztkhtlcda</a> , [url=http://www.qeidvctnpv.com]xuyxtsgwno[/url], http://www.ajudzoybzy.com mztkhtlcda'),(847,NULL,0,'1','Implications for Instruction',',12,','tvrmoetjtz','','cryajrzfky@bhewjy.com',0,NULL,1,0,'2013-06-24 00:07:36','bagovfmbgffecbdl, <a href=\"http://www.j