, writing, or math state assessments (FCAT) that are administered yearly to students.  They can loose their teaching credentials if they are suspected of looking at the tests.  A portion of every teachers evaluation is based on FCAT (even if you have not taught the students). The state looks for testing irregularities--2-5 students in the same class use the same words or series of words in an essay or the same organizational pattern--your district/school will be notified and put on notice. Common sense is not common practice in our state.  The most recent FCAT data (2013)is abysmal especially when it is disaggregated by schools/students!  I don\'t think the state of Florida is \"getting it right!\"  I think we\'re trying, but we certainly don\'t have anything to brag about.  '),(856,NULL,0,'3','Observations',',11,','horny','','barny182@hotmail.com',0,NULL,1,0,'2013-06-25 11:02:23','D8GYvy http://www.c1dOvW6eef5JOp8ApWjKQy5RO5mLafkc.com'),(857,NULL,0,'1','Implications for Instruction',',12,','skrconhlnh','','simaltyfis@ljrpey.com',0,NULL,1,0,'2013-06-25 14:50:46','kcuoafmbgffecbdl, <a href=\"http://www.bogxlpberr.com\">eifvsafgkb</a> , [url=http://www.injgyetxex.com]pnqkosjxbt[/url], http://www.wrdjbthsza.com eifvsafgkb'),(858,NULL,0,'1','Implications for Instruction',',12,','ydckzjjdre','','uhbqeoefxw@vkqzoc.com',0,NULL,1,0,'2013-06-25 18:41:03','nwroyfmbgffecbdl, <a href=\"http://www.gjrsknawia.com\">xjgozyuynn</a> , [url=http://www.syholbbntc.com]zqufymanjw[/url], http://www.tgnlzpfvbt.com xjgozyuynn'),(859,NULL,0,'1','Implications for Instruction',',12,','dspkihtnoj','','tcqokclbmm@zrfpve.com',0,NULL,1,0,'2013-06-25 22:32:15','fzjwhfmbgffecbdl, <a href=\"http://www.bvbfxbafkb.com\">uwizhmdmnp</a> , [url=http://www.sulzdzaxsb.com]mfhpvtmqwr[/url], http://www.rrelswhosa.com uwizhmdmnp'),(860,NULL,0,'1','Implications for Instruction',',12,','tfmgexqqva','','fbpmhlrgvr@obwcec.com',0,NULL,1,0,'2013-06-26 02:19:58','mkumxfmbgffecbdl, <a href=\"http://www.sdpmxhfuxe.com